INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66633, 66633, 'Cleverman', 'In the near future, creatures from ancient Aboriginal mythology endowed with extraordinary physical traits have emerged and must coexist with humans. Known as ''Hairypeople'' they battle for survival in a world that wants to exploit and destroy them. One young man – The Cleverman – struggles with his own power and the responsibility to unite this divided world, but he must first overcome a deep estrangement from his older brother.', null, 'Returning Series', 52, 18, '2016-06-01', null, null, null, '/ndwQn6o3qTpkN8pHmOeVoToDS6J.jpg', 0, '/cxn3LJ3Fh5woVR0Bqepma8LI6Ko.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66634, 66634, 'Wanted', 'One of Korea''s top actresses has her son kidnapped. She struggles to carry out a mission on a live reality show following the kidnapper''s demands.', null, 'Ended', 60, 156, '2016-06-22', null, null, null, '/7rac6bLE2GrDXiJpR43H6uWO8H5.jpg', 0, '/exQuNpRxajsgBAEhpXXARJSeMBM.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66639, 66639, 'The Celts: Blood Iron & Sacrifice with Alice Roberts and Neil Oliver', 'Three-part documentary series in which anthropologist professor Alice Roberts and archaeologist Neil Oliver go in search of the Celts - one of the world''s most mysterious ancient civilisations.', null, 'Ended', 50, 332, '2015-10-05', null, null, null, '/iRsIvqIIGNjFWbU1IXVH29vPRCk.jpg', 0, '/3BRP7wrXzWRs5yvXO3C8iMssqKv.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66641, 66641, 'Barbarians Rising', 'Told from the perspective of the rebel leaders, the series chronicles a wave of rebellions against absolute power by those the Roman Empire called “barbarians” – tribes they viewed as beyond the fringe of civilization that lived a brutish and violent existence. But these also were men and women who launched epic struggles that shaped the world to come with a centuries-long fight to defeat the sprawling empire.', null, 'Ended', 84, 65, '2016-06-06', null, null, null, '/N02jROGaZ04xesZsDeSYxskOnQ.jpg', 0, '/wKcuNB9WGshk8wurqgsjYDBGe3x.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66647, 66647, 'Terrace House: Boys & Girls in the City', 'Six men and women start off as strangers and live together under one roof. All that is provided is a beautiful house and a car. There is no script.', null, 'Ended', 28, 1, '2015-10-12', null, null, null, '/ymtA00DMpRa5CdDq2t6h5EJJfvf.jpg', 0, '/2JFuL5HAoGJC5EzZ9zPAVdAe4W0.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66649, 66649, 'Nina', 'At the age of 39, Nina finds herself a trainee nurse under the orders of Léo, a 15-year-younger "girl" with a difficult temperament, and Dr. Proust, who likes to scare her ... Not easy ! Especially for all, Nina is the wife of the boss, Costa Antonakis, his ex with whom nothing is really settled despite their divorce. But after healing Lily, their daughter, for ten years, nothing scares Nina! With years spent in hospitals in contact with doctors such as nurses and health-care aides, Nina, the daughter of a great internist and a renowned obstetrician, runs the risk of disappointing them to trace her own path in the hospital universe to which she can not really escape ... Listening and care as a profession of faith, the desire to live and love as a prescription ...', null, 'Returning Series', 50, 361, '2015-06-17', null, null, null, '/qoYkQRQgEaIPbLlRrf052z51BXI.jpg', 0, '/c3Q1XkjckJJ4alYuoWZCY0i2LfG.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66657, 66657, 'No Such Thing as the News', 'The most interesting events of the week dug up and dusted off by QI''s research team.', null, 'Ended', 30, 332, '2016-05-20', null, null, null, '/v7wOFZS9oFLdk74umxFEdGbmhJK.jpg', 0, '/rfqYcdC1rZA3hWsrWaCjH8tajqb.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66659, 66659, 'Backstage', 'A group of “very talented” teenagers sing, dance, and perform their way to the top at the famous Keaton School of the Arts! From the disappointments of failure, to the new friendships and crowning achievements, being a student at Keaton means you''re on the path to becoming a star!', null, 'Returning Series', 30, 54, '2016-03-18', null, null, null, '/4ayRx3nGcpmSsJ52t9sM6uDinOm.jpg', 0, '/bd8AOH736gHOkzrPjS26gLa305y.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66660, 66660, 'Hibana: Spark', 'Tokunaga, a comedian who is down on his luck, has a shock encounter with Kamiya, an older comedian when he visits a fireworks event in Atami on a job. Tokunaga is deeply touched by Kamiya and asks if he can become his apprentice. Kamiya is a genius type of comedian who is full of human kindness. He accepts Tokunaga’s proposition on the condition that he will write his biography.', null, 'Returning Series', 60, 213, '2016-06-02', null, null, null, '/pX5g40ATXu5MUVYEbctDOEgXKL8.jpg', 0, '/8bEVKllllAyrR3O4MZuaMIwMAPs.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66662, 66662, 'Mon ex à moi', 'Love gives you wings, puts stars in your eyes and butterflies in your stomach…but it can also make you blind and crazy! Amélie’s world falls apart when François, the man of her dreams, suddenly leaves her. Amélie may be a bright financial planner in her 20s, but when it comes to re-conquering her ex, she loses it and becomes a total crackpot. With her loyal friends Marilou and Mathieu by her side, Amélie will go to any lengths and try any hair-brained, absurd or extravagant scheme to get her man back. As she clings to the hope of reuniting with François, her perseverance – and her imagination – know no bounds.', null, 'Ended', 23, 502, '2015-04-01', null, null, null, '/aPSE7QPZzpm3HL49hvRMqWINEON.jpg', 0, '/jfVIWs9TBU8NcbnEzTKoy4xXa91.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66669, 66669, 'The Vet Life', 'Follow veterinarians Dr. Diarra Blue, Dr. Aubrey Ross and Dr. Michael Lavigne, who recently moved to Houston to open a full-service veterinarian hospital and animal shelter together. The series captures the doctors'' lives as they juggle running a new business while managing their family life filled with spouses, parents, in-laws, children, pets and friends, as well as their intense moments saving the lives of animals at their clinic.', null, 'Returning Series', 60, 91, '2016-06-04', null, null, null, '/ojdE9LrsbcUvNXAzXpscgxquxON.jpg', 0, '/7yltpP7z8NpxfiO8SOf9p2LUGDq.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66671, 66671, 'Agatha Raisin', 'Burnt out on office politics, Agatha Raisin retires early to a picturesque village in the Cotswolds and soon finds a second career as an amateur detective investigating mischief, mayhem, and murder in her deceptively quaint town.', null, 'Returning Series', 45, 214, '2016-06-07', null, null, null, '/kGzKvGXm7yuLsgFo3BiV4VlNkmd.jpg', 0, '/26OhV3Ha7kRBi6t0Z6F0bcInbsw.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (66672, 66672, '(fdp)', 'An original comic-drama fiction series that portrays the routine of a Brazilian soccer referee in the pursuit of his biggest dream: to blow the whistle at a World Cup final.', null, 'Ended', 0, 1089, '2012-08-26', null, null, null, '/obRi3FoeuQNO3m31qhf51pW39Fl.jpg', 0, '/2vnxZaeZ9DP1tSEowEQiYUaRUxS.jpg');
