INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (85631, 85631, 'The Age of Iron', 'Rauta-aika (The Age of Iron) is a dramatic four-part miniseries completed in 1982 by Finnish broadcast network Yle TV2. The production attempts to adapt the national epic of Finland, the Kalevala, for the television audience by way of humanizing the mythological characters whose thoughts and actions drive the narrative. The protagonists of Rauta-aika, Väinö, Ilmari and Lemminki, have been inspired by the tales in the Kalevala and go in search of a woman, eventually finding themselves at war with the Nordic people, and in the end pay dearly for their pursuits.', null, 'Ended', 68, 995, '1982-02-28', null, null, null, '/9R4zI1QpTa99exwYiW7dbJhvC1g.jpg', 0, '/3cFShNUF7zAZDdlJXn779EJF0nu.jpg');
