INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (57278, 57278, 'Secret Love', 'A devoted woman makes the ultimate sacrifice for her boyfriend, only to learn that love doesn''t always conquer all. Yoo Jeong (Hwang Jeong Eum) is a sweet, upbeat person who has always stuck by her boyfriend, Ahn Do Hoon (Bae Soo Bin), all through school as he cared for a disabled father. But Do Hoon gets into a car accident that results in the death of a woman. Unable to face her boyfriend having to go to jail for a hit-and-run accident, the self-sacrificing Yoo Jeong takes the blame for the accident and serves time in prison in his place. Min Hyeok (Ji Sung), a cold-hearted heir to a business empire, had just begun to open his heart to a woman when she is killed in the hit-and-run accident. Years later, he is engaged to Shin Se Yeon (Lee Da Hee), a congressman''s daughter. Can Yoo Jeong and Min Hyeok mend their wounded hearts and discover the real meaning of love? ', null, 'Ended', 65, 342, '2013-09-25', null, null, null, '/zeL1acoA8ygEOJn7kUI1FItsYl0.jpg', 0, '/vavz4gUhLRafyJBAjCxYhZdIyB3.jpg');
