INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (70581, 70581, 'Circle', 'After Aliens arrive, the story takes place in two time streams: 2017 and 2037. In twenty years, and by 2037, the world has been divided into a “Smart Earth” where artificial intelligence has created a utopian environment in which no diseases or crimes exist, and an “Ordinary Earth” where people still suffer from rampant plague and lawlessness.', null, 'Ended', 60, 866, '2017-05-22', null, null, null, '/1sINEbJKM2p47VIvZkNvK6APAzH.jpg', 0, '/bNKkzY9rWxtzCZmMrO62IEO7AEf.jpg');
