INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, network_id, firstaired, imdbid, added, updated, posterurl, followers, bannerurl) VALUES (70606, 70606, 'My Father and His Family', 'Tanınmış işadamı Kemal İpekçi, İstanbul’da karısı Suzan, çok sevdiği çocukları Mert ve Çiçek ile imrenilecek bir hayat sürerken, Kemal İpekçi’nin oğlu Mert’in başından geçen bir olay ile Adana’da kimselerin bilmediği bir ailesi daha olduğu ortaya çıkar. Gençlik aşkı Nilgün ve ikizleri Kadir ile Hasret o güne kadar Adana’da gözlerden uzak yaşamışken, Kemal de yıllarca ikili bir hayat sürmek zorunda kalmıştır. Ancak gerçekler açığa çıktıktan sonra Kemal hem yarım kalan aşkına hem de çocuklarına sahip çıkmak için hiç beklemediği olaylarla savaşmak zorunda', null, 'In Production', 90, 439, '2016-09-19', null, null, null, '/6l6iX5VtrACneWQhdj3aMWBrL1j.jpg', 0, '/pKsO1WlVq2aIis8rT5o8HB59TCP.jpg');
