INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198449, 'Containment Authority', 'A behind the scenes look at the vast and intricately woven world of Cleverman.', 66633, 1, 1198449, 77655, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198450, 'The ''Cleverman''', 'A behind the scenes look at the vast and intricately woven world of Cleverman.', 66633, 2, 1198450, 77655, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198451, 'The Zone', 'A behind the scenes look at the vast and intricately woven world of Cleverman.', 66633, 3, 1198451, 77655, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198452, 'Theme Song', 'A behind the scenes look at the creation of the theme song for Cleverman.', 66633, 4, 1198452, 77655, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197115, 'First Contact', 'A series of unexplained violent attacks in the city are blamed on the newly discovered ''Hairypeople'', who have been living and passing amongst us, without our knowledge.', 66633, 1, 1197115, 77489, '2016-06-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197123, 'Containment', 'Koen is mystified by his strange new powers. Looking for answers, he heads into The Zone. Aunty Linda realizes there is a new Cleverman.', 66633, 2, 1197123, 77489, '2016-06-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197124, 'A Free Ranger', 'Problems at the Containment Center create further panic; while both Waruu and Koen reject Slade’s offer to help in a mysterious laboratory.', 66633, 3, 1197124, 77489, '2016-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197126, 'Sun and Moon', 'The Hairies are blamed for the continuing deaths. As tensions mount, Waruu demands Koen use his Cleverman powers to halt the murders.', 66633, 4, 1197126, 77489, '2016-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197125, 'A Man of Vision', 'Charlotte agrees to one last attempt at IVF at a clinic offering new  technology. Slade offers Waruu a deal he struggles to refuse.', 66633, 5, 1197125, 77489, '2016-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197127, 'Terra Nullius', 'As the Containment Authority prepares to clear the city of Hairypeople, Koen must finally face his destiny as a Cleverman.', 66633, 6, 1197127, 77489, '2016-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329737, 'Revival', 'Koen must unite the hairy and human people of the Zone, who have scattered and disappeared across the City after the demolishing of their home.', 66633, 1, 1329737, 89623, '2017-06-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329738, 'Bindawu', 'Waruu takes a position in government for the Inclusion Initiative. Koen vows to do whatever he can to help the Hairy people.', 66633, 2, 1329738, 89623, '2017-07-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329739, 'Dark Clouds', 'Koen grows in power and understanding as he spends time with Uncle Jimmy. Meanwhile, Waruu discovers a dangerous new creature and is led by an old story to a substance he believes can vanquish the Cleverman.', 66633, 3, 1329739, 89623, '2017-07-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329740, 'Muya', 'Koen fears his powers are diminishing. Darana is appalled by Jarli''s actions. Waruu learns vital information about the nulla nulla.', 66633, 4, 1329740, 89623, '2017-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329741, 'Skin', 'Koen targets Waruu''s power base and confronts him, demanding he close the Inclusion Clinic. Waruu is unintimidated as he believes he has a very special weapon. Slade has Waruu''s hair DNA tested and is stunned by the results.', 66633, 5, 1329741, 89623, '2017-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329742, 'Borrowed Time', 'Allegiances are tested when Jarli takes action in the city. Waruu possesses the one thing that can kill Koen.', 66633, 6, 1329742, 89623, '2017-08-02');
