INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197212, 'Episode 1', 'Hosts Alice Roberts and Neil Oliver locate the origins of the Celts in the Alps of Central Europe, and relive the moment of first contact with the Romans in a pitched battle just north of Rome - a battle that the Celts won and devastated the city.', 66639, 1, 1197212, 77498, '2015-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197213, 'Episode 2', 'In episode two, we discover the Golden Age of the La Tene Celtic warrior and whose world extended as far as Central Turkey. But by the middle of the first Century BC the Celts came up against the Roman Empire, and the Gallic warrior Vercingetorix would challenge Julius Caesar in an epic battle.', 66639, 2, 1197213, 77498, '2015-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197214, 'Episode 3', 'In the final episode, the Roman Army turns its attention to Britain, an island of rich resources, powerful tribes and druids, and advanced military equipment. We tell the story of the Celts last stand against the Roman Army, a revolt led by another great leader, the warrior Queen... Boudicca.', 66639, 3, 1197214, 77498, '2015-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197283, 'Resistance', 'Hannibal builds an army to conquer the Alps, and the shepherd Viriathus organizes a resistance to save his people.', 66641, 1, 1197283, 77510, '2016-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197359, 'Rebellion', 'Spartacus'' slave uprising threatens Rome on its own turf. Arminius, born in Germania but raised a Roman, chooses a side in the fight for freedom.', 66641, 2, 1197359, 77510, '2016-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197360, 'Revenge', 'Arminius unites tribes and sets up an ambush to drive Rome out of Germania. Boudica wreaks bloody havoc on the Empire. Rome''s betrayal of the Goths leads to an apocalyptic clash.', 66641, 3, 1197360, 77510, '2016-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201740, 'Ruin', 'Led by Alaric, the Goths sack Rome. Attila the Hun seizes power in the midst of chaos and destruction, while the barbarians move in for the kill. Geiseric, king of the Vandals, masterminds the end of Rome. The Roman Empire falls.', 66641, 4, 1201740, 77510, '2016-06-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197370, 'New Boys, New Girls, New City', 'One summer''s day, six young strangers move into a house together and start living an unscripted drama.', 66647, 1, 1197370, 77518, '2015-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197372, 'Three Crushes', 'Everyone changes into swimsuits after lunch and heads to the pool on the terrace.  The boys are excited at the sight of the girls in their swimsuits.', 66647, 2, 1197372, 77518, '2015-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197373, 'Dream Police', 'The roommates celebrate tap dancer Yuki''s birthday.  However, his harsh words trigger tears from both Mizuki and Yuriko.', 66647, 3, 1197373, 77518, '2015-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197374, 'In Tears Again', 'Makoto and Minori go out to dinner alone together.  Yuki asks Yuriko out on a date, but she''s had a bit too much sake to drink.  What will she say?', 66647, 4, 1197374, 77518, '2015-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197375, 'Eenie Meenie Miney Mo', 'Tatsuya rocks the house by declaring he''ll take each of the three girls on a date this summer.  Meanwhile, something is up with Minori and Makoto.', 66647, 5, 1197375, 77518, '2015-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197376, 'All Screwed Up', 'Tatsuya declared he would go on a date with all three of the girls.  First comes Mizuki, and next is Yuriko, but her date opens a whole can of worms.', 66647, 6, 1197376, 77518, '2015-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197377, 'Showing His True Colors', 'Makoto angers Tatsuya with his rash behavior but shows no signs of remorse, creating a touch-and-go situation in the boys'' room.', 66647, 7, 1197377, 77518, '2015-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197378, 'Late Night Poolside', 'Minori loses interest as she sees how Makoto behaves.  Tatsuya reflects on his dates with the three girls in an effort to choose one as his lover.', 66647, 8, 1197378, 77518, '2015-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1847352, 'Mientras Dormías', 'Teresa''s closest allies must make difficult decisions without her when she cannot.', 66676, 11, 1847352, 125212, '2019-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197379, 'What A Good Day!', 'Tatsuya and Minori go on a second date.  Tatsuya tells her how he feels but says she need not give her answer now. Makoto has a present for Minori.', 66647, 9, 1197379, 77518, '2015-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197380, 'Before He Says the Word...', 'Unable to forget her ex, Yuriko calls and asks to see him.  Meanwhile, after receiving a present from Makoto, Minori talks to him about her feelings.', 66647, 10, 1197380, 77518, '2015-12-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197381, 'Boy from the Rainbow State', 'At the Girls Award event, Tatsuya and Minori meet former member Seina, who encouraged their budding relationship.  A new member arrives from overseas.', 66647, 11, 1197381, 77518, '2016-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197382, 'Is She Just Best of Three?', 'Tatsuya finally asks Minori to officially be his girlfriend.  How will she answer?  Hawaii-born Arman, the newest housemate, asks Mizuki out on a date.', 66647, 12, 1197382, 77518, '2016-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197383, 'Who Will Survive?', 'Yuriko confesses her feelings to the ex before leaving the house.  And her ex''s reply?  The boys get excited over the arrival of the new girl member.', 66647, 13, 1197383, 77518, '2016-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197384, 'Ikujinashi', 'Arisa''s arrival to the house excites Arman and Yuki because she''s "their type."  Meanwhile, Tatsuya and Minori find it difficult to take the next step.', 66647, 14, 1197384, 77518, '2016-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197385, 'Heating Up for Someone Else', 'A kiss takes Tatsuya and Minori''s relationship to the next level.  Arisa and Arman head to Mt. Takao on a date.  But Mizuki also has feelings for Arman.', 66647, 15, 1197385, 77518, '2016-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197386, 'Magic Spell Costco', 'Arisa grows closer to Arman after having gone out on a number of dates.  Yuki, who also hopes to ask Arisa out, tries hard to steal her attention.', 66647, 16, 1197386, 77518, '2016-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197387, 'Anywhere for You', 'Arman, Arisa, and Mizuki prepare the Japanese-style room for Minori and Tatsuya, now a couple.  Arisa promises she will go anywhere with Arman if he wins his fight.', 66647, 17, 1197387, 77518, '2016-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197388, 'Worst Date Ever', 'Minori confesses her relationship issues to her older sister, Kurumi, who asks Minori whether the two are having make-up sex or not.', 66647, 18, 1197388, 77518, '2016-02-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240654, 'A Christmas Nightmare', 'Arman and Arisa go out on a Christmas dinner date.  The two hold hands and enjoy the Christmas lights.  Then, Arman expresses his feelings to Arisa.', 66647, 19, 1240654, 77518, '2016-04-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240667, 'Scissorhands', 'Excitement buzzes as Terrace House welcomes two new members.  But upon Natsumi''s arrival, an incident causes a clash between her and Minori.', 66647, 20, 1240667, 77518, '2016-04-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240668, 'Case of Poke Bowl', 'New member Natsumi invites Arman out to the beach one morning.  Later that day, Arman fixes the busy Arisa a Hawaiian fish salad called "poke."', 66647, 21, 1240668, 77518, '2016-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240669, 'Case of the Meat', 'One night, the housemates discover they have run out of food.  Minori suggests eating the fancy wagyu beef that Tatsuya got as a present at work.', 66647, 22, 1240669, 77518, '2016-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240670, 'No Use Crying Over Meat', 'Tatsuya is furious with his housemates for eating his beef without his permission.  Minori''s older sister comes to visit and reasons with him.', 66647, 23, 1240670, 77518, '2016-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240681, 'New It Girl in the City', 'Tatsuya and Minori depart from the house as a couple after seven month.  Upon arrival, the new girl becomes an instant love interest among the boys.', 66647, 24, 1240681, 77518, '2016-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240682, 'Mr. Perfect in the City', 'Aspiring architect Yuto Handa moves in after Misaki.  He intends to complete his studies at Harvard and attracts the attention of the female residents.', 66647, 25, 1240682, 77518, '2016-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240687, 'Love Is in the Air', 'Hikaru is interested in the new housemate Misaki.  When she talks about her ex, he doesn''t hide his irritation.  The next day, when the two are alone...', 66647, 26, 1240687, 77518, '2016-05-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240692, 'Always Smiling With You', 'Hikaru takes Misaki for a romantic motorbike ride to the beach.  Later, Misaki tells Natsumi that she wishes the date had lasted forever.', 66647, 27, 1240692, 77518, '2016-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240693, 'Cry, Cry, Cry', 'Yuto promises to go fishing with Natsumi, but he changes his mind and tells her he can''t go because of his girlfriend.  Natsumi starts to cry.', 66647, 28, 1240693, 77518, '2016-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240694, 'Nightie Nightmare', 'High school student Riko Nagai, who recently won a national beauty contest, joins the gang.  Misaki quickly befriends her and they chat about Hikaru.', 66647, 29, 1240694, 77518, '2016-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240695, 'Girl''s Decision in Love', 'When Misaki buys some sleepwear with Hikaru''s opinion in mind, Natsumi seriesReviewComments on it and the two get into an argument.  Yuto sides against Natsumi.', 66647, 30, 1240695, 77518, '2016-06-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240696, 'Natsumi & Fuyumi', 'Misaki confesses her feelings to Hikaru.  That night, she says something that makes Natsumi incredibly angry and winds up paying the price for it.', 66647, 31, 1240696, 77518, '2016-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240697, 'Shall We Pas de Deux?', 'When Hikaru suddenly declares that he will leave the house with Natsumi, the rest of the members are shocked.  Misaki has a talk with him in private.', 66647, 32, 1240697, 77518, '2016-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240698, 'First Dip in the Pool', 'Hayato promises to go on a date with Riko, but she worries she''s too young for him.  During the welcome party, an unexpected surprise occurs.', 66647, 33, 1240698, 77518, '2016-07-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240699, 'Hamburg x Hamburg', 'Riko asks Hayato if he thinks she''s immature, but he reassures her.  They decide on Tsukiji for their second date.  Arman participates in a festival.', 66647, 34, 1240699, 77518, '2016-07-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240700, 'Bye Bye Mr. Perfect', 'Momoka works up the courage to ask Arman out to the beach.  Hayato and Riko enjoy their date at Tsukiji.  Meanwhile, Yuto makes a decision.', 66647, 35, 1240700, 77518, '2016-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240701, 'Byrnes Sandwich', 'Shortly after Handa''s departure, Yuuki arrives at the house.  Good looking and tall, he''s just Riko''s type.  But he has his eyes on someone else.', 66647, 36, 1240701, 77518, '2016-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240702, 'Slow Down Your Love', 'Yuuki''s had his eye on Misaki ever since moving in and asks her out on a date.  Misaki tells him about her unrequited feelings for Hikaru.', 66647, 37, 1240702, 77518, '2016-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240707, 'Quick to Say I Love You', 'After their date ends awkwardly, Riko tries to clear the air with Hayato.  Meanwhile, Momoka faces a life-changing contest.', 66647, 38, 1240707, 77518, '2016-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240709, 'Rocket Girl Dives Into Love', 'During Misaki''s birthday party, Yuuki can''t control himself and confesses his feelings for Misaki.  The next morning, she asks if he remembers.', 66647, 39, 1240709, 77518, '2016-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240710, 'Midsummer Intimacy', 'Recently entrant Masako quickly declares her fondness for Hayato and promises to cook with him.  One night, the two of them spend time alone at the pool.', 66647, 40, 1240710, 77518, '2016-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240711, 'Better Luck This Time', 'Yuuki goes on his first drive with Misaki to Yokohama, where she once fell out of love.  He finally tells her how he really feels about her.', 66647, 41, 1240711, 77518, '2016-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240712, 'Fragile Boy, Fragile Girl', 'Masako feels even more strongly about Hayato and, after seeing him with Riko, asks him out on a date.  Arman goes out for nighttime skateboarding.', 66647, 42, 1240712, 77518, '2016-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240716, 'Kiss and Tell', 'Riko and Hayato''s date to see the fireworks ends uneventfully.  He says that he doesn''t see her as a woman, but this statement proves consequential.', 66647, 43, 1240716, 77518, '2016-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240722, 'Price of a Lie', 'Despite the apparent lack of progress in Riko and Hayato''s relationship, the other housemates question them upon learning they have already kissed.', 66647, 44, 1240722, 77518, '2016-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240726, 'The Riko Special', 'The house members confront Hayato and Riko about the lies they told about their relationship.  Hayato remains silent and all eyes turn to Riko.', 66647, 45, 1240726, 77518, '2016-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240728, 'Bye Bye Terrace House in the City', 'In the season finale, as the evening of their arrangement arrives, Hayato prepares for Riko in his restaurant.  But she may be headed somewhere else.', 66647, 46, 1240728, 77518, '2016-10-25');
