INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629849, 'Episode 4', 'James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber discuss the most fascinating news stories of the week.', 66657, 4, 1629849, 77532, '2016-06-10');
