INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629852, 'Episode 2', 'James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber discuss the most fascinating news stories of the week.', 66657, 2, 1629852, 113446, '2016-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629853, 'Episode 3', 'It''s the news as you''ve never seen it before - a fascinating, funny look at the last seven days from the team behind QI. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 3, 1629853, 113446, '2016-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629854, 'Episode 4', 'No Such Thing As The News is a current events programme you can watch with pleasure rather than anxiety. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 4, 1629854, 113446, '2016-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629855, 'Episode 5', 'No Such Thing As The News is a current events programme you can watch with pleasure rather than anxiety. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 5, 1629855, 113446, '2016-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629856, 'Episode 6', 'No Such Thing As The News is a current events programme you can watch with pleasure rather than anxiety. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 6, 1629856, 113446, '2016-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629857, 'Episode 7', 'A humorous look at the lesser-known events of the week. Who would ever have thought the news could be this much fun? With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 7, 1629857, 113446, '2016-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1629858, 'Episode 8', 'Your last chance before Christmas to hear something interesting about the world we live in. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 8, 1629858, 113446, '2016-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224037, 'The First Day', 'Best friends Vanessa and Carly embark on their first day as ballet dancers at the prestigious Keaton School of the Arts. Meanwhile, singer Alya struggles with stage fright in front of her music class.', 66659, 1, 1224037, 77536, '2016-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224038, 'Groups of Two', 'Carly and Vanessa are forced to dance with new partners, while Jax disapproves of Miles'' preferential treatment in music class. Alya contends with a celebrity classmate.', 66659, 2, 1224038, 77536, '2016-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224039, 'The Brightside', 'Student council president Julie plans a spectacular freshman orientation while tension mounts between Carly and Vanessa. Miles keeps a secret from his classmates.', 66659, 3, 1224039, 77536, '2016-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224040, 'Stand Tall', 'Carly helps Vanessa to impress the prima dancers, while Bianca enlists a reluctant classmate to create a spectacular song. Denzel tries to wow his artistic hero.', 66659, 4, 1224040, 77536, '2016-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224041, 'Take Me Out', 'Carly worries that emotions are getting in the way of her duet with Sasha. Kit and Denzel are paired with a singer with an attitude, and Jax is forced out of his comfort zone.', 66659, 5, 1224041, 77536, '2016-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224042, 'Dig Deeper', 'Alya''s new musical partnership doesn''t go as hoped. Singer Scarlet struggles with a movement for a non-movers class. Vanessa is hurt when Carly forgets their friendiversary.', 66659, 6, 1224042, 77536, '2016-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224043, 'In Their Shoes', 'Carly and Vanessa compete against each other in mid-term ballet auditions. Miles'' new lease on life has Jax concerned for his friend''s health. Scarlet''s intrigue with Julie grows.', 66659, 7, 1224043, 77536, '2016-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224044, 'On Deck', 'Bianca is determined to impress her casting agent mother, while Jax challenges Kit to a DJ battle. Denzel''s costume designs for the mid-term ballet are put to the test.', 66659, 8, 1224044, 77536, '2016-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224045, 'Sotto Voce', 'Kit faces expulsion from Keaton if she doesn''t reveal her secret; Vanessa needs Carly''s help to impress Ms. Helstweel; tension builds when Miles must share studio space with Julie.', 66659, 9, 1224045, 77536, '2016-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224046, 'The Understudy', 'Alya''s newfound celebrity status at Keaton intensifies her rivalry with Bianca. Sasha comes up with a plan to win Carly''s friendship back. Scarlett loses her voice.', 66659, 10, 1224046, 77536, '2016-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224047, 'Lose Yourself', 'Julie stands up for her right to artistic expression; Vanessa pushes herself to her limits; Bianca reconsiders her future at Keaton.', 66659, 11, 1224047, 77536, '2016-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197501, ' Plays Well with Others', 'Talented high school students at a fine arts school hone their crafts while dealing with the drama that comes from tough teachers, competitive friends, and their own self worth', 66659, 12, 1197501, 77536, '2016-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198822, 'Hold On', 'Carly desperately tries to cheer Vanessa up after getting her kicked out of the primas; Bianca struggles to come clean about her secret; Denzel wants to make his mark in the art world', 66659, 13, 1198822, 77536, '2016-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200133, 'Twelve Hours to Showtime', 'Tensions run high as the mid-term performances approach; Vanessa becomes determined to dance in the freshman ballet despite her injury', 66659, 14, 1200133, 77536, '2016-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201527, 'Showtime', '', 66659, 15, 1201527, 77536, '2016-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1223123, 'Restart', 'School is back in session but nothing is as it was before the break; new musical partnerships, changing dynamics in the dance stream and missing faces in the halls.', 66659, 16, 1223123, 77536, '2016-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224049, 'Juggle', 'Sasha finds himself caught in the middle of Vanessa and Carly''s feud. Miles must come to grips with the new normal at Keaton. Scarlett''s presidency is threatened.', 66659, 17, 1224049, 77536, '2016-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224050, 'Eyes Forward', 'A mysterious film student has Carly distracted from dance. Bianca''s feelings for Jax resurface. Denzel must win over the student body to accomplish an ambitious project.', 66659, 18, 1224050, 77536, '2016-09-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224051, 'Once in a Lifetime', 'Vanessa''s frustration with not being able to dance reaches a boiling point. Miles is shocked when a familiar face returns and Julie broadens her creative horizons.', 66659, 19, 1224051, 77536, '2016-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224052, 'Da Capo', 'Alya tries to reintegrate into life at Keaton but is met with hostility. Carly questions her feelings for Austin and Kit attempts to inject her true identity into her music.', 66659, 20, 1224052, 77536, '2016-09-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224053, 'Friend or Foe', 'The music students put aside their differences to get through a difficult day. Vanessa makes a promise she might not be able to keep. Denzel must deliver bad news to a friend.', 66659, 21, 1224053, 77536, '2016-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224054, 'Verite', 'Julie is consumed with guilt over cheating on her PSATs. A musical roots assignment hits an emotional nerve with Scarlett, while Carly''s insecurities get the better of her.', 66659, 22, 1224054, 77536, '2016-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224055, 'Step Up', 'Miles is nervous to define his relationship with Alya. Meanwhile, Vanessa questions whether or not she will be able to dance again and Julie faces the unexpected consequences of cheating.', 66659, 23, 1224055, 77536, '2016-09-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224056, 'Ensemble', 'The freshmen dance class wants revenge on Julie for Ms. Maria''s firing. Scarlett makes a discovery that unsettles Kit. Vanessa runs interference in Carly''s relationship.', 66659, 24, 1224056, 77536, '2016-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224057, 'After the Flood', 'Sasha exposes a classmate''s secret on his blog with heartbreaking results. Bianca''s guilt gets the best of her. Jenna is at odds with the rest of the grade nine dancers.', 66659, 25, 1224057, 77536, '2016-09-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224058, 'Try Again', 'Creative differences threaten to put an end to Denzel''s music video. Sasha enlists Vanessa''s help for an audition. Carly''s role in the sprinkler incident comes into question.', 66659, 26, 1224058, 77536, '2016-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224059, 'Fallout', 'In the aftermath of Austin''s bullying, Kit worries for Denzel''s well-being. Alya seeks comfort from Miles. Vanessa tries to rebuild her friendship with a distant Carly.', 66659, 27, 1224059, 77536, '2016-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224060, 'Lead the Way', 'The dance students rally together amid threats that their secret will be exposed. Bianca is determined to make memories with Jax, while Denzel faces a new challenge.', 66659, 28, 1224060, 77536, '2016-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224061, 'Me', 'A dance rivalry comes between Carly and Vanessa. Bianca gets a career opportunity that could jeopardize her future with Jax and Alya questions Miles'' feelings for a former crush.', 66659, 29, 1224061, 77536, '2016-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1224062, 'We', 'Keaton''s talent is on display at the Open House, but as the school year comes to a close, the future of each student is uncertain.', 66659, 30, 1224062, 77536, '2016-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1355388, 'And We Are Back...', 'The students are back at Keaton. Vanessa and Carly face some hard consequences, Jax''s summer returns to haunt him. Alya and Miles compete to be mentored by a top music student.', 66659, 1, 1355388, 91856, '2017-08-28');
