INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197542, 'Episode 1', 'Struggling comedian Tokunaga meets intense senior comic Kamiya at a festival and asks to become his apprentice. Kamiya agrees on one condition.', 66660, 1, 1197542, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197543, 'Episode 2', 'Kamiya''s comedy duo relocates to Tokyo, and he and Tokunaga grow closer. Meanwhile, Sparks gets their first shot at an audition to play a real venue.', 66660, 2, 1197543, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197544, 'Episode 3', 'Prospects for Sparks are looking better every day as New Year''s approaches. Kamiya moves in with a woman named Maki, but his career is going nowhere.', 66660, 3, 1197544, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197545, 'Episode 4', 'Tokunaga and Yamashita juggle part-time jobs and comedy gigs, but when Yamashita is offered a movie role, they both have to think about their future.', 66660, 4, 1197545, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197546, 'Episode 5', 'Sparks and Ahondara perform in a variety show where the audience votes for the winner. After the results are announced, Tokunaga makes a change.', 66660, 5, 1197546, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197547, 'Episode 6', 'Sparks prepares for the first stand-alone show. Meanwhile, Kamiya''s situation with Maki has grown precarious, and he asks Tokunaga for help.', 66660, 6, 1197547, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197548, 'Episode 7', 'Sparks goes from a radio gig to a spot on a TV comedy contest. Ahondara performs on the show, too, exposing the difference between their styles.', 66660, 7, 1197548, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197549, 'Episode 8', 'Tokunaga''s TV appearances earn him a higher income; they also open a gap between him and Kamiya, whose debts and life are spiraling out of control.', 66660, 8, 1197549, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197550, 'Episode 9', 'Plans for a regular spot on a TV show fall through, making Sparks has-beens overnight. Tokunaga wants to keep going, but Yamashita has his own ideas.', 66660, 9, 1197550, 77538, '2016-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197551, 'Episode 10', 'Sparks play one last farewell show and bring the house down. A year later, Tokunaga''s real estate job is interrupted by news of Kamiya''s return.', 66660, 10, 1197551, 77538, '2016-06-02');
