INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197629, 'Hello Houston', 'Houston welcomes veterinarians Dr. Blue, Dr. Ross and Dr. Lavigne, who have their hands full with everything from risky surgeries to diagnosing sick chameleons. A car accident brings the practice to a halt as one of the doctors faces a long recovery.', 66669, 1, 1197629, 77553, '2016-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303807, 'Turnin’ Texan', 'Dr. Ross is back at the clinic, but a check-up with a large per proves to be too much too soon. When pregnant Frenchie goes into early labor, Dr. Lavigne performs an emergency c-section. Dr. Blue plans a Texas outing, to help lift Dr. Ross’s spirits.', 66669, 2, 1303807, 77553, '2016-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303808, 'No Goats, No Glory', 'While Dr. Blue & Dr. Ross help a client at their goat farm, Dr. Lavigne must save a pup with an obstruction in his intestines and concerned family waiting. Dr. Blue & Dr. Ross compete in a cook-off to see who is the best grill master.', 66669, 3, 1303808, 77553, '2016-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303809, 'The Vet Mobile', 'Dr. Ross buys a mobile unit for community outreach and Dr. Blue enlists his brother to help deck it out. Back at the clinic, Dr. Ross examines an iguana for an abscess and Dr. Lavigne helps a paraplegic dachshund get a new set of wheels.', 66669, 4, 1303809, 77553, '2016-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303810, 'Raining Cats, Dogs, and Tigers', 'Flooding has sent Houston into a state of emergency. While the clinic takes in displaced animals, Dr. Blue treats a puppy that has contracted a deadly disease from standing water. Dr. Lavigne and Dr. Ross examine a tiger found wandering in a neighborhood.', 66669, 5, 1303810, 77553, '2016-07-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303811, 'Hope for Hoppy', 'Dr. Ross performs a life-altering surgery on a sweet pup given a second chance at life, while Dr. Lavigne examines a prickly pet. After treating an injured owl, Dr. Blue joins Dr. Ross on pig farm to examine a cute litter of tiny piglets that are sick.', 66669, 6, 1303811, 77553, '2016-07-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303812, 'Training Day', 'Dr. Lavigne must remove tumors from an older dog, while Dr. Ross tries to save a rabbit''s foot that''s been damaged by a dog attack. Before he can compete with Dr. Ross in a puppy-training competition, Dr. Blue visits farm to castrate an aggressive donkey.', 66669, 7, 1303812, 77553, '2016-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303813, 'Lights, Camera, Action!', 'The clock is ticking as Dr. Blue performs an emergency C-section on a mother with two puppies stuck in her uterus, while Dr. Ross and Dr. Lavigne work on pets with serious eye issues. The vets test their on-camera skills to create a video for the clinic.', 66669, 8, 1303813, 77553, '2016-07-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303814, 'Dunk-A-Doctor', 'Dr. Ross treats baby kangaroos and works with the owners of a petting zoo to hold a fun event at the clinic to promote animal awareness. Dr. Blue removes a mass from a beloved pit mix, and Dr. Lavigne treats a vision and hearing impaired Great Dane.', 66669, 1, 1303814, 87457, '2017-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303815, 'Not So Easy Riders', 'Aubrey sees a bearded dragon that''s laying bad eggs. Michael mulls treatment for a boxer with a tumor on its toe. Diarra''s dreams of motorcycle riding with his brother are put on hold by a health scare.', 66669, 2, 1303815, 87457, '2017-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377295, 'Hog Wild and Home Free', 'The time has come for Dr. Ross and Tauvia to move out of his mama''s house. Dr. Lavigne makes a life or death decision with Diesel, a mastiff who could have a toy lodged in his intestines. Dr. Blue sees a pig with an affection for household furniture.', 66669, 3, 1377295, 87457, '2017-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377296, 'Emergency Engine Cat', 'Dr. Ross and vet tech Kyerra rush to save a stray cat that''s been brutally mangled by a car engine. The Ross'' move into their new home while Dr. Blue treats a 700 lb. arthritic pig. Dr. Lavigne sees a rescue Chihuahua with an incredible story.', 66669, 4, 1377296, 87457, '2017-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377297, 'Little Dog, Big Problem', 'Dr. Blue uncovers a big problem for a paralyzed Yorkie. Dr. Ross sees to a pair of roosters involved in a barnyard brawl before joining Dr. Lavigne on a hyena consultation. The Lavigne family hosts a dinner party showcasing Anne''s cooking skills.', 66669, 5, 1377297, 87457, '2017-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377298, 'California Dreamin''', 'The doctors battle it out to determine who will go to a vet conference in San Diego. Dr. Ross treats a kinkajou nearing his terrible twos, while Dr. Blue rids a Min Pin of drop dead breath. Dr. Lavigne suspects a cat has a contagious disease.', 66669, 6, 1377298, 87457, '2017-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377299, 'Miracle Puppies', 'Dr. Blue needs to act fast when a Rottweiler in labor is rushed into the hospital with two puppies stuck inside  her. Then, the three vets grab the reins and their cowboy hats to ride horseback into town for Houston''s biggest rodeo parade.', 66669, 7, 1377299, 87457, '2017-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1377300, 'Tuskegee Reunion', 'The docs visit their alma mater for a class reunion and become professors for a day. A Shih Tzu is rushed to the clinic after swallowing a large piece of rawhide, while the owner of a pitbull with a deformed leg must consider drastic surgery.', 66669, 8, 1377300, 87457, '2017-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659326, 'Episode 1', 'A small brunch cafe opened in bright tangerine farm.', 85457, 1, 1659326, 115394, '2019-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781277, 'Hurricane Harvey Special', 'Dr. Blue opens up the clinic after Hurricane Harvey pours 30-plus inches of rain on the city of Houston, Texas; the doctors help animals affected by the storm, while dealing with the personal issues that Hurricane Harvey has brought to the city.', 66669, 1, 1781277, 123647, '2018-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781278, 'Award Winning Docs', 'The doctors are honored for their contributions to the community; a goat with a twisted leg; a Great Dane with a life-threatening condition; a bulldog is rescued from a puppy mill.', 66669, 2, 1781278, 123647, '2018-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781279, 'Doctor Dads', 'Dr. Blue castrates five adult bulls on a vegan cattle ranch; a scary bulldozing occurs; a hen with a rough-mating injury; a young puppy is hit by a car.', 66669, 3, 1781279, 123647, '2018-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781281, 'Vegan Cowboys', 'Tensions run high when Dr. Blue visits a cattle ranch to castrate five adult bulls; Dr. Ross treats a hen with an injury; a puppy needs a serious surgery after being hit by a car.', 66669, 4, 1781281, 123647, '2018-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781282, 'Dr. Blue Gets Tanked', 'Dr. Blue wants a home aquarium; Dr. Ross attempts to diagnose a dog with bizarre test results; Dr. Lavigne performs knee surgery on a bulldog; a lamb has breathing problems.', 66669, 5, 1781282, 123647, '2018-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781283, 'Bait n'' Switch', 'Six sugar gliders turn Dr. Ross into their personal jungle gym; a young Chihuahua with atypical heart trouble; the doctors fish with a client.', 66669, 6, 1781283, 123647, '2018-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781284, 'Fly, Miss Thang, Fly', 'Dr. Ross examines a barred owl that was hit by a car, but he hopes will fly again; the doctors also visit an animal rescue center and get close to Texas wildlife.', 66669, 7, 1781284, 123647, '2018-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781286, 'Wedding Day Blues', 'Dr. Blue surprises his wife with a romantic wedding vow renewal in Las Vegas; a Schnauzer being boarded at the clinic needs medical help from Dr. Lavigne; Dr. Ross treats a very ornery parrot; a senior dog with a recurring eye mass.', 66669, 8, 1781286, 123647, '2018-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781287, 'The Pig Whisperers', 'A pit bull suffers a raccoon attack; an aggressive ferret; the vets test their pig-whispering skills at an animal rescue; the doctors have a surprise announcement for their wives.', 66669, 1, 1781287, 123649, '2019-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781288, 'Pomeranian Plot Twist', 'Dr. Lavigne sees a surprise on an X-ray of one of his favorite patients; Dr. Ross flexes his exotic vet chops with a fennec fox and a kinkajou with a highly contagious infection; Dr. Blue has his hands full with a former frat house pig named Aubie.', 66669, 2, 1781288, 123649, '2019-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781289, 'A Tale of Two Tails', 'DescriptionA dog has chewed off her own tail; a reptile may need a tail amputation; Dr. Lavigne helps Sutter Butter, a cat rescued from being thrown out of a car, and is now having seizures.', 66669, 3, 1781289, 123649, '2019-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781290, 'A Boy Who Spayed Wolf', 'Dr. Blue recruits Dr. Ross to tackle two wolf spays at a local sanctuary; Dr. Lavigne performs surgery on a pit bull with a torn ACL; new vet Dr. Fedke treats a cat with a creepy, crawly injury.', 66669, 4, 1781290, 123649, '2019-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781291, '16-Pound Tumor', 'Dr. Lavigne performs a risky surgery on a loving pit bull with a record-breaking tumor; Dr. Ross examines a rescue pigeon turned pet; an aspiring vet student joins Dr. Blue at Cy-Fair; the doctors deal with a heartbreaking situation at the clinic.', 66669, 5, 1781291, 123649, '2019-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1781292, 'Hog House Call', 'Bubby Cook, a beloved Basset Hound, has a condition that could complicate surgery for Dr. Ross; Dr. Blue has a hog house call; Dr. Lavigne has concerns over his vet tech assisting with an operation on her own dog; a blackout creates chaos at Cy-Fair.', 66669, 6, 1781292, 123649, '2019-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1794027, 'Bulldog Bellyache', 'Yuki the bulldog ate something she shouldn''t have and it''s up to Dr. Blue to find it; Dr. Lavigne and his wife learn how to do alternative home care on Suki, an amputee rescue cat his family adopted.', 66669, 7, 1794027, 123649, '2019-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1794131, 'Yogi Goat', 'After treating a yoga goat, Dr. Blue brings his best namaste to a herd house call; Dr. Lavigne has his hands full with a trained protection dog who''s not a fan of him or the cameras; a party reveals if the Blues will be adding pink to their family.', 66669, 8, 1794131, 123649, '2019-05-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1882433, 'The Dog Ate My Shorts', 'Dr. Blue must figure out what''s wrong with Niko, a lethargic dog that may have eaten his mom''s shorts; Dr. Lavigne operates on a husky with a torn ligament; Dr. Ross faces an emergency with his own family pet.', 66669, 1, 1882433, 129509, '2019-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1893115, 'Cat vs. Robot', '', 66669, 2, 1893115, 129509, '2019-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1903218, 'This Little Piggy Has Mites', 'An itchy pig with a mean bite tries to take a chunk out of Dr. Blue, while Dr. Lavigne uses a unique method to fix a small dog''s broken leg; Dr. Ross helps a rescue dog whose injuries may have gone untreated for too long; the docs go for gold.', 66669, 3, 1903218, 129509, '2019-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1916752, 'Pardon My Frenchie', 'Dr. Lavigne treats a French bulldog with a very vocal breathing problem that requires a special surgery, before joining Dr. Blue on a pet pig transport; Dr. Ross has an exam with Gurgi the guinea pig, who is coughing and sneezing.', 66669, 4, 1916752, 129509, '2019-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1922166, 'Calendar Boys', 'Dr. Lavigne must decide during surgery if a giant schnauzer can keep his ear; a poodle named Jay-Z with suspicious symptoms needs Dr. Blue''s help; Dr. Ross removes tumors from a rat; the vets pose with pets for a calendar to help animals in Haiti.', 66669, 5, 1922166, 129509, '2019-09-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1930117, 'Operation Dalmatian', 'Dr. Blue performs a difficult surgery on a Dalmatian being weighed down by a grapefruit-sized tumor on his head; Dr. Ross brings his family together to get a service dog for his brother Tedric, who has been suffering from seizures his whole life.', 66669, 6, 1930117, 129509, '2019-09-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1935630, 'Lumpy Duck', 'Ross closely examines a duck with a lump in his throat; Dr. Lavigne uses x-ray film during surgery in a very unexpected way; Dr. Blue tries to uncover a guinea pig mystery at the clinic; Dr. Lavigne''s wife joins a local roller derby team.', 66669, 7, 1935630, 129509, '2019-09-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1941188, 'Llama Drama', 'Dr. Lavigne is tasked at removing a 6-pound mass from a small dog; Dr. Blue and wife welcome their first daughter to the family; the vets make a house call to a llama that''s causing some drama; Dr. Ross extracts 14 teeth from a mini poodle.', 66669, 8, 1941188, 129509, '2019-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1330513, 'Agatha Raisin and the Quiche of Death', 'Agatha Raisin, a public relations professional, gives up her life in London in the hope of starting a new life in the seemingly quiet village of Carsley, but soon finds herself a suspect in a murder case when she enters the village''s annual quiche-making competition in an attempt to ingratiate herself with the community. She sets out to clear her name and solve the mystery of the quiche of death.', 66671, 1, 1330513, 89712, '2014-12-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197632, 'The Walkers of Dembley', 'A walker is found dead on a local baronet''s land soon after he declares war on her rambling group for trespassing on his land. Eager to solve the crime, Agatha convinces James that they should pose as a married couple and go undercover in the victim''s walking group.', 66671, 1, 1197632, 77555, '2016-06-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197991, 'Hell''s Bells', 'Bell-ringer Amanda Ballard is found hanged in the belfry with a suicide note left beside her, but Agatha is not convinced she took her own life and enlists a reluctant Roy to help her research the case.', 66671, 2, 1197991, 77555, '2016-06-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197992, 'The Wellspring of Death', 'Roy lures Agatha back into the world of PR. She represents a local mineral water company -- but a murder there throws a spanner in the works.', 66671, 3, 1197992, 77555, '2016-06-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1666703, 'Episode 2', '', 85457, 2, 1666703, 115394, '2019-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197993, 'The Potted Gardener', 'Agatha springs into action when James''s girlfriend Mary is found dead shortly before the village gardening competition.', 66671, 4, 1197993, 77555, '2016-06-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197994, 'The Vicious Vet', 'Agatha and James spring into action when the local vet and village heartthrob is found dead, the day after he and Agatha went on a date.', 66671, 5, 1197994, 77555, '2016-07-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197995, 'The Day the Floods Came', 'The murder of a bride throws the village into shock. Ignoring warnings Agatha investigates, but soon finds she''s in desperate danger.', 66671, 6, 1197995, 77555, '2016-07-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197996, 'The Witch of Wyckhadden', '', 66671, 7, 1197996, 77555, '2016-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197997, 'Murderous Marriage', '', 66671, 8, 1197997, 77555, '2016-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1625384, 'Agatha Raisin and the Wizard of Evesham', 'Now back in her quaint Cotswolds hamlet, Agatha suspects her hair salon''s arrogant stylist is blackmailing clients with their darkest secrets.', 66671, 1, 1625384, 113056, '2018-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1651805, 'Agatha Raisin and the Fairies of Fryfam', 'Looking to get away for a few days, Agatha rents a cottage in Fryfam, a village where mythical fairies are said to live. Before Agatha can start relaxing, however, she is employed by a local woman to prove that her wealthy husband is having an affair.', 66671, 2, 1651805, 113056, '2018-12-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1651806, 'Agatha Raisin and the Curious Curate', 'The arrival of a handsome new curate causes a stir in the village, but when murder strikes, one of Agatha''s friends becomes the prime suspect. As she works to clear her friend''s name, Agatha''s love life gets in the way of her investigation.', 66671, 3, 1651806, 113056, '2019-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197643, 'Judge vs Judge', 'Football referee Juarez is fighting his ex-wife Manuela in court for custody of their son Vini, but the judge in the case makes it plain that his ruling will depend on the result of an upcoming match.', 66672, 1, 1197643, 77558, '2012-08-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197644, 'The Mother', 'Short of money, Juarez goes to live with his mother Rosali and her boyfriend Guzman, an avid football fan. Juarez''s boss, Caponero, asks him to referee in the prestigious Libertadores Cup.', 66672, 2, 1197644, 77558, '2012-09-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197645, 'Between the Football Boots and the Pointe Shoes', 'Juarez is horrified when Vini asks him for gymnast slippers for his birthday. Manuela succumbs to the amorous attentions of her divorce lawyer, Rui. Juarez makes a discovery about a colleague.', 66672, 3, 1197645, 77558, '2012-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197646, 'The Referee''s Team', 'A worried Juarez must referee a match involving his favourite team, which is facing possible relegation. He asks for help from his friend and linesman Carvalhosa, who unleashes a comedy of errors.', 66672, 4, 1197646, 77558, '2012-09-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197647, 'The Hot Lineswoman', 'Juarez and Carvalhosa complain about having to referee a match with a woman when they travel to Venezuela for an important Libertadores Cup game with attractive new lineswoman Vitoria da Matta.', 66672, 5, 1197647, 77558, '2012-09-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197648, 'Side Effects', 'Juarez fails the Football Referee Confederation''s physical examination and only has one more chance to pass. He takes steroids to improve his chances, but they have some frustrating side effects.', 66672, 6, 1197648, 77558, '2012-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197650, 'Naked with His Hand in His Pocket', 'Juarez agrees to referee a charity football match between two teams of glamorous models, leaving new girlfriend Vitoria fuming with jealousy but she soon catches the attention of the game''s organisers.', 66672, 7, 1197650, 77558, '2012-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197651, 'The Videotape Is Stupid and the Earpiece Is Useless', 'Juarez is worried about making a mistake on the pitch, so Vitoria suggests helping him out when he referees his next match by sending messages to him from the commentary box via a hidden earpiece.', 66672, 8, 1197651, 77558, '2012-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197652, 'Yellow Card', 'With help from Carvalhosa, Juarez manages to set up a lunch meeting with Caponero to talk about his suspension. But on the way to the restaurant, he recalls there''s a football match at Vini''s school.', 66672, 9, 1197652, 77558, '2012-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197653, 'What Goes Around Comes Around', 'Juarez is kidnapped by a group of football fans who are enraged by a bad call he made long ago that put their team at a disadvantage. Manuela has had enough of Rui and ends their relationship.', 66672, 10, 1197653, 77558, '2012-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197654, 'Men Don''t Betray Men', 'Rosali and Guzman get married, with Juarez and Manuela as witnesses. Vitoria starts a romance with Caponero, so Juarez threatens to reveal their affair to the press unless he gets his job back.', 66672, 11, 1197654, 77558, '2012-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197655, 'Gold Whistle, Black Whistle', 'Juarez, now reconciled with Manuela, is assigned to referee the final match of the Libertadores Cup. But he''s shocked to see his family arrive as guests of the owner of one of the teams about to play.', 66672, 12, 1197655, 77558, '2012-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197656, 'Finally, the Final', 'Juarez receives an offer of millions to throw the match and learns that one of the linesmen is in on the scheme, but Manuela makes it clear that if he takes the bribe, she''s leaving him for good.', 66672, 13, 1197656, 77558, '2012-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250862, 'Episode 1', '', 66674, 1, 1250862, 83236, '2016-12-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197659, 'Stanotte al Museo Egizio', 'Alberto Angela takes viewers on an extraordinary visit: it is night, the halls are clear of tourists and curious; the masterpieces of ancient Egypt emerge one after the other and are always admired in all their splendor. The tenant becomes the eye of the public, and guides him in gigantic statues of pharaohs and sphinxes, in a rich tomb within a Nubian temple rebuilt piece by piece in the museum.', 66674, 1, 1197659, 77567, '2015-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250440, 'Stanotte a Firenze', 'Florence, like you''ve never seen. At night, without the crowds of tourists, you will have the privilege of discovering one of the most visited cities and admire the world, staying face to face with his masterpieces. Finally, the works of art can speak and tell the secrets of beauty that enchants for centuries.', 66674, 2, 1250440, 77567, '2016-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250441, 'Stanotte a San Pietro', '', 66674, 3, 1250441, 77567, '2016-12-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1197691, 'Piloto', 'When the Mexican drug cartel comes after Teresa Mendoza with a vengeance, she is forced to run and do whatever it takes to survive. Now, her fate is sealed in the dangerous narco world forever.', 66676, 1, 1197691, 77570, '2016-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202326, 'Cuarenta Minutos', 'Teresa has to prove her worth to Camila. Meanwhile, Epifanio gets closer in his hunt for Teresa. Back in Mexico, Brenda desperately tries to find Teresa and hide from the cartel.', 66676, 2, 1202326, 77570, '2016-06-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202327, 'Estrategia de Entrada', 'Camila sends Teresa out on a major drug operation to test her loyalty. In secret, Camila makes her first big move to take over Epifanio’s cartel. Meanwhile, Brenda plots her escape to America.', 66676, 3, 1202327, 77570, '2016-07-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202746, 'Lirio de los Valles', 'A deadly mistake mars Teresa’s first solo drug run and she soon finds herself in peril. Meanwhile, Brenda and Tony make the risky escape to Dallas.', 66676, 4, 1202746, 77570, '2016-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202747, 'Un Alma. Un Mapa. Dos Futuros.', 'Teresa witnesses a horrific event that forces her to advance her plans. Now, safely in Dallas, Brenda needs money to survive, and starts assembling a rag tag team to help her sell drugs.', 66676, 5, 1202747, 77570, '2016-07-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202748, 'El Engaño como la Regla', 'Camila, riddled with debt and short on supply, grows desperate and ponders giving Teresa up. Meanwhile, Brenda''s burgeoning drug enterprise creates a rift between her and Tony.', 66676, 6, 1202748, 77570, '2016-07-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1848567, 'Diosa de la Guerra', 'Teresa takes out a group of mercenaries while expanding her empire to an unexpected place.', 66676, 12, 1848567, 125212, '2019-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204327, 'El Hombre Pájaro', 'Camila sends Teresa out on a life-threatening, multi- million dollar midnight mission. Pressured by a lack of supply, Brenda puts her crew in the line of fire.', 66676, 7, 1204327, 77570, '2016-08-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204328, 'Billete de Magia', 'A desperate Camila attempts an incredibly risky heist. Meanwhile, Teresa goes undercover and, with her life on the line, is forced to make a choice that forever changes her.', 66676, 8, 1204328, 77570, '2016-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204329, 'Coge Todo Lo Que Puede Llevar', 'Teresa races to save a witness in the recent heist. With renewed confidence, Camila assures her partners that she’s back in business and vows to be done with Epifanio once and for all.', 66676, 9, 1204329, 77570, '2016-08-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204330, 'Esta ‘Cosa’ Que Es Nuestra', 'Camila returns to Mexico to protect her life, while James hunts Teresa down. Meanwhile Teresa finds herself in grave danger taking Maria through the tunnel to Mexico.', 66676, 10, 1204330, 77570, '2016-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204331, 'Punto Sin Retorno', 'Aligning with the Jimenez Cartel, Camila’s operation goes underground. Teresa and Brenda try to start a new life utilizing knowledge from Güero’s book.', 66676, 11, 1204331, 77570, '2016-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204332, 'Quinientos Mil', 'Teresa and Brenda risk everything in a game of extortion. Camila takes further steps to overtake Epifanio’s empire.', 66676, 12, 1204332, 77570, '2016-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204333, 'Cicatriz', 'Teresa risks her life to protect Güero’s book by any means necessary. Camila’s takeover becomes rocky and Epifanio gets new intel that changes everything.', 66676, 13, 1204333, 77570, '2016-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1325305, 'El Cuerpo de Cristo', 'Teresa brokers a deal with an eccentric smuggler, Camila struggles to rebuild her empire, and Epifanio takes on a new partner he may not be able to control.', 66676, 1, 1325305, 89112, '2017-06-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1325912, 'Dios y el Abogado', 'Teresa and crew rig a high-stakes narco horse race, but old enemies — and old flames — threaten to tear everything apart.', 66676, 2, 1325912, 89112, '2017-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1325913, 'Un Pacto con el Diablo', 'While trying to destroy Epifanio''s drug smuggling tunnels, Teresa and James come face-to-face with a group of American border vigilantes.', 66676, 3, 1325913, 89112, '2017-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1325914, 'El Beso de Judas', 'Teresa''s loyalties are tested when she is asked to assassinate a DEA mole.', 66676, 4, 1325914, 89112, '2017-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329125, 'El Nacimiento de Bolivia', 'Teresa, James and Guero travel to Bolivia in search of a new supplier: the mysterious and dangerous narco-cult leader El Santo.', 66676, 5, 1329125, 89112, '2017-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329126, 'El Camino de la Muerte', 'Captured by narco-cult leader El Santo, Teresa embarks on a spiritual journey with real-world consequences.', 66676, 6, 1329126, 89112, '2017-07-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329127, 'El Precio de Fe', 'With their payment deadline looming, Teresa and Camila need to find a new distributor, but their plans become threatened.', 66676, 7, 1329127, 89112, '2017-07-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329128, 'Sacar con Sifon el Mar', 'Camila sends Teresa and her crew to Chicago to secure a meeting with an elusive drug distributor.', 66676, 8, 1329128, 89112, '2017-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341721, 'Sólo el Amor de Una Madre', 'An uncharacteristic blunder forces Camila and Teresa to go on the run from hit men, but as they flee, their bond grows deeper.', 66676, 9, 1341721, 89112, '2017-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341720, 'Que Manden los Payasos', 'When Teresa competes with James for Camila''s trust, she begins to question everything; Epifanio plans to leave the cartel world for good.', 66676, 10, 1341720, 89112, '2017-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341723, 'La Noche Oscura del Alma', 'Teresa goes on the run to flee Camila, but she realizes the time for running is over after a showdown with hired guns.', 66676, 11, 1341723, 89112, '2017-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341722, 'Todas las Horas Hieren', 'Eager to break away from Camila, Teresa forges new, uneasy alliances and brings the fight to Camila''s doorstep.', 66676, 12, 1341722, 89112, '2017-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341724, 'La Última Hora Mata', 'In the final showdown between Teresa and Camila, they are forced to accept the truth that there can be only one queen.', 66676, 13, 1341724, 89112, '2017-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1460077, 'La Ermitaña', 'Hiding from Camila in Malta, Teresa tries to launch a drug empire of her own by striking a deal with a dangerous money launderer.', 66676, 1, 1460077, 101320, '2018-06-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507563, 'El Colgado', 'On the run from hitmen in Malta, Teresa is helped by an old friend whose intentions are anything but clear.', 66676, 2, 1507563, 101320, '2018-06-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1515833, 'Reina de Oros', 'Teresa puts her life and her empire on the line when she attempts to rescue girls being trafficked by her new European business partner.', 66676, 3, 1515833, 101320, '2018-07-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1515915, 'La Fuerza', 'Teresa flees Europe and starts fresh in Phoenix, Ariz.; she must deal with a commission of cartel bosses and a corrupt local sheriff.', 66676, 4, 1515915, 101320, '2018-07-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1515916, 'El Juicio', 'An old enemy lays siege to Teresa''s new Phoenix winery; in defending her business, she finds passion with an old friend.', 66676, 5, 1515916, 101320, '2018-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1515917, 'Los Enamorados', 'Teresa tries to escape her captors with the help of an unexpected ally.', 66676, 6, 1515917, 101320, '2018-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1536327, 'Reina De Espadas', 'Rocked by a deeply personal tragedy, Teresa battles a dangerous sicario and a mutiny within her own ranks.', 66676, 7, 1536327, 101320, '2018-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545168, 'El Carro', 'In a bold plan to take over all drug distribution in Phoenix, Teresa makes a deal with the devil.', 66676, 8, 1545168, 101320, '2018-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545169, 'El Diablo', 'To help wipe out her Phoenix rivals, Teresa gets into bed with an ambitious politician.', 66676, 9, 1545169, 101320, '2018-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545170, 'La Muerte', 'Returning to Bolivia, Teresa risks her life to prove her loyalty to El Santo.', 66676, 10, 1545170, 101320, '2018-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545171, 'Diez de Copas', 'Teresa hunts for a mole inside her own operation and faces a terrible choice.', 66676, 11, 1545171, 101320, '2018-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545172, 'Justicia', 'Teresa tries to free a friend from his cage and comes face to face with her sworn enemy.', 66676, 12, 1545172, 101320, '2018-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1545173, 'El Mundo', 'Reeling from a surprise attack, Teresa makes a bold move to seize the throne.', 66676, 13, 1545173, 101320, '2018-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803884, 'Bienvenidos a Nuevo Orleans', 'Teresa expands her business and proves herself to a smuggler who offers her a business opportunity.', 66676, 1, 1803884, 125212, '2019-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803885, 'Un Asunto de Familia', 'Teresa''s deal with a smuggler goes sieways when a local kingpin discovers she''s smuggling cocaine.', 66676, 2, 1803885, 125212, '2019-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803886, 'Hospitalidad Sureña', 'A corrupt judge wants in on Teresa''s deal when he learns about her business.', 66676, 3, 1803886, 125212, '2019-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803887, 'La Maldición', 'While Javier and Boaz deal with a personal problem, Teresa gets involved in a deadly turf war.', 66676, 4, 1803887, 125212, '2019-06-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803888, 'Noche de las Chicas', 'El Gordo introduces Teresa to Russian drug queenpin Oksana in the hopes of forging a partnership.', 66676, 5, 1803888, 125212, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803889, 'La Mujer en el Espejo', 'Dealing with the losses of a drug war, Teresa and Dumas finally strike a truce.', 66676, 6, 1803889, 125212, '2019-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803890, 'Amores Perros', 'On her day off, Teresa is hunted by a sicario from her previous life while on the road.', 66676, 7, 1803890, 125212, '2019-07-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803891, 'Secretos y Mentiras', 'An FBI informant threatens Teresa''s growing empire while she deals with turmoil within her family.', 66676, 8, 1803891, 125212, '2019-07-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803892, 'Los Pecados de los Padres', 'Teresa must choose between leaving New Orleans and compromising her morals.', 66676, 9, 1803892, 125212, '2019-08-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1847351, 'Lo Que Más Temes', 'Teresa works to ease tensions between her business partners after she discovers that someone is stealing from her.', 66676, 10, 1847351, 125212, '2019-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1848568, 'Vienen Por Ti', 'Teresa must solidify a new business deal to take down an enemy - but an unexpected visitor arrives.', 66676, 13, 1848568, 125212, '2019-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198156, 'Pilot', 'Men who went to all-male schools and work in male-dominated professions talk about their lives.', 66700, 0, 1198156, 77616, '2014-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198158, 'The Only Man in a World of Women', '147 men who grew up and lived in female-dominated environments share their joys and agonies.', 66700, 1, 1198158, 77616, '2014-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198159, 'What''s It Like to Live as a Tone-Deaf Man?', 'Tone-deaf men afraid of going to karaoke have their singing abilities  assessed by Kim Yeon-woo, a wanna-be singer, and share what it is like to  live with tone deafness.', 66700, 2, 1198159, 77616, '2014-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198160, 'Men Who Lost More Than 10 kg', 'Men who lost more than 10 kg of weight are invited to speak about  weight-related issues, and discuss pros and cons of being on a diet.', 66700, 3, 1198160, 77616, '2014-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198161, 'Men Who Will Be Married Soon', 'Soon-to-be-married bachelors talk about marriage.', 66700, 4, 1198161, 77616, '2014-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198162, 'Men from the Countryside', 'Country boys who moved to Seoul share their thoughts on big city life.', 66700, 5, 1198162, 77616, '2014-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198163, 'Men With Unusual Names', 'Men with unusual names tell their stories. They are joined by two  special guests: Yoo Sang-moo, a comedian, and Kim Dong-hyun, a mixed  martial arts fighter.', 66700, 6, 1198163, 77616, '2014-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198164, 'Men Who are Dating or Married to Older Women', 'Men in relationships with older women tell stories they wouldn''t dare to share with their significant others.', 66700, 7, 1198164, 77616, '2014-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198165, 'Men Who Look Old or Young', 'Men who don''t look their age tell us about the pros and cons of looking older/younger than you are.', 66700, 8, 1198165, 77616, '2014-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198166, 'Men Who Look Alike', 'Male celebrity look-alikes share their stories. Special guests include "Gandhi" and "Obama."', 66700, 9, 1198166, 77616, '2014-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198167, 'Empolyment and War', 'Men who had a hard time finding a job discuss their experiences.', 66700, 10, 1198167, 77616, '2014-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198168, 'I Am A Woman Special', '100 women join the I Am a Man hosts and tell their stories.', 66700, 11, 1198168, 77616, '2014-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198169, 'The Single Man Special <The Single Since Birth and Broken-Hearted Man>', '100 single men talk about their lives being Single  Since Birth &amp; The Broken-Hearted Man. Guided by Muzie and Shin  Hyun-joon as dating experts, they tell the I Am a Man audience how to attract women.', 66700, 12, 1198169, 77616, '2014-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198170, 'Men Who Love Hip-Hop and Rock', 'Men who love hip-hop and rock music talk about their love for music.', 66700, 13, 1198170, 77616, '2014-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198171, 'Men Who Have Unique Jobs', 'This week, 100 men are invited to talk about their unique jobs.', 66700, 14, 1198171, 77616, '2014-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198172, 'Men and Women Special (1): Men and Women Who Live on Their Own', 'In this man and women special part 1, awkward situations between men and women turn into a hilarious situation.', 66700, 15, 1198172, 77616, '2014-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198173, 'Men and Women Special (2): I Am A Baseball Fanatic', 'In this man and women special part 2, I Am a Man hosts meet guys and girls who love baseball.', 66700, 16, 1198173, 77616, '2014-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198174, 'Men and Women Special (3): I Am An Alcohol Lover', 'In this man and women special part 3, they can''t live without drinking alcohol.', 66700, 17, 1198174, 77616, '2014-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198175, 'Men and Women Special (4): Men and Women Who Were Once Innocent', 'In this man and women special part 4, I Am a Man hosts meet man and women who were innocent in the past.', 66700, 18, 1198175, 77616, '2014-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198176, 'Men and Women Special (5): Men and Women Who Like to Travel', 'In this man and women special part 5, they just not only roamed around Korea, but also all around the world.', 66700, 19, 1198176, 77616, '2014-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198177, 'Title Match', 'It''s a title match between unique names, look-alikes, tone-deaf and fun-talented people.', 66700, 20, 1198177, 77616, '2014-12-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198373, 'Episode 1', '', 66719, 1, 1198373, 77647, '2012-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198374, 'Episode 2', '', 66719, 2, 1198374, 77647, '2012-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198542, 'Episode 1', 'The follies and foibles of the EU referendum are highlighted, along with prominent international politicians on Donald Trump''s campaign plane and inside Vladimir Putin''s presidential office.', 66728, 1, 1198542, 77665, '2016-06-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199748, 'Episode 2', 'With just over a week until the vote, tensions are high in the EU referendum camps. In the Unity Unit, the PM is coming to visit and Ruby is making cheesecake, while the Brexit team are suspicious about Malgosia. Oleg reminisces about Angela Merkel, and the Trump team attempt to woo the women.', 66728, 2, 1199748, 77665, '2016-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201198, 'Episode 3', 'With one day left for the EU Referendum camps to sway the waverers, Unity Unit''s Sara tries to manage conflict, and in the Brexit camp, Jackie wants to be eaten by eagles. Meanwhile, Brett is practising his best interpretative flamenco, and Team Putin are putting world leaders in their place.', 66728, 3, 1201198, 77665, '2016-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201583, 'Episode 4', 'The referendum results are in and the UK''s fate has been decided, leaving Tony keen to begin the healing process. Preeya departs into government and the David Cameron fudge morphs into a sad metaphor. Aboad Trump''s plane, Bea and the team are in operation damage control, while over in the Kremlin, Oleg is in operation elk control.', 66728, 4, 1201583, 77665, '2016-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202752, 'Episode 5', 'The Unity Unit has resorted to violence and Oleg has resorted to betrayal. Bea has resorted to tyranny and Gerry learns the healing power of the truth.', 66728, 5, 1202752, 77665, '2016-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204239, 'Episode 6', 'The Unity Unit has resorted to violence, Oleg has resorted to betrayal, Bea has resorted to tyranny and Gerry learns the healing power of the truth, all on Spencer''s wedding day!', 66728, 6, 1204239, 77665, '2016-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199919, 'The King and Queen of Bounce', 'When Big Freedia''s manager suggests teaming up with an internet sensation, Mr. Ghetto, for an international tour, not everyone on Freedia''s team agrees this is a good idea, and the collaboration is tested at a local show.', 66729, 1, 1199919, 77810, '2013-09-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199920, 'The Big Break-Up', 'Big Freedia''s worst suspicions are confirmed when Mr. Ghetto is arrested, jeopardizing the King and Queen of Bounce tour.', 66729, 2, 1199920, 77810, '2013-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199921, 'Old School Bounce', 'Stopping traffic on the streets of New Orleans and dancing on top of cars, Big Freedia goes back to her DIY roots - and risks arrest - to shoot the wildest Bounce video yet.', 66729, 3, 1199921, 77810, '2013-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199922, 'Dream Team of Bounce', 'Old grudges and wounded egos resurface when Big Freedia teams up with fellow Bounce artists to record a Bounce song for kids.', 66729, 4, 1199922, 77810, '2013-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199923, 'School House Bounce', 'Preparing for the first-ever Bounce show for kids, Big Freedia has to overhaul her act for a young audience and overcome the notion that Bounce is strictly X-rated.', 66729, 5, 1199923, 77810, '2013-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199924, 'Power Games', 'On the eve of their first international tour, dissension erupts in Team Freedia when old friends are excluded from the trip to Brazil.', 66729, 6, 1199924, 77810, '2013-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199925, 'Heads Will Roll', 'When the first show in Brazil proves to be rocky when Renee fills in as DJ, the team has to rebuild their act in time for the big show in Rio.', 66729, 7, 1199925, 77810, '2013-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199926, 'World Meets Bounce', 'Mardi Gras meets Carnival, and Brazilian booty shakes, as Big Freedia kicks off her international tour with the wildest Bounce party ever in Rio de Janeiro.', 66729, 8, 1199926, 77810, '2013-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199927, 'Bounce, Texas Style', 'Freedia prepares for the prestigious South by Southwest Music Festival in Austin, Texas, but with his mother''s ailing health and fighting between his two managers, Renee and Melvin, the Queen of Bounce is being pulled in too many directions.', 66729, 1, 1199927, 77811, '2014-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199928, 'Manager Shake Up', 'Big Freedia''s team continues to struggle at SXSW, one of the biggest music festivals in the world. The Queen of Bounce decides that a personnel change might be in order.', 66729, 2, 1199928, 77811, '2014-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199929, 'Bounce University', 'Back in New Orleans, the Queen of Bounce and her team prepare for Katy Red''s 15th anniversary performance and a lecture at Tulane University. Only problem is that the Shake Team have gone "Hollywood," giving a whole lotta of attitude and little effort.', 66729, 3, 1199929, 77811, '2014-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199930, 'No Place Like Home', 'With Vera''s health in decline, Freedia focuses on staying in New Orleans so he can work on his new album, get ready for the upcoming Mardi Gras parade and shop for a house that he could share with his mom.', 66729, 4, 1199930, 77811, '2014-07-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199931, 'New Boss of Bounce', 'Freedia''s live show hasn''t changed in years and his dancers seem uninspired, so the Queen of Bounce hires a fiery creative director to revamp the show and whip the dancers into shape.', 66729, 5, 1199931, 77811, '2014-07-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199932, 'Goodbye Vera', 'Devastated by his mother''s passing, Freedia tries to be strong for his family and friends as they rally to give her a big, New Orleans send off with a second line parade.', 66729, 6, 1199932, 77811, '2014-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199933, 'Shake Out', 'In a clear sign that she has reached the pinnacle of success in New Orleans, Freedia is honored with the Entertainer of the Year award at New Orleans premiere music event, The Big Easy Awards. But there''s much to do before the show will be ready for the rest of the world.', 66729, 7, 1199933, 77811, '2014-07-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199934, 'Bounce Goes Hollywood', 'Team Freedia is ready to put all their hard work to the test as they prepare to unveil their new live show in LA, but success doesn''t come easy as they also have to juggle a music video shoot and promotional events for Freedia''s new album release. Will Team Freedia cave under the pressure and demands in LA?', 66729, 8, 1199934, 77811, '2014-07-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199935, 'Just Be Free', 'As Freedia prepares for the biggest tour of her career - and the first without her beloved mom - the world seems to be conspiring to keep drama in her life. We meet her boyfriend, Devon for the first time. But there''s already a sense that when the cat''s on the road, the mouse might stray.', 66729, 1, 1199935, 77812, '2015-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199936, 'Flash''s Dance', 'Freedia is reeling after getting the news that her boyfriend has been arrested for marijuana possession. Now Devon can''t join Freedia on the rest of the tour as planned, because he''s been warned by authorities not to leave the state of Louisiana.', 66729, 2, 1199936, 77812, '2015-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199937, 'Freedia''s Twerk on Washington', 'Team Freedia arrives in Washington D.C. for a very special show to celebrate Freedia''s late mother''s birthday. Emotions run high as DJ Juan screws up the special tribute song the night before, and if tonight is anything less than perfect heads will roll.', 66729, 3, 1199937, 77812, '2015-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199938, 'The Dirtiest Song Ever Recorded', 'The Just Be Free tour rolls into Denver where Freedia has a recording date with best friend and "mother of Bounce" Katey Red. But manager Renee is frustrated because the song''s lyrics are so dirty that it could never make a radio playlist.', 66729, 4, 1199938, 77812, '2015-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199939, 'Trouble In Paradise', 'When Freedia learns that boyfriend Devon has cheated on her back home in New Orleans, she''s ready to cancel the rest of the tour. Her manager Melvin convinces Freedia that her career is more important than her stormy and often toxic relationship with Devon.', 66729, 5, 1199939, 77812, '2015-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199940, 'Big Bad Voodoo Finale', 'The grand finale of Freedia''s Just Be Free tour is Voodoo Fest in New Orleans, alongside some of the biggest artists in music, including Outkast, Skrillex and the Foo Fighters. Voodoo needs to be Freedia''s greatest concert yet and she pulls out all the creative stops.', 66729, 6, 1199940, 77812, '2015-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199941, 'Freedia Takes Manhattan', 'Team Freedia twerks through NYC and gets a shock when she meets with the publishers of her upcoming autobiography, and Skip dreams of bouncing on Broadway.', 66729, 1, 1199941, 77813, '2015-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199942, 'Art of the Azz', 'Freedia explores new creative frontiers when she invites the people of New Orleans to an open call photo shoot celebrating the art of the Azz and all things Twerk while also trying to work on her relationship with Devon.', 66729, 2, 1199942, 77813, '2015-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199943, 'Wanna Have a Good Time', 'Freedia struggles to overcome vocal problems in time to record a new collaboration, while Flash hopes to reunite with his long lost brother and Devon turns to Uncle Percy for advice on life &amp; love.', 66729, 3, 1199943, 77813, '2015-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199944, 'Big Freedia''s Twerk of Art', 'Freedia heads to LA for the all-star opening of her photography exhibit, while her boyfriend Devon plans a surprise for her return. Meanwhile, dancer Flash hopes to become a recording artist.', 66729, 4, 1199944, 77813, '2015-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199945, 'Buku or Bust', 'Freedia reunites with her father, and Skip &amp; Flash get one step closer to theirs as the team rocks Buku Fest.', 66729, 5, 1199945, 77813, '2015-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199946, 'Shake, Wiggle, Work', 'As Team Freedia prepares for their European tour, they shoot a music video for Dangerous and the Queen Diva suffers an injury that could stall her career.', 66729, 6, 1199946, 77813, '2015-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199947, 'Ich Liebe Dich', 'Team Freedia twerks across the pond to kick-off their European tour in Berlin, Germany where they find unexpected opportunities to expand the brand, and Freedia must make an important decision regarding the team''s future.', 66729, 7, 1199947, 77813, '2015-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198552, 'One Busy Queen', 'Queen Diva returns with bigger goals and a new manager, but tension with Melvin could derail plans.', 66729, 1, 1198552, 77667, '2016-06-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198550, 'Pop Goes the Question', 'Freedia prepares for her first major movie role. Devon works up the courage to propose.', 66729, 2, 1198550, 77667, '2016-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199948, 'OMG It''s Beyonce', 'Freedia and Devon can''t decide on details for their dream wedding; a phone call from Beyonce; a homeless Flash.', 66729, 3, 1199948, 77667, '2016-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199949, 'Get in Formation', 'Big Freedia''s feature on Beyonce''s "Formation" gets the Queen Diva lots of publicity, but a fight with Devon at Mardis Gras garners the wrong kind of attention. Tootie wants to bring back former dancer Steph and reunite the Shake Team.', 66729, 4, 1199949, 77667, '2016-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204338, 'Twerkloose', 'Freedia courts controversy when a concert in Mississippi gets canceled for excessive twerking; the team prepares to debut new music from the Queen Diva''s upcoming album; Tootie gives back to the community.', 66729, 5, 1204338, 77667, '2016-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205914, 'It''s Soul Food', 'A federal indictment rocks Freedia as she tries to expand her brand by launching Big Freedia''s Soul Food; Flash seeks to connect with his long-lost family.', 66729, 6, 1205914, 77667, '2016-07-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1208044, 'Diva''s Day in Court', 'Freedia has her day in court and faces a media circus; Flash heads to Michigan to meet his great-grandmother and learn about his past.', 66729, 7, 1208044, 77667, '2016-07-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1365227, 'The Queen Diva is Back!', '', 66729, 1, 1365227, 92701, '2017-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507794, 'Olivia Culpo/Gabriel Iglesias/Mary Lynn Rajskub/Craig Robinson', 'Celebrity panelists include Olivia Culpo, Gabriel Iglesias, Mary Lynn Rajskub and Craig Robinson.', 66784, 13, 1507794, 83271, '2017-08-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369456, 'Booty Poppin'' Potatoes', 'It''s the Queen''s birthday and parole ain''t stopping this diva from celebrating with family, friends and getting lit; chef Freedia hits the streets to better her community with her famous booty poppin'' potatoes.', 66729, 2, 1369456, 92701, '2017-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369457, 'The Power of Weed', 'Freedia heads back to Los Angeles to attend the Grammy Awards, but the temptation of weed affects her every step and threatens her ability to stay out of jail.', 66729, 3, 1369457, 92701, '2017-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369458, 'Veterans vs. Rookies', 'Freedia lives it up in LA; Berto mixes things up with the dancers in New Orleans; Tootie snaps when she hears Freedia is bonding with the new dancers deep in the swamps of Louisiana.', 66729, 4, 1369458, 92701, '2017-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369459, 'Girl Down', 'It''s Mardi Gras in New Orleans and Freedia has finally earned a coveted spot in the main parade, but a visit by a mysterious voodoo priest unsettles her as she hears shocking predictions about her future.', 66729, 5, 1369459, 92701, '2017-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369460, 'It Just Got Real', 'Freedia records a song for a local accident attorney that goes viral; rumors of Devon cheating turns Freedia''s personal life upside down.', 66729, 6, 1369460, 92701, '2017-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369461, 'What Do I Do', 'Big Freedia''s best friend Katey Red heads to the altar; competing LA-based record companies approach Freedia with life-changing opportunities.', 66729, 7, 1369461, 92701, '2017-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198665, 'Chapter One: The Vanishing of Will Byers', 'On his way home from a friend''s house, young Will sees something terrifying. Nearby, a sinister secret lurks in the depths of a government lab.', 66732, 1, 1198665, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1203677, 'Chapter Two: The Weirdo on Maple Street', 'Lucas, Mike and Dustin try to talk to the girl they found in the woods. Hopper questions an anxious Joyce about an unsettling phone call.', 66732, 2, 1203677, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1203679, 'Chapter Three: Holly, Jolly', 'An increasingly concerned Nancy looks for Barb and finds out what Jonathan''s been up to. Joyce is convinced Will is trying to talk to her.', 66732, 3, 1203679, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1203680, 'Chapter Four: The Body', 'Refusing to believe Will is dead, Joyce tries to connect with her son. The boys give Eleven a makeover. Nancy and Jonathan form an unlikely alliance.', 66732, 4, 1203680, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205904, 'Chapter Five: The Flea and the Acrobat', 'Hopper breaks into the lab while Nancy and Jonathan confront the force that took Will. The boys ask Mr. Clarke how to travel to another dimension.', 66732, 5, 1205904, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205905, 'Chapter Six: The Monster', 'A frantic Jonathan looks for Nancy in the darkness, but Steve''s looking for her, too. Hopper and Joyce uncover the truth about the lab''s experiments.', 66732, 6, 1205905, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205906, 'Chapter Seven: The Bathtub', 'Eleven struggles to reach Will, while Lucas warns that "the bad men are coming." Nancy and Jonathan show the police what Jonathan caught on camera.', 66732, 7, 1205906, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205907, 'Chapter Eight: The Upside Down', 'Dr. Brenner holds Hopper and Joyce for questioning while the boys wait with Eleven in the gym. Back at Will''s, Nancy and Jonathan prepare for battle.', 66732, 8, 1205907, 77680, '2016-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250983, 'Chapter One: MADMAX', 'As the town preps for Halloween, a high-scoring rival shakes things up at the arcade, and a skeptical Hopper inspects a field of rotting pumpkins.', 66732, 1, 1250983, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250984, 'Chapter Two: Trick or Treat, Freak', 'After Will sees something terrible on trick-or-treat night, Mike wonders whether Eleven''s still out there. Nancy wrestles with the truth about Barb.', 66732, 2, 1250984, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250985, 'Chapter Three: The Pollywog', 'Dustin adopts a strange new pet, and Eleven grows increasingly impatient. A well-meaning Bob urges Will to stand up to his fears.', 66732, 3, 1250985, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250986, 'Chapter Four: Will the Wise', 'An ailing Will opens up to Joyce -- with disturbing results. While Hopper digs for the truth, Eleven unearths a surprising discovery.', 66732, 4, 1250986, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250987, 'Chapter Five: Dig Dug', 'Nancy and Jonathan swap conspiracy theories with a new ally as Eleven searches for someone from her past. “Bob the Brain” tackles a difficult problem.', 66732, 5, 1250987, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250988, 'Chapter Six: The Spy', 'Will''s connection to a shadowy evil grows stronger, but no one''s quite sure how to stop it. Elsewhere, Dustin and Steve forge an unlikely bond.', 66732, 6, 1250988, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250989, 'Chapter Seven: The Lost Sister', 'Psychic visions draw Eleven to a band of violent outcasts and an angry girl with a shadowy past.', 66732, 7, 1250989, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250990, 'Chapter Eight: The Mind Flayer', 'An unlikely hero steps forward when a deadly development puts the Hawkins Lab on lockdown, trapping Will and several others inside.', 66732, 8, 1250990, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1250991, 'Chapter Nine: The Gate', 'Eleven makes plans to finish what she started while the survivors turn up the heat on the monstrous force that''s holding Will hostage.', 66732, 9, 1250991, 83248, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657328, 'Chapter One: Suzie, Do You Copy?', 'Summer brings new jobs and budding romance. But the mood shifts when Dustin''s radio picks up a Russian broadcast, and Will senses something is wrong.', 66732, 1, 1657328, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657329, 'Chapter Two: The Mall Rats', 'Nancy and Jonathan follow a lead, Steve and Robin sign on to a secret mission, and Max and Eleven go shopping. A rattled Billy has troubling visions.', 66732, 2, 1657329, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657330, 'Chapter Three: The Case of the Missing Lifeguard', 'With El and Max looking for Billy, Will declares a day without girls. Steve and Dustin go on a stakeout, and Joyce and Hopper return to Hawkins Lab.', 66732, 3, 1657330, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657331, 'Chapter Four: The Sauna Test', 'A code red brings the gang back together to face a frighteningly familiar evil. Karen urges Nancy to keep digging, and Robin finds a useful map.', 66732, 4, 1657331, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657332, 'Chapter Five: The Flayed', 'Strange surprises lurk inside an old farmhouse and deep beneath the Starcourt Mall. Meanwhile, the Mind Flayer is gathering strength.', 66732, 5, 1657332, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657333, 'Chapter Six: E Pluribus Unum', 'Dr. Alexei reveals what the Russians have been building, and Eleven sees where Billy has been. Dustin and Erica stage a daring rescue.', 66732, 6, 1657333, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657334, 'Chapter Seven: The Bite', 'With time running out -- and an assassin close behind -- Hopper''s crew races back to Hawkins, where El and the kids are preparing for war.', 66732, 7, 1657334, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1657335, 'Chapter Eight: The Battle of Starcourt', 'Terror reigns in the food court when the Mind Flayer comes to collect. But down below, in the dark, the future of the world is at stake.', 66732, 8, 1657335, 115216, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198674, 'Episode 1', 'Today the ladies hit the streets to find out how guys like being catcalled for a change. Megan increases her chances at love by juggling three online dates at once, and Nicole kisses strangers.', 66734, 1, 1198674, 77682, '2016-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199994, 'Episode 2', 'Today the cast petitions to prevent guys from pleasuring themselves. Anna-Lee assumes the role of jerk on a date. Blair decides it''s time for women to take their space back. Nicole and Megan give average men the red-carpet treatment.', 66734, 2, 1199994, 77682, '2016-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507795, 'Iliza Shlesinger/Taye Diggs/Jana Kramer/Ken Marino', 'Celebrity panelists include Iliza Shlesinger, Taye Diggs, Jana Kramer and Ken Marino.', 66784, 14, 1507795, 83271, '2017-09-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1676508, 'Episode 3', '', 85457, 3, 1676508, 115394, '2019-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1255169, 'Episode 3', 'Today the girls invade personal space by sniffing random dudes in Central Park. The cast snoops through each other''s most scandalous text messages. Matteo attempts the worst parking job in history. Blair has a big surprise in store for her blind date.', 66734, 3, 1255169, 77682, '2016-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1255170, 'Episode 4', 'Today Nicole and Megan do product research for a new line of toys for boys. Anna-Lee and Nicole struggle to get things done with wet nails. Our ladies convince men in Times Square to show them their goods.', 66734, 4, 1255170, 77682, '2016-06-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1255171, 'Episode 5', 'Blair has a different take on chivalry. Nicole has a shocking answer to a public proposal. Jade and Anna-Lee go to extreme lengths to squeeze into jeans.', 66734, 5, 1255171, 77682, '2016-07-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1255172, 'Episode 6', 'Nicole and Jade undress guys with their eyes. Special guest Carly Aquilino gets greedy with selfies. Blair hits up a barbershop for a hot shave.', 66734, 6, 1255172, 77682, '2016-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205917, 'Episode 7', 'Megan plays mind games with guys, thanks to their girlfriends. Nicole and Blair bro out at the gym. Blair and Jade swim upstream with their phones.', 66734, 7, 1205917, 77682, '2016-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1205918, 'Episode 8', 'Shannon and Blair help brides-to-be prank their moms. Megan goes speed dating. Nicole and Blair become power-crazy nightclub bouncers.', 66734, 8, 1205918, 77682, '2016-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198715, 'Part 1', 'The origin of O.J. Simpson''s football stardom in the ''60s, as America combusted with racial upheaval, and an examination into why the country fell in love with him off the field.', 66738, 1, 1198715, 77687, '2016-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198959, 'Part 2', 'While racial tension boils over in early-''90s Los Angeles, O.J. Simpson remains a world apart in exclusive Brentwood, cultivating a perfect image atop a life of secrets.', 66738, 2, 1198959, 77687, '2016-06-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198960, 'Part 3', 'O.J. Simpson is arrested and charged with the murders of his estranged wife and an acquaintance, setting off a saga unlike any in American history.', 66738, 3, 1198960, 77687, '2016-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198961, 'Part 4', 'O.J. Simpson''s 1995 "trial of the century" unfolds in downtown Los Angeles, riveting the country for months and reshaping the media and cultural landscape.', 66738, 4, 1198961, 77687, '2016-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198962, 'Part 5', 'In the years following his murder acquittal, O.J. Simpson''s life takes strange turns, culminating in a new arrest and, this time, a conviction.', 66738, 5, 1198962, 77687, '2016-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1198843, 'Pilot', 'Julie is in over her head when her husband suddenly dies leaving her as sole owner of The LA Rebels, a pro-football team.', 66748, 1, 1198843, 77702, '2014-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199072, 'Original Sin', 'The Medici family suffers a great loss with the death of its patriarch Giovanni. When the designated heir Cosimo discovers that his father was poisoned, he decides to put Marco Bello on the assassin''s trail.', 66761, 1, 1199072, 77728, '2016-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199085, 'The Dome and the Domicile', 'The war is throwing Florence into chaos. Piero, Cosimo''s only son, is eager to fight. Meanwhile, Cosimo manages to "buy" the withdrawal of Milan''s troops, thus saving the city, but in the meantime Florence has again fallen into the plague.', 66761, 2, 1199085, 77728, '2016-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199086, 'Pestilence', 'Albizzi has managed to foment the citizenry against Cosimo, accusing him of the crime of usury. When Cosimo learns of the situation, he decides to return to Florence. Albizzi then invents a ploy to get Cosimo arrested and held for trial.', 66761, 3, 1199086, 77728, '2016-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199087, 'Judgement Day', 'From prison, Cosimo asks Contessina to try bribing a member of the Signoria, to buy votes in his favor. Albizzi starts poisoning Cosimo''s food through his prison guard. Contessina negotiates exile rather than the death penalty.', 66761, 4, 1199087, 77728, '2016-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199088, 'Temptation', 'While the Medici are in exile in Venice, the situation deteriorates day by day in Florence, with Albizzi imposing his rule over a city gravely depleted by the absence of the Medici.', 66761, 5, 1199088, 77728, '2016-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199089, 'Ascendancy', 'The return of the Medici to Florence is an out-and-out triumph, with Albizzi in prison for his attempt to become the city''s "tyrant".', 66761, 6, 1199089, 77728, '2016-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199090, 'Purgatory', 'The Signoria now has a vacant chair, and Cosimo is asked to choose who should occupy it. Piero thinks that his moment has now come, but the banker Pazzi, too, has his eyes set on that seat.', 66761, 7, 1199090, 77728, '2016-11-08');
