INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507798, 'Ashley Graham, Jenna Elfman, Donald Faison and Alex Trebek', 'Ashley Graham, Jenna Elfman, Donald Faison, and Alex Trebek make up the celebrity panel and are presented with a variety of participants with interesting stories, from a Harlem Globetrotter to the person who played Thing on The Addams Family, and a professional mermaid.', 66784, 3, 1507798, 105290, '2018-06-24');
