INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564431, 'Episode 5', 'Oliver Hudson, Candace Cameron Bure, Kal Penn, and Ross Matthews make up the celebrity panel, and are presented with a variety of participants with interesting stories, from a drumming prodigy to a Miss America coach and an original model on The Price is Right.', 66784, 5, 1564431, 105290, '2018-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564432, 'Episode 6', 'Ashley Graham, Donald Faison, Craig Robinson, and Adam Pally make up the celebrity panel, and presented with a variety of participants with interesting stories, from someone who skydived without a parachute to a record-breaking forensic artist and a millionaire golf ball diver.', 66784, 6, 1564432, 105290, '2018-07-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564433, 'Episode 7', 'Joel McHale, Sasheer Zamata, Constance Zimmer, and Paul Reubens make up the celebrity panel, and are presented with a variety of participants with interesting stories, from Wonder Woman''s stunt double to a champion turkey caller and someone whose college debt was paid by Nicki Minaj.', 66784, 7, 1564433, 105290, '2018-07-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564434, 'Episode 8', 'Sherri Shepherd, Joshua Malina, Ryan Hansen, and Ayesha Curry make up the celebrity panel, and are presented with a variety of participants with interesting stories, from a former White House pastry chef to a competitive dog groomer and a lady with 1000 cats.', 66784, 8, 1564434, 105290, '2018-08-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564435, 'Episode 9', 'Theresa Caputo, Kal Penn, Denise Richards, and Matt McGorry make up the celebrity panel and are presented with a variety of participants with interesting stories, from the first female African-American airline captain to the creator of Zumba and a professional dead guy.', 66784, 9, 1564435, 105290, '2018-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1564436, 'Episode 10', 'Margaret Cho, Tony Hale, Justin Baldoni, and Ron Funches make up the celebrity panel and are presented with a variety of participants with interesting stories, from someone who is building a time machine to the world''s fastest pumpkin carver and the designer of the Starbucks logo.', 66784, 10, 1564436, 105290, '2018-08-19');
