INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1866127, 'Joshua Malina, Cedric The Entertainer, DL Hughley, George Lopez', 'Joshua Malina, Cedric the Entertainer, D.L. Hughley and George Lopez must guess the identities of the record breaking planker, the formerly conjoined twins, the aerial trapeze artists, the real UFC cutman, and the king of the Mitzvahs.', 66784, 2, 1866127, 125626, '2019-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1866128, 'Anna Camp, Joel McHale, Ron Funches, Kristie Alley', 'Celebrity panelists Anna Camp, Joel McHale, Ron Funches and Kristie Alley must guess which guest is a voodoo priest, the inventor of PopSockets, the record breaking bubble artist, the chocolate genius, and the owner of "Justin Beaver."', 66784, 3, 1866128, 125626, '2019-06-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1866129, 'Angela Kinsey, Alyssa Edwards, Fortune Feimster, Adam Rodriguez', 'Angela Kinsey, Alyssa Edwards, Fortune Feimster and Adam Rodriguez guess the identities of the real Punxsutawney Phil handler, a ninja turtle voice actor, the voice of Laurel vs. Yanny, an extreme embalmer, and an 18 times Grammy winner.', 66784, 4, 1866129, 125626, '2019-07-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1866130, 'Jay Pharoah, Inbar Lavi, Rob Riggle, Sherri Shepherd', 'Jay Pharoah, Inbar Lavi, Rob Riggle and Sherri Shepherd must guess the identities of a sperm donor, a hoop dancing champion, a real hypnotist (who hypnotizes Mama Doris), a slight-of-hand magician and a female baseball hall of famer.', 66784, 5, 1866130, 125626, '2019-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1866131, 'Tom Lennon, Nikki Glaser, Kareem Abdul Jabbar, Vivica A. Fox', 'Tom Lennon, Nikki Glaser, Kareem Abdul Jabbar and Vivica A. Fox must guess the identities of a crime scene cleaner, a graffiti artist called Saber, a Olympic saber fencing champion, a master debater, and a road kill cook-off champ.', 66784, 6, 1866131, 125626, '2019-07-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1891065, 'Norman Lear, Bob Saget, Joel McHale, Rita Moreno', 'The panel is presented with a variety of participants with interesting stories, from an air guitar champion to a world-renowned photographer and a prize-winning burlesque dancer.', 66784, 7, 1891065, 125626, '2019-07-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1891073, '''Weird Al'' Yankovic, Rob Riggle, Jesse Williams, Sherri Shepherd', 'The panel is presented with a variety of participants with interesting stories, from the Rubik’s Cube foot-solving record-holder to a vocal coach for the stars and a husband-calling champion.', 66784, 8, 1891073, 125626, '2019-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1891074, 'Adam Pally, Mayim Bialik, Chris D’Elia, Nicole Byer', 'The panel is presented with a variety of participants with interesting stories, from a real-life Ninja to the record-breaking pizza acrobat and someone who rowed across the Atlantic Ocean.', 66784, 9, 1891074, 125626, '2019-08-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1891075, 'Ana Gasteyer, Jalen Rose, Joshua Malina, Wanda Sykes', 'The panel is presented with a variety of participants with interesting stories, from the world record holders for the longest hug to a galactic realtor and someone with the world’s longest dreadlocks.', 66784, 10, 1891075, 125626, '2019-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199883, 'Pilot', 'A history professor''s life is turned upside down when she''s tapped to join an unlikely team tasked with stopping a man bent on changing the past - and possibly destroying the future.', 66786, 1, 1199883, 77804, '2016-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1223512, 'The Assassination of Abraham Lincoln', 'The team travels back to the assassination of Lincoln to stop Flynn from making that night an even bigger tragedy.', 66786, 2, 1223512, 77804, '2016-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1228828, 'Atomic City', 'In Rat Pack-era Vegas, the team is hot on Flynn’s heels with the era’s most infamous mistress in toe.', 66786, 3, 1228828, 77804, '2016-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1229028, 'Party at Castle Varlar', 'The trio teams up with one of literature''s most popular figures, James Bond creator Ian Fleming, to defeat Flynn''s sinister plot in Nazi Germany.', 66786, 4, 1229028, 77804, '2016-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1229029, 'The Alamo', 'The team races to stop Flynn before the bloody Battle of the Alamo ensues, but will it be victory or death for our time-traveling trio?', 66786, 5, 1229029, 77804, '2016-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1229030, 'The Watergate Tape', 'The trio races to catch Flynn in 1972 before he can steal the mysterious missing minutes of the Watergate tape, but personal secrets threaten to tear the team apart.', 66786, 6, 1229030, 77804, '2016-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1750988, 'Episode 9', '', 85457, 9, 1750988, 115394, '2019-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1750989, 'Episode 10', '', 85457, 10, 1750989, 115394, '2019-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1229031, 'Stranded', 'The team must battle the French, Indians and Mother Nature after Flynn sabotages the Lifeboat and traps them back in Western Pennsylvania circa 1754.', 66786, 7, 1229031, 77804, '2016-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1243423, 'Space Race', 'Back in 1969, the team goes undercover at NASA to stop Flynn from sabotaging the moon landing and killing the crew of Apollo 11.', 66786, 8, 1243423, 77804, '2016-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1244260, 'Last Ride of Bonnie & Clyde', 'On the run with the bank-robbing Barrow gang, the team needs to gain the trust of ill-fated lovers Bonnie and Clyde in order to find out Flynn''s target in the Depression-era South. While Agent Christopher tracks down a lead in present day, Lucy, Rufus, and Wyatt risk getting caught in the crossfire, suspecting that whatever Flynn''s after may be a key piece of the whole puzzle.', 66786, 9, 1244260, 77804, '2016-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1244261, 'The Capture of Benedict Arnold', 'A stunning turn during the American Revolution prompts Lucy, Wyatt, and Rufus to question whether they''ve been fighting on the wrong side this whole time. While Agent Christopher prepares for the worst back in present day, the team encounters the Father of the Country, makes a dubious pact, and confronts the possibility they may not be a trio for long.', 66786, 10, 1244261, 77804, '2016-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1251668, 'The World''s Columbian Exposition', 'Lucy''s situation grows desperate after she''s taken captive by Flynn and brought to the 1893 Chicago World''s Fair. In their dogged pursuit of Lucy, Wyatt and Rufus fall into a sinister trap.', 66786, 11, 1251668, 77804, '2017-01-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1257637, 'The Murder of Jesse James', 'Flynn teams up with legendary outlaw, Jesse James. Together they cut a bloody swath across the American frontier. Hot on Flynn''s trail, Lucy, Wyatt, and Rufus enlist the help of an iconic Marshal to help bring the fugitives to justice.', 66786, 12, 1257637, 77804, '2017-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1257638, 'Karma Chameleon', 'Wyatt convinces Rufus to steal the Lifeboat for an unauthorized mission to prevent Wyatt''s wife''s killer from ever being born. Lucy must cover for them in the present, as Agent Christopher discovers the ship is missing and Anthony Bruhl makes an alarming confession.', 66786, 13, 1257638, 77804, '2017-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1257916, 'The Lost Generation', 'As Lucy grapples with her newfound identity, Flynn disappears to 1927 France on the day that Charles Lindbergh completes his transatlantic flight. Now, Rufus, Lucy and their new soldier scramble through the City of Lights and team with young reporter, Ernest Hemingway, to keep history intact.', 66786, 14, 1257916, 77804, '2017-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1257917, 'Public Enemy No. 1', 'Flynn travels to 1931 Chicago to partner with gangster Al Capone. Lucy, Wyatt and Rufus, meanwhile, team up with the only man who can bring Capone down: federal law-enforcement agent Eliot Ness.', 66786, 15, 1257917, 77804, '2017-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1257918, 'The Red Scare', 'With one of our heroes'' lives on the line, the team chases Flynn to 1954 through the paranoid corridors of Joe McCarthy''s Washington D.C., en route to a secret, once-a-generation meeting of Rittenhouse leaders.  While there, Lucy must wager the ultimate sacrifice to save history as we know it.', 66786, 16, 1257918, 77804, '2017-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422503, 'The War to End All Wars', 'After barely escaping an explosion at Mason Industries, Wyatt and Rufus chase the Mothership back to a French battlefront during World War 1 to rescue Lucy from Rittenhouse. There, they discover that Lucy has recruited Marie Curie, the famous French scientist and the only person ever to win two Nobel Prizes, to help save the life of a wounded American soldier, only to learn that the soldier is Lucy’s own great-grandfather who Rittenhouse is bringing to the present to be their leader.', 66786, 1, 1422503, 98293, '2018-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1436452, 'The Darlington 500', 'The Time Team chases Rittenhouse to a stock car race in the 1950s where Wyatt learns that his favorite race car driver is actually a Rittenhouse sleeper agent on a mission to destroy the American car industry. To stop the Rittenhouse plan, Wyatt, Lucy and Rufus team up with Wendell Scott, the first African-American NASCAR driver.', 66786, 2, 1436452, 98293, '2018-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1453549, 'Hollywoodland', 'When a Rittenhouse sleeper agent in 1941 Hollywood steals the only copy of Citizen Kane, Lucy, Wyatt and Rufus team up with Hedy Lamarr to get it back. Hedy Lamarr turns out to be not only a glamorous movie star but also a scientific wizard whose discoveries led to the invention of Wi-Fi.', 66786, 3, 1453549, 98293, '2018-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1459975, 'The Salem Witch Hunt', 'While Wyatt sneaks away from the bunker to face an unbelievable truth, Lucy, Rufus and their former enemy-turned- teammate, Garcia Flynn, chase the Mothership to the Salem Witch Trials. There they must prevent the execution of a headstrong young woman who, it turns out, is mother to one of the most consequential Americans of all time – the yet to be born Benjamin Franklin. When Lucy is accused of being a witch, the team rallies together not only to save Abiah and Lucy, but all the accused women.', 66786, 4, 1459975, 98293, '2018-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464897, 'The Kennedy Curse', 'When a mission goes awry, Wyatt and Rufus are forced to bring a 17-year-old John F. Kennedy with them to the present. Anxious to return the future president to history, the team must find a way to work together to rescue JFK and return him to the past before Rittenhouse assassinates him in 2018.', 66786, 5, 1464897, 98293, '2018-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1469559, 'The King of the Delta Blues', 'When Rufus and Jiya add a fourth seat to the Lifeboat, for the first time ever, Connor Mason joins the team as they travel back to the dusty backroads and smoky juke joints of the Depression-era South to rescue the life and legacy of Robert Johnson – King of the Delta Blues, Godfather of Rock n’ Roll and a man who, legend has it, bought his musical genius from the Devil for the price of his soul. Meanwhile, Agent Christopher keeps Wyatt in the present to execute a dangerous raid on Rittenhouse headquarters.', 66786, 6, 1469559, 98293, '2018-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1469560, 'Mrs. Sherlock Holmes', 'In the bustle of 1919 New York City, suffragette Alice Paul is framed for murder and the Time Team partners up with legendary female crime solver Grace Humiston – AKA “Mrs. Sherlock Holmes.” Together they attempt to prove Alice’s innocence in time for her to give a powerful speech that turns the tide in the passage of the 19th Amendment giving women the right to vote. Back in the present, Connor Mason salvages key intel from the Rittenhouse raid.', 66786, 7, 1469560, 98293, '2018-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1469561, 'The Day Reagan Was Shot', 'The Time Team travels back to 1981 Washington D.C. on the day President Reagan was shot, only to discover that the Sleeper’s target isn’t the President – but a young rookie police officer – none other than Agent Christopher, who brought the time team together and kept the Lifeboat from getting into Rittenhouse’s hands. The Time Team must save Agent Christopher’s life and prevent her from making a mistake that set her on a different path that would forever change her own future, the future of the team -- and the future of the world.', 66786, 8, 1469561, 98293, '2018-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480964, 'The General / Chinatown', 'When the Mothership jumps to South Carolina in 1863, the Time Team partners up with a courageous Union spy and military leader, Harriet Tubman - AKA "The General" - to thwart Rittenhouse''s plan to alter the outcome of the Civil War. Back in the present, Rittenhouse hits the team where it hurts the most. Then, Jiya makes a daring escape from Rittenhouse that strands her in San Francisco''s Chinatown in 1888 with no way home.', 66786, 9, 1480964, 98293, '2018-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896844, 'Always Waiting for the Next Bad News', 'The cops name Clay as a person of interest in the murder. Ani catches Justin in a lie after learning Bryce bailed him out of a dangerous situation.', 66788, 9, 1896844, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1647932, 'The Miracle of Christmas Part I/II', 'Christmas arrives in the Bunker, and the Time Team is inspired by a visit from their future selves to find a way to try to save Rufus. But when the Mothership jumps to 1848 California, they’re forced to put those plans on hold and chase Rittenhouse back to the Gold Rush, where they encounter one of the era’s most dangerous villains. Then chasing the Mothership to Korea in the winter of 1950, the team helps a stranded, pregnant refugee attempt to escape a tragic fate.', 66786, 10, 1647932, 98293, '2018-12-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199962, 'Tape 1, Side A', 'As the school mourns the death of Hannah Baker, her friend Clay receives a box of tapes with messages she recorded before she committed suicide.', 66788, 1, 1199962, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199963, 'Tape 1, Side B', 'Hannah makes friends with Jessica and Alex, two other new students. Justin doesn''t show up at school, and Hannah''s mother finds something troubling.', 66788, 2, 1199963, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271122, 'Tape 2, Side A', 'Jealousy and gossip take a toll on Hannah''s relationships. As Alex struggles with feelings regret, the guys pressure Clay into getting drunk.', 66788, 3, 1271122, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271123, 'Tape 2, Side B', 'Hannah thinks someone is stalking her and sets a trap. Hannah''s mother confronts the principal, and Clay strikes back at someone who wronged Hannah.', 66788, 4, 1271123, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271124, 'Tape 3, Side A', 'Hannah and Clay connect at the school dance, but a crass rumor ruins the mood. Clay takes Courtney to visit Hannah''s grave.', 66788, 5, 1271124, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271125, 'Tape 3, Side B', 'Hannah''s date on Valentine''s Day doens''t go as planned. Alex gets in a big fight at school and has to face the honor board.', 66788, 6, 1271125, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271126, 'Tape 4, Side A', 'Another student sabotages Hannah during a class project. Clay''s nightmares about Hannah spill over into the daytime.', 66788, 7, 1271126, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271127, 'Tape 4, Side B', 'Inspired by a friend''s poetry reading, Hannah pours her heart out. Tony confides in Clay about the night of Hannah''s death.', 66788, 8, 1271127, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271128, 'Tape 5, Side A', 'Hannah witnesses a traumatic event at a summertime party. Clay tries to reason with Justin, and Marcus warns him that the worst is yet to come.', 66788, 9, 1271128, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271129, 'Tape 5, Side B', 'A distraught Hannah gets a ride home from the party. Jessica''s behavior grows increasingly erratic, and Clay learns the truth behind a tragedy.', 66788, 10, 1271129, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271130, 'Tape 6, Side A', 'Clay and Hannah grow closer. While Clay spends a heartbraking night listening to his tape with Tony, tensions boil over at Bryce''s house.', 66788, 11, 1271130, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271131, 'Tape 6, Side B', 'Hannah winds up at a party after an argument with her parents. The students are served with subpoenas, and Justin wrestles with conflicting loyalties.', 66788, 12, 1271131, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1271132, 'Tape 7, Side A', 'Hannah seeks help from Mr. Porter, the school counselor. Clay plays the new tape for Tony and weighs what to do next.', 66788, 13, 1271132, 77814, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480603, 'The First Polaroid', 'Five months after Hannah''s death, the case against Liberty goes to trial, with Tyler as the first witness. Clay finds a troubling photo in his locker.', 66788, 1, 1480603, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480604, 'Two Girls Kissing', 'Courtney makes a brave decision. Clay''s memories of Hannah drive a wedge between him and Skye. Someone trashes the yearbook office.', 66788, 2, 1480604, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480605, 'The Drunk Slut', 'Worried about threats against them, Alex and Clay urge Jessica to testify about Bryce. Clay enlists Tony''s help to find a potential witness.', 66788, 3, 1480605, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480606, 'The Second Polaroid', 'Clay hides a secret from his parents. Concerned about his reputation, Marcus lies in court. Jessica and Alex skip school together.', 66788, 4, 1480606, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480607, 'The Chalk Machine', 'Tyler and Cyrus embrace their outsider status. Alex fights to recover his lost memories. Ryan and Mrs. Baker look to Hannah''s poems for clues.', 66788, 5, 1480607, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480608, 'The Smile at the End of the Dock', 'Clay tries to figure out where the Polaroids were taken. Justin shows up at school. Zach''s revelation about Hannah takes everyone by surprise.', 66788, 6, 1480608, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480609, 'The Third Polaroid', 'Alex blows up at Bryce. Someone blackmails Marcus. Clay testifies about a night he and Hannah spent together. Jessica experiences a flashback.', 66788, 7, 1480609, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480610, 'The Little Girl', 'When Hannah''s parents come under scrutiny, Jessica reaches out to Mrs. Baker. Justin struggles to stay clean. Clay reconnects with Skye.', 66788, 8, 1480610, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480611, 'The Missing Page', 'Tyler goes out with Cyrus''s sister. Chloe confronts Bryce about the tapes. Jess wonders if she''s ready to date again. Mr. Porter wrestles with regret.', 66788, 9, 1480611, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480612, 'Smile, Bitches', 'Tony opens up about his past. Sheri devises a plan to get into the clubhouse. Mr. Porter tries to help Justin. Zach and Bryce butt heads.', 66788, 10, 1480612, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480613, 'Bryce and Chloe', 'Chaos erupts at school in the aftermath of Bryce''s testimony. Jessica tells Chloe about the clubhouse. Alex''s memories come rushing back.', 66788, 11, 1480613, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480614, 'The Box of Polaroids', 'Threats against Clay and the others escalate. Tyler faces disciplinary action. Justin testifies about Bryce, putting his own future at risk.', 66788, 12, 1480614, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1480615, 'Bye', 'One month later, Hannah''s loved ones celebrate her life and find comfort in each other. Meanwhile, a brutal assault pushes one student over the edge.', 66788, 13, 1480615, 103197, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1869656, 'Yeah. I''m the New Girl', 'The cops question Clay about Bryce''s disappearance. Clay remembers the aftermath of Spring Fling, when he raced to cover Tyler''s tracks and met Ani.', 66788, 1, 1869656, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896837, 'If You''re Breathing, You''re a Liar', 'After learning about Chloe''s pregnancy, Clay and Ani pay her a visit. Chloe recalls how she leaned on Zach for support -- and that Bryce never knew.', 66788, 2, 1896837, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896838, 'The Good Person Is Indistinguishable from the Bad', 'As the police investigation sets the school on edge, Ani remembers that Jessica confronted Bryce. Growing suspicious of Jess, Ani and Clay follow her.', 66788, 3, 1896838, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896839, 'Angry, Young and Man', 'After Tyler admits he still has a gun, the group keeps tabs on him at school. But their worry deepens when they learn he had a motive to kill Bryce.', 66788, 4, 1896839, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896840, 'Nobody''s Clean', 'The police search the school after finding steroids in Bryce''s car. Alex remembers how Bryce supported Alex after Jessica dumped him.', 66788, 5, 1896840, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896841, 'You Can Tell the Heart of a Man by How He Grieves', 'The police bring in Tony for questioning. At Bryce''s funeral, Ani uncovers two damning secrets.', 66788, 6, 1896841, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896842, 'There Are a Number of Problems with Clay Jensen', 'The police interrogate Justin and Clay about the night Clay pulled a gun on Bryce. Clay discovers that Ani and Bryce''s bond ran deeper than he realized.', 66788, 7, 1896842, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896843, 'In High School, Even on a Good Day, It''s Hard to Tell Who''s on Your Side', 'Mr. Porter interviews students about Clay, who pleads his innocence to Mrs. Walker. Learning Porter counseled Bryce, Clay and Ani question his motives.', 66788, 8, 1896843, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1247675, 'No Task for the Timid', '', 66803, 9, 1247675, 77849, '2016-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896845, 'The World Closing In', 'Hannah''s mother returns to town. Urging Clay to protect himself, she reveals that there was more to Tony and Bryce''s relationship than Clay knew.', 66788, 10, 1896845, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896846, 'There Are a Few Things I Haven''t Told You', 'As the cops close in on Clay -- their main suspect -- violent confrontations at the homecoming game expose that everyone had a reason to kill Bryce.', 66788, 11, 1896846, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896847, 'And Then the Hurricane Hit', 'The pressure of Clay’s arrest leads his friends to make risky decisions, and the full story of the brawl that erupted at homecoming emerges.', 66788, 12, 1896847, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1896848, 'Let the Dead Bury the Dead', 'Clay is released on bail, Ani puts a plan to exonerate him into action, and the truth about Bryce''s murder finally comes to light.', 66788, 13, 1896848, 124640, '2019-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199964, '12:00 Noon -1:00 PM', 'When an attempt on U.S. Army Sergeant Eric Carter''s life is made after his return home from a mission to kill terrorist leader Bin Khalid, he discovers that he and his fellow Rangers'' identities have been compromised. Carter enlists the help of former National Director of CTU, Rebecca Ingram, who quarterbacked the raid that killed Khalid and is one of the few who knew the Rangers'' identities. Together they work to uncover a sophisticated terrorist network in a race against the clock to stop a devastating terrorist attack on United States soil.', 66789, 1, 1199964, 77815, '2017-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199965, '1:00 PM - 2:00 PM', 'When Ben Grimes demands money in exchange for the list he seized from a safe box in Khalid''s compound, Carter must go back to his roots to help obtain the money. Meanwhile, Rebecca is determined to figure out who leaked the Rangers'' files.', 66789, 2, 1199965, 77815, '2017-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1263948, '2:00 PM-3:00 PM', 'After Carter escapes from the police precinct, he must put his trust in the CTU as he plans a meet up with Grimes to do the exchange. Meanwhile, Rebecca and Donovan try to isolate the leak and Amira and Harris deal with a slight hiccup in their plan.', 66789, 3, 1263948, 77815, '2017-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1263951, '3:00 PM-4:00 PM', 'Grimes comes to Carter with information that might lead them to the terrorists. Meanwhile, at the Donovan compound, Nilaa is sequestered and questioned by Rebecca.', 66789, 4, 1263951, 77815, '2017-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276094, '4:00 PM-5:00 PM', 'Carter and Grimes try to make a deal with the leader of a smuggling ring in order to find out the location of the terrorists for whom they''ve been searching. Meanwhile, Amira and Khasan get a visit from an unexpected guest, while progress is made on the leak.', 66789, 5, 1276094, 77815, '2017-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279800, '5:00 PM-6:00 PM', 'Using a lead, Carter and CTU narrow in on an enemy’s location. Meanwhile, Amira (guest star Kathryn Prescott) comes to a crossroads as her plan nears completion', 66789, 6, 1279800, 77815, '2017-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279803, '6:00 PM-7:00 PM', 'Carter turns to Andy for help, in order to get crucial evidence back in their possession. Meanwhile, Rebecca calls in someone from the outside when CTU’s regular interrogation techniques lead them to a dead end', 66789, 7, 1279803, 77815, '2017-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282655, '7:00 P.M. - 8:00 P.M.', 'Mullins and CTU try and track down Carter, as Andy is forced to do something he doesn''t want to do. Rebecca''s interrogation techniques lead Donovan to question her judgment. Isaac turns to his friends for help.', 66789, 8, 1282655, 77815, '2017-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282656, '8:00 P.M. - 9:00 P.M.', 'A threat forces CTU to go on lockdown. Meanwhile, Carter finds himself in a tense situation and Donovan reaches out to Rebecca when he faces a big decision in his campaign.', 66789, 9, 1282656, 77815, '2017-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282657, '9:00 P.M. - 10:00 P.M.', 'Rebecca''s personal and work life collide when she gets a phone call that forces her to make an important decision. Meanwhile, Nicole confronts Carter about his commitment to their relationship and his future with the CTU.', 66789, 10, 1282657, 77815, '2017-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282658, '10:00 P.M. - 11:00 P.M.', 'Andy uncovers important information about a high-ranking government official, leading Carter and Donovan to team up and find out more. Meanwhile, a reinforcement is brought into CTU to oversee operations.', 66789, 11, 1282658, 77815, '2017-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282659, '11:00 P.M. - 12:00 A.M.', 'Rebecca''s deal to save Donovan doesn''t go as planned. Meanwhile, CTU must rely on Carter to go out into the field and facilitate an important exchange.', 66789, 12, 1282659, 77815, '2017-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200134, 'Belfast', 'Menno visits the Peace Walls in Belfast, Northern Ireland. Although there has been peace for over 15 years between the Protestant and Catholic population, Menno finds out there are still tensions between the two groups.', 66795, 1, 1200134, 77829, '2014-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200135, 'Mexico', 'Menno travels to the border between Mexico and the United States where he investigates the steel wall that separate the two countries.', 66795, 2, 1200135, 77829, '2014-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200136, 'Western Sahara', 'In the Western Sahara there is a 2700 kilometer sand wall to separate the Sahrawi population from the Moroccan population. Menno travels to both sides of this wall and discovers a 40-year-old conflict.', 66795, 3, 1200136, 77829, '2014-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200137, 'Israeli West Bank', 'Travelling around the Israeli West Bank barrier, Menno discovers this wall made life for the Palestinian people a lot worse while the lives of Israelis and Jewish colonists improved.', 66795, 4, 1200137, 77829, '2014-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200138, 'Slovakia', '', 66795, 5, 1200138, 77829, '2014-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200139, 'South Korea', '', 66795, 6, 1200139, 77829, '2014-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1248661, 'Guantanamo Bay', '', 66795, 1, 1248661, 82957, '2016-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1248662, 'Ceuta', '', 66795, 2, 1248662, 82957, '2016-12-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1248663, 'Botswana', '', 66795, 3, 1248663, 82957, '2016-12-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200248, 'Part One', 'Part 1 is all about the seventies. From searching for the perfect host to making international stars and friends, Julia Zemiro takes us through the show''s story.', 66799, 1, 1200248, 77844, '2014-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200253, 'Part Two', 'The 80s brought a new wave of musicians &amp; styles arrived to infuse the show with a new swagger. Kids who grew up watching the show were now appearing on its stage &amp; international guests arrived.', 66799, 2, 1200253, 77844, '2014-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200282, 'Don''t Tell Bill', 'Three disparate people discover that they share a subconscious link via a dream.', 66803, 1, 1200282, 77849, '2016-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1232405, 'Calling the Vasty Deep', 'Burton must face the idea that The Woman in Red may only exist his dreams; Tess starts to learn how to navigate into other people''s dreams; Taka connects the group suicide to unexpected sources.', 66803, 2, 1232405, 77849, '2016-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1234608, 'Monsters, Most Familiar', 'Taka investigates the cult; Burton goes on a business trip and meets a mysterious CEO; Tess endures an unpleasant trip to her mother''s house and discovers difficult information.', 66803, 3, 1234608, 77849, '2016-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236642, 'Castles Made of Sand', 'Burton''s facade begins to crumble; Taka and Sabine find an unexpected intimacy; Tess seeks solace with a dying ex-lover.', 66803, 4, 1236642, 77849, '2016-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1238393, 'Ambergris', 'Tess quits the experiments and learns more about her mother''s secrets; Burton rejects sleep; Taka is torn.', 66803, 5, 1238393, 77849, '2016-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1240549, 'The Swirl', 'Tess trespasses in her mother''s dreams; Ann-Marie Bowen tries to recruit Taka; Burton discovers new secrets.', 66803, 6, 1240549, 77849, '2016-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1243004, 'Three Half Blind Mice', 'Taka and Tess are brought together by a blackout; Burton finds evidence that the Woman in Red exists in reality.', 66803, 7, 1243004, 77849, '2016-12-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1245827, 'The Well', 'Burton trails the Woman in Red; Taka loses his footing with Sabine; Tess and BIll follow a lead on the Boy.', 66803, 8, 1245827, 77849, '2016-12-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1249347, 'Circular Time', 'Surrounded by enemies, Tess tries to protect the Boy; Taka tries to appease the Green; Burton tries to heal the Woman in Red.', 66803, 10, 1249347, 77849, '2016-12-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1404855, 'Shadowman', 'Tess, Taka and Burton try to move on, but get drawn back into the worlds of dreams and dreamers; James tells Tess about a dangerous enemy.', 66803, 1, 1404855, 96518, '2018-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1413684, 'Watchers', 'Tess faces off with an intruder; Burton encounters a ghost from his past; Taka believes his mother''s dreams may hold the key to solving his case.', 66803, 2, 1413684, 96518, '2018-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1413685, 'Safehouse', 'Tess, Taka and Burton deal with their Shadowman-inflicted pain in both the dream and real worlds; Woody infiltrates the dreams of the mayor.', 66803, 3, 1413685, 96518, '2018-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422020, 'Dröm', 'Taka traces Shadowman, trying to find him in the real world; Tess and Burton search for a missing dreamer; Woody sells out the mayor to Taylor Bennett; Bill Boerg returns.', 66803, 4, 1422020, 96518, '2018-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422019, 'Promotion', 'Tess and Burton follow clues from their shared dream; Taka and Alex connect Shadowman to the people trafficking in dreamers; Shadowman confronts his past.', 66803, 5, 1422019, 96518, '2018-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422022, 'Mothers, Fathers, Daughters, Sons', 'Tess and Alex try to convince a rescued dreamer to testify; Taka and Burton pressure Nicholas Hull to flip on Taylor; Bill Boerg is approached.', 66803, 6, 1422022, 96518, '2018-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422023, 'Love is a Dreamer', 'Tess'' sister starts to fall apart. Taka and Alex pay a visit to Shadowman''s family. Burton struggles with his guilt. Bennett puts a hit out on Woody.', 66803, 7, 1422023, 96518, '2018-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1422024, 'Nothing Personal', 'Burton faces his past with the help of Tess; Shadowman stays a step ahead of Taka and Alex; Woody agrees to help bring Bennett down; Boerg remembers his sister.', 66803, 8, 1422024, 96518, '2018-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1434555, 'Risk Assessment', 'The team sets up a sting to catch Taylor Bennett and her buyer. Taka and Alex hound Shadowman''s daughter, hoping she''ll lead them to him.', 66803, 9, 1434555, 96518, '2018-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1435245, 'The Art of the Deal', 'Taka and Alex interrogate Shadowman; Tess learns of her mother''s history with Bennett''s buyer, Dr. Ginsburg; a stranger comes to Shadowman''s rescue; the team springs their trap.', 66803, 10, 1435245, 96518, '2018-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200303, 'Episode 1', '', 66806, 1, 1200303, 77855, '2016-07-06');
