INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1838554, 'Bailes regionales', 'Paquita returns to Navarrete, her town, after receiving the news of the death of her mother. Belinda and an old representative of PS Management will have to hide from the journalists when the news fell on them.', 66806, 5, 1838554, 126845, '2019-06-28');
