INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200564, 'Waking Nightmare', 'After an extended drug bender, addict Jake ventures out into the quiet streets to discover he''s actually missed a terrifying global phenomenon.', 66819, 1, 1200564, 77877, '2016-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201982, 'Cognitive Dissonance', 'Ellis'' plan hits a snag, just in time for some sleepless delirium to settle in.', 66819, 2, 1201982, 77877, '2016-06-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1203512, 'Night Terrors', 'As Ellis heads for Dallas, Jake, Sam and Ally are diverted by a new kind of foe.', 66819, 3, 1203512, 77877, '2016-07-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740238, 'Sweet Dreams', 'New clues converge in Dallas, while Ally attempts a dangerous reunion in Austin.', 66819, 4, 1740238, 77877, '2016-07-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740239, 'Beacons in the Dark', 'Lex shows her research to Ally; Ellis investigates a mysterious signal.', 66819, 5, 1740239, 77877, '2016-07-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740240, 'Wide Awake', 'In the season finale, alliances at Dr. Abrams'' facility are pushed to a breaking point; Ellis'' group puts their theory to the test.', 66819, 6, 1740240, 77877, '2016-07-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1429132, 'Manifest Destiny', 'Ellis finds his way to an aerodrome, meeting Aiden, who is being held at gunpoint and made to fly a light plane.', 66819, 1, 1429132, 98932, '2017-08-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1429133, 'Oasis', 'The team hunts for Gabbi and any chance to track down the Safe Sleep Zone, as Aidan and a new ally attempt to enter the Sandman''s Oasis.', 66819, 2, 1429133, 98932, '2017-08-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1429134, 'Lucid', 'Aidan and Paula check out their new "home" and the others deal with a group of maniacs who have a unique way of staying awake.', 66819, 3, 1429134, 98932, '2017-08-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740242, 'Circadian Rhythms', 'The group find themselves on a plane, piloted by an Ellis trying to hide his mental state from the others. Abrams gives out why he is no longer working in the facility.', 66819, 4, 1740242, 98932, '2017-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740243, 'Sleepwalkers', 'The team pursues the Oasis through the desert, as Aidan navigates the politics of the camp. Meredith finds an unlikely ally in her new assignment.', 66819, 5, 1740243, 98932, '2017-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740244, 'Parasomnia', 'As the fractured teams close in on the camp, a chance encounter pushes one hero to the breaking point. Aidan''s actions at the Oasis have unexpected consequences.', 66819, 6, 1740244, 98932, '2017-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740245, 'Apnea', 'Forces converge on The Oasis and the battle for the sleep zone begins.', 66819, 7, 1740245, 98932, '2017-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1740246, 'Dawn', 'When some "heavenly" beings come to earth and makes sleeps deadly, Follow along with Jake and the rest of the crew through car chases, planes crashing, gun fights all will not sleeping.Just remember to stay awake.', 66819, 8, 1740246, 98932, '2017-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200661, 'Part 1', 'Catching Milat is a two-part Australian television miniseries that screened on the Seven Network, in collaboration with "Screen Australia" on 17 and 24 May 2015.[1] It is based on the book "Sins of the Brother" by Mark Whittaker and Les Kennedy and is loosely based upon the true story of how NSW Police and detectives under "Task Force Air" tracked down and caught serial killer Ivan Milat, who was responsible for the infamous backpacker murders.', 66823, 1, 1200661, 77881, '2015-05-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200662, 'Part 2', 'Clive Small, a former assistant police commissioner, retired detective and now author, served as the head of Task Force Air. He has criticised the program as a marginally fictionalised account, especially for overstating the role of Detective Paul Gordon.', 66823, 2, 1200662, 77881, '2015-05-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200663, 'Episode 1', 'Follow six boys from Sydney as they live a life of sex, drugs and rock ''n'' roll with the highs and lows of fame in the rock band INXS.', 66824, 1, 1200663, 77882, '2014-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200664, 'Episode 2', 'INXS are at the peak of their success with the world at their feet. But the rock ''n'' roll lifestyle soon begins to take its toll, leading to a tragic and devastating end.', 66824, 2, 1200664, 77882, '2014-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1570059, 'Closing Doors', 'The Bishop and Lady Mae make alternate plans after Clara denies them the check for the IRS bill. Grace tends to Sophia when a medical emergency sends her daughter to the hospital.', 66830, 5, 1570059, 107503, '2018-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659347, 'Episode 1', '', 85458, 1, 1659347, 115396, '2019-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200821, ' A Time to Heal', 'The drama centered on a Memphis megachurch opens with the return home of estranged daughter Gracie following the death of her sister, Faith. Her father, the church bishop, seems happy to see her, but other family members are less than welcoming. Complicating matters even more: she learns unsettling information about the family and her sister''s death from her Aunt Mavis', 66830, 1, 1200821, 77894, '2016-06-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201036, 'The Baptism', 'Grace decides to move home in order to pursue the person she blames for her sister''s death, but working at the church proves to be more difficult than she imagined. In other events, Jacob takes on more responsibilities at the church as a result of her return; Kevin has doubts about his and Charity''s plan to start a family; and the Bishop refuses a senator''s inquiries into the church''s finances.', 66830, 2, 1201036, 77894, '2016-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201037, 'We Shall See Him as He Is', 'Grace has an uncomfortable dinner date with a former beau and his fiancée; Jacob and Kerissa face the deficiencies in their marriage; Kevin has an unwanted attraction; and Senator Banks ups the pressure in his inquiry into the church''s finances.', 66830, 3, 1201037, 77894, '2016-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1201038, 'Behind Closed Doors', 'The mayor calls in a favor, which leaves the Bishop in a bind that could split the church; Grace is blackmailed about Faith''s past; Jacob and Kerissa attend couple counseling; and Charity has difficulty keeping a secret.', 66830, 4, 1201038, 77894, '2016-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1202946, 'Meaningful Survival', '', 66830, 5, 1202946, 77894, '2016-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1204413, 'Good Morning, Calvary', '', 66830, 6, 1204413, 77894, '2016-07-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1206266, 'One Train May Hide Another', '', 66830, 7, 1206266, 77894, '2016-07-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1209772, 'The Whole Book', 'Grace reaches out to Officer Nelson while also working with Noah in an effort to find evidence against Mac; Lady Mae is suspicious of Grace and Noah; Jacob presents his TV plan to the Bishop; Lady Mae pushes the Bishop to reveal a secret; and the Bishop deals with a woman who is out to destroy Calvary.', 66830, 8, 1209772, 77894, '2016-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1210155, 'The Broken Road', '', 66830, 9, 1210155, 77894, '2016-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1212977, 'March to the Sea', '', 66830, 10, 1212977, 77894, '2016-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1214116, 'Men Like Trees Walking', 'The church is losing money and members; Ray seeks custody of Sophia; Jacob''s offers to help Calvary are declined; and Kevin gets closer to Adrian.', 66830, 11, 1214116, 77894, '2016-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1215198, 'Veni, Vidi, Vici', '', 66830, 12, 1215198, 77894, '2016-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1215199, 'What Are You Doing Here?', '', 66830, 13, 1215199, 77894, '2016-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1287533, 'A House Divided', 'The Greenleaf family struggles in the aftermath of Mac''s release. Lady Mae makes a last-ditch attempt to save the Bishop. Basie''s announcement opens a rift between the Bishop and Jacob.', 66830, 1, 1287533, 86191, '2017-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290681, 'Strange Bedfellows', 'Grace and Charity oppose Lady Mae''s reaction to demands from the Deacon Board. The Bishop visits his father-in-law and runs into Mac. Kerissa and Jacob prepare to move out. Grace goes out with Darius Nash, a journalist following Calvary.', 66830, 2, 1290681, 86191, '2017-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290845, 'A Mother''s Love', 'After one of Mac''s victims attempts suicide, Grace makes a rash decision that may have lasting consequences. Kevin''s mother visits, exposing old wounds. Lady Mae tries to reason with Jacob.', 66830, 3, 1290845, 86191, '2017-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290846, 'Revival', 'Bishop and Lady Mae preside over Calvary''s Fall Revival, and decide to take action against Basie. Lady Mae and Grace connect with old friends. Grace confronts Mac''s new girlfriend.', 66830, 4, 1290846, 86191, '2017-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290847, 'Point of No Return', 'When Basie hears about the injunction filed to stop construction of Triumph Two, he stages a sit-in at Calvary in an attempt to force Bishop''s hand. Grace''s plan to put Mac away hits a snag.', 66830, 5, 1290847, 86191, '2017-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302896, 'The Royal Family', 'Kevin and Charity begin divorce proceedings, but the circumstances are exacerbated when Lady Mae learns the truth about Kevin. Grace and Darius''s relationship reaches a stalemate.', 66830, 6, 1302896, 86191, '2017-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302897, 'Born to Trouble', 'The anniversary of Faith''s death is at hand and Grace shows no sign of giving up her pursuit of Mac. Basie and Jacob, meanwhile, receive bad news regarding Triumph Two''s finances.', 66830, 7, 1302897, 86191, '2017-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1308143, 'And the Sparks Fly Upward', 'In the Season 2 midseason finale, Jacob makes Triumph pastor Basie Skanks an offer to clear his debt and gain full control of Triumph II and Mac receives bad news from Skip Leonard that puts him in an explosive collision course with Grace.', 66830, 8, 1308143, 86191, '2017-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1332336, 'The Bear', 'In the Season 2 midseason premiere, Grace and Mac''s showdown sends shockwaves through the family. Jacob offers the Bishop an olive branch. Kevin makes a decision that leaves Charity reeling.', 66830, 9, 1332336, 86191, '2017-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1342083, 'Call Not Complete', 'Jacob and Kerissa establish their new ministry. Charity desperately tries to reach Kevin. Darius gets an offer that may take him out of Memphis, leaving Grace to wonder where she fits in his life.', 66830, 10, 1342083, 86191, '2017-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1342084, 'Changing Season', 'When Sophia and Zora are excluded from the upcoming debutante cotillion, Lady Mae sets out to make things right. Grace is inspired by Basie''s sermon. Charity reaches out to Carlton.', 66830, 11, 1342084, 86191, '2017-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1350747, 'House Rules', 'Basie''s sermon regarding inclusivity in the church goes viral, lighting a fire under Grace and provoking the Bishop''s suspicions. In other events, Kerissa pushes Jacob to get a day job.', 66830, 12, 1350747, 86191, '2017-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1350748, 'Silence and Loneliness', 'A series of recurring nightmares leaves Grace unnerved; Charity looks to take her relationship with Jabari to the next level; and Bishop gives Basie an ultimatum.', 66830, 13, 1350748, 86191, '2017-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1366345, 'The Father''s Will', 'Lionel returns and drops a bombshell on Bishop and Lady Mae; Charity receives great news from Jabari; Jacob encounters resistance on his first day as head of Triumph.', 66830, 14, 1366345, 86191, '2017-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1369068, 'Two by Two', 'Charity''s plan hits a roadblock; Skip Leonard offers Jacob an enticing deal; Lady Mae suddenly finds herself at odds with the Bishop.', 66830, 15, 1369068, 86191, '2017-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1372444, 'The Pearl', 'The tensions in Zora and Isaiah''s relationship come to a head at the Cotillion; Lady Mae makes an overture of peace to Mavis and the result is a revelation that sends Mae into a tailspin.', 66830, 16, 1372444, 86191, '2017-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1542045, 'Strange Currents', 'The Bishop and Lady Mae''s crumbling marriage threatens to destroy the Greenleaf family, but they soon find their church in danger when a $2 million IRS tax bill arrives at Calvary. The Season 3 premiere.', 66830, 1, 1542045, 107503, '2018-08-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1542046, 'The Space Between', 'Grace takes Rochelle up on her offer to help start a legal defense fund. Bishop and Lady Mae ask if parishioner Clara Jackson''s Powerball winnings can assist with their IRS bill.', 66830, 2, 1542046, 107503, '2018-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1561121, 'Chain of Command', 'The Bishop sends Lady Mae into a tailspin when he surprises her with divorce papers. Grace does a newspaper interview in Mae''s place, while deploying Darius to investigate Rochelle.', 66830, 3, 1561121, 107503, '2018-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1570058, 'The Underdog', 'Lady Mae visits world famous Pastor Maxine Patterson and endures the Bishop''s final attempt to win her back at a Round Table party. Connie asks if Grace is interested in running Calvary.', 66830, 4, 1570058, 107503, '2018-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659351, 'Episode 2', '', 85458, 2, 1659351, 115396, '2019-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659352, 'Episode 3', '', 85458, 3, 1659352, 115396, '2019-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659353, 'Episode 4', '', 85458, 4, 1659353, 115396, '2019-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1570060, 'She Changes Everything', 'Maxine Patterson visits Calvary the weekend Lady Mae and the Bishop announce their divorce to the congregation. Grace and Rochelle find a case for their legal defense fund.', 66830, 6, 1570060, 107503, '2018-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1592222, 'That Was Then', 'Grace questions her involvement in the Coralie Hunter case when the D.A. threatens to reopen her case with Mac. The Bishop and Lady Mae disagree on hosting “A Day with Lady Mae” at Calvary.', 66830, 7, 1592222, 107503, '2018-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1596954, 'Dea Abscondita', 'The Bishop struggles to maintain his place within the family after another Zora crisis hits the Greenleafs; Grace attempts to convince Coralie not to take the district attorney''s plea deal.', 66830, 8, 1596954, 107503, '2018-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1596955, 'Runaway Train', 'The Bishop wrestles with signing the divorce papers on the weekend of his Silver Jubilee celebration; Grace realizes her father will need help at Calvary when Lady Mae is gone.', 66830, 9, 1596955, 107503, '2018-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1609491, 'The Promised Land', 'Grace discovers Rochelle Cross'' true identity with Darius'' help. Kerissa welcomes Triumph''s new accountant and learns two hundred thousand dollars is missing.', 66830, 10, 1609491, 107503, '2018-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1609492, 'The End Is Near', 'The Greenleafs'' IRS issues escalate when the FBI raids both Calvary and Triumph on suspicion of embezzlement; Grace questions her paternity when Aaron tells her that his father, Lionel, died.', 66830, 11, 1609492, 107503, '2018-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1620675, 'Day of Reckoning', 'Mae preaches beautifully at A Day With Lady Mae as the Bishop fears he may lose Calvary; Grace gets a paternity test with Aaron and works with Jacob to clear their family name.', 66830, 12, 1620675, 107503, '2018-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1625420, 'The New Life', 'After the success of her big day, Lady Mae is denied the right to run Calvary despite support from the Bishop; Grace takes over thanks to Connie and joins Harmony & Hope Ministries.', 66830, 13, 1625420, 107503, '2018-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1905503, 'Original Sin', 'On the first Sunday after Harmony and Hope''s installation at Calvary, the Greenleaf family''s united front shatters. Grace attempts to lead the church''s loyalties back toward the Greenleafs, but a call from Noah brings a long buried secret to light.', 66830, 1, 1905503, 131137, '2019-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1906657, 'Did I Lose You?', 'While engaging in a power struggle with Phil, Grace walks a tightrope, uncertain of what to do in regards to her secret. Bishop discovers something about a rival, making it possible to win back Mae and the church.', 66830, 2, 1906657, 131137, '2019-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1932534, 'Visions and Dreams', 'Grace faces her past but as she does so, gives Phil the opportunity to impress key church leadership. Lady Mae steps in to do damage control in Grace''s absence and is forced to face Mac''s ghost and her own stained reputation.', 66830, 3, 1932534, 131137, '2019-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1938455, 'A Common Enemy', 'Bob Whitmore returns to Memphis to remind Grace that he is the one in charge and to firmly encourage her to consider a new idea he has for Calvary. On a mission to uncover what''s been going on between Noah and Grace, Charity makes an explosive phone call.', 66830, 4, 1938455, 131137, '2019-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1943579, 'Unwanted', 'The fractures between Bishop and Lady Mae deepen and old wounds are reopened as he considers an invitation to preach elsewhere. Grace struggles to keep her secret and the church under compartmentalized control, the pressure mounting with every moment.', 66830, 5, 1943579, 131137, '2019-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1947718, 'The Stranger', 'Unable to keep her secret any longer, Grace confesses to her family. However, not all of the Greenleafs are on her side, the situation is further complicated by the police, lies, affairs, and the interests of Harmony & Hope.', 66830, 6, 1947718, 131137, '2019-10-08');
