INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915547, 'Sneak Peak', '', 48860, 1, 915547, 55209, '2013-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915539, 'Pilot', 'When Stephen Jameson begins hearing voices and waking up in strange places, he starts to question his sanity. In desperation, Stephen decides to listen to one of the voices in his head, and it leads him to his first encounter with the Tomorrow People — John, Cara and Russell — a genetically advanced race with the abilities of telekinesis, teleportation and telepathic communication. The Tomorrow People inform him that they are being hunted down by a paramilitary group of scientists known as Ultra, led by Dr. Jedikiah Price. Meanwhile, Stephen gets another surprise that leads him down his own path, which he hopes will help him uncover the truth about his father’s mysterious disappearance.', 48860, 1, 915539, 55208, '2013-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915540, 'In Too Deep', 'When Ultra tries to probe Stephen''s brain, he looks to his fellow Tomorrow People for help, but is rebuffed by an angry John, leaving Cara to go behind John''s back to help Stephen. Meanwhile, Ultra tracks down the identity of a new break-out, who has been using his powers to commit crimes. Stephen tracks down the new break-out, but is shocked when an Ultra swat team is called in. At a loss for what to do, Stephen calls on John, Cara and Russell for help, leaving them with a risk of also getting caught. Upon learning of Ultra''s evil motives, John tries to convince Stephen to spy on Ultra to help save other potential Tomorrow People, while still pursuing the answers he seeks about this father.', 48860, 2, 915540, 55208, '2013-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915544, 'Girl, Interrupted', 'Stephen reluctantly attends a party with Astrid, but is startled when he hears that one of his classmates is in peril. Desperate to help, Stephen turns to John and Cara, but they make it clear that they do not help humans. Stephen secretly tries to enlist Cara’s help, which brings up her own feelings about her traumatic past. Meanwhile, John gives Stephen a mission to infiltrate Ultra’s main computer to help give them an advantage in finding new break-outs.', 48860, 3, 915544, 55208, '2013-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915541, 'Kill or Be Killed', 'When Ultra''s most wanted, Killian McCrane, resurfaces after years of being in hiding, Stephen enlists John''s help in tracking him down. John reluctantly agrees to help, but changes his mind when he learns that Killian isn''t after Jedikiah as everyone suspects. Stephen, wants to help, but Cara explains that John''s history with Killian, which brings back a flood of memories from John''s past, making him do something he never thought he would do again. Meanwhile, Stephen''s mom is suspicious of his whereabouts, putting him in an awkward position.', 48860, 4, 915541, 55208, '2013-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659397, 'Episode 1', '', 85462, 1, 1659397, 115400, '2011-07-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915542, 'All Tomorrow''s Parties', 'After Stephen breaks Ultra protocol during a training exercise, Jedikiah’s mysterious boss insists on meeting Stephen.  Stephen grows concerned when he learns Jedikiah is unable to protect him, so he turns to John, who is only interested for selfish reasons. Elsewhere, the Tomorrow People are desperate to go topside to a party like normal people, but John and Cara disagree on the dangerous plan. Meanwhile, Stephen makes a plan to go to Homecoming with Astrid, but when he bails on her once again, she decides to find out what he is really up too.', 48860, 5, 915542, 55208, '2013-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915543, 'Sorry for Your Loss', 'When Stephen and Russell head out for a night of fun, they run into a potential new break-out. Stephen and Russell report back to John and Cara about the new person, but they want to keep a low profile from Ultra. Sadly, Russell learns that his dad has passed away and he is torn about whether or not he should go home. John volunteers to accompany Russell to help keep him out of trouble. Meanwhile, Jedikiah has a shocking secret that could destroy his career.', 48860, 6, 915543, 55208, '2013-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915545, 'Limbo', 'When Stephen decides to have some fun with his newfound powers, Jedikiah takes extreme measures to make sure it doesn’t happen again. After John and Russell return from their trip, John feels a strange tension between himself and Cara. Stephen tries to handle a new and dangerous breakout on his own, but finds himself in over his head and needing help from his fellow Tomorrow People.', 48860, 7, 915545, 55208, '2013-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915546, 'Thanatos', 'Stephen is determined to uncover what he hopes is the key to finding his father, and crafts a plan with the Tomorrow People that involves getting inside Jedikiah''s head. Meanwhile, Cara and Russell encounter an uninvited visitor in the subway tunnel base. Stephen takes a risky opportunity and snoops around Ultra.', 48860, 8, 915546, 55208, '2013-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968840, 'Death''s Door', 'When John finds himself in a dangerous situation, Stephen is unable to help without revealing himself to Ultra. Not satisfied with the answer he has discovered about his father''s disappearance, Stephen decides to take drastic measures with the help of his fellow Tomorrow People to find out the truth.  Meanwhile, Cara and Russell negotiate a trade with Jedikiah, which ultimately makes Jedikiah take a big risk.', 48860, 9, 968840, 55208, '2013-12-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970252, 'The Citadel', 'After Stephen returns from the brink, he thinks he has a clue to what happened to his father, but his fellow Tomorrow People are not sure they believe him. When the Tomorrow People learn some disappointing news from John, they make an unexpected decision about their future. The Tomorrow People finally get a lead on Ultra’s secret research lab and they devise a dangerous plan to free all those being held captive there. Meanwhile, Stephen’s mom introduces Stephen and his brother Luca to a new man she is dating, but Stephen is having a hard time getting a read on him.', 48860, 10, 970252, 55208, '2014-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970456, 'Rumble', 'Stephen and his fellow Ultra trainees are given a test by Jedikiah to see who is worthy of becoming an Ultra agent, but not everyone is happy to work as a team. Cara is faced with a mysterious visitor from her past. Russell is sent on a dangerous recon mission that could force a clash between Tomorrow People groups. Meanwhile, John works with a new break-out.', 48860, 11, 970456, 55208, '2014-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970717, 'Sitting Ducks', 'Stephen feels uneasy about his fellow trainee Hillary who has a secret agenda of her own. Stephen''s mom wants the family to go camping including her new boyfriend Peter, whom Stephen seems to be having a difficult time reading. Knowing he is going to be out of town, Stephen asks for Cara and John''s help to make sure that everything is ok with Astrid while he''s gone.', 48860, 12, 970717, 55208, '2014-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970924, 'Things Fall Apart', 'Stephen is upset with Jedikiah for going back on his word, leaving Stephen to face The Founder. In order to protect Astrid, Stephen has to make a dangerous deal to bring in a powerful break-out. John and Cara clash, forcing Cara to issue a harsh and unexpected punishment. Meanwhile, Stephen learns a surprising secret about his mom.', 48860, 13, 970924, 55208, '2014-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (971830, 'Brother''s Keeper', 'After getting some shocking news, Stephen attempts to restore order in both his worlds by making a deal with Jedikiah. With a new break-out on the loose, Cara and Russell try to lure him in but must contend with a trap from Ultra. Meanwhile, Jedikiah is closer to developing a new secret technology that could change his future.', 48860, 14, 971830, 55208, '2014-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972088, 'Enemy of My Enemy', 'Julian is back and angrier than ever, but when he gets caught by Ultra he is forced to strike a deal that could cost his and Stephen’s lives. John once again disobeys Cara’s orders when he learns the Julian has discovered the location of the Tomorrow People’s lair. Meanwhile, Astrid is plagued by nightmares after her near-death experience and turns to her new friend John for some comfort.', 48860, 15, 972088, 55208, '2014-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972729, 'Superhero', 'Stephen is still walking a fine line with his Ultra partner Hillary, who continues to be suspicious of his loyalties. When the Tomorrow People and Ultra learn that there is a new break-out doing good for humans, they both want her on their side. Meanwhile, Morgan takes a risk and betrays Jedikiah’s trust to help the Tomorrow People, but what Jedikiah discovers from Morgan is an even bigger surprise.', 48860, 16, 972729, 55208, '2014-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973084, 'Endgame', 'Stephen stumbles upon a clue that the Tomorrow People have been desperately searching for. John and Russell learn of a dangerous plan that Jedikiah has in the works, but no one could have predicted the ultimate outcome. Meanwhile, Cara gets a lead on a new break-out, but is shocked to discover that it’s someone from her past.', 48860, 17, 973084, 55208, '2014-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973317, 'Smoke and Mirrors', 'Fed up with Jedikiah’s constant lies about his father, Stephen makes a choice about his alliances. Trusting in Ultra and Hillary, Stephen wants to bring in a break-out to Ultra to see if things have really changed, much to Cara’s dismay. Meanwhile, Stephen’s brother goes missing after Jedikiah forces Stephen to protect him.', 48860, 18, 973317, 55208, '2014-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974003, 'Modus Vivendi', 'Stephen’s hard work as a double agent seems to be paying off with a potential truce between the Tomorrow People and Ultra. Still untrusting, Cara sends Russell to meet with The Founder. Jedikiah is now on the run and is desperate to keep Ultra from discovering his secret. Meanwhile, with the help of Hillary, Stephen tries to contact his dad once again.', 48860, 19, 974003, 55208, '2014-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974300, 'A Sort of Homecoming', 'With the possible return of Roger on the horizon, everyone is concerned about the consequences if The Founder were to find out. Stephen now knows the truth about the machine The Founder has been using him to train in and needs John and Cara’s help to destroy it.  Meanwhile, Russell and other Tomorrow People have lost hope they will ever find The Refuge and choose to head out on their own.', 48860, 20, 974300, 55208, '2014-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974456, 'Kill Switch', 'When the Tomorrow People learn the truth about the serum they were injected with, Stephen and Cara attempt to buy time for Jedikiah while he tries to create a possible antidote. Growing impatient, Russell and the other rogue Tomorrow People make a rash decision to sacrifice Roger to Ultra for their own safety. Meanwhile, John is having a hard time figuring out his new role and the only one he can turn to for advice is Astrid.', 48860, 21, 974456, 55208, '2014-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659398, 'Episode 2', '', 85462, 2, 1659398, 115400, '2011-07-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659399, 'Episode 3', '', 85462, 3, 1659399, 115400, '2011-07-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975361, 'Son of Man', 'Russell realizes his alliance with The Founder was a mistake, and tries to make up for his decision by saving Cara from an Ultra ambush. Stephen understands that he must be the one to stop The Machine and the extermination of humanity, but he fears he may be too late. Russell offers up a plan to help Stephen, but he is going to need everyone’s help, including John and Astrid, if they are going to have any chance to survive. Meanwhile, Jedikiah offers John an interesting opportunity that could have them working together again.', 48860, 22, 975361, 55208, '2014-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915549, 'Pilot', 'Mary arrives in France to formalize her arranged marriage to Prince Francis, but complications arise when she meets his attractive half brother and skeptical mother in the series premiere of this historical drama about young monarchs.', 48865, 1, 915549, 55211, '2013-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967871, 'Snakes in the Garden', 'Mary and Francis play up their romance after an English envoy expresses doubts about their union. Elsewhere, Catherine seeks to eliminate an individual who''s aware of her scheme to destroy Mary.', 48865, 2, 967871, 55211, '2013-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967872, 'Kissed', 'A Portuguese prince offers much-needed aid to Scotland if Mary accepts his marriage proposal and break things off with Francis. Elsewhere, Francis'' feelings for Mary lead him to put Bash in a risky situation.', 48865, 3, 967872, 55211, '2013-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967873, 'Hearts and Minds', 'Mary has a chance to get out of her engagement, but it requires lying and sentencing a man to death. Meanwhile, Francis and Bash suspect that Tomas may be disguising his real motives.', 48865, 4, 967873, 55211, '2013-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967874, 'A Chill in the Air', 'An ex-lover of Francis'' arrives and brings danger with her, so an uneasy Mary turns to Bash for comfort. Meanwhile, Queen Catherine persuades Aylee to snoop on Mary; and Bash lands in hot water with heretics, who accuse him of disrupting a sacred ritual.', 48865, 5, 967874, 55211, '2013-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967875, 'Chosen', 'Francis observes the growing bond between Mary and Bash, so he turns to Olivia. Meanwhile, Catherine wants to ensure that whoever threatened Mary is captured; Bash seeks to repay his debt; and Kenna tells her friends about her affair with Henry.', 48865, 6, 967875, 55211, '2013-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968722, 'Left Behind', 'Mary and Francis are taken hostage when the castle falls under siege, and Catherine makes a shocking suggestion in an effort to save them. Meanwhile, Diane reveals to Bash that she''s plotting to have him declared legitimate.', 48865, 7, 968722, 55211, '2013-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968877, 'Fated', 'Nostradamus shares with Mary his prophecy about a death, which leads Mary to make a big decision concerning Francis. Meanwhile, Clarissa gets brazen as she pursues her goals; and Kenna tells Catherine about Diane''s intentions regarding Bash.', 48865, 8, 968877, 55211, '2013-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970775, 'For King and Country', 'Mary and Bass return to the castle, where Catherine remains resolved to keep Francis safe from Mary. Meanwhile, Francis learns of the dark prophecy, but it does not dissuade his desire to marry Mary.', 48865, 9, 970775, 55211, '2014-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970884, 'Sacrifice', 'An assassination attempt is made on Bash''s life, and Catherine appears to be responsible for it. Meanwhile, Mary offers assistance to a jailed peasant who has a curious link to Bash; and Lola tries to stop Catherine from meddling with Bash and Mary.', 48865, 10, 970884, 55211, '2014-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970923, 'Inquisition', 'Henry claims Catherine has committed treason and adultery, so she attempts to save herself by shedding light on a dark part of Bash''s past, and Bash and Mary then try to even the score. Meanwhile, Nostradamus discloses the truth about the castle''s ghost.', 48865, 11, 970923, 55211, '2014-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (971918, 'Royal Blood', 'Clarissa kidnaps Henry and Catherine''s youngest sons, so Catherine turns to Mary and Bash for help. Elsewhere, Lola tries to assist her brother with a debt, but when she gets in over her head, Francis comes to her aid.', 48865, 12, 971918, 55211, '2014-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972230, 'The Consummation', 'Mary must decide whether to marry Bash or Francis, who returns accompanied by Lola. Meanwhile, Mary''s mother visits and pushes her own agenda, and her mere presence in the castle troubles both Henry and Catherine.', 48865, 13, 972230, 55211, '2014-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972371, 'Dirty Laundry', 'Mary''s honeymoon ends and she returns to the castle. Meanwhile, Lola displays some odd behavior, which leads to a secret being exposed; Bash finds a bewildered Olivia and asks Nostradamus to assist her; and Henry seeks help from Catherine.', 48865, 14, 972371, 55211, '2014-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972843, 'The Darkness', 'A matchmaking event is held for the women in the castle, but Lola doesn''t want to take part in it. Meanwhile, Kenna grows frightened when Henry flies into another rage, so she turns to Catherine; and Bash learns firsthand about the horrors of the woods.', 48865, 15, 972843, 55211, '2014-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973106, 'Monsters', 'Bash saves Francis'' life while they''re in the woods exploring the latest ominous threat. Meanwhile, Henry becomes obsessed with a servant who won a contest; Greer is seen kissing a kitchen servant; and Henry forces a new couple into a union.', 48865, 16, 973106, 55211, '2014-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973789, 'Liege Lord', 'Mary uncovers her marriage contract''s secret clause, which was added by Catherine and her mother, so she and Francis attempt to persuade the people of Scotland to renounce her mother.', 48865, 17, 973789, 55211, '2014-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974034, 'No Exit', 'Mary''s brother visits and asks her to return to Scotland, but Francis is suspicious of his motives. Meanwhile, Penelope takes command as Henry''s mental instability progresses; and Lola is skeptical about Julien''s marriage proposal.', 48865, 18, 974034, 55211, '2014-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974367, 'Toy Soldiers', 'Mary''s uncle arrives at the castle and brings dire news about her mother, forcing Mary and Francis to make a tough choice about priorities. Meanwhile, Henry devises a destructive plan; and Bash and Kenna grow closer as they strengthen their forced union.', 48865, 19, 974367, 55211, '2014-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974660, 'Higher Ground', 'Mary hires a mercenary to help her save Scotland. Meanwhile, Francis prepares France to wage war on England, and Leith becomes his ally in this endeavor; and Lola and Julien''s bond deepens, but she fears he will betray her.', 48865, 20, 974660, 55211, '2014-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975362, 'Long Live the King', 'Mary teams up with Catherine to deal with Henry, whose deranged behavior puts Francis at risk. Elsewhere, Bash resolves to destroy the Darkness after meeting a boy who survived the horror; and a devoted Lola tries to protect Julien.', 48865, 21, 975362, 55211, '2014-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975477, 'Slaughter of Innocence', 'Mary and Francis take drastic action in response to Henry''s madness. Meanwhile, a terror in the woods puts everyone in peril; and Mary makes a bold choice when she discovers Lola is in the midst of a life-threatening labor.', 48865, 22, 975477, 55211, '2014-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011399, 'The Plague', 'Francis and Mary''s new rule is threatened when a plague ravages the land. Kenna''s life is at risk. Greer discovers something shocking about Leith.', 48865, 1, 1011399, 62984, '2014-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011400, 'Drawn and Quartered', 'A powerful and dominating Lord learns Mary was responsible for his son''s death, he demands retribution. Francis and Lola return to the castle with their new son.', 48865, 2, 1011400, 62984, '2014-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011401, 'Coronation', 'Mary searches for a way to feed the people of France; Francis is haunted by suspicions about his dead father''s spirit; Catherine plans a lavish coronation ceremony.', 48865, 3, 1011401, 62984, '2014-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659401, 'Episode 4', '', 85462, 4, 1659401, 115400, '2011-07-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659402, 'Episode 5', '', 85462, 5, 1659402, 115400, '2011-08-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659403, 'Episode 6', '', 85462, 6, 1659403, 115400, '2011-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011402, 'The Lamb and the Slaughter', 'Shadowy riders have attacked a shepherd, Lord Conde and Bash investigate. Mary reconsiders her relationship with Lola. Leith returns to court.', 48865, 4, 1011402, 62984, '2014-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011403, 'Blood for Blood', 'Tension rises between the Catholics and the Protestants. Francis receives a gift from his dead father. Kenna is shocked by a discovery.', 48865, 5, 1011403, 62984, '2014-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012697, 'Three Queens', 'Mary and Catherine have to hide their identities when they meet a mob of angry peasants. Lola wants to become independent.', 48865, 6, 1012697, 62984, '2014-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1016527, 'The Prince of the Blood', 'Princess Claude makes a surprise visit home. The princess is known to be a provocative and reckless young woman. Greer''s wedding tour ends earlier than expected.', 48865, 7, 1016527, 62984, '2014-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1016528, 'Terror of the Faithful', 'Some Vatican inquisitors punish those believed to be a Protestant. Lord Condé ends up being abducted.', 48865, 8, 1016528, 62984, '2014-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1016529, 'Acts of War', 'Bash and Francis come up with a daring plan whilst Mary has a surprising proposal for Claude.', 48865, 9, 1016529, 62984, '2014-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1021766, 'Mercy', 'Francis comes to a surprising decision. Mary takes part in a treacherous mission with Lord Condé.', 48865, 10, 1021766, 62984, '2014-12-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1021767, 'Getaway', 'Mary attempts to help Condé after finding out that the Vatican is after him.', 48865, 11, 1021767, 62984, '2015-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1037861, 'Banished', 'Mary ends up doing something unexpected. The rivalry between Francis and Condé increases.', 48865, 12, 1037861, 62984, '2015-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038207, 'Sins of the Past', 'As they prepare for a feast, King Antoine tells Francis and Mary about England''s plans for revenge.', 48865, 13, 1038207, 62984, '2015-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038208, 'The End of Mourning', 'As Mary and Francis investigate who was behind the poisoning of King Henry (Alan Van Sprang), they unearth secrets of the past which force Mary to confront her feelings for Conde as she attempts to move forward. Catherine finds herself in the middle of a romantic triangle when the Duke of Guise (guest star Gil Darnell) returns, which forces Narcisse (Craig Parker) to commit a hideous act out of desperation. Meanwhile, Greer (Celina Sinden) finds herself in a situation she never fathomed in order to survive. ', 48865, 14, 1038208, 62984, '2015-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040665, 'Forbidden', 'Mary''s mother (guest star Amy Brenneman) returns to advise Mary that her throne is in jeopardy. Mary makes a shocking proposition to Conde, along with a bold move to reclaim her throne. Francis moves closer to Lola after a setback with Mary, while King Antoine (guest star Ben Aldridge) makes Kenna an interesting offer. Megan Follows, Craig Parker, Rose Williams, Celina Sinden, Torrance Coombs and Jonathan Keltz also star.', 48865, 15, 1040665, 62984, '2015-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040666, 'Tasting Revenge', 'Francis makes a surprising move after being threatened by King Antoine; Bash and Kenna''s marriage is in trouble; Leith makes a discovery about Greer''s new career path.', 48865, 16, 1040666, 62984, '2015-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1044461, 'Tempting Fate', 'Catherine is suspicious that Mary and Condé are having an affair; Francis becomes ill; Bash''s life is in peril; Leith is forced to guard Claude.', 48865, 17, 1044461, 62984, '2015-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1049551, 'Reversal of Fortune', 'Mary becomes the temporary leader of France; Catherine asks Narcisse for help beating Mary at her own game; Bash sees a familiar face in the village.', 48865, 18, 1049551, 62984, '2015-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1051436, 'Abandoned', 'Mary aligns herself with France as the threat of England looms; Condé makes an audacious move; Kenna and Gen. Renaude grow closer.', 48865, 19, 1051436, 62984, '2015-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1053015, 'Fugitive', 'Mary takes extreme measures as she tries to stop Francis from catching Condé; a jealous Catherine wants Narcisse to prove himself; Greer makes a decision that could end her relationship with Leith.', 48865, 20, 1053015, 62984, '2015-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1054869, 'The Siege', 'Francis and Mary are forced to set aside their differences and determine the extent of Condé''s betrayal; Catherine teaches Narcisse a lesson; Bash brings Delphine to the castle.', 48865, 21, 1054869, 62984, '2015-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1054870, 'Burn', 'As Francis thinks Mary is turning against France, she risks everything to take Condé down; Catherine meets with Queen Elizabeth; Kenna''s secret will seal the fate of her relationship with Bash.', 48865, 22, 1054870, 62984, '2015-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1079408, 'Three Queens, Two Tigers', 'Queen Mary struggles to hold on to her power in Scotland amidst Queen Elizabeth''s campaign to sabotage her with the help of a new ally in Queen Catherine. Meanwhile, with Francis'' fate at odds and Elizabeth distracted by temptation in her first love, Robert Dudley, both queens struggle to rule. ', 48865, 1, 1079408, 67992, '2015-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112879, 'Betrothed', 'Elizabeth must deal with the political backlash of harboring Catherine in England, while Catherine is imprisoned upon her return to France. Mary is forced to make some difficult decisions about securing Scotland''s future and Lola is conflicted in her feelings for Narcisse.', 48865, 2, 1112879, 67992, '2015-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1114428, 'Extreme Measures', 'When King Antoine unexpectedly returns to Court, Mary must help Francis hide his weakening condition long enough to secure his family''s future. With the Throne in jeopardy and time running out, they must turn to an unlikely ally in need of redemption. ', 48865, 3, 1114428, 67992, '2015-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1131235, 'The Price', 'After Mary receives an urgent message from her ailing mother about the dire situation in Scotland, she finds herself looking to Francis for aid. Catherine finds herself up against Narcisse as she fights to become the regent to Charles. Meanwhile, Elizabeth faces continued pressure to wed.', 48865, 4, 1131235, 67992, '2015-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1132086, 'In A Clearing', 'Grateful for a future with a revived Francis, Mary considers signing away her claim to the English throne, and staying in France forever. Catherine learns that Nostradamus has returned -- with a new vision involving Francis'' fate.', 48865, 5, 1132086, 67992, '2015-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1134587, 'Fight or Flight', 'Mary realizes she must help Catherine in her quest to become regent, even at the risk of hurting the alliance with Scotland. Claude is determined to help Leith marry while Elizabeth struggles with the prospect of losing Dudley.', 48865, 6, 1134587, 67992, '2015-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1135154, 'The Hound and the Hare', 'Mary unearths a dark secret being kept by a Spanish prince, so she seeks Catherine''s counsel. Meanwhile, suspicion surrounds a new ambassador from English court; and Bash''s quest to find a mysterious murderer takes him to Greer''s tavern.', 48865, 7, 1135154, 67992, '2015-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1141328, 'Our Undoing', 'Mary must marry again in order to help Scotland, whose welfare she has to prioritize over her heart. Meanwhile, Catherine is accused of poisoning Francis, but Mary believes Catherine is being framed by Narcisse, who''s angling to become regent of France.', 48865, 8, 1141328, 67992, '2016-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1141329, 'Wedlock', 'Claude is forced to marry someone selected by Narcisse. Meanwhile, a surprising discovery is made by Elizabeth, and it could alter her reign; and Mary asks Gideon to help her confirm her suspicions about Prince Don Carlos.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1141330, 'Bruises That Lie', 'Mary''s feelings for Gideon are hard to suppress, but she does her best as she seeks political allies. Meanwhile, Elizabeth and Greer face gut-wrenching scenarios; Claude is in danger on her wedding night; and a power struggle over the regency continues.', 48865, 10, 1141330, 67992, '2016-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659324, 'Get Cooking', 'Tom recruits eight families keen to change their lives for the better. The first step of his plan is to simply get the families cooking more.', 85456, 1, 1659324, 115393, '2019-01-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1187867, 'Succession', 'Charles'' coronation nears, forcing Mary to find a suitor who will be her ally. Meanwhile, Lola discovers who''s been poisoning Elizabeth; and the castle''s serial killer has special plans for Catherine.', 48865, 11, 1187867, 67992, '2016-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1189074, 'No Way Out', 'Mary must prioritize her life over her cousin''s. Meanwhile, Lola and Elizabeth unexpectedly join forces; Catherine can''t escape her past; and Mary and Gideon begin to see each other in a new light.', 48865, 12, 1189074, 67992, '2016-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1191079, 'Strange Bedfellows', 'Mary, in order to protect Elizabeth, unknowingly puts Gideon’s life in danger. To save him, Mary turns to another Englishman for help – Robert Dudley. Meanwhile, Bash  is determined to track down the men behind the threats to Catherine', 48865, 13, 1191079, 67992, '2016-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1192498, 'To the Death', 'Mary realizes she must return to Scotland and raise an army to save her throne; Lola gets caught while trying to help Elizabeth find information about her mother.', 48865, 14, 1192498, 67992, '2016-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1195632, 'Safe Passage', 'Mary learns from Lola that she has a chance to get to Scotland safely, but she must act quietly and quickly. When Catherine is framed for murder, Mary must decide if she should stay to protect her, which would jeopardize her safe passage to Scotland.', 48865, 15, 1195632, 67992, '2016-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1196309, 'Clans', 'When Mary arrives in Scotland, she is stunned by the treacherous world it has become and is forced her to keep her royal identity a secret until she learns who she can trust. When Elizabeth jeopardizes her standing with an unbearable new suitor, Lola steps in to help, which causes the Queen to question Lola’s ulterior motives.', 48865, 16, 1196309, 67992, '2016-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1199178, 'Intruders', 'When Mary is presumed dead, Elizabeth asks for Lola''s help in taking the Scottish crown for herself; James must defend Mary''s throne from John Knox; Mary faces Francis''s killer.', 48865, 17, 1199178, 67992, '2016-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1200278, 'Spiders in a Jar', 'Mary makes a bold move to defend her reign in Scotland, which results in a battle royale with her cousin, Elizabeth. Lola is accused of a heinous crime and suffers the drastic consequences. Meanwhile, back in France, Catherine finds that Charles has returned a changed man after paying a price for his mother''s relentless quest for power.', 48865, 18, 1200278, 67992, '2016-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1266825, 'With Friends Like These', 'Queen Mary, unsure who to trust, tests her brother James to ensure his loyalty after hearing of his meeting with John Knox. Queen Elizabeth agrees to help Lord Darnley, in an attempt to sabotage the powerful suitor’s relationship with Mary.', 48865, 1, 1266825, 84865, '2017-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1270905, 'A Grain of Deception', 'Queen Mary discovers there is a leak amongst her advisors and sets out to uncover the traitor. Queen Elizabeth enlists Narcisse to further her quest for supremacy. Catherine takes desperate measures to regain some of the power she has lost.', 48865, 2, 1270905, 84865, '2017-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1270906, 'Leaps of Faith', 'Gideon shows Mary what life could be like if she chose love over country. Catherine fights to cover King Charles'' increasingly erratic behavior, while Claude finds an enemy in her sister Leeza.', 48865, 3, 1270906, 84865, '2017-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1270941, 'Playing with Fire', 'When Lord Darnley surprises Mary with a visit in Scotland, Mary sees a glimmer of a union that could be more than just political. Elizabeth fights to gain allies in her favor and Catherine must work to get Claude back on track by finding her a new husband.', 48865, 4, 1270941, 84865, '2017-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1270942, 'Highland Games', 'In order to get Mary to agree to a marriage, Lord Darnley must demonstrate his loyalty when she voices her concerns about his true intentions. Catherine and Narcisse work to repair King Charles'' reputation after rumors spread about his strange behavior and threaten the throne.', 48865, 5, 1270942, 84865, '2017-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1270943, 'Love & Death', 'Mary must deal with the political repercussions of a potential marriage to Lord Darnley and King Charles disappears, leaving Catherine to pick up the pieces. Elizabeth comes to Gideon''s aid, while Claude receives an interesting proposition.', 48865, 6, 1270943, 84865, '2017-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1297227, 'Hanging Swords', 'When Darnley gets a surprise visitor, his marriage to Mary hangs in the balance. Elizabeth learns her attempt to stop Mary backfired. Meanwhile, Catherine and Narcisse find King Charles and must convince him to return to the castle.', 48865, 7, 1297227, 84865, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1297228, 'Uncharted Waters', 'As Mary’s upcoming wedding looms, a terrible tragedy pushes Mary and Darnley apart, forcing Mary to enlist in Catherine’s help. Elizabeth encounters a traitor to Spain, who petitions her to support an expedition to the New World.', 48865, 8, 1297228, 84865, '2017-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303404, 'Pulling Strings', 'Mary and Darnley wed in a lavish affair, which proves to be a successful decision in regards to her political standing. James makes an interesting discovery about Greer, while Elizabeth frantically tries to salvage England’s power.', 48865, 9, 1303404, 84865, '2017-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309048, 'A Better Man', 'Mary contemplates how to take over the English throne; Elizabeth struggles to find an appropriate suitor to marry. James gets caught up in a scheme orchestrated by John Knox.', 48865, 10, 1309048, 84865, '2017-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309378, 'Dead of Night', 'Mary and Darnley are at odds as their plan to seize England is put into action. Elizabeth is conflicted about her feelings for Gideon. Catherine''s son Henri tries to claim the throne from Charles.', 48865, 11, 1309378, 84865, '2017-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309379, 'The Shakedown', 'After a tragic earthquake hits Scotland, Mary must face John Knox amidst claims that she isn''t coming to the aid of her people. Elizabeth takes drastic measures after she is discovered with Gideon, while Charles makes a decision that backfires.', 48865, 12, 1309379, 84865, '2017-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309380, 'Coup de Grace', 'Darnley teams up with John Knox to strip Mary of her throne, which will leave a close friend of Mary''s dead. Elizabeth must banish Gideon from court at the request of her future husband, while Charles takes a bold stance against his brother Henri.', 48865, 13, 1309380, 84865, '2017-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309381, 'A Bride. A Box. A Body.', 'Mary pursues justice by launching a counterattack on her conspirators. Elizabeth suffers a major setback, and it turns her world upside down.', 48865, 14, 1309381, 84865, '2017-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309382, 'Blood in the Water', 'Mary’s life hangs in the balance — Childbirth threatens to take Mary’s life, which leaves her and her unborn child’s safety in jeopardy.  Elizabeth discovers that someone in her inner circle was the cause of the death of someone close to her.', 48865, 15, 1309382, 84865, '2017-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309383, 'All It Cost Her', 'In the series finale, Mary changes the course of history with a decision she makes, and her perilous move for survival causes her to have a stunning realization. Meanwhile, Elizabeth steadies herself for war and becomes the instigator in Mary''s demise.', 48865, 16, 1309383, 84865, '2017-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972730, 'Pilot', '97 years after a nuclear war, human kind is living in space. 100 juvenile delinquents are sent down to Earth to see if the planet is habitable.', 48866, 1, 972730, 55214, '2014-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973085, 'Earth Skills', 'Discovering that Jasper may still be alive, Clarke, Bellamy, Finn, Wells and Murphy head out to find him. On the Ark, Abby is determined to prove Earth is habitable, and enlists a mechanic to craft an escape pod.', 48866, 2, 973085, 55214, '2014-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1166745, 'Thirteen', 'Lexa tries to maintain peace and order within the clans, and Clarke uncovers a strange and game-changing truth. Meanwhile, a flashback takes us into the darker chapter of humanity’s past.', 48866, 7, 1166745, 72595, '2016-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973318, 'Earth Kills', 'As a dangerous, acidic fog approaches, Clarke, Finn and Wells set out in search of a seaweed-like plant to make an antibiotic poultice for Jasper''s wounds, while a vulnerable young girl follows when Bellamy takes a group out hunting for food.', 48866, 3, 973318, 55214, '2014-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973741, 'Murphy''s Law', 'Bellamy, Clarke and Finn try to protect Charlotte when everyone learns she killed Wells. On the Ark, Abby risks getting floated in order to give Raven the chance to launch the escape pod.', 48866, 4, 973741, 55214, '2014-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040842, 'Twilight''s Last Gleaming', 'A plan to contact the Ark is put in motion after Raven crash lands on Earth. Meanwhile, Abby exposes Kane''s plan to reduce the population of the Ark.', 48866, 5, 1040842, 55214, '2014-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975438, 'His Sister''s Keeper', 'Bellamy, Finn and Jasper head into Grounder territory to search for Octavia, as flashbacks show the siblings'' difficult childhood on the Ark. Meanwhile, Raven finds out about Clarke and Finn.', 48866, 6, 975438, 55214, '2014-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040844, 'Contents Under Pressure', 'While Bellamy tortures the Grounder, Raven and Clarke make contact with the Ark and ask Abby to help them save Finn. On the Ark, Kane deals with his guilt, and Jaha surprises the council with a shocking revelation.', 48866, 7, 1040844, 55214, '2014-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040845, 'Day Trip', 'Shumway secretly orders one of the 100 to kill Bellamy. Meanwhile, hallucinogenic nuts provide Octavia with an opportunity to help the Grounder escape the camp, and Bellamy and Clarke investigate a nearby underground depot, where they find military weapons.', 48866, 8, 1040845, 55214, '2014-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1040846, 'Unity Day', 'Finn arranges a meeting with Clarke and the leader of the Grounders in order to bring peace, however a sceptical Clarke warns Bellamy, who along with Jasper and Raven follow them to the meeting with weapons. On the Ark, Diana takes over the exodus ship.', 48866, 9, 1040846, 55214, '2014-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (991803, 'I Am Become Death', 'Murphy returns to the camp carrying a horrific virus created by the Grounders to weaken the camp. After learning the Grounders plan to attack the next day, Bellamy, Finn and Raven come up with a plan to delay them.', 48866, 10, 991803, 55214, '2014-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (991804, 'The Calm', 'Clarke and Finn are captured by Anya, who forces them to save the life of a victim of the explosion. Meanwhile, Raven deals with her split from Finn, and Kane fights to save the Ark and it''s survivors.', 48866, 11, 991804, 55214, '2014-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (991805, 'We Are Grounders, Part 1', 'Clarke and Finn come face to face with a new enemy after Lincoln rescues them from Anya, while Bellamy, Raven, Octavia and Jasper deal with a vengeful Murphy. On the Ark, Jaha makes a plan to try and get to Earth.', 48866, 12, 991805, 55214, '2014-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (991806, 'We Are Grounders, Part 2', 'As the remaining members of the 100 face off against the Grounders, Jaha makes a noble sacrifice to ensure the Ark makes it to Earth.', 48866, 13, 991806, 55214, '2014-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1000651, 'The 48', 'Clarke is still on her own in the white room, frantically attempting to make sense of her bizarre surroundings. Lincoln and Octavia''s plan is ruined and an enemy returns.', 48866, 1, 1000651, 62026, '2014-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012127, 'Inclement Weather', 'Clarke wants answers from the President. Abby performs emergency surgery. Octavia will do anything to find Lincoln.', 48866, 2, 1012127, 62026, '2014-10-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012128, 'Reapercussions', 'After discovering a horrifying project in Mount Weather''s medical ward, Clarke joins forces with an unexpected ally.', 48866, 3, 1012128, 62026, '2014-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012129, 'Many Happy Returns', 'Clarke ends up being betrayed by somebody that she trusted. Bellamy, Finn and Murphy attempt to save a stranger.', 48866, 4, 1012129, 62026, '2014-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012130, 'Human Trials', 'Kane takes part in a mission to make peace with the Grounders. Jasper decides to take part in a risky experiment. Lincoln enters a world of pain and President Dante Wallace issues a warning.', 48866, 5, 1012130, 62026, '2014-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018758, 'Fog of War', 'Tensions are running high between Clarke and Finn. Raven finds out that Mount Weather is interfering with their communication systems.', 48866, 6, 1018758, 62026, '2014-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018759, 'Long Into an Abyss', 'Bellamy is able to get Clarke to agree to accompany him to the drop ship. Dr. Tsing is in charge of a deadly experiment.', 48866, 7, 1018759, 62026, '2014-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018760, 'Spacewalker', 'Clarke comes back to Camp Jaha with some shocking news. Finn has to face the consequences of his actions.', 48866, 8, 1018760, 62026, '2014-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018761, 'Remember Me', 'Lexa and Clarke manage to make a deal.The newly created alliance is under threat. Monty comes up with a plan.', 48866, 9, 1018761, 62026, '2015-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038147, 'Survival of the Fittest', 'Lives are left in danger following the arrival of a new threat. Lincoln and Bellamy decide to break into Mount Weather.', 48866, 10, 1038147, 62026, '2015-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038149, 'Coup de Grâce', 'Lincoln and Bellamy''s efforts to get into Mount Weather has some brutal consequences.', 48866, 11, 1038149, 62026, '2015-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038148, 'Rubicon', 'Clarke is faced with a difficult choice and Raven helps Bellamy navigate Mount Weather as Dr. Tsing begins to harvest the 47, while Jaha and Murphy encounter a stranger on their journey to the City of Light.', 48866, 12, 1038148, 62026, '2015-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038150, 'Resurrection', 'Clarke begins to question Lexa''s leadership decisions and Indra continues to push Octavia. Meanwhile, at Mount Weather, Jasper steps up into the role of leader, and Cage throws Maya into a life threatening situation.', 48866, 13, 1038150, 62026, '2015-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038154, 'Bodyguard of Lies', 'Lexa and Clarke get into a heated discussion during battle preparations; Bellamy races against time.', 48866, 14, 1038154, 62026, '2015-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038153, 'Blood Must Have Blood, Part 1', 'Wick and Raven are faced with a setback. Maya and Jasper witness a terrible act.', 48866, 15, 1038153, 62026, '2015-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038152, 'Blood Must Have Blood, Part 2', 'Jaha makes a surprising move. Clarke gets help from an unexpected source. Lincoln seeks revenge.', 48866, 16, 1038152, 62026, '2015-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1146093, 'Wanheda: Part One', 'Three months have passed since the tragedy at Mount Weather and our heroes learn that a bounty has been put on Clarke’s head. Unbeknownst to Clarke, a team led by Bellamy and Kane journeys deep into Grounder territory to save her. Meanwhile, Murphy finds his way to the mansion and discovers a very different Jaha on a very different mission.', 48866, 1, 1146093, 72595, '2016-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1146094, 'Wanheda: Part Two', 'Bellamy and Kane risk life and limb to rescue Clarke. In an attempt to avoid worrying about her daughter, Abby focuses on whether to open Mount Weather as a medical facility. Meanwhile, Murphy plots to betray his former Chancellor.', 48866, 2, 1146094, 72595, '2016-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1158146, 'Ye Who Enter Here', 'Clarke wrestles with a decision. Bellamy learns that something isn''t what it seems. Meanwhile, Murphy plots to betray his former Chancellor.', 48866, 3, 1158146, 72595, '2016-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1158147, 'Watch the Thrones', 'Clarke discovers the mastermind behind a devious plan. Kane struggles to keep the peace. Meanwhile, Jasper’s grief drives him to reckless behavior.', 48866, 4, 1158147, 72595, '2016-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1163512, 'Hakeldama', 'Pike''s twisted crusade threatens Clarke''s attempts for peace. Raven becomes a target, while Murphy tries to conspire against Jaha.', 48866, 5, 1163512, 72595, '2016-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1166744, 'Bitter Harvest', 'Clarke is torn between vengeance and mercy. Meanwhile, Kane and Octavia work together to avert a disaster, and Abby continues to worry about Raven.', 48866, 6, 1166744, 72595, '2016-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915719, 'Up In Smoke', 'Jeff scoops up a shipment of furniture that might have been used to sell drugs.', 48979, 7, 915719, 55225, '2012-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1174518, 'Terms and Conditions', 'Kane is searching for a peaceful way to handle things but soon realizes he may be forced to resort to drastic measures. Meanwhile, Pike suspects that there may be a leak within the walls of Arkadia. Lastly, Raven has a plan and reaches out to Jasper for help.', 48866, 8, 1174518, 72595, '2016-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1176186, 'Stealing Fire', 'Clarke discovers a shocking truth, and Octavia is forced to make a decision that could have devastating consequences. Meanwhile, Kane and Abby share a moment.', 48866, 9, 1176186, 72595, '2016-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1184333, 'Fallen', 'Jaha employs a terrifying new method to convince Abby to join his cause, Kane is on a mission, and Bellamy is hit with a hard truth. Meanwhile, Monty finds himself in a precarious situation, and Jasper rushes to save one of his own.', 48866, 10, 1184333, 72595, '2016-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1184334, 'Nevermore', 'Alie forces Raven’s dark side to come out, and Jasper’s anger continues to grow. Meanwhile, Octavia wrestles with her place in the world, and Monty is forced to make a split second decision.', 48866, 11, 1184334, 72595, '2016-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1184335, 'Demons', 'Jaha returns to Polis, and Murphy has a surprise encounter. Meanwhile, Octavia uncovers a clue.', 48866, 12, 1184335, 72595, '2016-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1184336, 'Join or Die', 'Clarke is on a mission that could change everything. Meanwhile, Murphy gains insight that might prove useful in ensuring his survival. Lastly, Kane reaches a breaking point.', 48866, 13, 1184336, 72595, '2016-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1189895, 'Red Sky at Morning', 'Clarke, Bellamy, Octavia and Jasper hit a tragic roadblock. Meanwhile, Raven and Monty make an important discovery.', 48866, 14, 1189895, 72595, '2016-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1190494, 'Perverse Instantiation: Part One', 'Clarke finds hope in the most unlikely place. Meanwhile, Alie’s master plan comes together.', 48866, 15, 1190494, 72595, '2016-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1190495, 'Perverse Instantiation: Part Two', 'Our heroes begin to face the reality of their tragic situation. Everyone prepares for a final showdown.', 48866, 16, 1190495, 72595, '2016-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1248746, 'Echoes', 'Clarke and her friends struggle with how to proceed after the fate of the world is revealed.', 48866, 1, 1248746, 82960, '2017-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259903, 'Heavy Lies the Crown', 'The burden of leading weighs heavily upon Clarke and Bellamy when different challenges force them to determine who will live and die.', 48866, 2, 1259903, 82960, '2017-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259904, 'The Four Horsemen', 'Jaha leads Clarke and Bellamy down a road to possible salvation while tensions rise in Arkadia and Polis.', 48866, 3, 1259904, 82960, '2017-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259905, 'A Lie Guarded', 'Continued struggles with leadership and trust in Arkadia and Polis take violent turns while Abby leads a team to a distant location hoping to find answers.', 48866, 4, 1259905, 82960, '2017-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269682, 'The Tinder Box', 'Clarke makes a desperate plea with a former allied force in an attempt to avoid a war and ensure the survival of her people.', 48866, 5, 1269682, 82960, '2017-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269683, 'We Will Rise', 'Clarke and Roan are forced to work together when they are tasked to deliver a dangerous but crucial asset to Abby through enemy territories.', 48866, 6, 1269683, 82960, '2017-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269684, 'Gimme Shelter', 'Clarke''s arrival on the island quickly takes a turn for the worse. Meanwhile, Bellamy tries to avoid further tragedy in Arkadia.', 48866, 7, 1269684, 82960, '2017-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269685, 'God Complex', 'After a disappointing discovery, Clarke and Abby question how far they''re willing to go. Meanwhile, Jaha finds a lead to the mysterious Second Dawn.', 48866, 8, 1269685, 82960, '2017-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269686, 'DNR', 'Jasper and Bellamy go on a quest. Meanwhile, Clarke struggles to keep the peace after word of Jaha''s discovery spreads.', 48866, 9, 1269686, 82960, '2017-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269687, 'Die All, Die Merrily', 'Octavia fights in the final battle for her people''s survival, but not everyone is willing to play fair.', 48866, 10, 1269687, 82960, '2017-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269688, 'The Other Side', 'Clarke faces the consequences of her fateful choice.', 48866, 11, 1269688, 82960, '2017-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269689, 'The Chosen', 'Jaha and Kane disagree over how to handle their grim reality. Meanwhile, Clarke leads a group to save a friend.', 48866, 12, 1269689, 82960, '2017-05-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1269690, 'Praimfaya', 'It''s a race against the end of the world as Praimfaya arrives forcing our heroes to make impossible decisions to ensure their survival.', 48866, 13, 1269690, 82960, '2017-05-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1409138, 'Eden', 'Clarke struggles to survive on a desolate, scorched earth while her friends in space come across a long-awaited beacon of hope.', 48866, 1, 1409138, 90748, '2018-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1409139, 'Red Queen', 'Octavia is forced to take guidance from an unlikely ally when the future of the bunker and all those inside it is jeopardized.', 48866, 2, 1409139, 90748, '2018-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1461258, 'Sleeping Giants', 'Bellamy leads the charge investigating a potential way home. Meanwhile, Clarke and Madi deal with the new, uncertain threat to their home.', 48866, 3, 1461258, 90748, '2018-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1461259, 'Pandora''s Box', 'Our Heroes are forced to rely on the help of Shallow Valley''s dangerous new inhabitants in order to save some of their own, with surprising results.', 48866, 4, 1461259, 90748, '2018-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1482926, 'Shifting Sands', 'Octavia leads her people towards Shallow Valley against the advice of Clarke and Bellamy. Meanwhile, Kane and Abby adjust to a new set of challenges.', 48866, 5, 1482926, 90748, '2018-05-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1485449, 'Exit Wounds', 'Kane''s attempt to prove himself useful tests Wonkru''s allegiance to Octavia. Madi faces an unexpected threat inside Wonkru, forcing Clarke to make an unlikely ally.', 48866, 6, 1485449, 90748, '2018-06-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1485450, 'Acceptable Losses', 'Clarke and Bellamy make a startling discovery about Wonkru’s battle plans as Echo risks her friendship with Raven to complete her mission.', 48866, 7, 1485450, 90748, '2018-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1485451, 'How We Get to Peace', 'Clarke’s determination to protect Madi puts Bellamy  in an impossible position.', 48866, 8, 1485451, 90748, '2018-06-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1485452, 'Sic Semper Tyrannis', 'The growing fractures in Wonkru threaten to explode once and for all. Meanwhile, in Shadow Valley, Murphy starts a fire, unleashing catastrophic results.', 48866, 9, 1485452, 90748, '2018-07-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1514127, 'The Warriors Will', 'Monty strives to show Wonkru an alternative to war, and to the valley itself. Meanwhile, Abby’s health continues to deteriorate, along with McCreary’s patience.', 48866, 10, 1514127, 90748, '2018-07-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1514128, 'The Dark Year', 'As Clarke races to save Abby, she learns more about the trials and tribulations Wonkru faced in the bunker, and the impossible decisions they were forced to make in the dark year.', 48866, 11, 1514128, 90748, '2018-07-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1514129, 'Damocles - Part One', 'Octavia leads her people into war. While behind enemy lines, our heroes must overcome their differences to save Wonkru from extinction.', 48866, 12, 1514129, 90748, '2018-07-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1514130, 'Damocles - Part Two', 'Clarke and her friends must risk everything to fight one last battle for survival, only to glimpse an even darker threat to the last living valley on Earth.', 48866, 13, 1514130, 90748, '2018-08-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1667569, 'Sanctum', 'Still reeling after receiving Monty’s message, a small group goes down to explore the mysterious new planet. Back on the Mothership, several members of Wonkru face the consequences of their decisions.', 48866, 1, 1667569, 116111, '2019-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1686688, 'Red Sun Rising', 'The team on the ground flights to survive the threat they face on the new planet. Meanwhile, Raven must join forces with an unlikely ally to save everyone on board the Mothership.', 48866, 2, 1686688, 116111, '2019-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915718, 'No Way, Jose', 'With a major shipment en route and no more room in the warehouse, Jeff must convince Jose to share his space with the enemy.', 48979, 8, 915718, 55225, '2012-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1779357, 'The Children of Gabriel', 'Clarke tries to win over the leaders of Sanctum in order to let her people stay. Meanwhile, Bellamy, Echo and Octavia discover a new threat while on a mission to retrieve the transport ship.', 48866, 3, 1779357, 116111, '2019-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1794480, 'The Face Behind the Glass', 'Clarke embraces the traditions of Sanctum and tries to make amends for her past actions.', 48866, 4, 1794480, 116111, '2019-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1794482, 'The Gospel of Josephine', 'Jordan investigates Sanctum. Meanwhile, Octavia and Diyoza discover the threats of the new planet firsthand. Lastly, Bellamy and Clarke butt heads.', 48866, 5, 1794482, 116111, '2019-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1801333, 'Memento Mori', 'Diyoza learns more about the mysterious Children of Gabriel while Abby continues searching for a way to save Kane.', 48866, 6, 1801333, 116111, '2019-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1803229, 'Nevermind', 'Clarke’s past catches up to her.', 48866, 7, 1803229, 116111, '2019-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1814611, 'The Old Man and The Anomaly', 'Octavia and Diyoza make their way to the mysterious anomaly in search of the Old Man. Meanwhile, Murphy  has an offer for Emori.', 48866, 8, 1814611, 116111, '2019-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1831024, 'What You Take With You', 'Bellamy must venture into enemy territory with an unlikely companion. Meanwhile, Octavia is forced to confront her past.', 48866, 9, 1831024, 116111, '2019-07-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1836151, 'Matryoshka', 'Russell seeks justice. Meanwhile, Gabriel must make a difficult choice. Lastly, the Blake siblings reunite.', 48866, 10, 1836151, 116111, '2019-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1844664, 'Ashes to Ashes', 'Bellamy and Octavia must work together to save their friends. Echo is forced to face her past.', 48866, 11, 1844664, 116111, '2019-07-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1849023, 'Adjustment Protocol', 'A special Naming Day changes everything in Sanctum. Gabriel comes face to face with an old friend.', 48866, 12, 1849023, 116111, '2019-07-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1857470, 'The Blood of Sanctum', 'Sanctum becomes a battleground between the devout and the non-believers. The mystery of the anomaly deepens.', 48866, 13, 1857470, 116111, '2019-08-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915556, 'Six Minute Preview', '', 48891, 1, 915556, 55216, '2013-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915551, 'Pilot', 'Detective Jake Peralta is a talented, but carefree police detective at Brooklyn''s 99th precinct who, along with his eclectic group of colleagues, are used to having a lax captain around the office. However, when tightly-wound Captain Ray Holt takes over, he is determined to make this dysfunctional group of detectives into the best precinct in Brooklyn.', 48891, 1, 915551, 55215, '2013-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915553, 'The Tagger', 'When Jake is late for roll call, Captain Ray Holt assigns him to a graffiti case that Jake feels is below his level. However, when the culprit turns out to be the Deputy Commissioner’s son, the case becomes a major problem. Meanwhile, Gina’s psychic friend visits the precinct and gets inside Charles.', 48891, 2, 915553, 55215, '2013-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915554, 'The Slump', 'When Jake starts accumulating unsolved cases, the other detectives worry his losing streak will rub off on them; Amy, Rosa and Gina run a program for at-risk youth; Boyle helps Sergeant Jeffords with a case.', 48891, 3, 915554, 55215, '2013-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915552, 'M.E. Time', 'Much to the team’s annoyance, Jake hits on an attractive medical examiner, Dr. Rossi at a crime scene and holds up the autopsy report. He learns his lesson when Dr. Rossi turns out to be more than he bargained for. Meanwhile, Amy’s purse-snatching case is stalled when the sketch artist is out sick, but she discovers that Sgt. Jeffords has hidden artistic talents.', 48891, 4, 915552, 55215, '2013-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915555, 'The Vulture', 'A detective from Major Crimes takes over Jake''s nearly solved murder case and steals his thunder.', 48891, 5, 915555, 55215, '2013-10-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968146, 'Halloween', 'It''s Halloween night, a busy time of the year for any police precinct. Amy detests the holiday, and is not thrilled when she has to don a costume to go undercover on street patrol with Charles. Back at the precinct, Jake bets Captain Holt that he can steal his Medal of Valor before midnight, which results in him bringing out some costumes of his own.', 48891, 6, 968146, 55215, '2013-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967877, '48 Hours', 'When Jake makes an arrest without a lot of proof, he only has 48 hours to collect evidence, or else the "perp" will be released. After his unsuccessful interrogation of the suspect, Jake forces his co-workers to spend their weekend helping him crack the case. So, while the team is stuck at the precinct, Charles judges a pie contest between Gina and Rosa, and Holt helps Terry look better in the eyes of his in-laws.', 48891, 7, 967877, 55215, '2013-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967880, 'Old School', 'Jake gets to spend the day with his hero, a former crime reporter; Terry and Charles work with Rosa on how she comes across on the witness stand.', 48891, 8, 967880, 55215, '2013-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967879, 'Sal''s Pizza', 'When Sal''s Pizza burns down, Jake goes out of his way to disprove the fire marshal''s assumption that the owner set the fire; a computer virus exposes the precinct members'' Internet browser histories.', 48891, 9, 967879, 55215, '2013-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968723, 'Thanksgiving', 'When Holt and Jake must leave Amy''s Thanksgiving dinner to catch a perp, Boyle steps in to save the day.', 48891, 10, 968723, 55215, '2013-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968799, 'Christmas', 'When Holt starts getting death threats, Jake takes charge of his security; Amy tries to get a precinct Christmas photo; Terry gets his mojo back.', 48891, 11, 968799, 55215, '2013-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970251, 'Pontiac Bandit', 'Jake is interested in one of Rosa''s perps, Doug Judy, who has information about the "Pontiac Bandit," a car thief whom Jake has been tracking for years. Meanwhile, the station tries to accommodate a scooter-bound Charles'' every need when he returns to work, but he proves to be too much to handle. And Captain Holt struggles to find a home for two puppies.', 48891, 12, 970251, 55215, '2014-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970379, 'The Bet', 'Jake and Amy''s ongoing bet about who can make more arrests comes to a close. Meanwhile, Charles receives the Medal of Valor for getting shot in the line of duty, but the pain medication he is taking causes him to reveal his true opinions about his colleagues.', 48891, 13, 970379, 55215, '2014-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970643, 'The Ebony Falcon', 'On his first task back in the field, Terry busts a steroid ring, and in doing so, takes cues from Jake on how to harness his emotions. Meanwhile, Amy and Rosa help solve a breaking-and-entering case at Gina''s apartment.', 48891, 14, 970643, 55215, '2014-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970922, 'Operation: Broken Feather', 'Jake probes a series of hotel robberies with Amy, but is upset when he learns she may leave the precinct to work with the Vulture in the Special Crimes unit. Meanwhile, Holt and Jeffords try to make their workplace more efficient.', 48891, 15, 970922, 55215, '2014-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (971284, 'The Party', 'The officers in the precinct head over to Holt''s house to celebrate his birthday, but they wind up making a poor impression on his husband.', 48891, 16, 971284, 55215, '2014-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (971479, 'Full Boyle', 'Detective Boyle''s new romance has upped his swagger, but Jake intervenes before his colleague goes "Full Boyle" and gets too serious, too soon, with his girlfriend. Meanwhile, Rosa and Amy have trouble taking a costumed citizen crime-fighter seriously, and Captain Holt has a new opponent', 48891, 17, 971479, 55215, '2014-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972004, 'The Apartment', 'Jake’s crushing debt finally catches up to him, and he is in danger of losing his apartment, unless Gina can find a way to bail him out. Captain Holt and Sergeant Jeffords hold performance reviews for the entire precinct, and Rosa and Boyle have a run-in with one of the weekend squad officers.', 48891, 18, 972004, 55215, '2014-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915711, 'Storage Locker Roulette', 'Jeff places his bets on a series of storage lockers, even though he knows the odds are against a big jackpot.', 48979, 9, 915711, 55225, '2012-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972341, 'Tactical Village', 'The precinct heads to Tactical Village Day, a mandatory training course in which all regional precincts compete. While there, Amy runs into Teddy, a fellow officer she used to date. Meanwhile, Holt becomes addicted to a game on his phone and Rosa is pissed at Charles for not inviting her to his wedding', 48891, 19, 972341, 55215, '2014-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972691, 'Fancy Brugdom', 'Charles asks Jake to be the best man at his wedding, a role that requires Jake to be supportive in important wedding decisions, ranging from cake tasting to floral arrangements. Meanwhile, Terry, Amy and Gina support each other as they start a new extreme diet and Holt helps Rosa make a sincere apology.', 48891, 20, 972691, 55215, '2014-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973086, 'Unsolvable', 'During a weekend off, Jake decides to tackle a cold case that everyone thinks is unsolvable; Amy plans a trip with Teddy (Kyle Bornheimer); Rosa and Gina share a secret with Charles.', 48891, 21, 973086, 55215, '2014-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973302, 'Charges and Specs', 'Jake’s investigation of philanthropic civic leader Lucas Wint is shut down by Commissioner Podalski. Still determined to crack the case, Jake enlists Amy and a reluctant Captain Holt to help him uncover more evidence, even if it means facing suspension. Meanwhile, Charles is devastated over pre-marital problems with Vivian, and Gina knows just how to cheer him up.', 48891, 22, 973302, 55215, '2014-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004769, 'Undercover', 'Jake’s undercover FBI operation ends in a successful sting, until he learns one mobster has gotten away. As Jake enlists Charles’ help to track him down, Holt tests the squad’s patience with practice drills.', 48891, 1, 1004769, 62379, '2014-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004770, 'Chocolate Milk', 'Holt is taken by surprise when his longtime nemesis, Deputy Chief Madeline Wuntch arrives for an inspection of his precinct. Meanwhile, Jake and Terry test the boundaries of “work friends” vs. “friend friends” as they investigate a stabbing at a hipster chocolate milk bar.', 48891, 2, 1004770, 62379, '2014-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009811, 'The Jimmy Jab Games', 'The squad has time to kill when the arrival of the Serbian President’s motorcade to Brooklyn has been delayed. So, Jake launches “The Jimmy Jab Games,” an annual series of competitions in the precinct. Meanwhile, Terry and Holt take on a new drug task force approved by Holt’s nemesis, Deputy Chief Madeline Wuntch.', 48891, 3, 1009811, 62379, '2014-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010284, 'Halloween II', 'The Peralta/Holt annual Halloween bet continues when Jake challenges the Captain that he can steal his watch before midnight. Meanwhile, Gina is upset that her dance team, Floorgasm, kicks her off the squad and Terry confronts her about her bad attitude.', 48891, 4, 1010284, 62379, '2014-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012043, 'The Mole', 'There''s a mole in the precinct and Holt and Jake need to find out who it is before Deputy Chief Madeline Wuntch gets wind of it. Meanwhile, Terry and Rosa visit a "silent" disco to uncover new leads for their new drug task force.', 48891, 5, 1012043, 62379, '2014-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1011853, 'Jake and Sophia', 'Jake hits it off with Sophia, a woman whom he meets at a bar, only to find out she is the defense attorney for a perp he is trying to put in jail. Meanwhile, Gina and Charles work to put their relationship behind them.', 48891, 6, 1011853, 62379, '2014-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1012950, 'Lockdown', 'The precinct goes into lockdown mode on Thanksgiving night, and Jake, who was left in charge, is confident in his ability to keep spirits high and avoid chaos. Amy is less confident, as things spiral out of control.', 48891, 7, 1012950, 62379, '2014-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1014440, 'USPIS', 'While attempting to catch a drug dealer, Jake and Charles reluctantly join forces with the nerdy lead investigator at the U.S. Postal Service, Jack Danger. Meanwhile, the rest of the team helps Amy quit smoking', 48891, 8, 1014440, 62379, '2014-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1016956, 'The Road Trip', 'In an attempt to add a touch of romance to their work trip, Jake invites his girlfriend, Sophia, as well as Amy''s boyfriend, Teddy, to join them at a B&B. Meanwhile, Rosa adamantly refuses to admit to Terry and Gina that she is sick, and Charles is eager to help Holt with his anniversary breakfast.', 48891, 9, 1016956, 62379, '2014-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018187, 'The Pontiac Bandit Returns', '"The Pontiac Bandit," aka Doug Judy, is back in custody, after jamming up Jake and Rosa in his previous encounter with them. Meanwhile, Gina and Boyle are nervous that their parents might be getting too close, and Santiago makes Holt a Christmas gift against his wishes.', 48891, 10, 1018187, 62379, '2014-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1022916, 'Stakeout', 'Jake and Charles'' bro-mance starts to crack when they volunteer for an eight-day stakeout in very close quarters. Meanwhile, Captain Holt''s nephew, Marcus, comes to Brooklyn and captures Rosa''s attention.', 48891, 11, 1022916, 62379, '2014-12-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1022917, 'Beach House', 'The team is excited to spend the weekend at Charles'' beach house for a detectives-only-getaway, until Jake ruins the fun by inviting Captain Holt. Meanwhile, Charles helps Rosa send romantic texts to her new boyfriend, and Gina tries to get Amy drunk, simply for her own enjoyment.', 48891, 12, 1022917, 62379, '2015-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1022918, 'Payback', 'The squad decides it''s high time Jake paid them back all the money he has owed them from over the years. Meanwhile, Amy and Holt team up to re-open the Brooklyn Broiler case.', 48891, 13, 1022918, 62379, '2015-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1032003, 'Defense Rests', 'When Sophia''s job gets in the way of her relationship with Jake, Jake tries to smooth things over with her boss. Meanwhile, Wuntch needs Holt''s help for a job recommendation.', 48891, 14, 1032003, 62379, '2015-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1037113, 'Windbreaker City', 'Jake is heartbroken over Sophia but his spirits are lifted when the squad is invited to a Homeland Security terrorist training simulation. That is, until the agent in charge assigns them the lame role of playing hostages. Meanwhile, Gina administers a psychological exam to Holt, and Amy and Rosa compete for a day off from work.', 48891, 15, 1037113, 62379, '2015-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1038357, 'The Wednesday Incident', 'When Jake notices that Holt has been acting moody, he teams up with Holt''s husband to figure out what happened. Meanwhile, at the precinct, Charles tries to get a confession out of a geriatric suspect who pretends to be senile and adorable whenever Amy and Rosa are around.', 48891, 16, 1038357, 62379, '2015-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041361, 'Boyle-Linetti Wedding', 'It''s the day of Gina and Charles'' parents'' wedding, and the whole squad is given a job to fulfill for the ceremony. However, Jake and Amy get sidetracked chasing a criminal, and Terry struggles to officiate the wedding.', 48891, 17, 1041361, 62379, '2015-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1042433, 'Captain Peralta', 'Jake''s mainly absentee father, Roger, comes to town to spend some time with his son. Jake can''t wait to see him, but Charles is skeptical of Roger''s intentions. Meanwhile, Holt tasks Amy, Terry, Gina and Rosa with an impossible brain teaser in exchange for Beyoncé tickets.', 48891, 18, 1042433, 62379, '2015-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043567, 'Sabatoge', 'After a streak of really bad luck, Jake thinks he''s being sabotaged by an enemy. Holt assigns Amy and Rosa to investigate the truth. Meanwhile, Holt hurts Gina''s feelings by calling her dance troupe a "hobby," and Charles is stuck working a case with Scully and Hitchcock in Jake''s absence.', 48891, 19, 1043567, 62379, '2015-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050494, 'AC/DC', 'After Jake injures himself on a case, Terry forces him take time off and rest -- something Jake doesn’t know how to do. Across town, Holt and Rosa try to avoid intimate conversation during a double-date with their significant others.', 48891, 20, 1050494, 62379, '2015-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915710, 'Dealmakers Anonymous', 'After buying a shipment of Asian noodles that are about to expire, Jeff is forced to admit that he''s addicted to the deal.', 48979, 10, 915710, 55225, '2012-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1052898, 'Det. Dave Majors', 'Jake is excited to work a case with the best detective in the NYPD, Detective Majors, until Majors shares his intentions to ask Amy out on a date. Meanwhile, Charles and Gina try to convince Terry to stay at the Nine-Nine when he considers accepting an offer to work at a private security firm.', 48891, 21, 1052898, 62379, '2015-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1053440, 'The Chopper', 'Holt is wary when Wuntch lets Jake work his dream case, worried that she is setting him up to fail. Back at the precinct, Amy, Rosa and Gina help Terry host a field trip for a local magnet school.', 48891, 22, 1053440, 62379, '2015-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1054900, 'Johnny and Dora', 'Jake and Amy go undercover to catch Brooklyn’s most notorious identity thief, and the case brings them closer together – very close. Meanwhile, the entire precinct is caught off-guard when one of their own says goodbye to the Nine-Nine.', 48891, 23, 1054900, 62379, '2015-05-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1097832, 'New Captain', 'After Holt is transferred to the NYPD Department of Public Relations, the new captain''s arrival causes the precinct to dissolve into chaos, despite Terry''s best efforts to keep everyone on point. Meanwhile, Jake and Amy face the aftermath of their "for reals" kiss.', 48891, 1, 1097832, 69590, '2015-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1097833, 'The Funeral', 'The Nine-Nine gets another personnel change that could put Jake and Amy’s budding relationship at risk. Meanwhile, Terry assists Holt with an important public relations matter, and Rosa and Gina try to convince Charles to rethink his affection for a fellow officer.', 48891, 2, 1097833, 69590, '2015-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1107199, 'Boyle''s Hunch', 'Jake thinks Boyle might have met his soulmate in Genevieve, an art gallery owner, and he tries to help set them up. Meanwhile, Rosa deals with inter-precinct theft and Holt seeks Amy’s help with an image campaign.', 48891, 3, 1107199, 69590, '2015-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1110048, 'The Oolong Slayer', 'When investigating a serial killer, Jake enlists Holt’s help in an attempt to solve the case off the radar. At the precinct, Rosa and Amy are forced to deal with demands from an old adversary and Terry discovers a new obsession.', 48891, 4, 1110048, 69590, '2015-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1131714, 'Halloween III', 'The third installment of Captain Holt and Jake’s Halloween heist culminates with a tie-breaking competition to claim the title of “amazing detective slash genius.” This year, Jake and Holt split the squad into two teams to help them win.', 48891, 5, 1131714, 69590, '2015-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1131715, 'Into the Woods', 'Jake and Charles convince Terry to take a weekend camping trip as a much needed "babymoon," but they soon realize it might not be the idealistic weekend for which they had hoped. Meanwhile back at the precinct, Holt gives Rosa some important relationship advice and Amy enlists Gina''s help to prepare her for an important presentation.', 48891, 6, 1131715, 69590, '2015-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1131716, 'The Mattress', 'Jake and Amy convince the Captain to let them work a case together involving a new street drug, but their new relationship gets in the way. Meanwhile, at the precinct, Charles panics when he realizes he’s damaged one of Holt’s prized possessions and Terry teaches Rosa a lesson in discipline.', 48891, 7, 1131716, 69590, '2015-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1136866, 'Ava', 'Jake''s in charge of entertaining Sharon while Terry and Rosa head off to learn about the Douglass Street murders, but Sharon''s water breaks and crisis ensues at the precinct. Amy and Charles must process paperwork by hand due to an internet outage. Meanwhile, Holt is forced to confront his ex-boyfriend.', 48891, 8, 1136866, 69590, '2015-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1136867, 'The Swedes', 'In an attempt to solve an international case, Jake and Rosa are forced to work with a pair of Swedish cops and things get very competitive, very quickly. Meanwhile, Amy and Terry offer to help Gina prepare for a big test and Holt enlists Charles to sub in as his squash partner for an annual tournament.', 48891, 9, 1136867, 69590, '2015-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1138484, 'Yippie Kayak', 'Jake, Charles and Gina are involved in a real-life “Die Hard” situation while off-duty on Christmas Eve, and Terry must leave his family celebration to try to save his squad. Meanwhile, Amy tries to prove she’s just as tough as Holt and Rosa.', 48891, 10, 1138484, 69590, '2015-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1152278, 'Hostage Situation', 'Charles and Genevieve want to take their relationship to a new level, but his ex-wife, Eleanor, steamrolls their plans. Meanwhile, Amy asks Terry to write a recommendation letter with disastrous results, and Holt and Rosa enlist Gina’s help to solve a case.', 48891, 11, 1152278, 69590, '2016-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1152279, '9 Days', 'When Captain Holt and Jake accidentally contract the mumps during an investigation, they decide to be quarantined together in hopes of still solving the case. Meanwhile, Rosa tries to help Boyle through a mourning process, and Terry is forced to clean up Hitchcock and Scully’s mess.', 48891, 12, 1152279, 69590, '2016-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1161355, 'The Cruise', 'Jake and Amy are excited to go on their first real vacation together, but Amy’s perfectly planned cruise ship itinerary is thwarted when they discover an old adversary is on board with them. Meanwhile, Gina and Terry help Captain Holt survive a visit from his sister, Debbie, and Charles and Rosa vie for the same apartment.', 48891, 13, 1161355, 69590, '2016-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1161404, 'Karen Peralta', 'On his birthday, Jake brings Amy to meet his mother, but a surprise appearance by his dad throws a wrench in his special day. Meanwhile, Rosa and Charles struggle with a new mandate regarding body cams while on a stakeout with Terry, and Gina forgets to inform the precinct about an important plan of Holt’s.', 48891, 14, 1161404, 69590, '2016-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1161405, 'The 9-8', 'The Nine-Nine host the detectives from the Nine-Eight, their neighboring precinct, reuniting Jake with his old partner.  Charles is immediately jealous and tries to reclaim his best friend status with Jake. Meanwhile, the rest of the precinct tries to be welcoming to the Nine-Eight, but it doesn’t go as well as they had planned.', 48891, 15, 1161405, 69590, '2016-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1163062, 'House Mouses', 'When Jake insults Hitchcock and Scully''s work ethic in the precinct, they force their way into one of his cases in attempt to prove themselves. Meanwhile, Amy and Gina help Rosa conquer one of her biggest fears, and Holt and Boyle work a celebrity case.', 48891, 16, 1163062, 69590, '2016-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1166940, 'Adrian Pimento', 'When an unstable detective returns to the Nine-Nine after years undercover, Jake doesn''t know what to make of him. Meanwhile, Charles'' rebellious behavior pits him against the precinct''s custodian, and Holt enlists Gina''s help in directing a "fun and informational" video starring himself and Rosa.', 48891, 17, 1166940, 69590, '2016-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1166941, 'Cheddar', 'Holt allows Amy and Jake to house-sit for him while he visits Kevin in Paris, but mayhem ensues when Holt''s beloved dog, Cheddar, goes missing under their watch. Meanwhile, a romantic fling between Adrian Pimento and Rosa disrupts Terry and the rest of the precinct.', 48891, 18, 1166941, 69590, '2016-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172728, 'Terry Kitties', 'In an attempt to prove to his old precinct that he’s not a joke, Terry enlists Jake’s help in solving a case from his past. Meanwhile, Adrian moves in with Charles, with mixed results, and Amy invites herself to a hyper-competitive training exercise with Holt and Rosa', 48891, 19, 1172728, 69590, '2016-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1174511, 'Paranoia', 'Rosa enlists Jake to help change Terry’s disapproving opinion about her fast-moving relationship with Adrian Pimento. But their love for each other is put on hold when Pimento thinks someone from his past is trying to kill him.', 48891, 20, 1174511, 69590, '2016-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221882, 'What Women Want', 'Jeff''s tries to move women''s merchandise.', 48979, 17, 1221882, 80033, '2013-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659404, 'Episode 7', '', 85462, 7, 1659404, 115400, '2011-08-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1181840, 'Maximum Security', 'In an attempt to get information on a criminal operation, Amy has to go undercover at a women’s prison and befriend one of the prisoners. Meanwhile back at the precinct, Holt and the team plan a fake funeral in an attempt to catch a hitman.', 48891, 21, 1181840, 69590, '2016-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1181841, 'Bureau', 'With Pimento’s life still in peril, Captain Holt calls on an old friend in the FBI to help with a seemingly impossible heist. Meanwhile Amy makes a breakthrough while undercover, and Terry and Gina discover an information leak in the Nine-Nine.', 48891, 22, 1181841, 69590, '2016-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1181842, 'Greg and Larry', 'After a surprising turn of events in the Nine-Nine’s attempt to track down Adrian Pimento’s hitman, the precinct drops everything when they suspect Holt is in danger.', 48891, 23, 1181842, 69590, '2016-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1206222, 'Coral Palms, Part 1', 'Jake and Holt continue their new lives in Florida under the Witness Protection Program while Jimmy remains at large, but their identities may be revealed after a video of the pair goes viral.', 48891, 1, 1206222, 78513, '2016-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1223128, 'Coral Palms, Part 2', 'Jake and Holt end up on the other side of the interrogation table after being caught plotting an attack on Figgis. Meanwhile, a questionable new captain takes over at the precinct.', 48891, 2, 1223128, 78513, '2016-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1223833, 'Coral Palms, Part 3', 'The team makes a road trip to Florida to try to help Jake and Holt take down Figgis. With an unforeseen injury and yet another interruption by Sheriff Reynolds, the plan doesn’t follow through quite like they all had hoped. In the midst of the chaos, Jake and Amy share an awkward reunion.', 48891, 3, 1223833, 78513, '2016-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1225523, 'The Night Shift (I)', 'As Jake struggles with his first case back at the precinct, he encounters Jess Day, who is visiting New York, and enlists her to help him find his suspect. Meanwhile, Holt researches ways to increase office morale and Amy tries to figure out why Rosa keeps taking such long breaks.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1228347, 'Halloween IV', 'It’s Halloween in the Nine-Nine, which can only mean one thing: heist time. This year, the squad members pull out all the stops in their quest to win the new defending title of “Ultimate Detective Slash Genius.” Lines are drawn and plans are made, but there can only be one reigning champion.', 48891, 5, 1228347, 78513, '2016-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236045, 'Monster in the Closet', 'Pimento and Rosa decide to pick up where they left off and get married, so the whole squad preps a perfect wedding under Amy’s careful direction. Pimento enlists Jake and Gina to hunt for his grandmother’s ruby earrings for Rosa to wear in the ceremony, but the universe has other plans for them.', 48891, 6, 1236045, 78513, '2016-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236798, 'Mr. Santiago', 'At Amy''s intricately planned Thanksgiving dinner, Jake goes "full Santiago" (binder and all) in order to impress her father, a former cop. With Jake and Amy''s focus elsewhere, Charles is left on turkey duty and Holt helps Pimento cope after learning he can no longer work for the NYPD.', 48891, 7, 1236798, 78513, '2016-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1231128, 'Skyfire Cycle', 'When famous author DC Parlov receives death threats, Jake and Terry take the case, so that Terry can meet his lifelong hero. Back at the precinct, Gina forces her way into the Boyle clan of cousins in an attempt to choose the location of the annual Boyle family vacation. Meanwhile, Holt''s anger peaks when Amy chooses Kevin''s side in their argument about a math puzzle.', 48891, 8, 1231128, 78513, '2016-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1241859, 'The Overmining', 'Captain "CJ" is having major problems with a big case, and Jake and Holt find the motivation to help him out. Inside the precinct, war ensues when Terry enforces a green initiative and tells Gina to get rid of her precious space heater, while Rosa and Boyle take a break from the night shift to visit a foot massage parlor.', 48891, 9, 1241859, 78513, '2016-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1241860, 'Captain Latvia', 'Charles enlists Jake''s help in tracking down his son''s favorite toy for Christmas, and the two find themselves accidentally facing off against a Latvian criminal ring as a result. Back at the precinct, the team gears up for their annual Christmas carol competition against their sworn enemy: the MTA.', 48891, 10, 1241860, 78513, '2016-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1247262, 'The Fugitive, Part 1', 'A mass escape of convicts from a prison van in the streets of Brooklyn sends the entire squad on a manhunt. The only key witness? Former NFL running back Marshawn Lynch. Meanwhile, Jake and Amy place a bet on who can bring in the most escaped convicts - and the loser has to move into the winner''s apartment.', 48891, 11, 1247262, 78513, '2017-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1249785, 'The Fugitive, Part 2', 'With only one fugitive still on the loose, Jake enlists a surprising ally.', 48891, 12, 1249785, 78513, '2017-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1258300, 'The Audit', 'With the crime rate lowered, Brooklyn will be shutting down one of its precincts - permanently. The Nine-Nine is confident they will be evaluated fairly, until the official auditor turns out to be Amy''s ex-boyfriend. The whole squad then must band together to try to save the precinct.', 48891, 13, 1258300, 78513, '2017-04-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1298152, 'Serve & Protect', 'Terry''s ex replaces Teddy in evaluating the precinct, but Jake and Rosa are distracted by a burglary case that occurred on the set of one of their favorite detective TV shows.', 48891, 14, 1298152, 78513, '2017-04-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300491, 'The Last Ride', 'In what could be their last case as partners, Jake and Charles go to great extremes to apprehend a local bike thief. Terry shockingly isn''t in the lead for "Mr. Nine-Nine" (the detective who has solved the most cases), leaving Rosa determined to boost his ego. Meanwhile, Amy spends some precious time with Holt.', 48891, 15, 1300491, 78513, '2017-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303163, 'Moo Moo', 'Sergeant Jeffords is stopped by a fellow police officer while off-duty in his own neighborhood. When the incident escalates, Terry wants to file an official complaint against him, but Captain Holt has other ideas. Manwehile, Jake and Amy get a glimpse into the difficulties of parenthood and answer some tough questions when they babysit Terry''s kids.', 48891, 16, 1303163, 78513, '2017-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1308198, 'Cop-Con', 'The precinct packs up and heads to the Tri-State Police Officers'' annual Cop-Con, which is usually the Nine-Nine''s excuse for a big annual party. But the squad''s fun is threatened this year when Holt asks them to be on their best behavior.', 48891, 17, 1308198, 78513, '2017-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1308199, 'Chasing Amy', 'Amy suddenly vanishes hours before taking the Sergeant Exam at Cop-Con, and it''s up to Jake and Rosa to find her before it''s too late', 48891, 18, 1308199, 78513, '2017-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309428, 'Your Honor', 'Captain Holt''s mom seeks support from the precinct after her house is robbed. Meanwhile, Terry, Rosa and Boyle remodel the breakroom and Amy teaches Gina how to change her own car tire.', 48891, 19, 1309428, 78513, '2017-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309429, 'The Slaughterhouse', 'Jake and Rosa try to earn the respect of their idol, Lieutenant Melanie Hawkins. Meanwhile Charles, Terry and Gina test different parenting methods to resolve a conflict between Scully and Hitchcock.', 48891, 20, 1309429, 78513, '2017-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1313832, 'The Bank Job', 'As Jake and Rosa continue their search for a bank-robbing operation with Lieutenant Hawkins, they realize there''s more to her team than meets the eye. After discovering a dangerous secret, they call for back-up from Holt and Pimento. Meanwhile, Boyle objects to Gina''s new boyfriend.', 48891, 21, 1313832, 78513, '2017-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1313833, 'Crime & Punishment', 'When Jake and Rosa are framed for a crime they didn''t commit, it''s up to the Nine-Nine to find a way to bust them out.', 48891, 22, 1313833, 78513, '2017-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659405, 'Episode 8', '', 85462, 8, 1659405, 115400, '2011-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1353983, 'The Big House Pt.1', 'Jake and Rosa assimilate to their new lives behind bars, but both are coping in very different ways. Jake bonds with his cellmate, Caleb, and is forced to join a prison gang led by notorious inmate Romero, in order to gain his protection. Meanwhile, in the women''s prison, Rosa puts Holt and Terry to the test by having them complete outrageous favors for her. Back in the precinct, Amy and Charles are doing all they can to exonerate their colleagues.', 48891, 1, 1353983, 91751, '2017-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1368191, 'The Big House Pt.2', 'When the warden asks Jake to investigate Romero''s drug smuggling operation, Jake and Caleb find themselves caught between the loyalty Jake has sworn to both of them. Meanwhile, Amy is offered a deal by a local mobster who claims he can prove that Hawkins is guilty, but Holt and the rest of the gang think they have a safer plan.', 48891, 2, 1368191, 91751, '2017-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1371839, 'Kicks', 'Now that he''s officially back at the precinct and desperate to solve a real case, Jake finds a loophole to get out of his temporarily designated desk duty. Unfortunately, that loophole rests on his ability to pass an official evaluation performed by Holt. While Charles provides Jake with moral support, Terry and Amy help Rosa, who believes Pimento may be cheating on her.', 48891, 3, 1371839, 91751, '2017-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1374428, 'HalloVeen', 'The Nine-Nine embarks on its fifth annual Halloween Heist and, as usual, everybody has a plan and no one is safe. Relationships and friendships are tested as the title "Amazing Human Slash Genius" must be snagged by midnight, leaving everyone pitted against each other.', 48891, 4, 1374428, 91751, '2017-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1379527, 'Bad Beat', 'To track down the infamous arms dealer Dan "Daniel" Valdano, Jake and Terry go undercover at an illegal gambling club, but when Holt gets involved to coach the two in the art of poker, his addiction resurfaces. Meanwhile, Boyle buys a food truck that was formerly used in a brutal string of murders without telling his investor, Amy, and Hitchcock and Scully challenge Rosa to a "Butt-lympics."', 48891, 5, 1379527, 91751, '2017-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1384133, 'The Venue', 'The always unwelcome Vulture pops back into Jake and Amy''s lives, threatening to swoop in and take something important away from them. Meanwhile, Boyle and Rosa must track down "Sergeant Peanut Butter," the kidnapped NYPD horse that Charles envies, and Holt challenges Terry to be less image-conscious.', 48891, 6, 1384133, 91751, '2017-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1387093, 'Two Turkeys', 'Jake and Amy attempt to get their parents to bond over Thanksgiving dinner; When Holt''s Thanksgiving pie is stolen from his office, he searches for the culprit.', 48891, 7, 1387093, 91751, '2017-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1387881, 'Return to Skyfire', 'When Terry''s favorite author, DC Parlov, returns to the precinct because his latest manuscript was stolen, Terry and Jake convince Rosa to go undercover with them at a fantasy fiction convention to find the culprit. As drama ensues between Parlov and another writer, Terry admits that he''s been writing a book of his own. Back at the precinct, Holt, Amy and Charles take a forensics course, but Charles'' big mouth gets him in trouble.', 48891, 8, 1387881, 91751, '2017-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1394740, '99', 'While the entire precinct attends a funeral in LA, Holt learns that he is in the running to become Chief Commissioner of the NYPD - his dream job. But after missing their flight back to New York, Jake must devise a variety of ways to get Holt back in time for the interview.', 48891, 9, 1394740, 91751, '2017-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1400205, 'Game Night', 'Rosa begs Jake to help her break some big news to her parents, but her plan is thrown off when they wrongly assume the two are dating.', 48891, 10, 1400205, 91751, '2017-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1400206, 'The Favor', 'When Seamus Murphy returns to redeem the favor Holt owes him, the precinct searches for a loophole that will allow Holt to uphold his end of the bargain without breaking the law.', 48891, 11, 1400206, 91751, '2017-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1448957, 'Safe House', 'After Seamus threatens Kevin, Holt devises an elaborate plan to hide him in a safe house, with Jake as his guard. Kevin is miserable as the 99 works overtime to find Seamus and take him down.', 48891, 12, 1448957, 91751, '2018-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1449288, 'The Negotiation', 'Jake is called upon to negotiate a hostage situation with a jewel thief, only to discover that the culprit seems to be a familiar face. Amy and Gina help Charles with the high demands of his new food truck, and Holt panics when a member of the Police Commissioner selection committee decides to interview Hitchcock about Holt.', 48891, 13, 1449288, 91751, '2018-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1452849, 'The Box', 'Jake embarks on an all-night long interrogation in order to elicit a confession out of a suspect. But when Captain Holt skips the opera in order to stay back and help, the two cops clash over how to get him to talk.', 48891, 14, 1452849, 91751, '2018-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1454570, 'The Puzzle Master', 'Jake surprises Amy with an investigation into a string of arsons connected to her favorite crossword puzzle author, Vin Stermley. Meanwhile, Gina helps Holt jazz up his Commissioner candidate speech, and Terry, Rosa, Hitchcock and Scully argue over who is most deserving of the new detective car.', 48891, 15, 1454570, 91751, '2018-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1460059, 'NutriBoom', 'Jake and Charles realize that they’ve been suckered into the cult-like NutriBoom pyramid scheme, and must find a way to sever their contracts.', 48891, 16, 1460059, 91751, '2018-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1460060, 'DFW', 'Jake invites his newly discovered half-sister to stay with him in New York, but when he and Amy realize she’s a bit of a nightmare, they must find a way to get her back home to Dallas.', 48891, 17, 1460060, 91751, '2018-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1462045, 'Gray Star Mutual', 'When a fire destroys Charles'' food truck, Pimento unexpectedly shows up to the scene as the insurance agent. Meanwhile, Rosa helps Amy to see that it’s okay to get excited about picking her wedding dress, and Gina and Terry coach Holt in the art of social media.', 48891, 18, 1462045, 91751, '2018-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1462494, 'Bachelor/ette Party', 'Charles plans an elaborate scavenger hunt for Jake''s bachelor party, but the day goes awry when the guys decide to take some short cuts instead. Meanwhile, Amy''s bachelorette party escalates when the ladies realize she previously slept with a member of her soon-to-be wedding band.', 48891, 19, 1462494, 91751, '2018-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1469581, 'Show Me Going', 'When Rosa responds to an active shooter alert, the rest of the squad is forced to stay back, desperately fearing for her safety. Feeling helpless, Jake frantically brainstorms ways to offer his assistance, Terry faces an existential crisis and Gina and Amy try to make themselves useful by fixing Rosa''s broken toilet.', 48891, 20, 1469581, 91751, '2018-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1473136, 'White Whale', 'Rosa and Amy team up to take down their "white whale" suspect - a ruthless killer who has managed to elude them for seven years - while Terry helps Jake tackle his wedding planning chores. Then, Captain Holt and his rival, Olivia Crawford, try to convince each other to step down in the campaign for Commissioner.', 48891, 21, 1473136, 91751, '2018-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1477935, 'Jake & Amy', 'Jake and Amy''s wedding day is majorly threatened, and Charles and the whole squad rush to help save it. Amidst the chaos, Holt hesitates to open the email that will indicate if he has won his campaign for Commissioner, despite Gina''s encouragement. Meanwhile, Terry gently pushes Rosa towards a potential love interest.', 48891, 22, 1477935, 91751, '2018-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1645240, 'Honeymoon', 'Jake and Amy go on their honeymoon. Capt. Holt finds out whether he is the new commissioner of the NYPD.', 48891, 1, 1645240, 114567, '2019-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659991, 'Professional activities', 'Sparks are flying between Daisuke and Destroyer911. The AwesomeTeam comes up with a questionable solution for their lack of training place.', 85453, 6, 1659991, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1645241, 'Hitchcock & Scully', 'Jake and Charles investigate a case of Hitchcock and Scully''s from the 1980s. Meanwhile, Amy''s uniformed officers and Terry''s detectives fight over limited resources.', 48891, 2, 1645241, 114567, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664108, 'The Tattler', 'Jake and Gina attend their 20th high school reunion. Back at the Nine-Nine, Charles helps Rosa with her love life.', 48891, 3, 1664108, 114567, '2019-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1677231, 'Four Movements', 'Gina spends time with each member of the squad.', 48891, 4, 1677231, 114567, '2019-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1682689, 'A Tale of Two Bandits', 'Terry believes the Pontiac Bandit is stealing cars again, but Jake is convinced his friend wouldn''t do that. The rest of the squad fight to keep Shaw''s a police bar after some firemen stake their claim to it.', 48891, 5, 1682689, 114567, '2019-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1682690, 'The Crime Scene', 'Jake and Rosa must deal with a mother in mourning as they work and rework a crime scene in order to solve a difficult murder case with confusing evidence.', 48891, 6, 1682690, 114567, '2019-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1697317, 'The Honeypot', 'Jake and Holt clash over the merits of a new hire in the 99th precinct. Terry, Amy, Rosa and Charles try to do something about the cluttered bullpen.', 48891, 7, 1697317, 114567, '2019-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1711115, 'He Said, She Said', 'Jake and Amy investigate a difficult "he said, she said" case. Holt becomes suspicious after learning his lifelong arch nemesis died in a prison transport accident.', 48891, 8, 1711115, 114567, '2019-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1705434, 'The Golden Child', 'Jake helps Amy navigate the complicated relationship she has with her brother, David. Charles introduces some drama into an undercover mission involving Terry and Holt.', 48891, 9, 1705434, 114567, '2019-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1730442, 'Gintars', 'A visitor from Latvia causes Charles and Jake to investigate Nikolaj''s family. Holt and Amy bring in famed forensic scientist Dr. Yee to help close a case for Rosa.', 48891, 10, 1730442, 114567, '2019-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1705433, 'The Therapist', 'Charles brings Jake into a case when a therapist reports one of his patients missing.', 48891, 11, 1705433, 114567, '2019-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1738279, 'Casecation', 'Work is so busy for Jake and Amy that they end up celebrating their anniversary while standing guard over a comatose patient in the hospital.', 48891, 12, 1738279, 114567, '2019-04-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1745726, 'The Bimbo', 'Holt and Jake investigate a case at Kevin''s university. Back at the precinct, Terry and Amy take the squad out for lunch.', 48891, 13, 1745726, 114567, '2019-04-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1753960, 'Ticking Clocks', 'Jake and the squad must track down a hacker who has infiltrated the Nine-Nine''s servers; Rosa deals with relationship issues; Hitchcock and Scully attempt to cook the perfect lasagna.', 48891, 14, 1753960, 114567, '2019-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1762637, 'Return of the King', 'When Gina returns to the Nine-Nine, Jake and Terry get drawn into her life. Holt learns that Charles’s son, Nikolaj, may be a genius. Rosa copes with an injury.', 48891, 15, 1762637, 114567, '2019-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1782130, 'Cinco de Mayo', 'In order to distract Terry from the stress of his upcoming lieutenant''s exam, Jake, Holt and the squad decide to hold the annual Halloween Heist on a new date, Cinco de Mayo.', 48891, 16, 1782130, 114567, '2019-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1782131, 'Sicko (1)', 'Jake and Charles investigate a dangerous serial killer. Holt continues to spar with his rival, Commissioner Kelly. Terry finds out about whether or not he has passed the lieutenant''s exam.', 48891, 17, 1782131, 114567, '2019-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1782132, 'Suicide Squad (2)', 'Desperate circumstances call for desperate measures, as Jake, Holt, Amy, Terry, Rosa and Charles must ally themselves with old enemies.', 48891, 18, 1782132, 114567, '2019-05-16');
