INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160849, 'Episode 3', '', 48908, 3, 1160849, 74106, '2010-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160850, 'Episode 4', '', 48908, 4, 1160850, 74106, '2010-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160851, 'Episode 5', '', 48908, 5, 1160851, 74106, '2010-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160852, 'Episode 6', '', 48908, 6, 1160852, 74106, '2010-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160853, 'Episode 7', '', 48908, 7, 1160853, 74106, '2010-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160854, 'Episode 8', '', 48908, 8, 1160854, 74106, '2010-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160855, 'Episode 9', '', 48908, 9, 1160855, 74106, '2010-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1160856, 'Episode 10', '', 48908, 10, 1160856, 74106, '2010-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041657, 'The Wedding', 'Everybody gathers as a wedding is about to take place.', 48936, 1, 1041657, 64949, '2013-08-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041658, 'The Obsession', 'With the napkin treaty signed, Tom''s resolve is put to a stronger test when Miranda asks if she can move in. Will his attraction to her lead to trouble?', 48936, 2, 1041658, 64949, '2013-08-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043354, 'The Parking', 'Tom and Miranda share a moment that will change their relationship forever, Colette reveals something to Rob that promises to shake their marriage and Maggie ends up on the wrong side of the law after meeting her Mother.', 48936, 3, 1043354, 64949, '2013-09-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043355, 'Celebrity', 'Colette''s lover is confronted by Rob in a violent rage. Carlos wants Grace to make their relationship public. Maggie is attempting to keep her DUI secret from Warwick.', 48936, 4, 1043355, 64949, '2013-09-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043356, 'Dreams', 'Tom’s father has a shock for the rest of his family. Grace questions her independence after Carlos surprises her.', 48936, 5, 1043356, 64949, '2013-09-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043357, 'Personal Space', 'Miranda starts to become aware of her increasing attraction towards Tom. Grace attempts to set dome boundaries for her relationship.', 48936, 6, 1043357, 64949, '2013-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043358, 'Hooking Up', 'Grace quizzes Carlos after she thionks that he has had a one night stand. Miranda decides to start dating again.', 48936, 7, 1043358, 64949, '2013-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043359, 'Macho', 'Tom decides that he needs to be tell Miranda what happened. Rob finds Colette cheating again. Carlos faces deportation following a car crash.', 48936, 8, 1043359, 64949, '2013-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043360, 'Exes', 'Miranda ends up receiving a shock visit from her former fiance. Maggie comes to a drastic decision about her marriage.', 48936, 9, 1043360, 64949, '2013-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043361, 'Motherhood', 'Colette finds out that she is going to have a baby. Dani is given a hard lesson about Steve''s fears with children.', 48936, 10, 1043361, 64949, '2013-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043362, 'Comfort Zone', 'Colette ends up realising that her marriage troubles aren''t over just yet. Dani and Steve get some bad news from Dani''s father. Tom decides to start dating again but cannot forget about his feelings for Miranda.', 48936, 11, 1043362, 64949, '2013-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043363, 'Gay Marriage', 'Grace is forced to think again about her views after she hears a revelation from Carlos. Rob and Colette have different ideas about it comes to their wedding.', 48936, 12, 1043363, 64949, '2013-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043364, 'Messages', 'Rob sees Colette with The Barista just before they are due to have  their vow renewals. Steve reveals the bet to Miranda, who then confronts Tom. Carlos tells Grace that he loves her who then panics.', 48936, 13, 1043364, 64949, '2013-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043366, 'Relationship Status', 'Colette is left feeling stunned after Rob changes his online status to separated. Miranda and Tom clash over a bet. Maggie makes a new male friend.', 48936, 1, 1043366, 64950, '2014-08-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043367, 'Standing In Line', 'Rob drags Tom out to a nightclub, determined to meet a girl; Carlos is jealous of Grace''s new male colleague; Miranda is intrigued by Tom''s romantic past; Dani puts her job on the line.', 48936, 2, 1043367, 64950, '2014-08-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043368, 'Fear Of Missing Out', 'Grace finds herself in the middle of a jealous Carlos and charming Nick. Tom attempts to sort things out with Miranda.', 48936, 3, 1043368, 64950, '2014-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659992, 'Lack of Trust', 'The AwesomeTeam is literally in deep shit. Old friend offers to help.', 85453, 7, 1659992, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043369, 'First World Problems', 'Rob helps a friend and finds a way to help himself, Miranda and Tom''s argument leads to them sharing a special connection, and Grace tries to keep Nick at arm''s length.', 48936, 4, 1043369, 64950, '2014-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043370, 'Monogamy', 'When Miranda has a hot fantasy about Tom she tries to put some distance between them; Maggies is shocked to hear there is a rival for Warwick''s affection; Colette and Rob both try to move on.', 48936, 5, 1043370, 64950, '2014-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043371, 'Saving Face', 'Tom''s attempts to solve his father''s problems might just cause more issues; news about Carlos prompts Grace to jump to the next stage with Nick; Dani keeps secrets for her troubled step-sister.', 48936, 6, 1043371, 64950, '2014-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043372, 'Narcissism', 'Tom''s chain of one-night stands is a sore point for Miranda ? but what''s really going on? Colette''s happiness leaves Rob feeling lonelier than ever; Grace gets a glimpse of Nick''s dark side.', 48936, 7, 1043372, 64950, '2014-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043373, 'Liking', 'Tom and Miranda plan a romantic interlude. will fate finally be on their side? Grace plays mum to Nick''s little girl; an accident at Rob''s work sees his relationship with Colette turn a new corner.', 48936, 8, 1043373, 64950, '2014-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043374, 'Milestones', 'Tom is ready to start a new chapter just as Miranda''s best friend Ava arrives; Grace discovers the truth about Nick; Steve has a surprise for Dani that could change their lives.', 48936, 9, 1043374, 64950, '2014-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043375, 'Home', 'Colette and Carlos return from Brazil with a massive secret. A mysterious new tenant shows up.', 48936, 10, 1043375, 64950, '2014-10-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043376, 'Secrets', 'Miranda discovers Tom and Ava''s secret - but can flirtatious Max cheer her up? Dani and Steve''s romantic reunion takes an unexpected turn. Will Carlos give in to temptation with Felicity?', 48936, 11, 1043376, 64950, '2014-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043377, 'Sex', 'Miranda is enjoying her new connection with Max but Tom is suspicious. Carlos puts his visa in jeopardy whilst Rob''s dilemma could end up making or breaking his reunion with Colette.', 48936, 12, 1043377, 64950, '2014-10-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043378, 'Burn', 'Could a blast from Tom''s past ruin everything with Ava? Grace is shocked to learn Carlos'' secret, and smitten Miranda ignores her friends'' concerns about Max.', 48936, 13, 1043378, 64950, '2014-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043379, 'Haunted', 'Steve and Miranda''s dad Callan comes for a visit that stirs up the past, Grace offers Carlos a chance to fix his legal problems, and Tom seeks answers from Sasha.', 48936, 14, 1043379, 64950, '2014-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043380, 'Blind', 'Max angers Miranda when his article puts her friends in danger, Tom puts his relationship with Ava at risk, and Grace finds a drastic way to save Carlos - but can she go through with it?', 48936, 15, 1043380, 64950, '2014-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041659, 'Rescue', 'Tom''s late night decision leaves him on thin ice; Callan''s efforts to bond with Steve result in a brush with death; Dani uncovers plans for a secret wedding but there''s an even bigger shock in store.', 48936, 1, 1041659, 64951, '2015-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041660, 'Rejection', 'With his unhealthy passion for Sasha reignited, will Tom close himself off to Miranda? Carlos tries to do the right thing by Grace. Dani surprises Steve in Singapore but walks into a surprise of her own.', 48936, 2, 1041660, 64951, '2015-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043381, 'Baggage', 'Tom learns a shocking truth about his parents'' history with Sasha; Distressed Maggie falls into the comforting arms of Callan; Miranda stumbles across a secret Max has been hiding.', 48936, 3, 1043381, 64951, '2015-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043382, 'Withholding', 'Sparks fly when Grace meets an old flame but can she tell him the truth about her marriage? When Sasha demands he tell her his secrets, Tom drops a bombshell about one of his friends.', 48936, 4, 1043382, 64951, '2015-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1044288, 'Toxic', 'Miranda''s attempt to help Tom sees the gloves come off between her and Sasha, Grace nurses Carlos through a mystery illness, and Warwick makes a surprise visit to guilty Maggie.', 48936, 5, 1044288, 64951, '2015-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1045321, 'Fathers', 'Colette is devastated when Jade reveals she is having Rob''s baby, Callan returns to fight for Maggie, and Grace must confess to her parents that she secretly married Carlos.', 48936, 6, 1045321, 64951, '2015-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1046785, 'Split', 'Tom considers going into business with Sasha, Dani learns of her mother''s separation and questions her own marriage, and Maggie''s flat becomes crowded when Warwick invites a new lady friend over.', 48936, 7, 1046785, 64951, '2015-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1047865, 'The Other Woman', 'Collette is home alone when Jade returns to her door with severe labour pains. Can she help Jade through this traumatic moment? Meanwhile, Carlos and Miranda do their best to cover up their kiss.', 48936, 8, 1047865, 64951, '2015-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050816, 'Business and Pleasure', 'Colette questions whether Rob is the baby''s father - will he agree to a paternity test? Miranda agrees to work with Max again but when things get dangerous, Max makes an unexpected declaration.', 48936, 9, 1050816, 64951, '2015-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1052897, 'Strange Bedfellows', 'On a night out with the girls Sasha crosses paths with someone who knows about her secret past. Meanwhile, Jade confesses she got pregnant on purpose causing a furious Rob to demand a paternity test.', 48936, 10, 1052897, 64951, '2015-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1054768, 'Epic', 'A jealous Warwick starts a fight with Callan that ends in the emergency room. Colette catches Rob lying to her and Tom is gearing up to pop a question that will stun everyone.', 48936, 11, 1054768, 64951, '2015-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1054769, 'Is It Love?', 'Unaware of her explosive secret, Tom pushes Sasha to set the date. Carlos sets high expectations for him and Grace but will he be let down? Collette feels the pressure of the baby''s arrival.', 48936, 12, 1054769, 64951, '2015-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1056624, 'Wild', 'In the lead up to Tom and Sasha''s wedding, an innocent night out with friends leads to fights, saucy games, a steamy affair and the ultimate betrayal.', 48936, 13, 1056624, 64951, '2015-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1058481, 'Lost', 'Miranda discovers a secret that could destroy any chance of a reunion between Sasha and Tom. Meanwhile, Colette is rushed to hospital with an emergency that threatens her pregnancy.', 48936, 14, 1058481, 64951, '2015-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1058482, 'Truth', 'Sasha reappears and tells Tom the truth about her dark past. Meanwhile, Miranda''s life is put in danger as she finally discovers the man she loves has been leading a double life.', 48936, 15, 1058482, 64951, '2015-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1061229, 'Commitment', 'It is the day of the wedding and Sasha is faced with the dilemma of a lifetime. Miranda also has a hard decision to make? will she reveal her true feelings towards Tom before it is too late?', 48936, 16, 1061229, 64951, '2015-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915708, 'Bricks and Mortals', 'After walking into a potentially lucrative deal, Jeff is forced to pick up the gavel and host an auction if he''s going to see any profit.', 48979, 1, 915708, 55225, '2012-07-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915709, 'Heads... Or Tails Between Legs', 'Jeff falls in love with a monster statue made of motorcycle parts… but so does Biker Doug.', 48979, 2, 915709, 55225, '2012-07-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915713, 'Everything Must Go', 'Jeff decides to mess with his staff by surprising them with unannounced shipments. But when the merchandise arrives, it''s Jeff who goes into overdrive to sell it off.', 48979, 3, 915713, 55225, '2012-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915714, 'The Flip', 'Jeff strikes while the iron sizzles and starts flipping merchandise before taking possession.', 48979, 4, 915714, 55225, '2012-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915712, 'Of Mensch and Men', 'Jeff goes crazy when he comes out on the losing end in a pricey electronics deal.', 48979, 5, 915712, 55225, '2012-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915717, 'Turn Over', 'You have to have a thick skin if you want to work at Direct Liquidation.', 48979, 6, 915717, 55225, '2012-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915716, 'A Chip Off the Old Block', 'Jeff’s son Nick convinces his dad to partner on a new t-shirt line, as intern Daniel takes on the management of a Pop-Up store. Jeff’s expectations are impossibly high.', 48979, 11, 915716, 55225, '2012-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915715, 'Settling the Score', 'As Jeff races against the clock to get top dollar for a warehouse full of dollar store junk, his "frenemy" Jose plots to get even for the piles of pallets Jeff snuck into his warehouse.', 48979, 12, 915715, 55225, '2012-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915720, 'On the Block', 'Inspired by the kinky contents of a bailiff seized barn, Jeff decides to hold the mother of all auctions.', 48979, 13, 915720, 55225, '2012-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915725, 'Risky Business', 'In the season two premiere, Jeff rolls the dice on the biggest gamble of his career-bidding tens of thousands of dollars, sight unseen, for a truckload of high-end electronics that has been damaged in a transportation mishap. He awaits delivery, his stomach in knots.', 48979, 1, 915725, 55226, '2012-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915722, 'Has the Master Lost His Mojo?', 'Jeff takes delivery of a massive load of dubious merchandise-including pallets of foam Easter eggs and Halloween pumpkins-and his staff starts to worry. Meanwhile, a planned auction of high-end goods teeters on the brink of disaster.', 48979, 2, 915722, 55226, '2012-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915724, 'No Rest for the Wicked', 'Jeff makes deals non-stop, wherever he is, all day and all night. That’s why he’s successful, but also the reason why he’s such a stress case. He tries his best to decompress, but finally reaches a breaking point. Jeff reluctantly lets his family take him on a brief vacation, but that doesn’t stop him from making deals and riding his staff.', 48979, 3, 915724, 55226, '2012-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915723, 'A Matter of Trust', 'Jeff makes his living on a handshake every day-he’s got to know whom to trust. When he’s called in to negotiate for the goods in an Italian gelato café that appears to be brewing something on the side, Jeff has to be careful not to get in over his head. Meanwhile, other deals for dodgy Chinese mattresses and wicker furniture demonstrate the extent-and limits-of Jeff’s trust.', 48979, 4, 915723, 55226, '2012-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915721, 'Collecting Cash', 'There’s a cardinal rule in the world of buy-and-sell: Never fall in love with your merchandise. But when Jeff finally decides to part with his beloved Motorcycle Monster statue, fellow-collector Rick appears to tempt him with even more novelty attractions. Sometimes even Jeff has to remember that money talks and love has a price.', 48979, 5, 915721, 55226, '2012-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915726, 'Man in the Middle', 'When a guy phones with a batch of tuxedos to sell, it sure helps if you know a guy who buys tuxedos. And, luckily, Jeff knows everybody. With his Rolodex spinning, expert middleman Jeff brings together a series of buyers and sellers, skimming off a bit of cream each time-without breaking a sweat.', 48979, 6, 915726, 55226, '2012-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915727, 'Tough Sell', 'For The Liquidator, snap decisions and big gambles are part of the game. But sometimes "slam-dunk" deals can give Jeff more trouble than he bargained for.', 48979, 7, 915727, 55226, '2013-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915728, 'A Hand Up', 'Jeff has a soft side for old acquaintances who find themselves down on their luck. When his long-time "frenemy" JosE faces the loss of his business, Jeff helps him find a way back into the game. But JosE would do well to remember: there''s always a price to pay for a hand up from Jeff.', 48979, 8, 915728, 55226, '2013-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915729, 'The Floor', 'After going on a buying-bender, Jeff pressures his staff to fit his impulse purchases into an already overcrowded warehouse. Jeff''s buddy Wayne manages to talk him into buying some weird, wacky-and BIG-items. After that, the flood of merchandise just keeps flowing-bedding, toys, hoodies, BBQs.', 48979, 9, 915729, 55226, '2013-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915733, 'You Get What You Pay For', 'In the world of bottom-feeding liquidators, Jeff is a shark. But he often wonders if he could survive as an alpha predator in the uncharted waters of high-end merchandise. When some tempting deals cross his path, Jeff takes the plunge.', 48979, 10, 915733, 55226, '2013-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915730, 'Eye Candy', 'Jeff''s warehouse is famous for "eye candy"-unusual and often kitschy pieces that add spark to his displays. But, when he gets talked into buying a mangy stuffed polar bear, Jeff crosses the line from kitsch to crazy.', 48979, 11, 915730, 55226, '2013-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915731, 'Good Buys and Goodbyes', 'Jeff''s large network of staff and associates can yield big paydays, and sometimes even bigger heartaches. He learns a bitter lesson when his old "pal" steals a lucrative deal right out from under him. Meanwhile, much-loved employee Christine departs Direct Liquidation-but not before negotiating one last deal with Jeff.', 48979, 12, 915731, 55226, '2013-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (915732, 'Man Toys', 'JMost men are little boys at heart-and they love their toys. When a local go-kart track goes out of business, Jeff''s excitement gets the better of him. He decides to host an auction to sell the used karts-and impulsively promises the track owners a $20-grand guarantee against the proceeds.', 48979, 13, 915732, 55226, '2013-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221866, 'Bailiff Booty', 'Jeff has one day to clear out a Chinese grocery store full of exotic and vile stock.', 48979, 1, 1221866, 80033, '2013-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221867, 'Armed To The Rafters', 'Jeff spends thousands on a military warehouse package deal that includes a decommissioned .50 caliber machine gun.', 48979, 2, 1221867, 80033, '2013-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221868, 'Size Matters', 'Jeff makes an impulse buy. Meanwhile, Daniel ends up with a truckload of shoes that are all the same size.', 48979, 3, 1221868, 80033, '2013-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221869, 'Tongue Twisted', 'Jeff takes a gamble in trying to sell some broken pianos, an assortment of pickled peppers, and a collection of ornamental seashells.', 48979, 4, 1221869, 80033, '2013-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221870, 'The Irregulars', 'Deals with some regulars leave Jeff looking to sell a baby grand, used staging furniture, and a collection of ugly jeans.', 48979, 5, 1221870, 80033, '2013-07-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221871, 'Belly Up', 'The purchase of a warehouse full of electronics has Jeff working against a tight deadline.', 48979, 6, 1221871, 80033, '2013-08-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221872, 'Friends With Benefits', 'Jeff has a face-off with regular customer Jose and contends with several regulars looking for deals.', 48979, 7, 1221872, 80033, '2013-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221873, 'The More, The Barrier', 'Jeff gets involved in a bidding war against his own customers.', 48979, 8, 1221873, 80033, '2013-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221874, 'Brief Encounters', 'Jeff dons a suit and tie in an effort to close a deal for underwear.', 48979, 9, 1221874, 80033, '2013-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221875, 'I’d Bet The Pot', 'A deal for a large inventory of hydroponics equipment brings Jeff some unusual customers.', 48979, 10, 1221875, 80033, '2013-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221876, 'He Works Hard For The Money', 'Jeff''s sales skills are put to the test when he''s faced with moving a live goat and a truckload of broken guitars.', 48979, 11, 1221876, 80033, '2016-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221877, 'What’s Your Beef?', 'Jeff pursues a store full of frozen meat. Then, a heated round with an art dealer gets Jeff riled up.', 48979, 12, 1221877, 80033, '2013-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221878, 'Phone A Friend', 'Jeff looks to his go-to guys when he finds himself stuck with a truckload of B-grade lumber and other assorted items.', 48979, 13, 1221878, 80033, '2013-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221879, 'California Dealin', 'A collector''s warehouse full of mystery antiques tempts Jeff, but he has to drive to California to see if it is the real deal.', 48979, 14, 1221879, 80033, '2013-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221880, 'Coffin Up Cash', 'Jeff fills the warehouse with handicap scooters and a coffin.', 48979, 15, 1221880, 80033, '2013-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221881, 'The Smell Of Money', 'Jeff commits to a high-stakes storage locker auction and a risky plan to sell off a down-and-out restaurant.', 48979, 16, 1221881, 80033, '2013-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221883, 'Operation: Liquidate', 'Jeff buys four truckloads of TV-set props and, with nowhere to put the goods, the staff tries to pull off the biggest outdoor sale in Liquidator history.', 48979, 18, 1221883, 80033, '2014-01-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221884, 'Down... But Not Out', 'Jeff tries to profit from an exhausting string of deals with Wayne. Meanwhile, a woodworking auction does not go as planned.', 48979, 19, 1221884, 80033, '2014-01-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221885, 'Crossing The Line', 'Jeff scoops a deal from Wayne, has a strange encounter in a sex shop, and then tries to sell an aging accordion to his own mother.', 48979, 20, 1221885, 80033, '2014-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221886, 'Bail Out', 'Jeff buys a load of cheap crafting supplies.', 48979, 21, 1221886, 80033, '2014-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221887, 'Taken For A Ride', 'Jeff falls hard for a vintage motorbike. Then when things go wrong with a mechanic, he has to turn to Sheldon the Bailiff to get it back.', 48979, 22, 1221887, 80033, '2014-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221888, 'Treasure Or Trash?', 'Jeff wears down sellers by trash-talking their merchandise, then tries to convince buyers that industrial pressure gauges and cheap pink T-shirts are treasures.', 48979, 23, 1221888, 80033, '2014-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221889, 'Rotten Timing', 'Jeff gambles on a series of end-of-the-line deals in hopes of a big payday.', 48979, 24, 1221889, 80033, '2013-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221890, 'Hairy Situation', 'Jeff makes a deal for fur coats and risks his reputation on a Hollywood memorabilia auction.', 48979, 25, 1221890, 80033, '2014-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221891, 'Redneck Round-Up', 'Jeff and Daniel travel to the California desert to visit an abandoned town, meet slot machine collectors, and make a deal on 30,000 wine corks.', 48979, 26, 1221891, 80033, '2014-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221892, 'Sink or Swim', 'When Jeff loses the key item in an upcoming auction – a yacht worth a quarter-million dollars – will he also lose his customers, or can he find a new centerpiece in time?', 48979, 1, 1221892, 80034, '2015-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221893, 'King of Scrap', 'Jeff has the knack for turning trash into treasure, but when he buys a load of native artifacts he doesn’t even want in order to secure a future deal, he has to think creatively to turn a profit.', 48979, 2, 1221893, 80034, '2015-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221894, 'Measuring Up', 'Jeff loves showing newbies the ropes – but will a nervous first-time liquidator end up teaching him a thing or two?', 48979, 3, 1221894, 80034, '2015-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221895, 'Big flipping deal', 'Flipping a deal is Jeff’s favorite way to make quick cash – but when Jeff tries to sell a huge load of dancewear, the flip goes flop. Will selling the product piecemeal be worth the extra effort?', 48979, 4, 1221895, 80034, '2015-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221896, 'Hare Raising Deals', 'When a rabbit shelter asks Jeff to pay more than he should for a load of donated clothing, will Jeff sacrifice his own profit for the baby bunnies, or can he find a way to help the bunnies while still helping himself?', 48979, 5, 1221896, 80034, '2015-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221897, 'Going,Going... Bong', 'When Jeff buys a boatload of bongs, his first instinct is to put them on the shelves of Direct Liquidation. But after his regular customers don’t bite, how will Jeff get these bongs long gone?', 48979, 6, 1221897, 80034, '2015-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221898, 'Doll-Ars to Dough-Nuts', 'Liquidating the contents of a restaurant should be easy – but the equipment is in such terrible condition Jeff can’t even recover his costs – until he tries a new tactic.', 48979, 7, 1221898, 80034, '2015-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221899, 'The Orient Distress', 'After receiving a load of rotten furniture, Jeff goes all the way to Indonesia in a bid to get his money back. But once he’s face-to-face with the shady manufacturer, will Jeff’s temper get the better of him?', 48979, 8, 1221899, 80034, '2015-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221900, 'Lost In Persuasion', 'Jeff only has a few days in Indonesia to fill up a container of furniture, but his tough-guy negotiating style doesn’t fly with the locals. Will Jeff be able to change up his game in time?', 48979, 9, 1221900, 80034, '2015-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221901, 'In The Schwarz Team', 'Jeff’s empire is growing, but when his second store’s Grand Opening looks like it might end up being a bland opening, will Jeff’s micromanaging turn things around—or turn everyone off?', 48979, 10, 1221901, 80034, '2015-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221902, 'Show Me The Moo-La', 'When Apprentice Daniel starts making thousand-dollar deals without checking with Jeff first, will Daniel’s inexperience cost Jeff money? Or will Jeff have to re-evaluate Daniel’s role at Direct Liquidation?', 48979, 11, 1221902, 80034, '2015-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221903, 'Hustle Apostle', 'A priest, a rabbi, and Jeff walk into a dorm, but only one of them walks away with a building full of falling-apart furniture. The joke''s on Jeff as he tries to turn old couches into cash.', 48979, 12, 1221903, 80034, '2016-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221904, 'Cagey Dealing', 'When Jeff finds out a risky high-tech deal he bought is worth hundreds of thousands of dollars, will he flip it for fast cash or go for the gold?', 48979, 13, 1221904, 80034, '2015-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221905, 'Pimping Iron', 'After dropping $50,000 for high-end gym equipment that won’t sell, Jeff calls in help to get out of the deal. But will the cavalry arrive prepared to help - or to do battle?', 48979, 14, 1221905, 80034, '2015-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221906, 'Cut Me A Deal', 'When a collector brings in a couple of heavies to intimidate Jeff into giving him a good deal, will Jeff manage to beat the guy up on price without getting a free pair of concrete shoes in the bargain?', 48979, 15, 1221906, 80034, '2015-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221907, 'Stripped Bare', 'It´s a sexy dream come true for Jeff as he liquidates a lingerie shop but will he and Daniel be so wowed by the women customers they end up giving away the profit?', 48979, 16, 1221907, 80034, '2015-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221908, 'Desperate Measures', 'When a competitor shows up at Jeff´s door with a truckload of mattresses, will pretending he bought the wrong product save Jeff money or enrage the seller?', 48979, 17, 1221908, 80034, '2015-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221909, 'Jaded', 'When Jeff pulls a dirty trick on a mattress competitor, will it save him a bunch of cash or get him in a bunch of trouble with the seller?', 48979, 18, 1221909, 80034, '2015-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221910, 'Clean Sweep', 'When Jeff buys a carful of clothes he doesn’t want to help out a charity, will he be able to trick a greenhorn liquidator into getting him out of the deal?', 48979, 19, 1221910, 80034, '2015-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221911, 'Sweeten the Deal', 'Jeff’s skills are put to the test as he tries to sell dozens of skids of candy that will expire in just a few days.', 48979, 20, 1221911, 80034, '2015-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221912, 'The Blind Side', 'When a partner makes a deal – using Jeff’s money – for a bunch of dirty restaurant equipment, it’s up to Jeff to get it sold – fast!', 48979, 21, 1221912, 80034, '2015-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221913, 'Floor Your Friends', 'When Jeff decides to put employee Tom in charge of a huge hardwood flooring deal, will Tom rise to the challenge? Or will the only thing on the rise be Jeff’s blood pressure?', 48979, 22, 1221913, 80034, '2016-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221914, 'Eyes on the Prize', 'When a five-ton truck full of merchandise pulls up that Jeff doesn’t remember buying, not only does he have to figure out a buyer – he has to find the seller, too.', 48979, 23, 1221914, 80034, '2015-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221915, 'The Right Combination', 'When too many vendors answer his call for coin-operated lockers, Jeff finds himself with hundreds more than he needs, and no place to store them.', 48979, 24, 1221915, 80034, '2015-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221916, 'Worth His Salt', 'When Jeff forgets to book staff for an auction, will he be able to do the jobs of clerk, cashier, locker cracker, and auctioneer by himself?', 48979, 25, 1221916, 80034, '2015-07-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659993, 'Captain', 'The last battle is at hand. Is Dragonslayer man enough to swallow his loss and lead his team to victory?', 85453, 8, 1659993, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221917, 'Profit Wars', 'When Jeff needs to turn a mountain of weapons into some quick cash, he turns to his auctioneer associate Sam to help him out. But when Sam sniffs weakness, will he go for Jeff’s throat?', 48979, 26, 1221917, 80034, '2015-07-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221918, 'Palm Trees and Face Palms', 'Jeff is left high and dry in California when he tries to help his friends stage a huge estate sale there. Will he pull off a desert miracle, or watch his profits disappear like a mirage?', 48979, 27, 1221918, 80034, '2015-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221919, 'Kink In The Road', 'Jeff’s all tied up in knots when a chance house call to a Palm Springs collector leads him into a dungeon full of leather bondage gear.', 48979, 28, 1221919, 80034, '2015-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221920, 'Flip Flop', 'When Jeff only has 8 hours to sell a hotel’s worth of falling-apart furniture, will he manage to turn a pile of garbage into gold? Or are these tables only fit for the trash?', 48979, 29, 1221920, 80034, '2015-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221921, 'Not My First Rodeo', 'Jeff and Daniel hit the road hoping to pick up out-of-the-way deals for almost nothing, but a grizzled rodeo vet shows them that some small town guys can be big-time negotiators.', 48979, 30, 1221921, 80034, '2015-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221922, 'Heads and Tails', 'When the company next door wants to unload $100k worth of motors, Jeff has to decide whether he wants to be a good neighbor and make friends – or make money.', 48979, 31, 1221922, 80034, '2015-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221923, 'Sock it to Me', 'Jeff gets saddled with a container full of unfashionable socks that no one in town will touch, until he decides that honesty isn’t the most profitable policy.', 48979, 32, 1221923, 80034, '2015-10-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221924, 'Bucked Off', 'When Jeff finds negotiating with a couple of professional pickers too easy, his warning system begins to go off. Will Jeff figure out the catch in time, or will he fall headfirst into their trap?', 48979, 33, 1221924, 80034, '2015-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221925, 'Toolin Around', 'Jeff is left high and dry in California when he tries to help his friends stage a huge estate sale there. Will he pull off a desert miracle, or watch his profits disappear like a mirage?', 48979, 34, 1221925, 80034, '2016-10-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221926, 'José ’em Down', 'When Jeff tries to make a deal at his vet’s office, his business goes to the dogs. Will he fare any better by letting José take the reins on the next one, or will his best frenemy sabotage him?', 48979, 35, 1221926, 80034, '2015-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221927, 'Street Cred', 'When Jeff and Daniel discover their Toronto auction is a sinking ship, they hit the streets in a wild attempt to bail it out.', 48979, 36, 1221927, 80034, '2016-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221928, 'Straddle the Saddle', 'Jeff goes behind his friend’s back to make a deal with his wife for Western props. But will they be caught red-handed before the deal is sealed?', 48979, 37, 1221928, 80034, '2015-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221929, 'A Passage to India', 'Jeff and Daniel travel to India in search of hot deals. The country is hot alright, but they quickly learn that bargains are hard to come by, even with the help of their pretty translator. Jeff inches along the path to enlightenment on deals for puppets and saris, until a hardware store owner won’t budge in negotiations for a bunch of tools.', 48979, 38, 1221929, 80034, '2015-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1221930, 'The Schwarz that Broke the Camel’s Back', 'Jeff and Daniel continue their Indian odyssey in Jodhpur, and learn that rules are made to be broken. Jeff is henpecked by lady customers when he stages a sari sale in the village square, then goes head to head with a doctor of “turbanology.” A furniture seller’s fluency in English comes as a surprise, and Jeff’s loose lips threaten to sabotage the biggest deal of his entire trip.', 48979, 39, 1221930, 80034, '2015-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659233, 'Virtual Warrior', 'Dragonslayer666 and mother get into fight with warful consequences. First computer gets thrown out, and then the man. Dragonslayer''s dream of becoming professional is at stake.', 85453, 1, 1659233, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659234, 'Feta Salad', 'Dragonslayer''s already sticky situation gets even more puzzling by a girl nicknamed Fetasalaatti, especially when it''s revealed that her family includes a living legend.', 85453, 2, 1659234, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659930, 'Megaman', 'Dragonslayer gets help from a friend with a bowl cut. Suffering from gaming withdrawal symptoms, Dragonslayer won''t say no to any means to be able to play again.', 85453, 3, 1659930, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659933, 'TheAwesomeTeam', 'Preliminary round is closing and Dragonslayer have to hurry. He tries everything from girlfriend manipulation to stunt jumping to get his idol into the team.', 85453, 4, 1659933, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659934, 'Group of Lemmings', 'Captain Dragonslayer is leading The AwesomeTeam with a iron grip, but are the others ready to jump off the cliff on his command?', 85453, 5, 1659934, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659935, 'Party', 'Well started preliminary round takes a surprising turn. Dragonslayer''s night ends wetly.', 85453, 6, 1659935, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659936, 'Sparrowkillers', 'Megaman saves DragonSlayer666 from trouble. But is he willing to sacrifice even his friends when he is offered the deal of his dreams.', 85453, 7, 1659936, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659937, 'Jönköping', 'The final tournament is at hand. Server''s most feared meets his worst nightmare.', 85453, 8, 1659937, 115389, '2017-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659939, 'The Greedy One Will Have a Shitty Start', 'The AwesomeTeam celebrates their bronze medal and gets ready for their next big tournament. Dragonslayer''s situation looks bad, but his mother has a surprise.', 85453, 1, 1659939, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659945, 'Duel', 'Pinokkio agrees to give his team position to Dragonslayer with one condition. Server''s most feared have to face battle of his life.', 85453, 2, 1659945, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659946, 'Turtle Defense', 'Dragonslayer666 has decided to impress Daisuke, whatever it may take. At the same time, The AwesomeTeam encounters an unexpected threat.', 85453, 3, 1659946, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659947, 'TheImmortalisTeam', 'Sweat and tears are flowing when Daisuke orientates new player to his training philosophy. Jorgo''s gives some pointers to Megaman in real life gaming moves.', 85453, 4, 1659947, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659948, 'Preliminary Round', 'Lot is at stake, when Dragonslayer is pitted against his old team.', 85453, 5, 1659948, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659949, 'Selfish Bastard', 'TheAwesomeTeam is in trouble and Destroyer911 is facing a tough choice.', 85453, 6, 1659949, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659950, 'Marseilles', 'The long waited tournament doesn''t start too well. Old enemies from the past show up to make things worse.', 85453, 7, 1659950, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659951, 'Next Level', 'The tournament in Marseilles takes a violent end. Now it  will be seen how good friend the server''s most feared really is.', 85453, 8, 1659951, 115429, '2018-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659953, 'New York', 'Dragonslayer666 and Megaman are running around Manhattan. A surprise waits in the ProTeam''s headquarters.', 85453, 1, 1659953, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659987, 'Shitstorm', 'Drago''s gaming career is like a booger in Jake''s milkshake. It''s time to seek help from Sensei Hannu.', 85453, 2, 1659987, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659988, 'Modern Technology Will Destroy Humankind', 'Work getting The AwesomeTeam back together is painstakingly slow. Samira, Pinokkio''s rap posse and even school are causing problems.', 85453, 3, 1659988, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659989, 'Troll', 'Preliminary match is closing in but the team doesn''t have computers or even place to train.', 85453, 4, 1659989, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659990, 'One-handed and One-legged', 'Drago tries to hide his predicament from others but training seems impossible.', 85453, 5, 1659990, 115431, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659325, 'Be the Boss', 'In step two of the plan, Tom''s gang are planning meals ahead, shopping sensibly and batch cooking.', 85456, 2, 1659325, 115393, '2019-01-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659406, 'Episode 9', '', 85462, 9, 1659406, 115400, '2011-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659407, 'Episode 10', '', 85462, 10, 1659407, 115400, '2011-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659408, 'Episode 11', '', 85462, 11, 1659408, 115400, '2011-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659409, 'Episode 12', '', 85462, 12, 1659409, 115400, '2011-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659410, 'Episode 13', '', 85462, 13, 1659410, 115400, '2011-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1659913, 'Episode 1', 'Piers Morgan interviews serial killer Mark Riebe. Mark is one of Florida''s most ruthless murderers and is believed to have killed more than 13 women in a period from the late 1980''s to the late 90''s. He was convicted in 1998 of the murder of Donna Callahan on August 6, 1989, and sentenced to 25 years in prison. Piers gets straight to the point to find out what has driven these people to commit such heinous crimes.', 85471, 1, 1659913, 115424, '2017-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1889574, 'Episode 2', 'Missouri''s most notorious serial killer terrorised the streets of Kansas City for over two decades. In this chilling film, Piers Morgan comes face to face with Lorenzo Gilyard, a seemingly ordinary man who killed 13 times before discarding his victims on the streets. Although he is serving six life sentences, Gilyard protests his innocence despite overwhelming DNA evidence against him. Piers Morgan sets out to discover what drove this family man to kill and kill again in a remarkable interview.', 85471, 2, 1889574, 115424, '2018-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1889575, 'Episode 3', 'Henriquez, convicted nearly 30 years ago for murdering two girls aged 10 and 14, and a 21-year-old woman in the Bronx, has never spoken publicly about his crimes. Now Piers aims to get beneath his lies and deceit to uncover the truth. Alex Henriquez is serving 75 years but continues to maintain his innocence.', 85471, 3, 1889575, 115424, '2018-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1889577, 'Episode 1', 'Piers Morgan comes face-to-face with a serial killer who not only admits his heinous crimes but is willing to explore what in his psyche compelled him to commit cold-blooded murder. Throughout their encounter, Piers draws fascinating psychological revelations from Bernard Giles at every turn. Giles acknowledges that even as a teenager, he knew he was destined to kill and admits that he first experienced the nascent thrill of sexual violence as a 6 year old boy, when playing a game with his female next door neighbour.', 85471, 1, 1889577, 129895, '2019-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1889578, 'Episode 2', 'An interview with American killer Paris Bennett, who in 2007, at the age of 13, stabbed his four-year-old sister to death as an act of revenge against his mother Piers Morgan ventures behind bars to talk to diagnosed psychopath Paris Bennett about what drove him to murder his four-year-old sister.', 85471, 2, 1889578, 129895, '2019-06-27');
