INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1660175, 'Episode 1', 'After reconnecting with a hugely successful friend at a wedding, struggling DJ Charlie receives an unexpected job offer.', 85486, 1, 1660175, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727740, 'Episode 2', 'Charlie''s new gig gets off to a rocky start when he and Gabrielle tag along with her parents to a party full of music industry bigwigs.', 85486, 2, 1727740, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727741, 'Episode 3', 'While her mom holes up in the studio with Layla Valentine, Gabrielle heads to her first day of school and quickly starts racking up enemies.', 85486, 3, 1727741, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727742, 'Episode 4', 'David surprises Sara with a romantic getaway, Charlie takes a shot at remixing his hit song, and Gabs sneaks out to meet Hunter.', 85486, 4, 1727742, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727743, 'Episode 5', 'During a day out with Gabs, David juggles mounting career worries and a parenting first. A nervous Charlie heads to the studio to record with Sara.', 85486, 5, 1727743, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727744, 'Episode 6', 'At the Latitude Festival, Sara''s determined to spend time with her daughter, but Gabs and Hunter have other plans. Charlie takes Astrid on a date.', 85486, 6, 1727744, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727745, 'Episode 7', 'In sunny Ibiza, Charlie puts his friendships and career on the line when he gets caught up in the party scene and slips back into old habits.', 85486, 7, 1727745, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1727746, 'Episode 8', 'A wild night and a romantic gesture stir up drama as everyone gathers for a life-changing weekend in Ibiza.', 85486, 8, 1727746, 115458, '2019-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1660295, 'Let the Titan Games Begin: Trial 1', 'Six contenders test their strength and fortitude as they compete to dethrone a reigning Titan.', 85487, 1, 1660295, 115461, '2019-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1666700, 'The Titan Games: Trials 2', 'Six contenders test their strength and fortitude as they compete to dethrone a reigning Titan. Dwayne Johnson hosts.', 85487, 2, 1666700, 115461, '2019-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1675986, 'The Titan Games: Trials 3', 'Six contenders test their strength and fortitude as they compete to dethrone a reigning Titan. Dwayne Johnson hosts.', 85487, 3, 1675986, 115461, '2019-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1700198, 'The Titan Games Trials 4', 'Six contenders test their strength and fortitude as they compete to dethrone a reigning Titan. Dwayne Johnson hosts.', 85487, 4, 1700198, 115461, '2019-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1700202, 'The Titan Games Trials 5', 'Competitors are pushed to the limit in unforgiving head-to-head challenges set up by Dwayne Johnson, with winners advancing to the ultimate challenge of Mt. Olympus. Male and female competitors who conquer Mt. Olympus become Titans, who return later.', 85487, 5, 1700202, 115461, '2019-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1700203, 'The Titan Games Trials 6', 'Competitors are pushed to the limit in unforgiving head-to-head challenges set up by Dwayne Johnson, with winners advancing to the ultimate challenge of Mt. Olympus. Male and female competitors who conquer Mt. Olympus become Titans, who return later.', 85487, 6, 1700203, 115461, '2019-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718533, 'The Titan Games Trials 7', 'Dwayne Johnson invites new competitors to test themselves on the most insane physical challenges ever devised -- including one challenge 30 feet above the ground -- in hopes of reaching Mount Olympus for the chance to become a Titan.', 85487, 7, 1718533, 115461, '2019-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718534, 'The Battle of the Titans', 'The remaining 16 elite Titans go head to head in battles set up by host Dwayne Johnson. The winners advance to the final test on Mt. Olympus for a chance to become a Titan Champion.', 85487, 8, 1718534, 115461, '2019-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718535, 'The Titan Games Championship', 'The field of 64 athletes has been narrowed down to eight elite Titans, who compete on Mount Olympus to determine the one man and one woman who will become the ultimate Titans.', 85487, 9, 1718535, 115461, '2019-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1660330, 'Episode 1', 'The life of Anemone Leduc is about to switch. In the same day, she is diagnosed with early Alzheimer''s disease and has to deal with the arrival of the new director of the funeral home, where she works as a toathaler.', 85490, 1, 1660330, 115464, '2019-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1663483, 'Episode 2', 'Still in shock of her diagnosis of early Alzheimer''s, Anemone reflects on how she will inform her children. All her children?', 85490, 2, 1663483, 115464, '2019-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1682330, 'Episode 3', 'Anemone organizes a family dinner in order to announce her diagnosis to her children. Sophie gets closer to Naëlle, Simon''s wife.', 85490, 3, 1682330, 115464, '2019-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1682331, 'Episode 4', 'Anemone doesn''t intend to find her first children as long as she does not know if the disease is hereditary. Simon wants to make things clear with his client Sophie, who takes the opportunity to make shocking revelations about the past of his father, Claudio (Manuel Tadros).', 85490, 4, 1682331, 115464, '2019-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674320, 'I Like What I Like', 'Nakamura is in the aftermath of the fight with her mother, and in a weird place with Yoshida and Damien, when her brother returns the VHS copy of Emerjason she lent him.', 85517, 7, 1674320, 115524, '2019-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1682332, 'Episode 5', 'Olivia is very troubled by the remains of a teenager who committed suicide and on whom Anémone and Vincent work. Vincent reveals to Anémone a drama that occurred in his childhood. Maryse decides to shed light with the latter about his mysterious notebook.', 85490, 5, 1682332, 115464, '2019-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1697665, 'Episode 6', 'Anémone still doesn,t know if her illness is hereditary, but Lise still tries to convince her to trace her children with the help of a private investigator. Olivia prepares with her mother the ceremony for the exhibition of the body of Lucius, and the last wishes of the deceased challenge him disturbingly.', 85490, 6, 1697665, 115464, '2019-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1697666, 'Episode 7', 'Anémone goes alone to her appointment with the neurologist and receives the result of her genetic test to know if the disease that consumes her memory is hereditary or not. She then announces it to her children Karla, Simon and Olivia.', 85490, 7, 1697666, 115464, '2019-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1709119, 'Episode 8', 'Lise continues to insist that Anémone call on a private investigator to find her first children. Simon receives text messages from his ex that he hides from Naëlle.', 85490, 8, 1709119, 115464, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1712436, 'Episode 9', 'Anémone meets the private detective recommended by Lise and also commemorates the anniversary of Claudio''s death with Émilien. Jean-Olivier continues to attend Eve to the chagrin of Benjamin. Caroline convinces Jean-Olivier to talk to Ron about taking his prints.', 85490, 9, 1712436, 115464, '2019-03-04');
