INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674315, 'Toraiger Lady', 'Nakamura''s mother comes into town which terrifies her, but later runs in the Toraiger lady from the train at a live show.', 85517, 2, 1674315, 115524, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674316, 'Additional Warrior', 'Nakamura and Yoshida gush over the new hero on Jyushouwan when Nakamura gets the idea to recruit one of her coworkers into being a tokusatsu fan.', 85517, 3, 1674316, 115524, '2019-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674317, 'An Otaku''s Feelings', 'After Nakamura reveals her Bee Boys secret, Kitashiro reflects on a fight she had with a friend six months prior.', 85517, 4, 1674317, 115524, '2019-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674318, 'Time at the Sea', 'Nakamura learns of a special DVD included with the TV Kids Magazine. Later, she and her fellow otaku head to the beach for a photo shoot.', 85517, 5, 1674318, 115524, '2019-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1674319, 'Feelings of a Mother', 'Nakamura and Damien make plans to meet up to see the Jyushouwan movie with Yoshida; Nakamura gets news from her brother that their mom is going to drop by her apartment for New Years.', 85517, 6, 1674319, 115524, '2019-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1661558, 'Pilot', '13-year-old Chase Dreams becomes a famous singer overnight; meanwhile, his two older siblings, Brooke and Cary, do not.', 85519, 1, 1661558, 115527, '2019-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1693741, 'Chase Goes to a Premiere', 'Chase, now a social media influencer, is invited to attend the movie premiere for "When in Gnome"; Brooke and Cary, who are not influencers of any kind, tag along.', 85519, 2, 1693741, 115527, '2019-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1699788, 'Chase Gets a Girlfriend', 'Chase collaborates with another up-and-coming singer, forcing Brooke and Cary to confront their own relationships.', 85519, 3, 1699788, 115527, '2019-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1699790, 'Chase Gets the Gays', 'Chase releases a beautiful, socially progressive music video that is very much about Cary; Brooke begins her new life as her little brother''s personal assistant.', 85519, 4, 1699790, 115527, '2019-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1699792, 'Chase Goes to a High School Dance', 'Chase goes to a school dance with a fan; Brooke and Cary accompany him and try to have the high school experiences they never had as teens.', 85519, 5, 1699792, 115527, '2019-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1717708, 'Chase Shoots a Music Video', 'Chase shoots a new music video that is borderline disgusting; Brooke confronts her past as a professional dancer; and Cary takes a big swing and debuts a new look to advance his career.', 85519, 6, 1717708, 115527, '2019-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1717709, 'Chase Gets a Nosebleed', 'Brooke finds that it''s hard to date with a famous brother; Cary tries to befriend a group of Instagays to help his chances of getting a part in a new Ryan Murphy miniseries.', 85519, 7, 1717709, 115527, '2019-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1717714, 'Chase Turns Fourteen', 'Streeter throws Chase a 14th birthday party at a wildly inappropriate club; Brooke and Cary each reconnect with a guy from their past; Pat takes molly with a girl named Mona.', 85519, 8, 1717714, 115527, '2019-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1734826, 'Chase Drops His First Album', 'Chase throws an album release party on a plane, and a devastating family secret is accidentally exposed on the live stream.', 85519, 9, 1734826, 115527, '2019-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1734827, 'Chase Performs at the VMAs', 'Chase performs live for the first time ever, and Brooke and Cary get life-changing news.', 85519, 10, 1734827, 115527, '2019-03-28');
