INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1662783, 'The Politician''s Son', 'DC Rob Brady and Trainee DC Billie Fitzgerald respond to a gruesome scene: a man found stabbed multiple times and left hanging from a tree. DS Vivienne Cole expects to lead the investigation but is shocked when DI David Bradford takes over, as he has been on leave since the disappearance of his wife.', 85547, 1, 1662783, 115604, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718659, 'Stag Night', 'A groom is killed at his bachelor party, and the man who reports the crime is the ex-husband of the bride. The detectives race to find the missing 18-year-old best man, who may have been the killer or another victim.', 85547, 2, 1718659, 115604, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718660, 'Blood Lines', 'A man is found murdered on his houseboat, but the woman who alerted police has fled the scene. When Vivienne and Billie question the victim''s widow, they discover he was having an affair with his best friend''s wife.', 85547, 3, 1718660, 115604, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718661, 'Sex Games', 'When the body of a woman turns up by the river, the detectives track a suspect through a dating site, only to find he may have shot himself. While Rob and Vivienne disagree about whether it was a murder-suicide, Billie worries about Amber, a witness in another case.', 85547, 4, 1718661, 115604, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1718662, 'Connected', 'With Billie stabbed and her attacker on the loose, Vivienne blames herself for not recognizing that Billie was in danger. As the team scrambles to track down Amber, they discover that there''s more to her than meets the eye.', 85547, 5, 1718662, 115604, '2019-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1853073, 'The Dark', 'Construction workers find the remains of a young man who appears to have died more than a year ago, but his sister claims he''s been sending her postcards all the while.', 85547, 1, 1853073, 127805, '2019-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1663640, 'Episode 33', '', 85593, 33, 1663640, 115676, '2019-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1663641, 'Episode 34', '', 85593, 34, 1663641, 115676, '2019-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1853074, 'The Ultimate Price', 'When an eight-year-old boy finds his grandfather dead in a pub basement, he tells Rob that he was hit by a man with a baseball bat, but Vivienne doubts his story.', 85547, 2, 1853074, 127805, '2019-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1853075, 'Family Affairs', 'While the team looks into the murder of a Portuguese au pair who was recently fired from her job, Vivienne and Rob start investigating David on the sly.', 85547, 3, 1853075, 127805, '2019-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1853076, 'Turf Wars', 'When a father and son are shot execution-style in broad daylight, the detectives immediately suspect a gangland hit and worry the violence could escalate.', 85547, 4, 1853076, 127805, '2019-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1853077, 'Captive', 'In exchange for turning a blind eye, Adrian gives Rob a tip about Sarah. Now believing that Sarah may still be alive, David and his team race to her find her.', 85547, 5, 1853077, 127805, '2019-07-15');
