INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664114, 'A video about Bum Bag Travel', 'Global travel with nothing but a bum bag - Video 1/ Introduction.', 85618, 1, 1664114, 115808, '2017-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664281, 'A Lesson, Transition & Obsession', 'Global travel with nothing but a bum bag - Video 2/ Why I decided to travel without a backpack.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664284, 'The Advantages to Carrying Less', 'Global travel with nothing but a bum bag - Video 3/ 14 Reasons to Travel Without Luggage.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664286, 'The Disadvantages to Carrying Less', 'Global travel with nothing but a bum bag - Video 4/ The complications to travelling without luggage.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664288, 'The Long-Term Personal Impact of Minimalism', 'Global travel with nothing but a bum bag - Video 5/ The personal effects of travelling without luggage.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664289, 'Bum Bag Travel for Women', 'Global travel with nothing but a bum bag - Video 6/ Ultralight packing differences for men & women.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1681872, 'Steps to Becoming a Minimalist Traveller', 'Global travel with nothing but a bum bag - Video 7/ The barriers before travelling without a backpack.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664188, 'Whales & Dolphins', 'Marine wildlife programme. Hugh Fearnley-Whittingstall and the team find out where to meet the UK''s dolphins and whales.', 85624, 1, 1664188, 115821, '2015-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664189, 'Sharks', 'Marine wildlife programme. Hugh and the team celebrate sharks. During summer over 30 species are found in the UK - including blue sharks, smoothhounds and basking sharks.', 85624, 2, 1664189, 115821, '2015-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664190, 'Seabirds', 'Marine wildlife programme. Hugh looks at seabirds. From gannets to guillemots, puffins to storm petrels - eight million seabirds descend on the UK coast every summer.', 85624, 3, 1664190, 115821, '2015-08-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333904, 'Episode 7', '', 70452, 7, 1333904, 85559, '2017-07-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664191, 'Seashore', 'Marine wildlife programme. Hugh and the team focus on the UK''s seashore, from seahorses to hermit crabs, otters to oysters and limpets to jellyfish.', 85624, 4, 1664191, 115821, '2015-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664192, 'Seals', 'Marine wildlife programme. Hugh and the team focus on the UK''s grey and common seals. This archipelago is home to one of the most significant seal populations in the world.', 85624, 5, 1664192, 115821, '2015-08-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664197, 'Britain''s Whales', 'Part one of a two part rollercoaster adventure, in which Ben Fogle and Ellie Harrison go in search of Britain’s whales and sharks. More than 25 kinds of whales and dolphins and over 30 different sharks either visit or live our waters. Prepare to see Britain’s waters like you’ve never seen it before.', 85625, 1, 1664197, 115822, '2016-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664198, 'Britain’s Sharks', 'Britain’s Sharks is a ground breaking, intimate adventure which captures unique scenes of the biggest gathering of sharks every seen in British waters.  The program profiles 6 of Britain’s sharks, and introduces the viewer to some of our more exotic visitors like leatherback turtles to swordfish.', 85625, 2, 1664198, 115822, '2016-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664205, 'Episode 1', 'Nadiya Hussain visits her family village near Sylhet in the north east of the Bangladesh. Using local produce and techniques she shares her favourite recipes, including baked fish with green mango chutney and a halva called thoosha shinni. As she cooks she reveals the roots of Bangladeshi cuisine.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664206, 'Episode 2', 'Nadiya has just spent a week with her family in Sylhet, and in this episode, she is setting off on her own to cook her way around Bangladesh and learn more about the country, its people and its food.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664212, 'Miranda Hart', 'Bear Grylls takes comedy writer and actress Miranda Hart on a once-in-a-lifetime expedition to the spectacular Swiss Alps.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664213, 'Jonathan Ross', 'Bear Grylls helps Jonathan Ross to discover his inner Tarzan on a once-in-a-lifetime expedition to the magnificent rainforests on the volcanic island of La Palma, one of the least-known of the Canaries.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664214, 'Stephen Fry', 'Bear Grylls pushes Stephen Fry to his limits with a series of incredible challenges on a once-in-a-lifetime expedition to one of the most spectacular mountain ranges in Europe.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664215, 'Ben Stiller', 'Survivalist Bear Grylls is partnered with actor and director Ben Stiller for a 48-hour, action-filled trek, pushing them to the limit both physically and mentally. Bear is keen to find out whether Ben, who has braved his share of stunts in films such as Zoolander and Tropic Thunder, can handle a trip into the wilds of Scotland. The expedition begins on the shores of Loch Harport on the Isle of Skye and as it progresses, the two must rope themselves together to scramble up and over a ragged set of rock cliffs, seek shelter, descend into the darkness of a vast cave to find a pool of fresh water, use an ascender - a combination of rope and hardware - to pull themselves straight up a sheer wall, and leap 40ft off a cliff into the North Atlantic, before finally swimming to a seaplane to climb on board', 85630, 4, 1664215, 115827, '2014-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664241, 'Part 1: Golden', 'The Blacksmith Ilmari promises the golden lady to bring back to life her late wife. Jouko, a young rebel, flees the battle with the grandmaster Väinö and has to forfeit the life of his sister Aino for his cowardice. Väinö leaves to wake up the daughter of Pohjola.', 85631, 1, 1664241, 115831, '1982-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664251, 'Part 2: Sampo', 'Pohjola''s wife promises her daughter if Väinö brings her money for a shot by Sampo. Väinö asks Ilmari to build Sampo, but begins to make a boat requested by her daughter. Thirdly, Lemminki, who gets to shoot Hiie''s deer, emerges as a suicide. After many failures, Ilmari completes Sampo, and Pohjola is preparing for the wedding. Lemminki is out of the way by giving him the task of shooting a swan from the stream of Tuonela.', 85631, 2, 1664251, 115831, '1982-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664253, 'Part 3: Lemminki', 'The third episode of the Iron Age tells the story of Lemminki. The adventurer does not enjoy at home but leaves for a kiosk trip to Pohjola. With the stream of Hell, he is shot, but the mother takes the body home. After awakening, the jealous Lemminki returns to the northern part of the wedding and kills its host. He escapes by sea to care for the Virgin of the Island, but has to slip away from the island''s angry men after returning home. In the meantime, the men of the North have burned the house of Lemminki, and he leaves for a retreat.', 85631, 3, 1664253, 115831, '1982-03-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333905, 'Episode 8', '', 70452, 8, 1333905, 85559, '2017-07-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664254, 'Part 4: Long Winter', 'Old and tired Väinö, according to Ilmar, attracts a robbery trip to reclaim Sampo. The people of Pohjola leave behind, and to avoid the massacre, Väinö tells us to sink Sampo into the sea. When they return home the men find the bear and the moose on the island. The knocked self-esteem is shrouded in bear bearings, where the bear and the man eventually change positions. At the end, Väinö and Ilmari will subscribe to their lives for today''s listeners. Lemminki tells about his robbery trip to Sigtuna.', 85631, 4, 1664254, 115831, '1982-04-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664247, 'Episode 1', 'Documentary series following life at the Big Cat Sanctuary in Kent, where Giles Clark wants to develop a centre of global excellence for big cat conservation.', 85635, 1, 1664247, 115835, '2018-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664248, 'Episode 2', 'Documentary series. Maya the jaguar is now a boisterous toddler and pushes the Clark family over the edge. Giles visits Costa Rica to find out what is happening to jaguars.', 85635, 2, 1664248, 115835, '2018-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664249, 'Episode 3', 'Documentary series. Maya is ten weeks old and is starting to push the family to their limits. Giles is invited to take her on BBC Breakfast.', 85635, 3, 1664249, 115835, '2018-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664252, 'Episode 1', 'BBC security correspondent Frank Gardner and explorer Benedict Allen journey through Papua New Guinea, to fulfil Frank''s lifelong dream of seeing birds of paradise.', 85637, 1, 1664252, 115837, '2017-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664255, 'Episode 2', 'BBC security correspondent Frank Gardner and explorer Benedict Allen journey through Papua New Guinea. As Frank gets close to realising his dream, old injuries return to haunt him.', 85637, 2, 1664255, 115837, '2017-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664383, 'Emergence (1982 – 1983)', 'In 1982, two families, the Sanders and the Landrys, are badly shaken when they learn that a mysterious deadly disease called AIDS is threatening the blood system. Each has boys with hemophilia, a genetic condition that means they depend on blood products to live. The medical community struggles to understand the growing epidemic while others deny the urgency.', 85647, 1, 1664383, 115853, '2019-01-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664384, 'Contraction (1983 - 1984)', 'With his son''s life hanging in the balance, Will Sanders desperately fights to get those in charge of blood safety to heed the danger. The Landry''s struggle to keep their family together after their son, Peter, distraught that he is likely infected with AIDS, leaves home. Dr. Christos Tsoukas publishes results of a study that suggests fifty percent of all hemophiliacs in Canada are HIV positive.', 85647, 2, 1664384, 115853, '2019-01-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664385, 'Heat-Treatment (1984 - 1985)', 'In 1985, Will Sanders questions why the Red Cross may still be distributing tainted blood when safe heat-treated product is available. Margaret Sanders battles the prejudice surrounding AIDS. Lawrence Hartley and Paul Kirpatrick, both infected hemophiliacs, lead the charge for victims, while waiting on HIV test results for their wives. Peter Landry spirals out of control to Ben and Alice''s dismay.', 85647, 3, 1664385, 115853, '2019-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1689240, 'Unsafe (1985 - 1988)', 'In 1987, hemophiliacs untouched by AIDS believe blood products are safe. But one company''s heat-treating process proves flawed and seven more people, five of them children, are infected. Brash and outspoken hemophiliac, Jim Krepke joins the fight. Will has a victory while Ben seeks direction. Alice and Peter try to pull themselves together.', 85647, 4, 1689240, 115853, '2019-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1689241, 'Compensation (1988 - 1993)', 'Over the early 90''s, victims of tainted blood begin to come forward and pressure the government with lawsuits. With Margaret''s help, the Hemophilia Society works tirelessly behind the scenes for compensation. Lucky to avoid HIV, Ryan Sanders suffers through the side-effects of treatment for Hepatitis C. Peter meets Darby and despite his HIV, they fall in love. Having finished the archival history, Ben starts work on a more personal book but it causes further rift between him and Peter.', 85647, 5, 1689241, 115853, '2019-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1689242, 'Krever (1993 - 1996)', 'In 1994, Justice Horace Krever is appointed to lead an inquiry into the tainted blood scandal. Shocking revelations and heart wrenching testimony are laid bare as he digs for the truth. Estranged from his family, Ben''s quest for revenge is galvanized, as victims around him continue to die. Krever is halted when those he intends to accuse of misconduct take him to court.', 85647, 6, 1689242, 115853, '2019-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1698208, 'Intent (1997 - 2005)', 'The supreme court rules in favor of Krever and his report finally comes out. It names many for wrongdoing and aims to rebuild the flawed blood system in Canada. While victims still suffer and loved ones mourn the dead, at least many feel that their voices were heard and those responsible were held accountable. But Ben is not satisfied and pushes for criminal charges.', 85647, 7, 1698208, 115853, '2019-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1705547, 'Apologies (2005 - 2015)', 'As the criminal trial falls apart, Ben considers taking matters into his own hands. Peter and Ryan both struggle with illness while forging families of their own. In 2015, both of their lives hang in the balance as the tragedy finally threatens to catch up to them.', 85647, 8, 1705547, 115853, '2019-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1664419, 'Episodes 01', 'Jiang Li ran away on the day of her wedding, only to end up being stabbed. An angel appears before her spirit and informs her that she has seven days to discover who attempted to murder her. With her past memories a blur after University, she sets out to figure out the culprit as she delves into the past. Apparently not everything she believes was as it seem.', 85651, 1, 1664419, 115858, '2015-02-02');
