INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008917, 'Children in Need: Born Again', 'The newly-regenerated Doctor explains to a disbelieving Rose that he has regenerated.', 57243, 1, 1008917, 58476, '2005-11-18');
