INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969304, 'The Attack of the Graske', 'A special interactive adventure that BBC viewers were able to access by pressing their red button on the remote control.', 57243, 3, 969304, 58476, '2005-12-25');
