INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008921, 'The Infinite Quest', 'Location: The Infinite, Boukon, Volag-Noc, Myarr, Pheros
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008553, 'Children in Need: Time Crash', 'Location: TARDIS
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008923, 'Voyage of the Damned', 'Location: The Titanic Cruise Liner, Earth
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008924, 'Proms Special: Music of the Spheres', 'The TARDIS is breeched by a Graske, who has come to “warn” the Doctor of a space portal opening up in the TARDIS. When the Doctor goes to look, he finds himself the entertainment of the real life BBC Proms, but the troublesome Graske has ideas of his own...', 57243, 8, 1008924, 58476, '2008-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008925, 'The Next Doctor', 'Location: London, England
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008926, 'Christmas Moments', 'A look back at the best moments from the Doctor''s festive adventures.', 57243, 10, 1008926, 58476, '2008-12-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008927, 'Doctor Who at the Proms', 'A family concert featuring music from the BBC''s Doctor Who series, and including a specially filmed scene, written by Russell T Davies and starring David Tennant.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008552, 'Planet of the Dead', 'Location: London, Earth San Helios
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008930, 'The Waters of Mars', 'Location: Bowie Base One, Mars
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008931, 'Dreamland', 'Location: Roswell, New Mexico & Area 51
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008554, 'The End of Time - Part One', 'Location: London, Earth
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008933, 'The End of Time - Part Two', 'Location: London, Earth
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008935, 'Tardisode 01: New Earth', 'Novice Hame, one of the feline nurses working at the hospital on New Earth, presents a promotional video for the infirmary, claiming the staff can cure any disease. She welcomes the audience to come to the hospital before pointing out one of the hospital’s current patients, who has a terminal illness known as Autras Disease.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008936, 'Tardisode 02: Tooth And Claw', 'An alien pod hurtles through space, heading for Earth. It crash-lands in a ball of flame somewhere in the Scottish Highlands, apparently unseen. Three hundred years later a man walks alone amongst the unchanged landscape, followed by the unsettling growl of a beast. He looks around for the source of the noise but sees nothing, and so continues on his way. A moment later the noise sounds again and he looks back over his shoulder a second time. On this occasion he sees the creature following him and runs for his life. However, he is unable to escape. The giant beast pounces and drags him to the ground…', 57243, 20, 1008936, 58476, '2006-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008937, 'Tardisode 03: School Reunion', 'Mickey sits alone in a café, clicking frantically on his laptop computer. He flicks through dozens of pictures showing mysterious UFOs but these mean nothing to him, he needs something bigger.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008938, 'Tardisode 04: The Girl In The Fireplace', 'On a spaceship deep in space one of the observation crew is taken by surprise when an ion storm erupts nearby. She calls out a warning to the rest of the crew but it is too late; the impact rocks the ship and the computer panels begin to overload in a shower of sparks. She calls out a mayday signal but there is nobody left to hear it.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008949, 'Children in Need: A TARDIS Tea Party', 'Matt and Karen introduce us to 2 boys who have benefited from money raised by Children In Need and have tea in the Tardis with them. This also includes a preview of the Doctor Who Christmas episode "A Christmas Carol".', 57243, 33, 1008949, 58476, '2010-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008939, 'Tardisode 05: Rise of the Cybermen', 'On a computer screen; a message has been received by a group known as ‘The Preachers’ from another figure known as ‘Gemini’. It details that the subject of the report is John Lumic, founder of Cybus Industries (est. 1982).
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008940, 'Tardisode 06: The Age Of Steel', 'A report issued from John Lumic to every continent on the planet orders all cyber factories across the Earth to begin production, the “ultimate upgrade” is about to reach maximum velocity.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008941, 'Tardisode 07: The Idiot''s Lantern', 'In an ordinary 1950’s household a deliveryman uncovers a brand new state of the art television set to an excited old woman.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008942, 'Tardisode 08: The Impossible Planet', 'In a shining white office an official-looking woman consults a man called Captain Walker, explaining a planet has been located holding a powerful power-source capable of preventing the world from being sucked into a black hole. If he has go and retrieve it he will have saved the empire.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008943, 'Tardisode 09: The Satan Pit', 'One of the Ood passes a member of the sanctuary base a box of possessions belonging to the late Captain Walker. He takes them and seals the box but reopens it when the lights dim and the computers begin to claim that “he shall awake”.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008944, 'Tardisode 10: Love And Monsters', 'A heavy-breathing man holding a cane sits in a high-backed chair staring at a laptop before him. As he drums his fingers on the smooth surface of the device he stares at the website it displays; an appeal from an organization called L.I.N.D.A asking for information on a man called the Doctor.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008945, 'Tardisode 11: Fear Her', 'In an ‘ordinary’ London street a reporter for a television called “Crime Crackers” tells his viewers that things are amiss in suburbia. Two children have gone missing from their own homes and the police do not know where they have gone or why they were taken.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008946, 'Tardisode 12: Army Of Ghosts', 'In a newspaper office a young male reporter tells his editor he can get her the biggest story of the century, the story of Torchwood. She tells him to find it for her and soon he is on the streets communicating with secret contacts who provide him with evidence to back up his suspicions of an organisation stretching back to the time of Queen Victoria.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008947, 'Tardisode 13: Doomsday', 'A newsreader sitting at her desk in a TV studio delivers an emergency broadcast. The country is under attack and the government have declared it a state of emergency.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008948, 'Doctor Who at the Proms (2010)', 'Doctor Who returns to the Proms with a new show hosted by stars Karen Gillan and Arthur Darvill, featuring Murray Gold''s music, behind-the-scenes access and a host of monsters.', 57243, 32, 1008948, 58476, '2010-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333907, 'Episode 9', '', 70452, 9, 1333907, 85559, '2017-07-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008950, 'A Christmas Carol', 'Amy and Rory are trapped on a crashing space liner, and the only way The Doctor can rescue them is to save the soul of a lonely old miser. But is Kazran Sardick, the richest man in Sardicktown, beyond redemption? And what is lurking in the fogs of Christmas Eve?', 57243, 34, 1008950, 58476, '2010-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008951, 'Space (1)', 'A special two-part mini episode with the Doctor, Amy and Rory in danger aboard the TARDIS.', 57243, 35, 1008951, 58476, '2011-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008952, 'Time (2)', 'A special two-part mini episode with the Doctor, Amy and Rory in danger aboard the TARDIS.', 57243, 36, 1008952, 58476, '2011-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008953, 'Best of the Doctor', 'Matt Smith reviews his best moments; Celebrity fans share their favorite moments.', 57243, 37, 1008953, 58476, '2011-08-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008954, 'Death is the Only Answer', 'Dr Who mini episode written by Oakley Junior School students.', 57243, 38, 1008954, 58476, '2011-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008955, 'Best of the Monsters', 'An in depth look at Iconic monsters from the series, As reflected on by guest stars from the last 2 seasons', 57243, 39, 1008955, 58476, '2011-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008956, 'Best of the Companions', 'Highlighted moments featuring Amy, Rory and River Song.', 57243, 40, 1008956, 58476, '2011-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008957, 'Doctor Who: A Celebration Concert', 'A musical odyssey through time and space with highlights and background footage from the Doctor Who - A Celebration concert at the Wales Millennium Centre in November 2006. Hosted by David Tennant, artists include the BBC National Orchestra and Chorus of Wales under the baton of Ben Foster, Oods, Daleks and Cybermen. The programme has insights into the musical soundtrack from composer Murray Gold, Doctor Who head writer Russell T Davies and executive producer Julie Gardner.', 57243, 41, 1008957, 58476, '2007-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008958, 'The Impossible Astronaut Prequel', 'The new series of Doctor Who begins at Easter with The Impossible Astronaut. But before that we have a short scene written by Steven Moffat that reveals a little of what we can expect from the adventure … and what the Doctor will be facing!', 57243, 42, 1008958, 58476, '2011-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008959, 'The Curse of the Black Spot Prequel', 'The next episode of Doctor Who is a scary, action-packed adventure called The Curse of the Black Spot. It''s on BBC ONE on Saturday, 7 May at 6.15pm but you can watch the spine-chilling Prequel to the story right now...', 57243, 43, 1008959, 58476, '2011-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008960, 'A Good Man Goes to War Prequel', 'As the Doctor prepares to face his darkest hour, key players conspire and a grim warning is given… Please note, we strongly recommend watching The Almost People before enjoying the Prequel.', 57243, 44, 1008960, 58476, '2011-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008961, 'Let''s Kill Hitler Prequel', 'The adventure continues in this brilliant Prequel written by Steven Moffat… The battle of Demon''s Run has been fought. Now return to the TARDIS to discover a little of what happened next!', 57243, 45, 1008961, 58476, '2011-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008962, 'The Wedding of River Song Prequel', 'Before the Doctor returns to Lake Silencio, we return to Area 52…', 57243, 46, 1008962, 58476, '2011-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008963, 'The Doctor, the Widow and the Wardrobe', 'The story is set during World War II and is about a family of Blitz refugees, Madge Arwell and her two children, Lily and Cyril, who have to relocate to Dorset, where they meet the Doctor.', 57243, 47, 1008963, 58476, '2012-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008964, 'Children in Need: The Doctor''s Clothes', 'Bid for the Doctor''s clothes at http://www.bbc.co.uk/pudsey', 57243, 48, 1008964, 58476, '2011-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008965, 'Best of the Christmas Specials', 'Hilights from the Christmas Specials. Reflections on the first 5 Christmas specials by celebrities, guest stars and fans.', 57243, 49, 1008965, 58476, '2011-12-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008966, 'The Doctor, the Widow and the Wardrobe Prequel', 'Watch an exclusive jaw-dropper prequel to the 2011 Christmas Special, written by Steven Moffat and starring Matt Smith.', 57243, 50, 1008966, 58476, '2011-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008967, 'Night and the Doctor: Bad Night', 'Amy wakes to answer the TARDIS phone, only to discover the Doctor desperate to deal with British royalty, a goldfish and a housefly.', 57243, 51, 1008967, 58476, '2011-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008968, 'Night and the Doctor: Good Night', 'Amy finally gets to ask the Doctor the question that has been plaguing her since DW: Space: how can she remember two distinct histories of her life since the universe was rebooted in DW: The Big Bang? The Doctor in part answers her question by giving her a chance to do a good deed for herself when she was a child.', 57243, 52, 1008968, 58476, '2011-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008969, 'Night and the Doctor: First Night', 'The Doctor arrives at Stormcage to pick up River Song on the evening of her imprisonment on twelve-thousand consecutive life sentences. It''s their "first date", but his plans are complicated when a future version of River turns up.', 57243, 53, 1008969, 58476, '2011-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008970, 'Night and the Doctor: Last Night', 'With no fewer than three River Songs from different times roaming the TARDIS, the Doctor has to avoid contaminating the timeline.', 57243, 54, 1008970, 58476, '2011-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008971, 'Night and the Doctor: Up All Night', 'Craig, Sophie and Alfie have a brief scene in which Craig discusses his fears of dealing with his son.', 57243, 55, 1008971, 58476, '2011-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008972, 'Good as Gold', 'An Olympic-themed mini-episode written by British schoolchildren.', 57243, 56, 1008972, 58476, '2012-05-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008973, 'The Science of Doctor Who', 'Like all great science fiction shows, there are kernels of truth and nuggets of science fact scattered throughout the incredible “Doctor Who” universe. In this special, we are going to explore these dynamic “Doctor Who” moments where science fiction and science fact converge and mingle.', 57243, 57, 1008973, 58476, '2012-08-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008974, 'The Women of Doctor Who', 'A special celebrating the women of the Doctor Who universe.', 57243, 58, 1008974, 58476, '2012-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008975, 'The Timey-Wimey of Doctor Who', 'A special exploring the mind-bending time-travels of the Doctor.', 57243, 59, 1008975, 58476, '2012-08-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008976, 'The Destinations of Doctor Who', 'A special visiting all the fabulous (and not-so-fabulous) locales of Doctor Who.', 57243, 60, 1008976, 58476, '2012-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008977, 'Pond Life (1)', 'Whilst the Ponds enjoy life at home, the Doctor has been having some unplanned adventures.', 57243, 61, 1008977, 58476, '2012-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008978, 'Pond Life (2)', 'The Doctor picks the wrong time to turn up unannounced.', 57243, 62, 1008978, 58476, '2012-08-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008979, 'Pond Life (3)', 'Rory stumbles upon an unexpected guest in his bathroom.', 57243, 63, 1008979, 58476, '2012-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008980, 'Pond Life (4)', 'Domestic life with the Ponds is never dull!', 57243, 64, 1008980, 58476, '2012-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008981, 'Pond Life (5)', 'The Doctor finally arrives at the Ponds House. But where are they?', 57243, 65, 1008981, 58476, '2012-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008982, 'The Snowmen', 'Christmas Eve, 1892, and the falling snow is the stuff of fairy tales. When the fairytale becomes a nightmare and a chilling menace threatens Earth, an unorthodox young governess, Clara, calls on the Doctor for help. But the Doctor is in mourning, reclusive and determined not to engage in the problems of the universe. As old friends return, will the Doctor really abandon humankind, or will he fight to save the world and Christmas from the icy clutches of this mysterious menace?', 57243, 66, 1008982, 58476, '2012-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008983, 'Meanwhile in the TARDIS (1)', 'On her first trip in the TARDIS, Amy questions the Eleventh Doctor on how the time machine works, why it takes the shape of a police box, and whether he is an alien. The Doctor answers most of her questions, and then opens the TARDIS doors to reveal that thy are in deep space. When Amy doesn''t believe what she is seeing, the Doctor pushes her though the doors.', 57243, 67, 1008983, 58476, '2010-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008984, 'Meanwhile in the TARDIS (2)', 'As Amy continues her attempts to seduce him, the Doctor explains to her true reason why he travels with a companion. She tricks him into asking the TARDIS to display visual records of previous inhabitants, before he decides to go find Rory at his bachelor party.', 57243, 68, 1008984, 58476, '2010-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008985, 'Asylum of the Daleks Prequel', 'The Doctor receives a message from a mysterious hooded stranger – a woman called Darla Von Karlsen wants to meet him...', 57243, 69, 1008985, 58476, '2012-09-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008986, 'The Making of the Gunslinger (A Town Called Mercy Prequel)', 'Civil war has ravaged the Kahler race, but a team of scientists has found an advantage. The Gunslinger is born.', 57243, 70, 1008986, 58476, '2012-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008987, 'The Last Day of the Ponds', 'Matt, Karen, Arthur and the team reflect on the Ponds’ era and their emotional farewell.', 57243, 71, 1008987, 58476, '2012-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008989, 'Doctor Who in America / Doctor Who in the U.S.', 'Behind the scenes with Doctor Who shooting in the U.S. Featuring interviews with Matt Smith and Karen Gillan plus Executive Producer and Lead Writer Steven Moffat.', 57243, 72, 1008989, 58476, '2011-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008990, 'The Great Detective (Children in Need)', 'Matt and Jenna introduce the Doctor Who Christmas Prequel, The Great Detective, in which Vastra, Jenny and Strax try to persuade the grumpy Doctor to engage again.', 57243, 74, 1008990, 58476, '2012-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008991, 'Doctor Who: P.S.', 'Find out what happened to Rory''s dad and the Ponds in this unshot scene by Chris Chibnall.', 57243, 75, 1008991, 58476, '2012-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314909, 'Doctor Who: Rewind - Trust your Doctor', 'Doctor Who: Rewind was a documentary co-produced by BBC America, BBC Worldwide and BBC Wales. It was essentially a recap of the story arc of series 5, with emphasis on the narrative points likely to recur in series 6. It debuted on BBCA immediately before their premiere of The Impossible Astronaut. It was a sequel of sorts to Doctor Who: The Ultimate Guide, a similar documentary made by many of the same BBCA crew.', 57243, 76, 1314909, 58476, '2011-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008993, 'Vastra Investigates: A Christmas Prequel', 'Madame Vastra, accompanied by her loyal companions Jenny Flint and Strax, is called upon to investigate a Victorian murder mystery. But where is the Doctor?', 57243, 77, 1008993, 58476, '2012-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008994, 'An Adventure in Space and Time', 'This special one-off drama travels back in time to 1963 to see how Doctor Who was first brought to the screen.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008995, 'The Bells of Saint John: A Prequel', 'The Doctor takes a break on Earth, despondent that he can''t find Clara.', 57243, 79, 1008995, 58476, '2013-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008996, 'The Battle of Demons Run: Two Days Later', 'In the aftermath of the Battle of Demons Run, a battled-scarred Strax lies dead on the floor — or has he just fainted...', 57243, 80, 1008996, 58476, '2013-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008997, 'National Television Awards Sketch 2011', 'Dermot O''Leary wakes up late for the National Television Awards. The Eleventh Doctor tries to take him there, but keeps ending up in the wrong place, meeting many famous people in places such as Walford, Weatherfield and the BBC Television Centre in 2111.', 57243, 81, 1008997, 58476, '2011-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009005, 'The Night of the Doctor', 'On the eve of his most terrible battle, the Time Lord is faced with a choice that will change the course of his life. The darkest of days are about to begin.', 57243, 82, 1009005, 58476, '2013-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008999, 'The Day of the Doctor', 'The Doctors embark on their greatest adventure in this 50th anniversary special. In 2013, something terrible is awakening in London''s National Gallery; in 1562, a murderous plot is afoot in Elizabethan England; and somewhere in space an ancient battle reaches its devastating conclusion. All of reality is at stake as the Doctor''s own dangerous past comes back to haunt him.', 57243, 83, 1008999, 58476, '2013-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009000, 'The Time of the Doctor', 'Orbiting a quiet backwater planet, the massed forces of the universe''s deadliest species gather, drawn to a mysterious message that echoes out to the stars. And amongst them, the Doctor. Rescuing Clara from a family Christmas dinner, the Time Lord and his best friend must learn what this enigmatic signal means for his own fate and that of the universe.', 57243, 84, 1009000, 58476, '2013-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009001, 'She Said, He Said (The Name of the Doctor Prequel)', 'The Doctor and Clara reflect on how little they know about each other.', 57243, 85, 1009001, 58476, '2013-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009002, 'Clarence and the Whispermen (The Name of the Doctor Prequel)', 'The Whispermen approach Clarence DeMarco in jail providing him with the coordinates to Trenzalore.', 57243, 86, 1009002, 58476, '2013-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009003, 'Doctor Who Live: The Next Doctor', 'The half-hour show, presented by Zoe Ball, will feature an interview with the new lead, as well as 11th Doctor Matt Smith and executive producer Steven Moffat.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009004, 'Doctor Who at the Proms 2013', 'The concert features the very best of Murray Gold’s scores for recent adventures as well as music from the eras of the early Doctors. Matt Smith and Jenna Coleman make special appearances and it’s great to see Madam Vastra and Strax back, hosting the Prom… In fact, any concert without a Sontaran and a Silurian will now seem relatively pedestrian!
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1008998, 'The Companions', 'As the Doctor’s newest companion, Clara Oswald, steps into the TARDIS, take a look back at previous companions that have won over the Doctor’s heart in Doctor Who: The Companions. Along the way, companions old and new talk about how the show has changed their lives, and how they''ve never quite managed to leave the TARDIS behind. Matt Smith and David Tennant are joined by fellow contributors including John Barrowman (Captain Jack), Arthur Darvill (Rory) and Noel Clarke (Mickey).', 57243, 89, 1008998, 58476, '2013-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009006, 'The Science of Doctor Who', 'For one night only, Professor Brian Cox takes an audience of celebrity guests, including Charles Dance and Rufus Hound, and members of the public on a journey into the wonderful universe of the Doctor, from the lecture hall of the Royal Institution of Great Britain. Drawing on the latest theories as well as 200 years of scientific discoveries and the genius of Einstein, Brian tries to answer the classic questions raised by the Doctor - can you really travel in time? Does extra-terrestrial life exist in our galaxy? And how do you build something as fantastical as the TARDIS?', 57243, 90, 1009006, 58476, '2013-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009027, 'The Doctors Revisited: The Eighth Doctor', 'Take a look back at how Paul McGann''s portrayal of the Eighth Doctor breathed new life into ''Doctor Who'' after it had been off the air for years.', 57243, 111, 1009027, 58476, '2013-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009028, 'The Doctors Revisited: The Ninth Doctor', '', 57243, 112, 1009028, 58476, '2013-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1106037, 'Season 9 Prologue', 'The Doctor visits the planet Karn, to discuss an old enemy...or is it an old friend?  ''and embarks on a course that could lead to his destruction....', 57243, 146, 1106037, 58476, '2015-09-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009007, 'The Ultimate Guide', 'Matt Smith and Jenna Coleman celebrate the 50th anniversary of the space-travelling Time Lord and take an in-depth look at of one of the most intriguing fictional characters of all time.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009008, 'The Afterparty', 'Zoe Ball and Rick Edwards are live, getting the party started for the ultimate celebration of 50 years of Doctor Who. With an impressive guest list of Doctors and companions both past and present, celebrity fans and some very special surprises, this is the afterparty not to be missed. As well as all the gossip on the new episode The Day of the Doctor, there are exclusive interviews, showstopping monster moments and plenty of fun. So make a date to celebrate with us and be a part of this time-travelling extravaganza as we say Happy Birthday Doctor Who.', 57243, 92, 1009008, 58476, '2013-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009009, 'The Last Day', 'First day on the front line? Time to attach a Headcam for a soldier''s point-of-view. What could possibly go wrong?', 57243, 93, 1009009, 58476, '2013-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009010, 'Doctor Who Explained', 'Everything you really need to know about the Doctor - current, future or past.', 57243, 94, 1009010, 58476, '2013-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009011, 'The Five(ish) Doctors Reboot', 'A star studded special written and directed by Peter Davison. With the 50th anniversary of Doctor Who about to film, the ''Classic'' Doctors are keen to be involved. But do they manage it?', 57243, 95, 1009011, 58476, '2013-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009012, 'The Day of the Doctor: Behind the Lens', 'As Doctor Who celebrates 50 years, we go behind the lens on the year''s most anticipated television drama. Voiced by the Sixth Doctor, Colin Baker, we catch up with old friends and meet some new ones. It''s a rollercoaster ride and a time to celebrate. Features Matt Smith, David Tennant and Jenna Coleman with Billie Piper and John Hurt, as well as lead writer and executive producer Steven Moffat, discussing their 50th Anniversary experiences.', 57243, 96, 1009012, 58476, '2013-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009013, 'Tales from the TARDIS', 'An all-new special, Doctor Who: Tales from the TARDIS, features the series’ actors and producers sharing their experiences and memories of the world’s longest-running sci-fi show. The special features exclusive interviews with principal cast members from the show’s 50-year history, including actors who have played the Doctor: Matt Smith, David Tennant, Tom Baker, and Peter Davison, actors who have played companions: Jenna Coleman, Karen Gillan, Freema Agyeman, and William Russell, as well as the current lead writer and executive producer Steven Moffat. The discussion includes how the actors got cast, how the roles changed their lives, how a ‘regeneration’ is recorded, and how filming the show in the 60′s compares to today.', 57243, 97, 1009013, 58476, '2013-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009014, 'Clara and the TARDIS', 'Clara Oswald gets into an argument with the TARDIS after the TARDIS plays a practical joke on her in the shower and then makes her bedroom disappear. After revealing to Clara that she is far from being the first girl the Doctor has "brought home", the TARDIS plays another trick on Clara that has her seeing double, and triple, and quadruple...', 57243, 98, 1009014, 58476, '2013-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009015, 'Rain Gods', 'The Doctor and River Song find themselves at the mercy of the natives of the planet of the Rain Gods, who mean to sacrifice them to their deities, until the Doctor calls upon the gods themselves to help them out of the fix', 57243, 99, 1009015, 58476, '2013-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009016, 'The Inforarium', 'The Inforarium — the greatest source of illicit information in recorded history — is compromised. The Doctor appears in a hologram — "Who the hell are you?". He tells a guard that he will be erasing all traces of himself from their database, making everyone forget what they''ve heard through means he''d adapted from the Silence. At the end of the message, the guard completely forgets the whole ordeal. Then it replays... "Who the hell are you?"', 57243, 100, 1009016, 58476, '2013-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009017, 'Farewell to Matt Smith', 'Bid the eleventh Doctor, Matt Smith, a fond farewell in this hour long retrospective documentary special about Doctor Who series five, six and seven – “the Matt Smith Years.” This compelling documentary, narrated by Alex Kingston (Doctor Who’s River Song), features highlights from Smith’s run with interview footage from the man himself, his cast-mates, writers, producers, guest stars and celebrity Whovians.', 57243, 101, 1009017, 58476, '2013-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009018, 'Tonight''s the Night', 'Jack Harkness enters the Doctor''s TARDIS and discovers a blue-headed alien who claims to be a regenerated Doctor. The alien gives the game away when Jack notices that he''s armed, something the real Doctor would never be. The alien identifies himself as Sao Til, a literal arms dealer who trades in limbs. Jack draws his gun and the two enter into a standoff before...', 57243, 102, 1009018, 58476, '2009-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009019, 'The Time of the Doctor: Behind the Lens', 'Behind the scenes look at the making of the 2013 Doctor Who Christmas Special.', 57243, 103, 1009019, 58476, '2013-12-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009020, 'The Doctors Revisited: The First Doctor', 'The Revisited team looks back at the adventures in time and space of the original Doctor Who, played by William Hartnell, with a first look at the TARDIS and the first appearance of the Daleks. Contributors include current show runner and lead writer, Stephen Moffat, tenth Doctor David Tennant, companion John Barrowman and executive producer Caroline Skinner.', 57243, 104, 1009020, 58476, '2013-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009021, 'The Doctors Revisited: The Second Doctor', 'In 1966, the Doctor Who production team decided to recast the show lead. The Revisited team looks back at the era of the new Doctor Who, played by Patrick Troughton, considering the impact of a new take on the character and the first appearance of the Cybermen. The regular contributors are joined by former companions Frazer Hines and Wendy Padbury.', 57243, 105, 1009021, 58476, '2013-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009022, 'The Doctors Revisited: The Third Doctor', 'A new decade, a new Doctor. And now in color! The Revisited team takes a nostalgic look back at the adventures of the third Doctor, played by Jon Pertwee, his role as scientific adviser to U.N.I.T., and the first appearance of the Master. Hugh Bonneville joins the regular contributors.', 57243, 106, 1009022, 58476, '2013-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009023, 'The Doctors Revisited: The Fourth Doctor', 'The Revisited team looks back to the era of the fourth, and longest serving, Doctor, played by Tom Baker, who brought a new and eccentric take on the Time Lord. Highlights include the first visit to the Doctor''s homeworld, Gallifrey, and the introduction of Davros, the creator of the Daleks. Show star Tom Baker and companion Louise Jameson join the regular contributors.', 57243, 107, 1009023, 58476, '2013-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009024, 'The Doctors Revisited: The Fifth Doctor', 'Take an in-depth look at the fifth incarnation of the timeless Time Lord, played by the youngest actor in the part until current Matt Smith.', 57243, 108, 1009024, 58476, '2013-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009025, 'The Doctors Revisited: The Sixth Doctor', 'Take a look back at the sixth and most eccentric incarnation of the Doctor yet!', 57243, 109, 1009025, 58476, '2013-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009026, 'The Doctors Revisited: The Seventh Doctor', 'Discover the many layers of Sylvester McCoy''s Seventh Doctor.', 57243, 110, 1009026, 58476, '2013-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941593, 'Episode 8', '', 57267, 8, 941593, 58481, '2013-08-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941594, 'Episode 9', '', 57267, 9, 941594, 58481, '2013-08-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009029, 'The Doctors Revisited: The Tenth Doctor', 'BBC AMERICA celebrates the Tenth Doctor, David Tennant, in a new special of Doctor Who: The Doctors Revisited. Tennant played the part from 2005 to 2010. The special begins with David Tennant, Freema Agyeman (companion Martha Jones), lead writer and executive producer Steven Moffat, among others, discussing how and why the Tenth Doctor has become one of the most popular Doctors of all time.', 57243, 113, 1009029, 58476, '2013-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009030, 'The Doctors Revisited: The Eleventh Doctor', 'The Eleventh Doctor, played by Matt Smith, arrived on screen lively, funny but wise. Join the Doctors Revisited as we examine the human side of this Doctor and take a look at how his 950 years have affected him. Featuring interviews with Matt Smith and Jenna Coleman, we take a look at the Doctor''s new companion Clara Oswald and catch a glimpse of the Doctor''s very frightening foe The Silence.', 57243, 114, 1009030, 58476, '2013-11-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009031, 'Greatest Monsters and Villains (1) - The Judoon', 'This episode features the Judoon from the episode Smith & Jones featuring the 10th Doctor and Martha Jones as the companion.', 57243, 115, 1009031, 58476, '2013-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009032, 'Greatest Monsters and Villains (2) - The Silurians', 'This episode features the Silurians from the episode A Good Man Goes to War featuring the 11th Doctor and Amy Pond/Rory Williams as the companions.', 57243, 116, 1009032, 58476, '2013-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009033, 'Greatest Monsters and Villains (3) - The Ood', 'This episode features the Ood from the episode Planet of the Ood featuring the 10th Doctor and Donna Noble as the companion.', 57243, 117, 1009033, 58476, '2013-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009034, 'Greatest Monsters and Villains (4) - The Clockwork Men', 'This episode features the Clockwork Men from the episode The Girl in the Fireplace featuring the 10th Doctor and Rose Tyler/Mickey Smith as the companions.', 57243, 118, 1009034, 58476, '2013-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009035, 'Greatest Monsters and Villains (5) - The Ice Warriors', 'This episode features the Ice Warriors from the episode Cold War featuring the 11th Doctor and Clara Oswald as the companion.', 57243, 119, 1009035, 58476, '2013-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009036, 'Greatest Monsters and Villains (6) - The Cybermen', 'This episode features the Cybermen from the episode The Next Doctor featuring the 10th Doctor and Jackson Lake as the companion.', 57243, 120, 1009036, 58476, '2013-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009037, 'Greatest Monsters and Villains (7) - The Silence', 'This episode features the Silence from the episodes The Impossible Astronaut & Day of the Moon featuring the 11th Doctor and Amy Pond/Rory Williams as the companions.', 57243, 121, 1009037, 58476, '2013-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009038, 'Greatest Monsters and Villains (8) - The Master', 'This episode features the Master from the episode Utopia featuring the 10th Doctor and Martha Jones/Captian Jack Harkness as the companions.', 57243, 122, 1009038, 58476, '2013-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009039, 'Greatest Monsters and Villains (9) - The Weeping Angels', 'This episode features the The Weeping Angels from the episode Blink featuring the 10th Doctor and Martha Jones as the companion.', 57243, 123, 1009039, 58476, '2013-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009040, 'Greatest Monsters and Villains (10) - The Daleks', 'This episode features the Daleks from the episode Dalek featuring the 9th Doctor and Rose Tyler as the companion.', 57243, 124, 1009040, 58476, '2013-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009041, 'The Ultimate Companion', 'Peter Davison recounts what it takes to be the ultimate companion. Meeting with cast and crew past and present, Peter travels the UK and the USA in search of the answers.', 57243, 125, 1009041, 58476, '2014-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009042, 'The Ultimate Time Lord', 'Peter Davison, the Fifth Doctor, meets the talented people and stars who have helped create the show both past, present and future, and asks ''Who is the Doctor? What makes him tick? What will make the Twelfth Doctor unique?', 57243, 126, 1009042, 58476, '2014-08-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009043, 'Earth Conquest', 'Doctor Who: Earth Conquest is a one-hour special following the stars Peter Capaldi and Jenna Coleman on Doctor Who: The World Tour. It sees them visiting seven cities across five continents in 12 days to publicize the upcoming season. The tour launched in Cardiff, Wales on August 7 and went through London (UK), Seoul (South Korea), Sydney (Australia), New York (U.S.), Mexico City (Mexico) and Rio de Janeiro (Brazil).', 57243, 127, 1009043, 58476, '2014-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009044, 'Live Preshow', 'Comedian and Doctor Who super fan Chris Hardwick hosts this preshow to celebrate the premiere of Doctor Who Season 8. Featuring Mark Gatiss and an array of studio guests with exclusive behind-the-scenes footage.', 57243, 128, 1009044, 58476, '2014-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009045, 'After Who Live', 'Comedian and Doctor Who superfan Chris Hardwick hosts this live aftershow to celebrate the premiere of Doctor Who Season 8. Featuring Mark Gatiss and an array of studio guests with exclusive behind-the-scenes footage.', 57243, 129, 1009045, 58476, '2014-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009046, 'Doctor Who Extra: Deep Breath', 'A new series, a new costume and a new Doctor! Take a Deep Breath and go behind the scenes on the first episode starring Peter Capaldi as the Twelfth Doctor.', 57243, 130, 1009046, 58476, '2014-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009047, 'Doctor Who Extra: Into the Dalek', '', 57243, 131, 1009047, 58476, '2014-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009048, 'Doctor Who Extra: Robot of Sherwood', '', 57243, 132, 1009048, 58476, '2014-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009049, 'Doctor Who Extra: Listen', '', 57243, 133, 1009049, 58476, '2014-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009050, 'Doctor Who Extra: Time Heist', '', 57243, 134, 1009050, 58476, '2014-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009051, 'Doctor Who Extra: The Caretaker', '', 57243, 135, 1009051, 58476, '2014-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009052, 'Doctor Who Extra: Kill the Moon', '', 57243, 136, 1009052, 58476, '2014-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1009053, 'Doctor Who Extra: Mummy on the Orient Express', '', 57243, 137, 1009053, 58476, '2014-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018470, 'Doctor Who Extra: Flatline', '', 57243, 138, 1018470, 58476, '2014-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018471, 'Doctor Who Extra: The Forest of the Night', 'If you go down to the woods today... You''re sure to find Doctor Who Extra with Peter Capaldi, Jenna Coleman and the team, along with a unique tour through the trees with Samuel Anderson!', 57243, 139, 1018471, 58476, '2014-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018472, 'Doctor Who Extra: Dark Water', 'Peter Capaldi, Michelle Gomez, Samuel Anderson and the Doctor Who team talk Cybermen, Missy and what it took to create one of the series'' most ambitious episodes.', 57243, 140, 1018472, 58476, '2014-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018473, 'Doctor Who Extra: Death in Heaven', 'The return of iconic old enemies, a terrifying invasion and some incredible stunts are all covered in this bumper episode! Includes exclusive interviews with Peter Capaldi, Michelle Gomez, Steven Moffat and many more.', 57243, 141, 1018473, 58476, '2014-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019128, 'Last Christmas', 'The Doctor and Clara face their Last Christmas. Trapped on an Arctic base, under attack from terrifying creatures, who are you going to call? Santa Claus!', 57243, 142, 1019128, 58476, '2014-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1030376, 'Doctor Who Extra: Last Christmas', 'The cast and crew of Doctor Who bring you the inside story of the 2014 Christmas special "Last Christmas".', 57243, 143, 1030376, 58476, '2014-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1088428, 'Doctor Who: Earth Conquest - The World Tour', 'Peter Capaldi and Jenna Coleman embark on a global tour to key cities across the world, taking in Cardiff, London, Seoul, Sydney, New York, Mexico City and Rio. They get to know the fans who have made the show what it is, understand why they love the Doctor, and just why the show has such global appeal.', 57243, 144, 1088428, 58476, '2014-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1061780, 'Deep Breath Prequel', 'With fleeting appearances by Madame Vastra and Jenny, this prequel has Strax giving another overview of all the Doctors, this time updated to include the new Twelfth Doctor.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1108508, 'The Doctor''s Meditation', 'The Doctor must meditate to prepare to see his ''old friend'' and atone for a past mistake..but he can''t mediate without proper drinking water..', 57243, 147, 1108508, 58476, '2015-09-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1144438, 'The Husbands of River Song', 'It’s Christmas Day on a remote human colony and the Doctor is hiding from Christmas Carols and Comedy Antlers. But when a crashed spaceship calls upon the Doctor for help, he finds himself recruited into River Song’s squad and hurled into a fast and frantic chase across the galaxy.', 57243, 148, 1144438, 58476, '2015-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1230025, 'The Return of Doctor Mysterio', 'The Doctor and Nardole try to save Manhattan from brain-swapping aliens.', 57243, 149, 1230025, 58476, '2016-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1331651, 'Doctor Who Live Q&A', 'Following a special screening of  ''World Enough and Time'', episode 11 of the current tenth series of the show, featuring the BBC National Orchestra of Wales (who perform the score for the finished series) playing Murray Gold''s music in front of an audience of fans at the Wales Millennium centre on Saturday 24th June to coincide with the TV broadcast,  a Q&A with series star Pearl Mackie and head writer Steven Moffat which fans could  submit questions for via Doctor Who’s official website and social media feeds.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1376557, 'Twice Upon a Time', 'Two Doctors stranded in a forbidding snowscape, refusing to face regeneration. A British army captain, seemingly destined to die in the First World War but taken from the trenches to play his part in the Doctor''s story. In the final chapter of the Twelfth Doctor''s epic adventure, he must face his past to decide his future. Along the way he realises the resilience of humanity, discovering hope in his darkest frozen moment. It is the end of an era, but the Doctor''s journey is only just beginning.', 57243, 151, 1376557, 58476, '2017-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1620735, 'Resolution', 'As the New Year begins, a terrifying evil is stirring from across the centuries of Earth’s history. As the Doctor, Ryan, Graham and Yaz return home, will they be able to overcome the threat to planet Earth?', 57243, 152, 1620735, 58476, '2019-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941474, 'Rose', 'Rose Tyler meets a mysterious stranger called the Doctor, and realises Earth is in danger.', 57243, 1, 941474, 58468, '2005-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941475, 'The End of the World', 'The Doctor takes Rose on her first voyage through time: to the year five billion, when the Sun is about to expand and swallow the Earth. She is cautious and soon starts to question her reasons for joining The Doctor. But amongst the powerful alien races gathering to watch on Platform One, a murderer is at work. Who is controlling the mysterious and deadly metal spiders?', 57243, 2, 941475, 58468, '2005-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968589, 'The Unquiet Dead', 'Charles Dickens and the Doctor team up as corpses stalk the streets of Victorian Cardiff.', 57243, 3, 968589, 58468, '2005-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968590, 'Aliens of London (1)', 'Rose is taken home, but a spaceship crashes in the Thames and London is closed off... Enter the Slitheen!', 57243, 4, 968590, 58468, '2005-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968592, 'World War Three (2)', 'Time is running out for the Doctor as Downing Street announces mankind''s first Interplanetary War.', 57243, 5, 968592, 58468, '2005-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968595, 'Dalek', 'The Doctor is shattered and Earth is in danger as he and Rose discover the Time Lords'' deadliest enemy beneath Utah.', 57243, 6, 968595, 58468, '2005-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968596, 'The Long Game', 'Adam catches a glimpse of the wonders of travelling in the Tardis, as they head to a future, where Satellite 5 broadcasts to the entire Earth Empire. But anyone promoted to Floor 500 is never seen again, and the Doctor suspects mankind is being manipulated.', 57243, 7, 968596, 58468, '2005-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968597, 'Father''s Day', 'Rose requests a trip back to the day her father, Pete Tyler, died. Reluctantly, the Doctor agrees, but he realises he has made a mistake, when Rose saves Pete from being run over by a car. This has now changed the timeline, and Reapers are transposing themselves all over the Universe. However, this time, the Doctor doesn''t have a plan…', 57243, 8, 968597, 58468, '2005-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968598, 'The Empty Child (1)', 'After chasing an unexplained capsule through time, the TARDIS lands in London, during an air raid. Rose investigates when a small child wearing a gasmask, standing on a rooftop, continuously calls out for his mummy. After floating above the city on a barrage balloon, Rose is swept off her feet by another time traveller – Captain Jack Harkness. Meanwhile, The Doctor follows a teenaged girl to a meeting of the homeless children of the Blitz. Here, the child in the gasmask is terrorising them with a parade of strange events, constantly asking for his mother.', 57243, 9, 968598, 58468, '2005-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968599, 'The Doctor Dances (2)', 'After narrowly escaping the gas mask monsters, The Doctor, Rose, and Captain Jack try to stop the mutated people from infecting other victims. But it soon becomes apparent that one of the group may indirectly responsible for the virus. The answer lies at the bomb site, but time is running out...', 57243, 10, 968599, 58468, '2005-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968600, 'Boom Town', 'The Doctor, Rose and Captain Jack stop off in present-day Cardiff to recharge the TARDIS on the Rift they formerly encountered in 1869. Whilst there, they come upon a since-thought-long-dead enemy of theirs, who is hatching yet another plan to destroy Earth.', 57243, 11, 968600, 58468, '2005-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968601, 'Bad Wolf (1)', 'In a seemingly futuristic world, the Doctor wakes up in the Big Brother house during an eviction, Rose wakes up on the Weakest Link with the Anne-Droid, and Captain Jack gets a make over with Trin-E and Zu-Zana. But something unusual is happening, and the losing contestants are being disintergrated. Obviously, it''s time for the Doctor to investigate. There could be only one monster behind this - the Daleks!', 57243, 12, 968601, 58468, '2005-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968602, 'The Parting of the Ways (2)', 'The fate of the Universe is hanging in the balance as the Dalek fleet begin their invasion of Earth. The Doctor must decide whether to sacrifice every human being on Earth in order to save every other living creature in the universe from the Daleks. Either way, he knows he must send Rose home...', 57243, 13, 968602, 58468, '2005-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974836, 'New Earth', 'In the year five billion and twenty-three, after the destruction of the Earth, the Doctor takes Rose to the New Earth. There, in a hospital facility, the feline Sisters of Plenitude can mysteriously cure any diseases, but, in the basement, an old enemy of the Doctor is out for revenge.', 57243, 1, 974836, 58469, '2006-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941479, 'Tooth and Claw', 'Landing in 1879, Scotland, the Tenth Doctor and Rose meet Queen Victoria, travelling with her to spend the night at the Torchwood Estate. However, a group of warrior monks have sinister plans for the monarch, and the full moon is about to summon a creature out of legend.', 57243, 2, 941479, 58469, '2006-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941480, 'School Reunion', 'There are strange goings-on at a comprehensive school - UFOs, over-intelligent children, and odd-tasting school dinners. This attracts the attention of the Tenth Doctor, Rose and Mickey Smith, as well as a couple of old friends…', 57243, 3, 941480, 58469, '2006-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941481, 'The Girl in the Fireplace', 'On a seemingly abandoned spaceship in the 51st century, the Tenth Doctor, Rose and Mickey find time windows leading to 18th century France and a group of clockwork androids using them to stalk a young woman throughout her life.', 57243, 4, 941481, 58469, '2006-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941595, 'Episode 10', '', 57267, 10, 941595, 58481, '2013-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941596, 'Episode 11', '', 57267, 11, 941596, 58481, '2013-09-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941597, 'Episode 12', '', 57267, 12, 941597, 58481, '2013-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941482, 'Rise of the Cybermen (1)', 'After the TARDIS makes a crash landing on the Earth of another universe, Rose discovers her father is alive and rich, Mickey encounters his alternative self, and the Tenth Doctor learns one of his oldest and deadliest foes is about to be reborn.', 57243, 5, 941482, 58469, '2006-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941483, 'The Age of Steel (2)', 'The plans of John Lumic to convert the world into Cybermen are now in full force. The Tenth Doctor, Rose, Mickey and the Preachers must find a way to stop him from enforcing his "ultimate upgrade."', 57243, 6, 941483, 58469, '2006-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941490, 'The Idiot''s Lantern', 'In 1953 London, the police are abducting people from their homes. The people of Britain gather around their new-fangled "tele-vision" sets to celebrate the new Queen''s coronation - but something strange is affecting the signal.', 57243, 7, 941490, 58469, '2006-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941484, 'The Impossible Planet (1)', 'Rose finds herself further away from home than ever before, on a desolate world in the orbit of a Black Hole. Trapped with an Earth expedition and the mysterious Ood, the time-travellers face an even greater danger as something ancient beneath the planet''s surface begins to awake.', 57243, 8, 941484, 58469, '2006-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941485, 'The Satan Pit (2)', 'The TARDIS lands in a base on a planet orbiting a black hole, an impossible situation that stumps even the Tenth Doctor. The base crew are drilling to the centre of the world, to claim the power that keeps it in orbit for themselves. However, an ancient evil is down there too, and he is awake…', 57243, 9, 941485, 58469, '2006-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941486, 'Love and Monsters', 'An ordinary man named Elton Pope becomes obsessed with the Tenth Doctor, Rose and their strange blue box, joining a group of like-minded people in hopes of finding him. But when the mysterious Victor Kennedy joins the group, the fun soon stops and Elton discovers a darker side to his hobby.', 57243, 10, 941486, 58469, '2006-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941487, 'Fear Her', 'When the TARDIS lands in 2012, the Tenth Doctor plans to show Rose the London Olympics. However, ordinary children are vanishing into thin air, a mother living in a seemingly normal British household is trying to hide her daughter''s unnatural powers from the world, and a demonic presence lurks in an upstairs cupboard.', 57243, 11, 941487, 58469, '2006-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941488, 'Army of Ghosts (1)', 'Ghostly beings have been regularly appearing across the world and people, believing them to be their dead loved ones, are welcoming their visits with open arms. When the TARDIS arrives at the Torchwood Institute, the Tenth Doctor and Rose are taken prisoner. They are drawn into the investigation of a mysterious sphere kept in Torchwood Tower, and monstrous foes return as two universes collide.', 57243, 12, 941488, 58469, '2006-07-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941489, 'Doomsday (2)', 'Humanity is caught in the crossfire as the Cybermen and the Daleks wage war against each other. When the mysterious Genesis Ark opens, the Tenth Doctor is faced with an impossible decision: saving the world could mean losing Rose Tyler forever…', 57243, 13, 941489, 58469, '2006-07-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941492, 'Smith and Jones', 'Trainee doctor Martha Jones has her hands full balancing her medical studies with placating her demanding family. So the last thing she needs is to find that the hospital where she works has been transported to the moon, where it''s invaded by an overbearing alien police force. There she encounters a patient called John Smith, who seems curiously at ease with the situation…', 57243, 1, 941492, 58470, '2007-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941493, 'The Shakespeare Code', 'Martha takes her first trip in the Tardis, all the way back to Elizabethan England. She and the Doctor hear of a series of bizarre deaths and discover that playwright William Shakespeare is being controlled by dangerous witch-like creatures. It seems the time-travelling duo must defeat ancient forces to prevent history from being rewritten.', 57243, 2, 941493, 58470, '2007-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941491, 'Gridlock', 'The Doctor takes Martha to New Earth, in the far future, only to find that an entire city has become a deadly trap.', 57243, 3, 941491, 58470, '2007-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941494, 'Daleks in Manhattan (1)', 'The Doctor investigates disappearances in New York at the height of the depression in the 1930s. Nefarious Pig Men linger in the sewers and the Daleks prepare an audacious plan at the top of the Empire State Building', 57243, 4, 941494, 58470, '2007-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941495, 'Evolution of the Daleks (2)', 'The newly-created Dalek-human hybrid, and the other three members of the Cult of Skaro launch an attack on Hooverville, along with their Pig Slaves. The Doctor, Martha, and Frank manage to escape, but discover that the Daleks'' plan involving the Empire State Building...', 57243, 5, 941495, 58470, '2007-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941496, 'The Lazarus Experiment', 'Martha has to save her family from the lunatic schemes of the monstrous Professor Lazarus.', 57243, 6, 941496, 58470, '2007-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941497, '42', 'In a far-flung galaxy, saboteurs are at work, and crew members are being possessed. The TARDIS crew find themselves in the 42nd century on a spaceship, SS Pentallian, slowly being pulled into a sun, and must find a way to survive', 57243, 7, 941497, 58470, '2007-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941498, 'Human Nature (1)', 'England, 1913. A schoolteacher called John Smith dreams of adventures in time and space. The Doctor, along with Martha, heads to a boarding school, but what he finds is far from ordinary...', 57243, 8, 941498, 58470, '2007-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941499, 'The Family of Blood (2)', 'It''s 1913, and war comes to England early as the terrifying Family hunt for the Doctor.', 57243, 9, 941499, 58470, '2007-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941500, 'Blink', 'Only the Doctor can stop the Weeping Angels, but he''s lost in time.', 57243, 10, 941500, 58470, '2007-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941501, 'Utopia (1)', 'After being brought back to life in The Parting of the Ways, Captain Jack Harkness was just left on the Gamestation by the Doctor and Rose. In this episode, Captain Jack Harkness storms back into the Doctor''s life, and the TARDIS is thrown to the end of the universe itself.', 57243, 11, 941501, 58470, '2007-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941502, 'The Sound of Drums (2)', 'Harry Saxon becomes Prime Minister and his reign of terror begins – but that''s only the start of his ambitions, as he announces mankind''s first contact with an alien race, the Toclafane. An audacious plan spanning the whole of time and space begins to close around the Earth, in the penultimate episode of Russell T Davies''s Doctor Who.', 57243, 12, 941502, 58470, '2007-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941503, 'Last of the Time Lords (3)', 'One year has passed since the events of "The Sound of Drums." The Earth has been conquered and its population enslaved, the Doctor is the Master''s prisoner, and the warships of a new Time Lord Empire rise from the ashes. The fate of the world is in Martha Jones'' hands.', 57243, 13, 941503, 58470, '2007-06-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941505, 'Partners in Crime', 'During an alien emergency in London, a woman called Donna Noble must search for an old friend who can save the day - a man named the Doctor. But can even the Doctor halt the plans of the mysterious Miss Foster?', 57243, 1, 941505, 58471, '2008-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941506, 'The Fires of Pompeii', 'The Doctor takes Donna back to Pompeii, on the day of the eruption of Mt. Vesuvius, and is faced with a great moral dilemma. Should they warn the residents of the impending disaster, or let history take its natural course?', 57243, 2, 941506, 58471, '2008-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941507, 'Planet of the Ood', 'The Doctor and Donna find themselves on an icy planet known as the Ood-Sphere. There they discover what drove the Ood to be a servant race.', 57243, 3, 941507, 58471, '2008-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941598, 'Episode 13', '', 57267, 13, 941598, 58481, '2013-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941599, 'Episode 14', '', 57267, 14, 941599, 58481, '2013-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941600, 'Episode 15', '', 57267, 15, 941600, 58481, '2013-09-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941508, 'The Sontaran Stratagem (1)', 'Aided by the Rattigan Academy, the Sontarans establish a covert base at the mysterious ATMOS Factory. Can the Doctor stop the Sontarans from unleashing a potent terror that will bring the world to its knees?', 57243, 4, 941508, 58471, '2008-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941509, 'The Poison Sky (2)', 'The Sontarans continue their evil plot and begin to "choke" the Earth. The Doctor and Donna, now teamed with Martha have to stop them! Can they save Earth before it''s too late?', 57243, 5, 941509, 58471, '2008-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941510, 'The Doctor''s Daughter', 'The Doctor lands on the remote planet Messaline as an age-old war rages and the threat of genocide looms. When Martha is kidnapped by the Hath, the Doctor is distracted by "the most important woman in his life."', 57243, 6, 941510, 58471, '2008-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941511, 'The Unicorn and the Wasp', 'The Doctor and Donna''s meet Agatha Christie at a manor owned buy Lady Eddison. When Agatha Christie goes missing and a body turns up in the library the adventure turns into a pulp sci-fiction murder mystery, with a murder, a jewel thief, and a wasp alien. Can they solve the mystery?', 57243, 7, 941511, 58471, '2008-05-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941512, 'Silence in the Library (1)', 'The Doctor and Donna land in a frightening position in the far future. While investigating a derelict library, the duo come face to face with the disembodied mind of a little girl, an archaeological team led by a woman from the Doctor''s future, and swarms of flesh-eating creatures that are seen only as shadows.', 57243, 8, 941512, 58471, '2008-05-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941513, 'Forest of the Dead (2)', 'As the shadows rise, the Doctor forges an alliance with the mysterious River Song.', 57243, 9, 941513, 58471, '2008-06-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941514, 'Midnight', 'While visiting the planet Midnight, a beautiful and luxury planet, full of lavishs and hightech cities, a terrifying problem arises that leaves The Doctor powerless.', 57243, 10, 941514, 58471, '2008-06-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941515, 'Turn Left', 'Whilst attending a carnival on the Chino-planet of Shan Shen, Donna is cajoled into having her fortune read, where her past is carefully examined. With the Doctor missing, Donna must work with Rose, a traveller from a parallel universe, to prevent darkness encompassing the whole of the universe.', 57243, 11, 941515, 58471, '2008-06-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941516, 'The Stolen Earth (1)', 'The Earth has been moved, and it''s a race against time as Donna and the Doctor try to find it before the Daleks destroy everything; they head for the Shadow Proclamation and the Medusa Cascade. Meanwhile on Earth a veritable bevy of ex-companions join together to contact the Doctor and take down the Daleks. Can Captain Jack, Sarah-Jane, Martha Jones and Rose find the Doctor in time...', 57243, 12, 941516, 58471, '2008-06-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941517, 'Journey''s End (2)', 'The Earth has been overwhelmed and the universe faces dominion by the resurgent forces of a terrifying and limitless empire led by one of The Doctor''s greatest enemies. Aiding the Time Lord in a final battle are several of his closest allies and companions, but for one of them, a price will be paid...', 57243, 13, 941517, 58471, '2008-07-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941518, 'The Eleventh Hour', 'The Doctor has regenerated into a brand new man, but danger strikes before he can even recover. With the TARDIS wrecked, and the sonic screwdriver destroyed, the new Doctor has just 20 minutes to save the whole world - and only Amy Pond to help him.', 57243, 1, 941518, 58472, '2010-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941519, 'The Beast Below', 'Amy Pond takes her first trip in the TARDIS when the Doctor whisks her away to the distant future and they discover Britain in space. Starship UK houses the future of the British people as they search the stars for a new home. But when Amy explores she encounters the terrifying Smilers and learns a deadly truth inside the Voting Booth...', 57243, 2, 941519, 58472, '2010-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941520, 'Victory of the Daleks', 'The Doctor has been summoned by old friend Winston Churchill, but in the Cabinet War Rooms far below the streets of blitz-torn London, it''s his oldest enemy he finds waiting for him, as the time-travelling adventures continue. The Daleks are back – but can Winston Churchill be in league with them?', 57243, 3, 941520, 58472, '2010-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941521, 'The Time of Angels (1)', 'A crashed spaceship, a shattered temple and a terrifying climb through the maze of the dead - River Song is back in the Doctor''s life, and she''s brought more trouble than even he can handle. The last of the weeping Angels is loose in the ruins of Alfava Metraxis, and the Doctor is recruited to track it down. "Don''t blink!" everyone tells Amy - but Amy is about to discover, not blinking might just be the worst thing you can do...', 57243, 4, 941521, 58472, '2010-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941522, 'Flesh and Stone (2)', 'There''s no way back, no way up and no way out. Trapped among an army of Weeping Angels, The Doctor and his friends must try to escape through the wreckage of a crashed space liner. Meanwhile, in the forest vault, the Doctor''s companion, Amy Pond, finds herself facing an even more deadly attack.', 57243, 5, 941522, 58472, '2010-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941523, 'The Vampires of Venice', 'Dessicated corpses, terror in the canal and a visit to the sinister House of Calvierri – the Doctor takes Amy and Rory for a romantic mini-break, as the Tardis touches down once again. But 16th-century Venice is not as it should be. The city has been sealed to protect it from the Plague, although Rosanna Calvierri may have other plans...', 57243, 6, 941523, 58472, '2010-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941524, 'Amy''s Choice', 'It has been five years since Amy Pond last travelled with the Doctor, and when he lands in her garden again, on the eve of the birth of her first child, she finds herself facing a heartbreaking choice – one that will change her life forever. They will have to choose which is the dream world and which is reality.', 57243, 7, 941524, 58472, '2010-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941525, 'The Hungry Earth (1)', 'In 2020, the most ambitious drilling project in history is under way. Dr Nasreen Chaudry and her team have reached 21 kilometers into the Earth''s crust - but something is stirring far below. Amy Pond discovers there''s nowhere to run when you can''t even trust the ground at your feet.', 57243, 8, 941525, 58472, '2010-05-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941526, 'Cold Blood (2)', 'It is the most important day in the history of Earth: the dawn of a new age of harmony… or the start of its final war. The Doctor must face his most difficult challenge yet and he tries desperately to ensure Alaya''s prediction of a massacre does not come true. Meanwhile, what fate will befall the captured Amy and can Tony and his friends be trusted?', 57243, 9, 941526, 58472, '2010-05-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941527, 'Vincent and the Doctor', 'Terror lurks in the cornfields of Provence, but only a sad and lonely painter can see it. Amy Pond finds herself shoulder to shoulder with Vincent van Gogh, in a battle with a deadly alien - saving the world has never been so ginger! But can even the Doctor save Vincent?', 57243, 10, 941527, 58472, '2010-06-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941528, 'The Lodger', 'There''s a house on Aickman road with a staircase that people go up, but never down... To solve the mystery of the man upstairs, the Doctor must pass himself off as a normal human being, and share a flat with Craig Owens.', 57243, 11, 941528, 58472, '2010-06-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941529, 'The Pandorica Opens (1)', 'The Doctor''s friends unite to send him a terrible warning; the Pandorica - which is said to contain the most feared being in all the cosmos - is opening. But what''s inside, and can the Doctor stop it?', 57243, 12, 941529, 58472, '2010-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941530, 'The Big Bang (2)', 'The Doctor is gone, the Tardis has been destroyed, and the universe is collapsing. The only hope for all reality is a little girl who still believes in stars.', 57243, 13, 941530, 58472, '2010-06-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941586, 'Episode 16', '', 57267, 16, 941586, 58481, '2013-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333909, 'Episode 10', '', 70452, 10, 1333909, 85559, '2017-08-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941531, 'The Impossible Astronaut (1)', 'Placing his life entirely in their hands, the Doctor agrees to search for the recipient of the fourth envelope - just who is Canton Everett Delaware the Third? And what is the relevance of their only other clue: ''Space 1969''? Their quest lands them - quite literally - in the Oval Office, where they are enlisted by President Nixon himself to assist enigmatic former-FBI agent Canton, in saving a terrified little girl from a mysterious spaceman.', 57243, 1, 941531, 58473, '2011-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941532, 'Day of the Moon (2)', 'The Doctor is locked in the perfect prison. Amy, Rory and River Song are being hunted down across America by the FBI. With the help of new friend and FBI-insider, Canton Everett Delaware the Third, our heroes are reunited to share their discoveries, if not their memories. For the world is occupied by an alien force who control humanity through seriesReview-hypnotic suggestion and no one can be trusted. Aided by President Nixon and Neil Armstrong''s foot, the Doctor must mount a revolution to drive out the enemy and rescue the missing little girl. No-one knows why they took her. Or why they have kidnapped Amy Pond...', 57243, 2, 941532, 58473, '2011-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941533, 'The Curse of the Black Spot', 'The TARDIS is marooned onboard a 17th-century pirate ship whose crew is being attacked by a mysterious and beautiful sea creature. Becalmed and beset by cabin fever, the pirates have numerous superstitious explanations for the Siren''s appearance. The Doctor has other ideas but, as his theories are disproved and every plan of escape is thwarted, he must work to win the trust of the implacable Captain Avery and uncover the truth behind the pirates'' supernatural fears – and he must work quickly, for some of his friends have already fallen under the Siren''s spell...', 57243, 3, 941533, 58473, '2011-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941534, 'The Doctor''s Wife', 'The Doctor receives a distress signal from an old friend. Could there really be another living Time Lord out there? Hopes raised, he follows the signal to a junkyard planet sitting upon a mysterious asteroid in a Bubble universe, populated by a very strange family, as the time-travelling drama continues. The Doctor, Amy and Rory are given the warmest of welcomes by Auntie, Uncle and Nephew. But the beautiful and insane Idris greets them in a more unusual fashion – what is she trying to tell the Doctor? As the Doctor investigates, he unwittingly puts his friends in the gravest danger.', 57243, 4, 941534, 58473, '2011-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941535, 'The Rebel Flesh (1)', 'A solar tsunami sends the TARDIS hurtling towards a futuristic factory on Earth, where human doppelgangers are used to mine dangerous acid, as the time-travelling adventures continue.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941536, 'The Almost People (2)', 'As the solar storm rages, Jennifer, a Ganger driven mad by the memories of being "decommissioned", is seeking revenge, as the time-travelling drama continues.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941537, 'A Good Man Goes to War (1)', 'Amy Pond has been kidnapped and the Doctor is raising an army to rescue her as the drama continues. But as he and Rory race across galaxies, calling in long-held debts and solemnly given promises, his enemies are laying a carefully concealed trap.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941538, 'Let''s Kill Hitler (2)', 'In the desperate search for Melody Pond, the TARDIS crash lands in Thirties Berlin, as the time-travelling drama returns for the second half of the series shown earlier in the year. The Doctor comes face to face with the greatest war criminal in the Universe. And Hitler. Old friendships are tested to their limits as the Doctor suffers the ultimate betrayal and learns a harsh lesson in the cruelest warfare of all. As precious time ebbs away, the Doctor must teach his adversaries that time travel has responsibilities. And he must succeed before an almighty price is paid.', 57243, 8, 941538, 58473, '2011-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941539, 'Night Terrors', 'A little boy named George sends a distress signal to the Doctor when he discovers that monsters live in his bedroom cupboard.', 57243, 9, 941539, 58473, '2011-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941540, 'The Girl Who Waited', 'The TARDIS brings its crew to a quarantine facility for victims of an alien plague. When Amy is trapped, Rory must rescue her from the facility''s doctors but learns something surprising about his wife.', 57243, 10, 941540, 58473, '2011-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941541, 'The God Complex', 'The trio arrive at a hotel where the layout of the rooms keeps changing. It also contains rooms that hold the greatest fears of each visitor.', 57243, 11, 941541, 58473, '2011-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941542, 'Closing Time', 'As the Doctor prepares for his inevitable death at Lake Silencio, he visits a former roommate and learns that the Cybermen are responsible for a series of disappearances at a local department store and resolves to investigate.', 57243, 12, 941542, 58473, '2011-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941543, 'The Wedding of River Song', 'As the Doctor makes his final journey to the shores of Lake Silencio in Utah, he knows only one thing can keep the universe safe – his own death – in the concluding episode of this series of the time-travelling drama. But has he reckoned without the love of a good woman?', 57243, 13, 941543, 58473, '2011-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941544, 'Asylum of the Daleks', 'Kidnapped by his oldest foe, the Doctor is forced on an impossible mission - to a place even the Daleks are too terrified to enter... the Asylum. A planetary prison confining the most terrifying and insane of their kind, the Doctor and the Ponds must find an escape route. But with Amy and Rory’s relationship in meltdown, and an army of mad Daleks closing in, it is up to the Doctor to save their lives, as well as the Pond’s marriage.', 57243, 1, 941544, 58474, '2012-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941545, 'Dinosaurs on a Spaceship', 'An unmanned spaceship hurtles towards certain destruction - unless the Doctor can save it, and its impossible cargo... of dinosaurs! By his side a ragtag gang of adventurers; a big game hunter, an Egyptian Queen and a surprised member of the Pond family. But little does the Doctor know there is someone else onboard who will stop at nothing to keep hold of his precious, prehistoric cargo.', 57243, 2, 941545, 58474, '2012-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968212, 'A Town Called Mercy', 'The Doctor gets a Stetson (and a gun!), and finds himself the reluctant Sheriff of a Western town under siege by a relentless cyborg, who goes by the name of the Gunslinger. But who is he and what does he want? The answer seems to lie with the mysterious, Kahler-Jex, an alien doctor (yes another one!) whose initial appearance is hiding a dark secret.', 57243, 3, 968212, 58474, '2012-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968211, 'The Power of Three', 'The Doctor and the Ponds puzzle an unlikely invasion of Earth, as millions of sinister black cubes arrive overnight, almost like presents falling from the sky. But what are they, what’s inside them and most importantly, who sent them? With the international community at a loss, it’s left to the Doctor to unearth who is behind the mystery.', 57243, 4, 968211, 58474, '2012-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941546, 'The Angels Take Manhattan', 'The Doctor’s heart-breaking farewell to Amy and Rory – a race against time through the streets of Manhattan, as New York’s statues come to life around them… With Rory’s life in danger, the Doctor and Amy must locate him before it’s too late! Luckily, an old friend helps them and guides the way.', 57243, 5, 941546, 58474, '2012-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (953165, 'The Bells of Saint John', 'When the Doctor receives a mysterious call from Clara, the woman that he''s been seeking since he has seen her die twice, he arrives in 21st century Earth and discovers that something is using wi-fi to download human minds into the Internet... and feed on them.', 57243, 6, 953165, 58474, '2013-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968214, 'The Rings of Akhaten', 'Clara wants to see something awesome, so the Doctor whisks her off to the inhabited rings of the planet Akhaten, where the Festival of Offerings is in full swing. Clara meets the young Queen of Years as the pilgrims and natives ready for the ceremony. But something is stirring in the pyramid, and a sacrifice will be demanded.', 57243, 7, 968214, 58474, '2013-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968213, 'Cold War', 'The Doctor and Clara land on a damaged Russian submarine in 1983 as it spirals out of control into the ocean depths. An alien creature is loose on board, having escaped from a block of Arctic ice. With tempers flaring and a cargo of nuclear weapons on board, it’s not just the crew but the whole of humanity at stake!', 57243, 8, 968213, 58474, '2013-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968605, 'Hide', 'Clara and the Doctor arrive at Caliburn House, a haunted mansion sat alone on a desolate moor. Within its walls, a ghost hunting Professor and a gifted psychic are searching for the Witch of the Well. Her apparition appears throughout the history of the building, but is she really a ghost? And what is chasing her?', 57243, 9, 968605, 58474, '2013-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968606, 'Journey to the Centre of the TARDIS', 'When a salvage ship attempts to pull the TARDIS aboard when the time vessel''s shields are down, an explosion occurs. The Doctor forces the salvage crew to help him find Clara, who is lost somewhere inside his vessel.', 57243, 10, 968606, 58474, '2013-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968607, 'The Crimson Horror', 'Something ghastly is afoot in Victorian Yorkshire, as bodies are found with their skin a waxy, glowing red.', 57243, 11, 968607, 58474, '2013-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968608, 'Nightmare in Silver', 'Hedgewick''s World of Wonders: the perfect theme park day out - and ground zero for a deadly silver resurrection.', 57243, 12, 968608, 58474, '2013-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968609, 'The Name of the Doctor', 'Someone is kidnapping the Doctor''s friends, leading him towards the one place in all of time and space that he should never go.', 57243, 13, 968609, 58474, '2013-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (988112, 'Deep Breath', 'When a dinosaur materialises alongside the Houses of Parliament in Victorian London, the Doctor''s old friends, the Paternoster Gang, are relieved when he arrives, seemingly to deal with the creature. However, they soon realise that the Doctor is the one in need of help; newly regenerated, extremely volatile and questioning his self-worth, this is a very different man to the one they last saw. The only person that may be able to help him is Clara, and she is still grappling with losing the Doctor she knew and loved.', 57243, 1, 988112, 58475, '2014-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004376, 'Into the Dalek', 'A Dalek fleet surrounds a lone rebel ship, and only the Doctor can help them now.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004522, 'Robot of Sherwood', 'In a sun-dappled Sherwood Forest, The Doctor discovers an evil plan from beyond the stars. But with the fate of Nottingham at stake (and possibly Derby), there''s no time for the two adventurers to get into a fight about who is real and who isn''t - which is probably why they do very little else!', 57243, 3, 1004522, 58475, '2014-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004523, 'Listen', 'What scares the grand old man of time? What horrors lurk under his bed? Ghosts of the past and future crowd into the lives of The Doctor and Clara; a terrified caretaker in a children''s home, the last man standing in the universe, and a little boy who doesn''t want to join the army...', 57243, 4, 1004523, 58475, '2014-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004524, 'Time Heist', 'The Bank of Karabraxos is the deadliest bank in the cosmos - only a fool or genius would tempt to rob it. Fortunately, for The Doctor, he''s both. But nothing even The Doctor has encountered can prepare them for the Teller: a creature of terrifying power that can detect guilt.', 57243, 5, 1004524, 58475, '2014-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004525, 'The Caretaker', 'Clara has it all under control: her life at school, her life in space; her new boyfriend and her mad old Time Lord. Everything is humming along just fine, so long as everybody never actually meets. And then, one morning, just before assembly, Coal Hill welcomes a new relief caretaker with a Scottish accent.', 57243, 6, 1004525, 58475, '2014-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1004526, 'Kill the Moon', 'In the near future, The Doctor and Clara arrive on a decrepit shuttle making a suicide mission to the Moon. Crashing on the lunar surface, they find a mining base full of eviscerated corpses, spider-like creatures scuttling about in the dark, and a terrible dilemma.', 57243, 7, 1004526, 58475, '2014-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1005081, 'Mummy on the Orient Express', 'Aboard the most beautiful train in history, speeding among the stars of the future, a legend is stalking the passengers. Once you see the Mummy, you have 66 seconds to live. Clara sees The Doctor at his deadliest and most ruthless - and finally she realises she''s made the right decision. Because this is their last adventure: it''s time to say goodbye to the Time Lord.', 57243, 8, 1005081, 58475, '2014-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1005082, 'Flatline', 'Separated from The Doctor, Clara discovers a new menace from another dimension. But how do you hide when even the walls are no protection.', 57243, 9, 1005082, 58475, '2014-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1005083, 'In the Forest of the Night', 'One morning in London, and every city and town in the world, the human race wakes up to the most surprising invasion yet: the trees have moved back in. Everywhere, in every land, a forest has grown overnight and taken back the Earth.', 57243, 10, 1005083, 58475, '2014-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1005084, 'Dark Water', 'In the mysterious world of the Nethersphere, plans have been drawn. Old friends and old enemies manoeuvre around The Doctor, and an impossible choice is looming over him.', 57243, 11, 1005084, 58475, '2014-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1005085, 'Death in Heaven', 'With Cybermen on the streets of London, old friends unite against old enemies and the Doctor takes to the air in a startling new role. As the Doctor faces his greatest challenge, sacrifices must be made before the day is won.', 57243, 12, 1005085, 58475, '2014-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1089718, 'The Magician''s Apprentice (1)', 'Where is the Doctor? When the skies of Earth are frozen by a mysterious alien force, Clara needs her friend. But where is the Doctor, and what is he hiding from? As past deeds come back to haunt him, old enemies will come face-to-face, and for the Doctor and Clara survival seems impossible.', 57243, 1, 1089718, 64188, '2015-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003770, 'The Daleks (The Dalek Invasion of Earth, Part Two)', 'The Doctor and Ian are taken to the Dalek saucer while Susan and Barbara join the rebels in planning an attack.', 121, 5, 1003770, 6970, '1964-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1089719, 'The Witch''s Familiar (2)', 'Trapped and alone in a terrifying Dalek city, the Doctor is at the heart of an evil Empire; no sonic, no TARDIS, nobody to help. With his greatest temptation before him, can the Doctor resist? And will there be mercy?', 57243, 2, 1089719, 64188, '2015-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096290, 'Under the Lake (1)', 'The Doctor and Clara save the frightened crew from a threat in an underwater base, but the Doctor questions the haunting.', 57243, 3, 1096290, 64188, '2015-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096291, 'Before the Flood (2)', 'An alien warlord sets a twisted plan in motion in order to ensure his survival on a remote Army outpost, and the Doctor may have to do something unthinkable.', 57243, 4, 1096291, 64188, '2015-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096292, 'The Girl Who Died (1)', 'In a Viking village, a girl named Ashildr is about to make a desperate mistake. The Mire are the deadliest mercenaries in the galaxy, famed for showing no mercy and Ashildr has just declared war on them. The Doctor and Clara have 12 hours to turn a peaceful village into strong fighters, ready for the deadly Mire.', 57243, 5, 1096292, 64188, '2015-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096293, 'The Woman Who Lived (2)', 'England, 1651. The deadly Highwayman ''The Knightmare'' and his sidekick stalk the dark streets of London. But when they find loot that''s not of this world, they come face to face with The Doctor. Who is the Nightmare in league with? And can the Doctor avoid the hangman''s noose and protect Earth from a devilish betrayal?', 57243, 6, 1096293, 64188, '2015-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096294, 'The Zygon Invasion (1)', 'When Osgood is kidnapped by a rogue gang of Zygons, the Doctor, Clara and Unit must scatter across the world in a bid to set her free. But will they reach her in time, and can they stop an uprising before it is too late?', 57243, 7, 1096294, 64188, '2015-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096295, 'The Zygon Inversion (2)', 'With UNIT neutralised, only the Doctor stands in the way of the Zygons.', 57243, 8, 1096295, 64188, '2015-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096303, 'Sleep No More', 'This terrifying story is assembled from footage discovered in the wreckage of Le Verrier Space Station.', 57243, 9, 1096303, 64188, '2015-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096304, 'Face the Raven', 'The Doctor and Clara, with their old friend Rigsy, find themselves in a magical alien world, hidden on a street in the heart of London.', 57243, 10, 1096304, 64188, '2015-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096305, 'Heaven Sent (1)', 'Trapped in a world unlike any other he has seen, the Doctor faces the greatest challenge of his many lives. One final test. And he must face it alone.', 57243, 11, 1096305, 64188, '2015-11-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096306, 'Hell Bent (2)', 'If you took everything from him, betrayed him, trapped him, and broke both his hearts...how far might the Doctor go?', 57243, 12, 1096306, 64188, '2015-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1231112, 'The Pilot', 'Two worlds collide when the Doctor meets Bill. A chance encounter with a girl with a star in her eye leads to a terrifying chase across time and space. Bill’s mind is opened to a universe that is bigger and more exciting than she could possibly have imagined – but who is the Doctor, and what is his secret mission with Nardole on Earth?', 57243, 1, 1231112, 76615, '2017-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295789, 'Smile', 'The language of the future is emoji! The Doctor takes Bill to a spectacular city on a distant planet - but where are the colonists? A band of ''cute'' droids hold the deadly answer.', 57243, 2, 1295789, 76615, '2017-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295790, 'Thin Ice', 'London, 1814. The entire city has turned out for the biggest Frost Fair in decades. But beneath the frozen Thames, revellers are disappearing, snatched through the ice and pulled into the depths where a terrifying monster lurks. Will the Doctor and Bill stop the slaughter before they too are dragged into the icy waters?', 57243, 3, 1295790, 76615, '2017-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295791, 'Knock Knock', 'Why do floorboards creak? When a sinister landlord shows Bill and her friends the perfect houseshare, they have no idea what lies ahead... knock knock, who''s there?', 57243, 4, 1295791, 76615, '2017-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295792, 'Oxygen', '“Space - the final frontier. Final because it wants to kill us.” Trapped on a space station with no oxygen, the Doctor, Bill and Nardole are horrified to discover the automated spacesuits keeping them alive are also trying to kill them!', 57243, 5, 1295792, 76615, '2017-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295793, 'Extremis (1)', '“The Veritas. The truth. Truth so true you can''t live with it. Is that looking into hell... or seeing the light?” Everyone who has ever read the Veritas has been found dead. In a forbidden library at the heart of the Vatican, the pope urges the Doctor to read the ancient text - but can he handle the truth?', 57243, 6, 1295793, 76615, '2017-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295794, 'The Pyramid at the End of the World (2)', 'An “ancient” pyramid appears overnight. Every clock in the world begins counting down to the Earth''s destruction. Three opposing armies lie ready to annihilate each other. An alien race stands ready to offer humanity a deal that could save them, but also enslave them. It''s a terrifying race against time to save the world. Will the Doctor be forced to accept their help?', 57243, 7, 1295794, 76615, '2017-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295795, 'The Lie of the Land', 'Earth has been invaded and Bill is living alone, an isolated figure surviving in occupied Britain. The Doctor is imprisoned and appears to be on the side of the enemy, flooding the airwaves with fake news. Bill and Nardole must embark on a deadly mission to rescue the Doctor and lead the resistance against the new regime, whatever the cost.', 57243, 8, 1295795, 76615, '2017-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295796, 'Empress of Mars', '“God save the Queen” has been scrawled on the surface of Mars. What are Victorians doing on the home of the Ice Warriors? And what will they find beneath the Martian soil?', 57243, 9, 1295796, 76615, '2017-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295799, 'The Eaters of Light', 'A long time ago, the ninth legion of the Roman army vanished into the mists of Scotland. Bill has a theory about what happened, and the Doctor has a time machine. But when they arrive in ancient Aberdeenshire, what they find is a far greater threat than any army. In a cairn, on a hillside, is a doorway leading to the end of the world.', 57243, 10, 1295799, 76615, '2017-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295801, 'World Enough and Time (1)', 'Friendship drives the Doctor into the rashest decision of his life. Trapped on a giant spaceship, caught in the event horizon of a black hole, he witnesses the death of someone he is pledged to protect. Is there any way he can redeem his mistake? Are events already out of control? For once, time is the Time Lord’s enemy.', 57243, 11, 1295801, 76615, '2017-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295802, 'The Doctor Falls (2)', '“Without hope, without witness, without reward.” The Mondasian Cybermen are on the rise. It’s time for the Doctor’s final battle…', 57243, 12, 1295802, 76615, '2017-07-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1563959, 'The Woman Who Fell to Earth', '“We don''t get aliens in Sheffield.” In a South Yorkshire city, Ryan Sinclair, Yasmin Khan and Graham O''Brien are about to have their lives changed forever, as a mysterious woman, unable to remember her own name, falls from the night sky. Can they believe a word she says? And can she help solve the strange events taking place across the city?', 57243, 1, 1563959, 97100, '2018-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1575666, 'The Ghost Monument', 'Still reeling from their first encounter, can the Doctor and her new friends stay alive long enough, in a hostile alien environment , to solve the mystery of Desolation? And just who are Angstrom and Epzo?', 57243, 2, 1575666, 97100, '2018-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1592668, 'Rosa', 'Montgomery, Alabama. 1955. The Doctor and her friends find themselves in the Deep South of America. As they encounter a seamstress by the name of Rosa Parks, they begin to wonder whether someone is attempting to change history.', 57243, 3, 1592668, 97100, '2018-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344182, 'Episode 11', '', 70452, 11, 1344182, 85559, '2017-08-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344183, 'Episode 12', '', 70452, 12, 1344183, 85559, '2017-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1595517, 'Arachnids in the UK', '“Something''s happening with the spiders in this city.” The Doctor, Yaz, Graham and Ryan find their way back to Yorkshire - and Yaz''s family - only to find something is stirring amidst the eight-legged arachnid population of Sheffield.', 57243, 4, 1595517, 97100, '2018-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1604460, 'The Tsuranga Conundrum', 'Injured and stranded in the wilds of a far-flung galaxy, the Doctor, Yaz, Graham and Ryan must band together with a group of strangers to survive against one of the universe''s most deadly - and unusual - creatures.', 57243, 5, 1604460, 97100, '2018-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1606441, 'Demons of the Punjab', 'India, 1947. The Doctor and her friends arrive in the Punjab, as India is being torn apart. While Yaz attempts to discover her grandmother''s hidden history, the Doctor discovers demons haunting the land. Who are they, and what do they want?', 57243, 6, 1606441, 97100, '2018-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1615579, 'Kerblam!', '“Delivery for the Doctor!” A mysterious message arrives in a package addressed to the Doctor, leading her, Graham, Yaz and Ryan to investigate the warehouse moon orbiting Kandoka, and the home of the galaxy’s largest retailer: Kerblam!', 57243, 7, 1615579, 97100, '2018-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1621455, 'The Witchfinders', 'The Doctor, Ryan, Graham and Yaz arrive in 17th-century Lancashire and become embroiled in a witch tria run by the local landowner. As fear stalks the land, the arrival of King James I only serves to intensify the witch hunt. But is there something even more dangerous at work? Can the Doctor and friends keep the people of Bilehurst Cragg safe from all the forces that are massing in the land?', 57243, 8, 1621455, 97100, '2018-11-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1626274, 'It Takes You Away', 'On the edge of a Norwegian fjord in the present day, the Doctor, Ryan, Graham and Yaz discover a boarded-up cottage and a girl named Hanne in need of their help. What has happened here? What monster lurks in the woods around the cottage - and beyond?', 57243, 9, 1626274, 97100, '2018-12-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1626276, 'The Battle of Ranskoor Av Kolos', 'On the planet of Ranskoor Av Kolos, a battlefield, a conflict-scarred survivor, and a deadly reckoning await the Doctor, Ryan, Yaz and Graham.', 57243, 10, 1626276, 97100, '2018-12-09');
