INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941566, 'Episode 9', '', 57255, 9, 941566, 58477, '2013-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941552, 'Episode 10', '', 57255, 10, 941552, 58477, '2013-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941553, 'Episode 11', '', 57255, 11, 941553, 58477, '2013-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941557, 'Episode 12', '', 57255, 12, 941557, 58477, '2013-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941556, 'Episode 13', '', 57255, 13, 941556, 58477, '2013-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941555, 'Episode 14', '', 57255, 14, 941555, 58477, '2013-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941561, 'Episode 15', '', 57255, 15, 941561, 58477, '2013-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941560, 'Episode 16', '', 57255, 16, 941560, 58477, '2013-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941559, 'Episode 17', '', 57255, 17, 941559, 58477, '2013-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941558, 'Episode 18', '', 57255, 18, 941558, 58477, '2013-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941550, 'Episode 19', '', 57255, 19, 941550, 58477, '2013-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941562, 'Episode 20', '', 57255, 20, 941562, 58477, '2013-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (978443, 'Episode 21', 'In the final episode, Gaze gets a new boss and there''s a happy wedding.', 57255, 21, 978443, 58477, '2013-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1029932, 'Episode 1', 'Aiden and Freya Hoynes are the golden couple of British  politics. Aiden resigns from cabinet in a failed leadership bid thwarted  by his best friend Bruce Babbish. In the cabinet reshuffle, Freya is  appointed tocabinet, whilst Aiden returns to the back benches and a life of  political obscurity. Finally out of her husband''s shadow, Freya is  forced to choose between her own career ambitions and publicly  supporting her husband.', 57261, 1, 1029932, 64111, '2013-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1029933, 'Episode 2', 'Driven by a desire to avenge his own downfall, Aiden plots  against his old friend Bruce. He is also spending more time at home  looking after the children and particularly their Asperger''s son, Noah.  As he sitson the  side-lines watching his wife''s meteoric rise, Aiden is increasingly  consumed with jealousy and paranoia. Unable to accept his wife''s  new-found success or forgive her betrayal, Aiden begins to plot Freya''s  downfall as well as Bruce''s.', 57261, 2, 1029933, 64111, '2013-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1029934, 'Episode 3', 'Aiden has to defend himself in an embarrassing sex scandal  that threatens to derail any chance of a political comeback and also  further threatens his marriage. As he wrestles both back from the brink  hediscovers Freya has been less than honest about her whereabouts and the time she is spending with Bruce.', 57261, 3, 1029934, 64111, '2013-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112628, 'Episode 1', 'Just before dawn the bell wakes the young apprentices for another 12-hour shift at Quarry Bank Mill. Charlie Crout forces Miriam to leave the factory floor and his absence leads to an accident.', 57263, 1, 1112628, 71098, '2013-07-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112629, 'Episode 2', 'Esther Price arrives at court after assaulting her overseer, Charlie Crout. On the assumption that she will be found guilty, Mr Timperley is sent to the workhouse to collect a replacement apprentice.', 57263, 2, 1112629, 71098, '2013-08-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112630, 'Episode 3', 'Esther and Lucy head for Liverpool, chased by Timperley, but discover that Lucy''s sister Catherine never returned to the workhouse.', 57263, 3, 1112630, 71098, '2013-08-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112631, 'Episode 4', 'Lucy and Esther are convinced that Mr Timperley is responsible for Catherine''s disappearance. They''re determined to expose him but are blocked at every turn.', 57263, 4, 1112631, 71098, '2013-08-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112632, 'Episode 1', 'Four years on from the Poor Law Amendment Act, impoverished economic migrants from the south of England start to arrive at Quarry Bank Mill.', 57263, 1, 1112632, 71103, '2014-07-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112633, 'Episode 2', 'Esther comes of age and leaves the apprentice house, but not before signing her contract of employment. Esther''s new home is a small, dirty cellar in Styal village, but it gives her new freedom.', 57263, 2, 1112633, 71103, '2014-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112634, 'Episode 3', 'The Chartist rally at Kersal Moor is approaching and Daniel does his best to gather the workers despite a lacklustre response.', 57263, 3, 1112634, 71103, '2014-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112635, 'Episode 4', 'After a difficult labour, Esther finally gives birth to a healthy baby boy. She returns to work the next day but struggles to keep up. John Howlett and his wife Rebecca receive tragic news.', 57263, 4, 1112635, 71103, '2014-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112636, 'Episode 5', 'With the country in recession, William Greg is forced to slash his workers'' wages. Daniel urges his colleagues to withdraw their labour, but can they afford to go unpaid during a strike?', 57263, 5, 1112636, 71103, '2014-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1112637, 'Episode 6', 'The second series reaches its climax. There''s a violent confrontation between the striking workers and the special constables, while Peter is desperate to find out the truth about Dominica.', 57263, 6, 1112637, 71103, '2014-08-24');
