INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972280, 'Arise My Love, Shake Off This Dream', 'The story follows a sheriff trying to police the small New Jersey town where he grew up and a nearby Native American settlement begins with a tragedy that impacts both factions of the area.', 57273, 1, 972280, 59907, '2014-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972281, 'The Wolf and the Dog', 'Determined to cover up the truth by any means necessary, Harold''s sworn duty to protect and serve suffers in the aftermath of the accident.', 57273, 2, 972281, 59907, '2014-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972282, 'The Woman Who Fell from the Sky', 'Rachel makes an interesting discovery at her grandparents'' house; Junior falls further under Kopus'' spell; Jean''s emotional turbulence worsens.', 57273, 3, 972282, 59907, '2014-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972283, 'The Bad Weapons', 'Harold finds himself caught between his role as law enforcement and the deal he has struck with Kopus.', 57273, 4, 972283, 59907, '2014-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972284, 'The Great Snake Battle', 'Harold makes a curious discovery as he puzzles over new details; Kopus heads to Brooklyn armed with new knowledge; Jean makes a bold decision.', 57273, 5, 972284, 59907, '2014-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972285, 'Snaring of the Sun', 'Kopus finds himself up against the wall and in imminent danger; Harold discovers heartbreaking news about his family''s past.', 57273, 6, 972285, 59907, '2014-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043530, 'Gifts', 'Kopus is released from jail and returns home with an ankle monitor, while Harold deals with locals who are not happy about the Lenape tribe receiving federal recognition.', 57273, 1, 1043530, 65090, '2015-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043531, 'Graves', 'Kopus becomes the focal point for all of the suspicion from the tribe. Harold protects Junior, jeopardizing his standing in the police department.', 57273, 2, 1043531, 65090, '2015-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050589, 'Intruders', 'After hearing of Captain Warren’s suicide, Harold, Jean and her parents discuss their uneasiness. Marie meets with the Tribal Council to discuss the issue of a casino, which Sky is fiercely opposed to.', 57273, 3, 1050589, 65090, '2015-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050590, 'A Cure', 'Believing his career is over, Harold meets with the Mayor. Rachel finds Jean’s diary and is deeply disturbed. Kopus confronts Harold.', 57273, 4, 1050590, 65090, '2015-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050591, 'The Hatching', 'Jean is distraught over Rachel’s episodeand believes her father knows more than he lets on. Kopus visits Junior’s campsite.', 57273, 5, 1050591, 65090, '2015-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050592, 'Shadow Walker', 'In New Jersey, Jean spirals further out of control. She confronts her father about his actions against her brother. Harold later goes to Marie to make peace.', 57273, 6, 1050592, 65090, '2015-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019356, 'The Way Men Divide', 'A young D.A., out to make a name, goes after cases that may be connected to VIPs. Hoping to make an even bigger name for himself, he goes after cold cases that are not only connected to VIPs but important people who want them solved.', 57277, 1, 1019356, 63507, '2014-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019357, 'No Such Thing as Justice', 'As the execution date looms, Christine and the Innocence Initiative staff scramble to prove a flaw in the case, while Adam plays every card he has in an effort to block them.', 57277, 2, 1019357, 63507, '2014-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019358, 'Facts Are the Enemy', 'Christine''s preoccupation with the Butler case makes it hard for her to focus on her impending bar exam, while Adam attempts to resolve his doubts by confirming Jenny Butler''s eyewitness ID.', 57277, 3, 1019358, 63507, '2014-07-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019359, 'Never Forget', 'Terry has difficulty re-entering society after his release. Adam chases down loose ends, while Christine finds herself unprepared for the most important test of her life.', 57277, 4, 1019359, 63507, '2014-07-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019360, 'I''m for Justice', 'The Page family deals with Jenny''s fate. Trey finds himself at odds with his father as he voices his own views about right and wrong. Christine reaches out to her estranged family for help as her investigation into Terry''s case turns dangerous.', 57277, 5, 1019360, 63507, '2014-08-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019361, 'And the Little Ones Get Caught', 'Adam is furious when he learns the truth about the Butler DNA evidence. While investigating his own murder case, Terry deepens his involvement with the wealthy Zale family. Clark''s own investigation into Terry''s case suddenly becomes dangerous.', 57277, 6, 1019361, 63507, '2014-08-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019362, 'I Can''t Go Back', 'It is now Terry''s turn to help Christine. Adam wrestles with a decision that endangers his family and political future. Terry puts his freedom on the line when he goes in search of DNA evidence that will prove his innocence once and for all.', 57277, 7, 1019362, 63507, '2014-08-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1019363, 'To Whom Evil Is Done', 'As Christine and Terry get closer, Stanley Zale forces her to choose between the two men in her life. Billie forms her own plan to protect her family. Bobby and Danny trap Eric in a violent event that reaches Terry and Christine in an epic finale', 57277, 8, 1019363, 63507, '2014-08-27');
