INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (941640, 'Pilot', 'Trey and his guys have an app, and a plan - now they need an investor. It''s party-crashing time.', 57284, 1, 941640, 58487, '2013-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977731, 'Kid Charlemagne', 'After getting to know the level of competition inside The Murch''s Accelerator, Trey defies Lisa by reaching out to a prominent tech blogger, hoping to generate press for BRB''s beta launch. When the plan backfires, it threatens the team''s future.', 57284, 2, 977731, 58487, '2013-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977732, 'Waiting For A Girl Like You', 'Nash''s parents visit the guys and demand that Nash go on a blind date with a girl they''ve chosen for him. With an investment from Nash''s parents at stake, Trey and Lisa must accompany Nash on his date.', 57284, 3, 977732, 58487, '2013-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977733, 'One on One', 'In the aftermath of Trey and Lisa''s hookup, Trey tries to get some clarity on their relationship while Lisa tries to stand up to The Murch.', 57284, 4, 977733, 58487, '2013-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977734, 'Takin'' It to the Streets', 'When BRB is hacked right after the beta launch, Trey and Hobbes get to know each other better as they desperately search the city for their prime suspect. Meanwhile, Mikki takes care of an anxious Mitchell after he runs out of Adderall.', 57284, 5, 977734, 58487, '2013-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977735, 'Lowdown', 'Trey realizes that BRB does not have enough female users to fulfill his vision and despite pressure from Nash to focus on BRB''s strengths, Trey is unwilling to alter his vision. Meanwhile, Hobbes spirals out of control leaving the team needs to figure out how best to deal with his increasingly volatile behavior.', 57284, 6, 977735, 58487, '2013-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165168, 'The Planet of Decision (The Chase, Part Six)', 'The Doctor and his friends are taken into the Mechanoid City but their troubles are far from over...especially when the Daleks launch an attack. ', 121, 35, 165168, 6970, '1965-06-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977736, 'Strange Magic', 'With the team in disarray before Demo Day, Murch sends Trey and the boys to a team-building retreat in the woods. Once there, they quickly reject the retreat''s itinerary and go rogue. In the end, their trip yields insights into the future of BRB and brings them closer together, in ways they never expected.', 57284, 7, 977736, 58487, '2013-12-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977737, 'Show & Tell', 'When BRB receives a lukewarm response from investors at Demo Day, Trey and Nash must choose between conflicting courses of action in order to secure the future of their company. Meanwhile, both Nash and Mitchell are forced to evaluate their personal lives and face some inner truths.', 57284, 8, 977737, 58487, '2013-12-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977738, 'Steppin'' Out', 'When a scandal puts the Murch on ice, BRB''s potential investors begin to pull out. Desperate, Trey must turn to an unlikely source for help, even if it means straining his relationship with Murch. Meanwhile, Mikki''s wayward mother drops in unexpectedly, hoping to pick up right where they left off.', 57284, 9, 977738, 58487, '2014-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977739, 'Blinded By The Light', 'Having turned his back on the Murch, Trey arrives in L.A. to run the Silicon Beach investor circuit with Victoria. Back in San Francisco, Mitchell accompanies Nash to Michael Lau''s birthday bash, and Hobbes gets closer with Trevor''s mom, Joanne.', 57284, 10, 977739, 58487, '2014-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (977740, 'This Is It', 'Armed with insider information from Jordan, Trey must decide whether or not to sell BRB. He mends fences with Murch and seeks his advice after the rest of the team votes to take Casper''s deal.', 57284, 11, 977740, 58487, '2014-01-17');
