INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164122, 'Children in Need: Born Again', 'The first episode, "An Unearthly Child", was originally recorded a month before full recording on the series began. However, the initial recording was bedevilled with technical problems and errors made during the performance. Two versions of the scene set in the TARDIS were recorded, along with an aborted first attempt to start the second version.', 121, 1, 164122, 6968, '2005-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164605, 'Dimensions in Time (1)', 'The Rani draws the Doctor''s First and Second incarnations into a time tunnel and traps his other incarnations in a time loop in Albert Square, bouncing back and forth between 1973, 1993 and 2013.', 121, 3, 164605, 6968, '1993-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164418, 'Dimensions in Time (2)', 'The Rani plans to transfer her time tunnel to the centre of the Earth''s time meridian, and use her store of genetic codes and brain prints of every living creature to control evolution itself.', 121, 4, 164418, 6968, '1993-11-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164123, 'Doctor Who', 'San Francisco, 1999. Returning home to Gallifrey with the remains of the Master, the TARDIS is forced off course, landing the Doctor in the middle of a street gang''s gun fight in San Francisco. Critically wounded in the shoot out, the Doctor regenerates to save his own life. Meanwhile, the Master has taken possession of another new body. As the clock counts down to the start of the new millennium, the Doctor has to stop the Master destroying all life on Earth.', 121, 5, 164123, 6968, '1996-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164186, 'Christmas Moments', 'Genesis of a Classic: 62 minute production documentary The Dalek Tapes: 53-minute humorous documentary on the convoluted fictional history of the Daleks Blue Peter: Excerpt from the time of Genesis''s transmission. Includes children''s models Continuities compilation: BBC logo and announcer from original and repeat showings of the serial', 121, 10, 164186, 6968, '2008-12-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164209, 'The Waters of Mars', 'An unedited studio recording of the pilot "An Unearthly Child", including all takes of the second part of the show.', 121, 14, 164209, 6968, '2009-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164315, 'Dreamland', 'Location: Roswell, New Mexico & Area 51 Date: 1947 & 1958 Enemies: Viperox, US Military,Alliance of Shades Skorpius Flies During a visit to a local diner the doctor stumbles upon a mysterious alien artefact that leads him on a mission to rescue Rivesh Mantilax from the threat of the Viperox and the clutches of the American military in New Mexico.', 121, 15, 164315, 6968, '2009-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164314, 'The End of Time (1)', 'Location: London, Earth Date: December 2009 Enemies: The Master, The Time Lords, Joshua Naismith Facing his mortality, the Doctor returns to Earth find the planet''s population haunted by horrific nightmares all their own. Reuniting with Wilf, The Doctor investigates a lingering mystery that threatens to unravel the planet as an old enemy prepares to be reborn.', 121, 16, 164314, 6968, '2009-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164316, 'The Curse of Fenric Special Edition', 'England, the 1940s. The TARDIS brings the Doctor and Ace to a secret naval base during WWII.', 121, 17, 164316, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (954632, 'The Ultimate Guide', 'The Doctor, his universe and the mythology of the series. A look at the first four series and who the Doctor really is. An a sneak peak at series five and the new Doctor.', 121, 18, 954632, 6968, '2010-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164325, 'The Two Doctors Supplemental DVD', '', 121, 28, 164325, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164327, 'A TARDIS Tea Party (Children in Need)', '- What Lies Beneath: Cast and crew explore how the socio-political climate of the late sixties shaped this story (35 mins) - Going Underground: Making Of (19 mins) - Now and Then: Location featurette (9 mins) - Musical Scales: Retrospective on an era of musical experimentation in Doctor Who - Color Silurian Overlay: Featurette showing how the story was restored to full color for DVD release (4 mins) - Isolated Music - Radio Times Listings (DVD-ROM PC/Mac) - Photo Gallery (6 mins)', 121, 33, 164327, 6968, '2010-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164334, 'Doctor Who: A Celebration Concert', 'An array of rare archive footage from the missing stories of Doctor Who as well as presenting the incredible stories that recount their discovery from Nigeria to Australia. There are the moments considered too frightening for Australian audiences, a six minute extract from Galaxy 4: Four Hundred Dawns and pristine film footage from The Dalek''s Master Plan, all carefully reconstructed and restored aurally and visually.', 121, 41, 164334, 6968, '2007-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164336, 'A Fix with Sontarans', '"A Fix with Sontarans" is the name of a specially written segment produced for the BBC children''s programme Jim''ll Fix It featuring Colin Baker in character as the Sixth Doctor. It was broadcast on 23 February 1985. It is not generally considered to be canonical by Doctor Who fans.', 121, 42, 164336, 6968, '1985-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165361, 'The Highlanders, Episode Two', 'Polly and Kirsty capture Lieutenant Ffinch to try and enlist his help while the Doctor tricks Gray in order to escape. ', 121, 16, 165361, 6972, '1966-12-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164352, 'Do You Have a License to Save This Planet', 'What do you get if you cross a Krynoid with an Auton, Sontaran and a sombrero wearing Cyberon with a penchant for fine wines and Ex-cell-ent conversation? Shot probably. On the other hand you could have landed yourself in the middle of the Licensed Reality Corporations'' ™ attempt to wipe the stain of the Foot Doctor from the bottom of Accepted Canonicity. Packed full of strange whizzy things, blue swirly things, and more than its fair share of spoons, "Do You Have A Licence To Save This Planet?" brings SYLVESTER McCOY into battle against some of the most fearsome (as seen on BBCTV''s DOCTOR WHO) monsters of all time. Armed only with a duffle coat, an umbrella and a patented Sylvester-o-matic-talk-them-to-death-o-tron THE FOOT DOCTOR has come to save the universe once again. He''s back. And it''s about feet.', 121, 60, 164352, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164360, 'The Pirate Planet Deleted Scenes', 'Cold Fusion - Cast and crew look back at the making of the story. With actors Frazer Hines, Deborah Watling and Sonny Caldinez, designer Jeremy Davies and James Bresslaw, son of the late actor Bernard Bresslaw. Beneath the Ice - A look behind the scenes of the animated Ice Warrior episodes. Producers Chris Chapman and Niel Bushnell, together with animation director Chris Chatterton from Qurios lift the lid on the process used to bring Varga and his Warriors back to life. VHS Links - the introduction to the story and linking material covering the two missing episodes, as used on the VHS release of the story in 1998. Includes the BBC Video “Adjust your tracking control” caption for a true sense of nostalgia! Blue Peter Design-a-Monster - the competition launch and subsequent winners of the 1967 Design-a-Monster competition, which ran during the transmission of The Ice Warriors.', 121, 78, 164360, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164361, 'The Stones of Blood Deleted Scenes', 'Taken Out Of Time - A frank and revealing examination of why Shada became the only Doctor Who story never to be completed. Featuring Tom Baker (The Doctor), Daniel Hill (Chris Parsons) and director Pennant Roberts. Strike! Strike! Strike! - A look at how industrial action impacted Doctor Who over the years. Now And Then - Compare the Cambridge locations as they appeared in 1979 with how they look today. Being A Girl - A look at the representation of women in Doctor Who.', 121, 79, 164361, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164363, 'Time-Flight Deleted Scenes', 'Mutt Mad - cast and crew look back at the making of the story. With actor Garrick Hagon, producer Barry Letts, director Christopher Barry, co-writer Bob Baker, script editor Terrance Dicks and designer Jeremy Bear. Race Against Time - Noel Clarke narrates a documentary looking at the representation of black actors in Doctor Who and on British TV as a whole. With writer and critic Bidisha, writer Stephen Bourne, actor Fraser James, and Doctor Who Magazine’s assistant editor Peter Ware. Dressing Doctor Who - three-times Academy Award winning costume designer James Acheson takes an affectionate look back over his earlier work on Doctor Who from his home in New Zealand. Narrated by Simon Ockendon. Blue Peter - Peter Purves takes a look at a collection of Doctor Who monsters prior to the opening of an exhibition of visual effects.', 121, 80, 164363, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164089, 'Time-Flight Outtakes', '', 121, 81, 164089, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164366, 'Mawdryn Undead Deleted Scenes', 'The Making of Day of The Daleks - Special Edition - Producer Steve Broster guides us through the creation of his Special Edition of this story. With voice artiste Nicholas Briggs, audio engineer Mark Ayres, cameraman John Kelly, Dalek builder Toby Chamberlain, UNIT soldier Kevan Looseley and Ogron Nick Nicholson. Now And Then - A visit to the locations used in Day Of The Daleks to see how they have changed over the years. Narrated by Toby Hadoke. The UNIT Family - Part 2 - The second instalment of the series looking at the Doctor''s years on Earth as scientific advisor to the United Nations Intelligence Taskforce and the strong family bonds created during that time. With Katy Manning, Barry Letts, Terrance Dicks, actors Nicholas Courtenay, John Levene, Richard Franklin and Fernanda Marlowe, stuntman Derek Ware.', 121, 82, 164366, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164078, 'The Caves of Androzani Deleted Scenes', '', 121, 85, 164078, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164086, 'Vengeance on Varos Deleted Scenes', '', 121, 86, 164086, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164066, 'Vengeance on Varos Outtakes', '', 121, 87, 164066, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955387, 'The Mark of the Rani Deleted Scenes', 'Happy Birthday To Who - Cast and crew recall the making of The Three Doctors in this brand-new documentary. With contributions from Katy Manning (Jo Grant) , Stephen Thorne (Omega) , producer Barry Letts, script editor Terrance Dicks and co-writer Bob Baker. Was Doctor Who Rubbish? - Four fans of the classic series defend traditional claims that the programme was nothing more than a quarry-bound romp with wobbly sets and dodgy effects. Girls, Girls , Girls - The 1970''s - Continuing this popular series, Caroline John (Liz Shaw) and louise Jameson (Leela) join Katy Manning for a discussion on the perils of being a 1970''s Doctor Who girl. Introduced by Peter Purves.', 121, 88, 955387, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164092, 'Revelation of the Daleks Deleted Scenes', '', 121, 89, 164092, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164094, 'The Mysterious Planet Deleted Scenes', '', 121, 90, 164094, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164372, 'Terror of the Vervoids Deleted Scenes', '', 121, 92, 164372, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164375, 'The Ultimate Foe Deleted Scenes', '', 121, 93, 164375, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164095, 'Ghost Light Deleted Scenes', '', 121, 95, 164095, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164380, 'Survival Deleted Scenes', '', 121, 96, 164380, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164097, 'Survival Outtakes', '', 121, 97, 164097, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164382, 'The Chase Supplemental DVD', '', 121, 98, 164382, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164388, 'The Ambassadors of Death - Extras', 'Mars Probe 7: Making the Ambassadors of Death - cast and crew look back at the making of the story. With Michael Ferguson, Terrance Dicks, Derek Ware, Roy Scammell and assistant floor manager Margot Hayhoe. Narrated by Carl Kennedy Trailer - the original BBC trailer for the story. Tomorrow’s Times - The Third Doctor - our ongoing series looking at the press coverage of Doctor Who reaches the Jon Pertwee era.', 121, 99, 164388, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164099, 'The Daemons Documentary - Return to Devils End', '', 121, 100, 164099, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164390, 'Real Time (1)', 'There has been a series of mysterious vanishings on the desert planet Chronos in the 33rd century. Survey teams working for a university seem to have simply vanished amongst the pyramids on the planet. Alongside two other survey teams and an expert on cybernetics, the Doctor and Evelyn learn the deadly truth: that the planet Chronos is being used as a base for one of the Doctor''s oldest and deadliest foes — the Cybermen.', 121, 101, 164390, 6968, '2002-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164392, 'Real Time (2)', 'There has been a series of mysterious vanishings on the desert planet Chronos in the 33rd century. Survey teams working for a university seem to have simply vanished amongst the pyramids on the planet. Alongside two other survey teams and an expert on cybernetics, the Doctor and Evelyn learn the deadly truth: that the planet Chronos is being used as a base for one of the Doctor''s oldest and deadliest foes — the Cybermen.', 121, 102, 164392, 6968, '2002-08-03');
