INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1511593, 'Creation of the Daleks', 'Bonus content from the Complete Classic 26 Seasons Collection for Season 1''s The Daleks, featuring the story of the creation of the Daleks', 121, 109, 1511593, 6968, null);
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164689, 'An Unearthly Child (An Unearthly Child, Part One)', 'London, 1963.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164768, 'The Cave of Skulls (An Unearthly Child, Part Two)', 'Earth, 100,000 B.C.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164784, 'The Forest of Fear (An Unearthly Child, Part Three)', 'Prisoners of the earliest humans, the TARDIS crew are caught in a deadly power play for leadership of the tribe.', 121, 3, 164784, 6969, '1963-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164851, 'The Firemaker (An Unearthly Child, Part Four)', 'The TARDIS crew must make fire for the early humans to stay alive. But once they do, they may not be allowed to leave!', 121, 4, 164851, 6969, '1963-12-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164868, 'The Dead Planet (The Daleks, Part One)', 'Time Unknown, Planet Unknown. The TARDIS lands in an eerie petrified forest overlooking a magnificent steel city. The Doctor wants to explore the city – but what is waiting there?', 121, 5, 164868, 6969, '1963-12-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164882, 'The Survivors (The Daleks, Part Two)', 'The dead planet is not uninhabited after all. The Doctor is about to meet what will become his greatest enemies. And he and his crew are dying of radiation sickness.', 121, 6, 164882, 6969, '1963-12-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164894, 'The Escape (The Daleks, Part Three)', 'Imprisoned on Skaro by the scheming Daleks, the Doctor and his companions work to escape their clutches.', 121, 7, 164894, 6969, '1964-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164932, 'The Ambush (The Daleks, Part Four)', 'The time travellers work desperately to both escape the Dalek city and prevent a bloody massacre.', 121, 8, 164932, 6969, '1964-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164942, 'The Expedition (The Daleks, Part Five)', 'The time travellers have escaped from the Daleks, but left a vital piece of the TARDIS behind. Getting it back will mean pushing the Thals to mount a dangerous operation.', 121, 9, 164942, 6969, '1964-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164952, 'The Ordeal (The Daleks, Part Six)', 'Ian, Barbara and the Thals struggle through the caves to reach the Dalek city. Will they get there in time? Is there even a way through the treacherous caves? And what are the Daleks planning?', 121, 10, 164952, 6969, '1964-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164960, 'The Rescue (The Daleks, Part Seven)', 'Time is running out as the Doctor and his companions try to defeat the Daleks before they wipe out all life on Skaro.', 121, 11, 164960, 6969, '1964-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164965, 'The Edge of Destruction (The Edge of Destruction, Part One)', 'A mysterious explosion has knocked the TARDIS into void. And in their confusion, the crew are turning on one another.', 121, 12, 164965, 6969, '1964-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164976, 'The Brink of Disaster (The Edge of Destruction, Part Two)', 'The TARDIS is adrift, the crew turning on each other. Only by working together can they find their way out before they are destroyed.', 121, 13, 164976, 6969, '1964-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164991, 'The Roof of the World (Marco Polo, Part One)', 'The TARDIS experiences a total power failure and is stranded in the Himalayas in the 13th century. The travellers are forced to join the caravan of the famous explorer, Marco Polo, in order to survive -- but Polo, fascinated by their claims that the TARDIS can fly through the air, seizes it on behalf of Kublai Khan in the hope that presenting the Khan with such a fabulous gift will convince him to let Polo return home to Venice. The travellers are forced to accompany Polo on his long trek across Asia to the Khan''s court, but their many attempts to reclaim their property are foiled -- not just by Polo, but by the war lord Tegana, who is apparently on a mission of peace but has entirely different plans for dealing with Kublai Khan...', 121, 14, 164991, 6969, '1964-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164998, 'The Singing Sands (Marco Polo, Part Two)', 'Tegana sabotages the party''s water bags, leaving them in dire need of fresh supplies. ', 121, 15, 164998, 6969, '1964-02-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165003, 'Five Hundred Eyes (Marco Polo, Part Three)', 'The Doctor and Susan are able to supply Marco with condensation that has formed inside the TARDIS, saving the group from dying of first.When the group are reunited with Tegana, the travelers begin to suspect he is up to something. ', 121, 16, 165003, 6969, '1964-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955394, 'The Wall of Lies (Marco Polo, Part Four)', 'The Doctor''s group manage to rescue Barbara from the Mongols but once more Marco remains unaware of Tegana''s involvement. ', 121, 17, 955394, 6969, '1964-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165045, 'Rider from Shang Tu (Marco Polo, Part Five)', 'The Doctor and his friends elect to warn Marco of Acomat''s attack even though it means losing their chance to gain access to the TARDIS. ', 121, 18, 165045, 6969, '1964-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165046, 'Mighty Kublai Khan (Marco Polo, Part Six)', 'The Doctor, Ian and Barbara are forced to surrender to Tegana and Marco, leaving both of them the opportunity to gain possession of the TARDIS. ', 121, 19, 165046, 6969, '1964-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165047, 'Assassin at Peking (Marco Polo, Part Seven)', 'Tegana finally makes his move to assassinate the Khan, giving the Doctor and his friends an opportunity to thwart his plans and regain the TARDIS. ', 121, 20, 165047, 6969, '1964-04-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344184, 'Episode 13', '', 70452, 13, 1344184, 85559, '2017-08-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165048, 'The Sea of Death (The Keys of Marinus, Part One)', 'The alien world of Marinus. Perfect peace has reigned here for decades due to the mind-controlling influence of a machine known as the Conscience. But now a race known as the Voord have developed an immunity and Arbitan, keeper of the machine, has been forced to scatter the vital control keys around the planet. Now he needs the help of the time travellers to get them back - it will be an extraordinary journey, with perils every step of the way...', 121, 21, 165048, 6969, '1964-04-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165049, 'The Velvet Web (The Keys of Marinus, Part Two)', 'The Doctor and his friends arrive in the apparently idyllic city of Morphoton but Barbara soon begins to realise there is more to their hosts than meets the eye. ', 121, 22, 165049, 6969, '1964-04-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165050, 'The Screaming Jungle (The Keys of Marinus, Part Three)', 'The search for the second key takes the travellers to a jungle where Ian and Barbara come under threat from rapidly growing plants. ', 121, 23, 165050, 6969, '1964-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165051, 'The Snows of Terror (The Keys of Marinus, Part Four)', 'Searching for the third key, Ian and Barbara meet with the sinister trapper Vasor before following Susan and the others into a cave system guarded by the mysterious Ice Soldiers.', 121, 24, 165051, 6969, '1964-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165052, 'Sentence of Death (The Keys of Marinus, Part Five)', 'The group are reunited with the Doctor in the city of Millennius where Ian faces trial for murder after the fourth key is stolen.', 121, 25, 165052, 6969, '1964-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165053, 'The Keys of Marinus (The Keys of Marinus, Part Six)', 'The Doctor and his friends must locate the real murderers and the fourth key before heading off for a final confrontation with the Voord', 121, 26, 165053, 6969, '1964-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165054, 'The Temple of Evil (The Aztecs, Part One)', 'The TARDIS arrives on Earth landing in 16th century Aztec society. Barbara goes off exploring - despite the Doctor''s orders not to wander off - and is taken away by the high priest Autloc who believes she is the reincarnation of the goddess Yetaxa. They believe it is a sign that the rains - which are late - will now come. The high priest of sacrifice Tlotoxl recruits Ian to lead their army but he finds he has a rival in Ixta. Ian is less than comfortable with his role when he learns that they are to deliver the human sacrifice to the high priest at the rain ceremony. The Doctor emphasizes that they must not interfere with Aztec rituals, something that does not sit well with Barbara.', 121, 27, 165054, 6969, '1964-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165056, 'The Warriors of Death (The Aztecs, Part Two)', 'Barbara tries to change the course of history - and Ian fights for his life. ', 121, 28, 165056, 6969, '1964-05-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165057, 'The Bride of Sacrifice (The Aztecs, Part Three)', 'While the Doctor tries to find a way back to the TARDIS, Tlotoxl continues to plot Barbara''s downfall and sees an opening when Susan questions Aztec custom. ', 121, 29, 165057, 6969, '1964-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165058, 'The Day of Darkness (The Aztecs, Part Four)', 'Tlotoxl''s machinations result in both Susan and Ian being arrested.With the TARDIS once again trapped inside the tomb, the travelers'' only hope for escape lies with Autloc and Cameca. ', 121, 30, 165058, 6969, '1964-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165059, 'Strangers in Space (The Sensorites, Part One)', 'The 28th century. The TARDIS materialises on a spaceship orbiting a planet known as the Sense-Sphere, whose natives, the Sensorites, have trapped the ship''s human crew in a state of paralysis.', 121, 31, 165059, 6969, '1964-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165065, 'The Unwilling Warriors (The Sensorites, Part Two)', 'The Doctor and his companions are on board an Earth ship trapped in orbit around the Sense-Sphere when it is boarded by the Sensorites, who steal the lock mechanism from the TARDIS.', 121, 32, 165065, 6969, '1964-06-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165066, 'Hidden Danger (The Sensorites, Part Three)', 'The Doctor and his companions are escorted to the Sense-Sphere where they attempt to negotiate with the Sensorites for the release of the TARDIS.', 121, 33, 165066, 6969, '1964-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165070, 'A Race Against Death (The Sensorites, Part Four)', 'With Ian having fallen victim to the Sensorites'' plague, the Doctor is desperate to find a cure. But the City Administrator is still determined to rid his world of aliens. ', 121, 34, 165070, 6969, '1964-07-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165072, 'Kidnap (The Sensorites, Part Five)', 'The City Administrator is determined to destroy the Doctor and his friends and his paranoia prevents the Doctor''s cure from being distributed. ', 121, 35, 165072, 6969, '1964-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165073, 'A Desperate Venture (The Sensorites, Part Six)', 'While the City Administrator''s schemes reach their climax, the Doctor and Ian venture into the tunnels under the city to discover the real cause of the Sensorite plague. ', 121, 36, 165073, 6969, '1964-08-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165074, 'A Land of Fear (The Reign of Terror, Part One)', 'The TARDIS lands during the French Revolution, where Ian, Barbara, and Susan become caught up in the politics of the day. When they are arrested and set to be executed, the Doctor must take on the disguise of a public official to try and save their lives.', 121, 37, 165074, 6969, '1964-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165083, 'Guests of Madame Guillotine (The Reign of Terror, Part Two)', 'Susan, Ian and Barbara are sentenced to be guillotined but an encounter with a dying English prisoner may offer Ian a chance of survival. ', 121, 38, 165083, 6969, '1964-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165084, 'A Change of Identity (The Reign of Terror, Part Three)', 'Susan and Barbara are rescued by Jules and Jean, two members of the escape chain, while the Doctor gains access to the prison by posing as a revolution official. ', 121, 39, 165084, 6969, '1964-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165085, 'The Tyrant of France (The Reign of Terror, Part Four)', 'The Doctor is forced into a meeting with Robespierre while Barbara''s attempts to find a physician for Susan result in them being betrayed. ', 121, 40, 165085, 6969, '1964-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165086, 'A Bargain of Necessity (The Reign of Terror, Part Five)', 'Ian finds himself held prisoner by the treacherous Leon while the Doctor attempts to engineer Susan and Barbara''s escape.', 121, 41, 165086, 6969, '1964-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165087, 'Prisoners of Conciergerie (The Reign of Terror, Part Six)', 'Ian finally delivers his message to James Stirling but in order to secure Susan''s release he and Barbara are forced into a dangerous spying mission.', 121, 42, 165087, 6969, '1964-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975855, 'Planet of Giants (Planet of Giants, Part One)', 'When the TARDIS malfunctions and the doors open in the time vortex, the travelers and their Ship shrink to the size of insects. When they arrive on Earth, they uncover a murderous plot involving a new insecticide - but how can they stop the crime in their miniaturized condition? (Originally broadcast in three parts.)', 121, 1, 975855, 6970, '1964-10-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003768, 'Dangerous Journey (Planet of Giants, Part Two)', 'Ian and Barbara are accidentally taken into Smithers'' laboratory and, while the Doctor and Susan face a hazardous journey to reach them, they witness the deadly effects of DN6 first hand.', 121, 2, 1003768, 6970, '1964-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003769, 'Crisis (Planet of Giants, Part Three)', 'The Doctor and his friends face a race against time to expose Forrester''s plans and return to normal size before Barbara succumbs to the effects of DN6.', 121, 3, 1003769, 6970, '1964-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975847, 'World''s End (The Dalek Invasion of Earth, Part One)', 'Ian and Barbara believe the TARDIS has finally returned to their contemporary London, but soon discover signs of plague and warfare. Their old enemies, the Daleks, have invaded the Earth of the 22nd century. Separated and fighting for their lives, the travelers must try to aid the remaining humans and overthrow the Daleks'' cruel tyranny. (Originally broadcast in six parts.)', 121, 4, 975847, 6970, '1964-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003787, 'Day of Reckoning (The Dalek Invasion of Earth, Part Three)', 'The Doctor manages to escape from the Dalek saucer and meet up with Susan and David but Ian is left trapped onboard. Meanwhile, Barbara and her new friends face a dangerous journey across London.', 121, 6, 1003787, 6970, '1964-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003788, 'The End of Tomorrow (The Dalek Invasion of Earth, Part Four)', 'While Susan and David try to find a way out of London, Ian and Larry infiltrate the Dalek mine workings.', 121, 7, 1003788, 6970, '1964-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003789, 'The Waking Ally (The Dalek Invasion of Earth, Part Five)', 'The Doctor''s party investigate the Daleks'' central control in Bedfordshire while Barbara and Jenny''s attempt to reach it are derailed when they are betrayed.', 121, 8, 1003789, 6970, '1964-12-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1003793, 'Flashpoint (The Dalek Invasion of Earth, Part Six)', 'The Daleks'' plan to transform Earth into a giant spaceship and wipe out its inhabitants is nearing completion and the Doctor and his friends face a race against time to prevent them from destroying the planet''s core.', 121, 9, 1003793, 6970, '1964-12-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975848, 'The Powerful Enemy (The Rescue, Part One)', 'On the planet Dido, the monstrous Koquillion terrorizes Bennett and Vicki, the only survivors of a crashed spaceship. When the TARDIS lands, the Doctor, Ian, and Barbara team up with Vicki to discover what Koquillion is hiding. (Originally broadcast in two parts.)', 121, 10, 975848, 6970, '1965-01-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975849, 'Desperate Measures (The Rescue, Part Two)', 'The Doctor and Ian reach the crashed spaceship and meet up with Barbara and Vicki, where the Doctor uncovers the truth about Koquillion.', 121, 11, 975849, 6970, '1965-01-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975850, 'The Slave Traders (The Romans, Part One)', 'The travelers decide to take a holiday near ancient Rome, but after a month the Doctor gets restless. He and Vicki determine to visit Rome, and while they are gone Ian and Barbara are abducted by slave traders. All roads lead to Rome, however, and the travelers find themselves at the mercy of the country''s petulant emperor, Nero... (Originally broadcast in four parts.)', 121, 12, 975850, 6970, '1965-01-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975852, 'All Roads Lead to Rome (The Romans, Part Two)', 'While the Doctor and Vicki meet with Nero, Barbara is taken to Rome to be sold while Ian is forced to work as a galley slave.', 121, 13, 975852, 6970, '1965-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165176, 'Conspiracy (The Romans, Part Three)', 'Ian and Delos are forced to fight each other for their freedom while the Doctor has to perform for Nero''s court.', 121, 14, 165176, 6970, '1965-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165106, 'Inferno (The Romans, Part Four)', 'Ian and Delos manage to escape from Sevcheria and Tavius agrees to help Barbara rejoin them.The Doctor''s attempts to avoid being thrown to the lions inadvertently result in Nero deciding to burn down Rome.', 121, 15, 165106, 6970, '1965-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165109, 'The Web Planet (The Web Planet, Part One)', 'The TARDIS is drawn by a mysterious force and lands on the alien planet Vortis. There the Doctor, Ian, Barbara and Vicki find themselves caught up in a war between an evil force known as "The Animus", its ant-like Zarbi allies, and the butterfly-like Menoptra race and their allies the subterranean Optera.', 121, 16, 165109, 6970, '1965-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165133, 'The Zarbi (The Web Planet, Part Two)', 'The Doctor, Ian and Vicki are captured by the Zarbi while Barbara meets up with the butterfly-like Menoptera who are trying to reclaim the planet.', 121, 17, 165133, 6970, '1965-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165134, 'Escape to Danger (The Web Planet, Part Three)', 'The Doctor is forced to co-operate with the Animus but Ian uses the opportunity to make an escape attempt. ', 121, 18, 165134, 6970, '1965-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165135, 'Crater of Needles (The Web Planet, Part Four)', 'Ian and Vrestin are captured by the subterranean Optera while Barbara and her Menoptera allies attempt to escape from the slave camp. ', 121, 19, 165135, 6970, '1965-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165139, 'Invasion (The Web Planet, Part Five)', 'Barbara and the surviving Menoptera take refuge in the Temple of Light while the Doctor and Vicki attempt to escape by taking control of a Zarbi. ', 121, 20, 165139, 6970, '1965-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165177, 'The Centre (The Web Planet, Part Six)', 'The Doctor and Vicki are taken before the Animus but the isoptope is left behind in the laboratory.The only hope of victory lies with Barbara and her Menoptera allies.', 121, 21, 165177, 6970, '1965-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165145, 'The Lion (The Crusade, Part One)', 'The TARDIS lands in the Holy Land during the Third Crusade and the crew help save Richard the Lionheart from an ambush, but Barbara is captured and brought before Saladin. ', 121, 22, 165145, 6970, '1965-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165149, 'The Knight of Jaffa (The Crusade, Part Two)', 'While the Doctor, Ian, and Vicki are drawn into the intrigues of King Richard''s court, Barbara has to cope with an impatient Saladin and the vengeful El Akir. ', 121, 23, 165149, 6970, '1965-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165174, 'The Wheel of Fortune (The Crusade, Part Three)', 'Barbara allies herself with a man whose were murdered by El Akir as the Doctor and Vicki are caught up in Richard''s plan to offer his sister''s hand in marriage to Saladin''s brother. ', 121, 24, 165174, 6970, '1965-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165153, 'The Warlords (The Crusade, Part Four)', 'Ian sets out with a reluctant accomplice to rescue Barbara from El Akir''s palace as the Doctor and Vicki try to evade the suspicions of the Earl of Leicester.', 121, 25, 165153, 6970, '1965-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165156, 'The Space Museum (The Space Museum, Part One)', 'The TARDIS arrives on a planet that has been turned into a space museum but the Doctor and his friends are puzzled when they find themselves out of phase with their surroundings. ', 121, 26, 165156, 6970, '1965-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165173, 'The Dimensions of Time (The Space Museum, Part Two)', 'Now back on their proper time track, the Doctor and his friends must work to avoid the future they saw for themselves.', 121, 27, 165173, 6970, '1965-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165159, 'The Search (The Space Museum, Part Three)', 'With the Doctor missing, Ian, Barbara and Vicki find themselves in danger from the Moroks while the Xerons also try to make contact with them. ', 121, 28, 165159, 6970, '1965-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165175, 'The Final Phase (The Space Museum, Part Four)', 'While Ian tries to force Lobos to release the Doctor from the museum, Vicki joins the Xerons in trying to gain the weapons needed to start a revolution against the occupiers. ', 121, 29, 165175, 6970, '1965-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165163, 'The Executioners (The Chase, Part One)', 'The Daleks pursue The Doctor through time and space, with the intentions of exterminating him. Places they land include the Mary Celeste, a haunted house and the empire state building. ', 121, 30, 165163, 6970, '1965-05-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165164, 'The Death of Time (The Chase, Part Two)', 'While Ian and Vicki are threatened by a Mire Beast, the Doctor and Barbara meet up with the Aridians...who are then ordered to hand them over to the Daleks. ', 121, 31, 165164, 6970, '1965-05-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165165, 'Flight Through Eternity (The Chase, Part Three)', 'The TARDIS crew''s attempts to escape from the Daleks take them to the top of the Empire State Building and a 19th century sailing ship. ', 121, 32, 165165, 6970, '1965-06-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165166, 'Journey into Terror (The Chase, Part Four)', 'The TARDIS lands in a haunted house where the Doctor and his friends are confronted by Dracula and Frankenstein''s Monster...and then the Daleks appear. ', 121, 33, 165166, 6970, '1965-06-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165167, 'The Death of Doctor Who (The Chase, Part Five)', 'With Vicki trapped on board the Dalek time machine, the Doctor, Ian and Barbara decide to make their stand on the planet Mechanus. ', 121, 34, 165167, 6970, '1965-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165368, 'The Highlanders, Episode Three', 'With the Highlanders imprisoned aboard Trask''s ship, the Doctor attempts to expose Grey''s plan. ', 121, 17, 165368, 6972, '1966-12-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165169, 'The Watcher (The Time Meddler, Part One)', 'The Doctor, Vicki, and Steven Taylor, go to 1066 England, but something doesn''t seem right including modern inventions like a Gramaphone and electricity. Could there be another Time Lord?', 121, 36, 165169, 6970, '1965-07-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165170, 'The Meddling Monk (The Time Meddler, Part Two)', 'The Doctor is being held prisoner by the Monk and Steven and Vicki''s search for him brings them to the Saxon village.But a greater danger threatens when a Viking raiding party arrives.', 121, 37, 165170, 6970, '1965-07-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165171, 'A Battle of Wits (The Time Meddler, Part Three)', 'The Doctor manages to escape from his cell and get the upper hand on the Monk but his plans are derailed when Sven and Ulf arrive at the monastery. ', 121, 38, 165171, 6970, '1965-07-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165172, 'Checkmate (The Time Meddler, Part Four)', 'The Doctor finally discovers what the Monk is up to and must move fast to prevent his opponent from altering the course of history.', 121, 39, 165172, 6970, '1965-07-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165178, 'Four Hundred Dawns (Galaxy 4, Part One)', 'After an encounter with a hostile robot called a Chumblie, the Doctor and his companions are rescued by a group of female Drahvins. ', 121, 1, 165178, 6971, '1965-09-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165331, 'Trap of Steel (Galaxy 4, Part Two)', 'With the knowledge that the planet will be destroyed in two days, the Drahvins instruct the Doctor to help them steal the Rills'' ship.', 121, 2, 165331, 6971, '1965-09-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164117, 'Air Lock (Galaxy 4, Part Three)', 'The Doctor and Vicki encounter the Rills and learn the situation is more complex than they thought while Steven finds the Drahvins'' hospitality ever more perilous.', 121, 3, 164117, 6971, '1965-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165179, 'The Exploding Planet (Galaxy 4, Part Four)', 'The Doctor and Vicki enlist the aid of the Chumblies to rescue Steven from the Drahvins and then find a way off the planet before its destruction. ', 121, 4, 165179, 6971, '1965-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165180, 'Mission to the Unknown', 'Whilst The Doctor, Steven and Vicki are traveling to their next destination. On the planet Kembel, Marc Cory, a Space Security Service agent discovers The Daleks are attending a secret meeting with their allies. Where Cory discovers the Dalek''s evil plan, which sets the stage for the epic 14-part adventure "The Dalek Master Plan". ', 121, 5, 165180, 6971, '1965-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165181, 'Temple of Secrets (The Myth Makers, Part One)', 'The TARDIS lands in the middle of the Trojan War, where the Doctor is mistaken for the god Zeus. ', 121, 6, 165181, 6971, '1965-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165182, 'Small Prophet, Quick Return (The Myth Makers, Part Two)', 'While Odysseus forces the Doctor to find a way to win the war, Steven decides to get himself taken prisoner in order to enter Troy and find Vicki and the TARDIS. ', 121, 7, 165182, 6971, '1965-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165183, 'Death of a Spy (The Myth Makers, Part Three)', 'With Steven and Vicki being held prisoner by the Trojans, the Doctor''s only hope of seeing them again is to suggest the idea of the Trojan Horse. ', 121, 8, 165183, 6971, '1965-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165333, 'Horse of Destruction (The Myth Makers, Part Four)', 'The Doctor waits inside the Trojan Horse for a chance to reach his companions but Steven''s assumed identity as a Greek soldier and Vicki''s growing feelings for Troilus endanger their escape.', 121, 9, 165333, 6971, '1965-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165184, 'The Nightmare Begins (The Daleks'' Master Plan, Part One)', 'The Doctor runs afoul of the Daleks and Special Security Agent Bret Vyon on the planet Kembel.', 121, 10, 165184, 6971, '1965-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975857, 'Day of Armageddon (The Daleks'' Master Plan, Part Two)', 'The Doctor infiltrates the Daleks'' conference to try and discover their plans, leaving Steven, Katarina and Bret to find a way off the planet.', 121, 11, 975857, 6971, '1965-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975858, 'Devil''s Planet (The Daleks'' Master Plan, Part Three)', 'The Doctor and his friends escape Kembel in the Spar ship but the Daleks force them down on the planet Desperus, where they are threatened by a group of convicts.', 121, 12, 975858, 6971, '1965-11-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165332, 'The Traitors (The Daleks'' Master Plan, Part Four)', 'With Katarina being held hostage, the Doctor, Steven and Bret are in danger of having to given in to Kirksen''s demands, while, on Earth, Chen has them listed as traitors. ', 121, 13, 165332, 6971, '1965-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165185, 'Counter Plot (The Daleks'' Master Plan, Part Five)', 'The Doctor, Steven and Sara are accidentally transported to the planet Mira where Chen sends the Daleks after them. ', 121, 14, 165185, 6971, '1965-12-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165186, 'Coronas of the Sun (The Daleks'' Master Plan, Part Six)', 'The Doctor, Steven and Sara escape Mira in a Dalek pursuit ship but when they find the ship is returning to Kembel, they are forced to come up with a new plan to avoid the Daleks. ', 121, 15, 165186, 6971, '1965-12-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165187, 'The Feast of Steven (The Daleks'' Master Plan, Part Seven)', 'The Doctor, Steven and Sara visit a Liverpool police station on Christmas Day and a Hollywood film set during the 1920s.', 121, 16, 165187, 6971, '1965-12-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165188, 'Volcano (The Daleks'' Master Plan, Part Eight)', 'The Daleks realise the Doctor has given them a fake Taranium Core while, on the planet Tigus, the Doctor encounters the Meddling Monk. ', 121, 17, 165188, 6971, '1966-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165189, 'Golden Death (The Daleks'' Master Plan, Part Nine)', 'The Doctor, Steven and Sara travel to Ancient Egypt, pursued by both the Daleks and the Meddling Monk.', 121, 18, 165189, 6971, '1966-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165190, 'Escape Switch (The Daleks'' Master Plan, Part Ten)', 'Steven, Sara and the Monk are captured by the Daleks in order to force the Doctor to hand over the Taranium Core. ', 121, 19, 165190, 6971, '1966-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165197, 'The Abandoned Planet (The Daleks'' Master Plan, Part Eleven)', 'The Doctor, Steven and Sara reach Kembel where they find the Daleks have betrayed their allies and imprisoned them.', 121, 20, 165197, 6971, '1966-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165201, 'Destruction of Time (The Daleks'' Master Plan, Part Twelve)', 'With the Daleks poised to invade the solar system, the Doctor decides his only option is to activate the Time Destructor prematurely, threatening the entire planet. ', 121, 21, 165201, 6971, '1966-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165204, 'War of God (The Massacre of St Bartholomew''s Eve, Part One)', 'The TARDIS lands in sixteenth century Paris and Steven becomes involved with a group of Huguenots. ', 121, 22, 165204, 6971, '1966-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165235, 'The Sea Beggar (The Massacre of St Bartholomew''s Eve, Part Two)', 'While trying to find the Doctor, Steven discovers a conspiracy to assassinate a man known as the Sea Beggar. ', 121, 23, 165235, 6971, '1966-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165240, 'Priest of Death (The Massacre of St Bartholomew''s Eve, Part Three)', 'Steven has discovered the identity of the Sea Beggar, but can he warn the Huguenots in time? ', 121, 24, 165240, 6971, '1966-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975861, 'Bell of Doom (The Massacre of St Bartholomew''s Eve, Part Four)', 'Steven rejoins the Doctor and they leave Paris just ahead of the massacre, leaving Anne behind.', 121, 25, 975861, 6971, '1966-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165248, 'The Steel Sky (The Ark, Part One)', 'The Doctor, Steven and Dodo arrive on a giant spaceship millions of years in the future, transporting the last humans away from the doomed Earth. ', 121, 26, 165248, 6971, '1966-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165249, 'The Plague (The Ark, Part Two)', 'With the Ark infected with a cold virus, the Doctor must convince the Guardians to trust him so he can find a cure. ', 121, 27, 165249, 6971, '1966-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165250, 'The Return (The Ark, Part Three)', 'The Doctor, Steven and Dodo have traveled 700 years into the future and find that the Ark is now under the control of the Monoids as it approaches Refusis. ', 121, 28, 165250, 6971, '1966-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344185, 'Episode 14', '', 70452, 14, 1344185, 85559, '2017-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344186, 'Episode 15', '', 70452, 15, 1344186, 85559, '2017-08-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165251, 'The Bomb (The Ark, Part Four)', 'The Monoids abandon the Ark, leaving Steven and the Guardians to die, but a mutiny in their ranks may give the Doctor a chance to bring about peace.', 121, 29, 165251, 6971, '1966-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165252, 'The Celestial Toyroom (The Celestial Toymaker, Part One)', 'The Doctor, Steven and Dodo arrive in the realms of the Celestial Toymaker, who forces them to play his deadly games.', 121, 30, 165252, 6971, '1966-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165293, 'The Hall of Dolls (The Celestial Toymaker, Part Two)', 'While the Doctor continues to play the Trilogic Game with the Toymaker, Steven and Dodo are involved in a deadly game of musical chairs. ', 121, 31, 165293, 6971, '1966-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165301, 'The Dancing Floor (The Celestial Toymaker, Part Three)', 'Steven and Dodo are forced to cross the dancing floor, where the Toymaker''s dolls plan to force them to dance for eternity. ', 121, 32, 165301, 6971, '1966-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165318, 'The Final Test (The Celestial Toymaker, Part Four)', 'As the Doctor nears the end of his game against the Toymaker, Steven and Dodo take on Cyril in a lethal game of hopscotch to try and recover the TARDIS. ', 121, 33, 165318, 6971, '1966-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165319, 'A Holiday for the Doctor (The Gunfighters, Part One)', 'The TARDIS arrives in Tombstone, Arizona in 1891. Where the Doctor is looking for a dentist when he has a toothache, where The Doctor finds the local dentist is the famous Doc Holliday who is in a feud with The Clanton Brothers and their hired gunfighter Johnny Ringo, whilst local sheriff Wyatt Earp is trying to keep the peace. The Doctor, Steven and Dodo find themselves joining forces with The Clanton Brothers and Sheriff Wyatt Earp. ', 121, 34, 165319, 6971, '1966-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165320, 'Don''t Shoot the Pianist (The Gunfighters, Part Two)', 'With the Clantons believing the Doctor to be Doc Holliday, Wyatt Earp takes him into protective custody but this leaves Steven and Dodo in danger. ', 121, 35, 165320, 6971, '1966-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165321, 'Johnny Ringo (The Gunfighters, Part Three)', 'Earp comes to Steven''s rescue and arrests Phineas Clanton, prompting the Clantons to decide to enlist the help of Johnny Ringo.', 121, 36, 165321, 6971, '1966-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165322, 'The O.K. Corral (The Gunfighters, Part Four)', 'The Clantons have shot Warren Earp, leading to a showdown between the two families with the Doctor powerless to prevent bloodshed. ', 121, 37, 165322, 6971, '1966-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165323, 'The Savages, Episode One', 'The Doctor, Steven and Dodo arrive in the far future and are welcomed by the advanced civilisation of the Elders but soon begin to suspect they are hiding a secret. ', 121, 38, 165323, 6971, '1966-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165324, 'The Savages, Episode Two', 'The Doctor, Steven and Dodo investigate why there are Savages in the Elders'' city and uncover the true price of the Elders'' perfect society. ', 121, 39, 165324, 6971, '1966-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165325, 'The Savages, Episode Three', 'The Doctor has been subjected to the Elders'' extraction process and Steven and Dodo must return to their city to rescue him. ', 121, 40, 165325, 6971, '1966-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165326, 'The Savages, Episode Four', 'The Doctor urges the Savages to finally bring an end to the Elders'' oppression and enlists the help of an unlikely ally. ', 121, 41, 165326, 6971, '1966-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165327, 'The War Machines, Episode One', 'The Doctor and Dodo return to London in the present day where the Doctor becomes concerned about WOTAN, a new super-computer installed in the Post Officer Tower. ', 121, 42, 165327, 6971, '1966-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165328, 'The War Machines, Episode Two', 'Dodo is under the control of WOTAN and attempts to lure the Doctor into a trap, while the rest of WOTAN''s slaves begin construction on its robotic War Machines. ', 121, 43, 165328, 6971, '1966-07-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165329, 'The War Machines, Episode Three', 'Ben tries to escape from the warehouse but is captured by Polly, who is now also under WOTAN''s control, and forced to work on construction the War Machine. ', 121, 44, 165329, 6971, '1966-07-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165330, 'The War Machines, Episode Four', 'The first War Machine is defeated but the Doctor only has a matter of hours to destroy WOTAN before the rest of its army is activated.', 121, 45, 165330, 6971, '1966-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165594, 'The Smugglers, Episode One', 'The Doctor discovers Polly and Ben aboard the TARDIS shortly before the ship arrives in 17th century Cornwall, where the local churchwarden gives the Doctor a cryptic message shortly before being murdered. ', 121, 1, 165594, 6972, '1966-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165592, 'The Smugglers, Episode Two', 'Pike is convinced that the Doctor knows the location of Avery''s treasure while Polly and Ben try to convince the locals they were not responsible for Longfoot''s murder. ', 121, 2, 165592, 6972, '1966-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165589, 'The Smugglers, Episode Three', 'Polly and Ben are placed in the custody of Blake, who reveals he also has his suspicions about the Squire, while the Doctor and Kewper are forced to team up to escape from Pike''s ship.', 121, 3, 165589, 6972, '1966-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165603, 'The Smugglers, Episode Four', 'The Doctor and his friends are at the mercy of Cherub, who is now seeking Avery''s treasure for himself, while Pike prepares to attack the village. ', 121, 4, 165603, 6972, '1966-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165600, 'The Tenth Planet, Episode One', 'In 1986 a new planet appears in the Solar System which turns out to be a long-lost twin of Earth''s named Mondas. Its inhabitants are the Cybermen. ', 121, 5, 165600, 6972, '1966-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165598, 'The Tenth Planet, Episode Two', 'The Doctor''s warnings are ignored and the Cybermen take over the base, hampering the crew''s efforts to help Zeus IV. ', 121, 6, 165598, 6972, '1966-10-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975874, 'The Tenth Planet, Episode Three', 'With the Doctor out of action, it is up to Polly, Ben and Barclay to stop Cutler using the Z-Bomb and devastating half the world.', 121, 7, 975874, 6972, '1966-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165609, 'The Tenth Planet, Episode Four', 'The Cybermen take over the base again, apparently to stop the humans using the Z-Bomb, but then the Doctor realises they intend to use it themselves to destroy Earth. ', 121, 8, 165609, 6972, '1966-10-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165587, 'The Power of the Daleks, Episode One', 'The TARDIS arrives on the Earth colony of Vulcan where the newly-regenerated Doctor assumes the identity of an Earth Examiner. ', 121, 9, 165587, 6972, '1966-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165585, 'The Power of the Daleks, Episode Two', 'While the Doctor worries about the inert Daleks in the capsules, Lesterson makes plan to reactivate one of them. ', 121, 10, 165585, 6972, '1966-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165586, 'The Power of the Daleks, Episode Three', 'The Doctor fails to convince the colonists of the danger posed by the Daleks and soon the other two are also reactivated. ', 121, 11, 165586, 6972, '1966-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164118, 'The Power of the Daleks, Episode Four', 'With Polly being held prisoner by the rebels, the Doctor and Ben decide to investigate them, while Lesterson discovers the Daleks are reproducing. ', 121, 12, 164118, 6972, '1966-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165584, 'The Power of the Daleks, Episode Five', 'The Doctor and Quinn attempt to escape in order to stop Bragen using the Daleks to take over the colony. ', 121, 13, 165584, 6972, '1966-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165334, 'The Power of the Daleks, Episode Six', 'With Bragen having taken over, the Daleks trick the rebels into turning them loose and only the Doctor can stop them wiping out the entire colony. ', 121, 14, 165334, 6972, '1966-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165335, 'The Highlanders, Episode One', 'The Doctor, Polly and Ben arrive in 1746, in the aftermath of the Battle of Culloden, and are captured by a group of Highlanders shortly before they themselves are captured by redcoats. ', 121, 15, 165335, 6972, '1966-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866343, 'Lacey', 'Mr. Gold asks David for help jogging Belle''s memory; Anton''s magic beans begin to grow; Rumpelstiltskin goes after a thief.', 39272, 19, 866343, 50701, '2013-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165369, 'The Highlanders, Episode Four', 'Ben manages to join up with the Doctor, Polly and Kirsty and together they work to free the Highlanders from Trask''s ship before Grey sells them into slavery. ', 121, 18, 165369, 6972, '1967-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165391, 'The Underwater Menace, Episode One', 'The TARDIS materialises on a deserted beach where the Doctor and his friends are captured by primitive warriors and taken to the fabled city of Atlantis. ', 121, 19, 165391, 6972, '1967-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165448, 'The Underwater Menace, Episode Two', 'While Ara tries to save Polly from being turned into a Fish Person and Ben and Jamie try to escape from the mines, the Doctor discovers the full extent of Zaroff''s plans. ', 121, 20, 165448, 6972, '1967-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165456, 'The Underwater Menace, Episode Three', 'The Doctor and Ramo are sentenced to be sacrificed to the goddess Amdo and must escape to put a stop to Zaroff''s plan. ', 121, 21, 165456, 6972, '1967-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165463, 'The Underwater Menace, Part Four', 'With Zaroff''s plan nearing completion, the Doctor and Ben realise the only way to save the world is to destroy Atlantis. ', 121, 22, 165463, 6972, '1967-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165469, 'The Moonbase, Episode One', 'The TARDIS arrives on the Moon in the year 2070.When Jamie is injured, the other travellers are forced to seek the help of a moonbase afflicted with a space plague. ', 121, 23, 165469, 6972, '1967-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165471, 'The Moonbase, Episode Two', 'The Doctor and his friends attempt to convince the Moonbase crew that the Cybermen are responsible for the disappearances and find a cure for the plague. ', 121, 24, 165471, 6972, '1967-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165476, 'The Moonbase, Episode Three', 'The Cybermen take over the Moonbase and begin using the Gravitron to attack Earth but Polly, Ben and Jamie come up with a way to fight back. ', 121, 25, 165476, 6972, '1967-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165516, 'The Moonbase, Episode Four', 'With the Cybermen preparing to launch a full attack, the Doctor and his friends must keep the Moonbase and the Gravitron out of their hands until help arrives from Earth. ', 121, 26, 165516, 6972, '1967-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165519, 'The Macra Terror, Episode One', 'The TARDIS arrives at a holiday camp company with the crew worried by a prediction of giant crabs and the Doctor becomes interested in the apparent madman Medok''s stories of creatures that roam the colony at night. ', 121, 27, 165519, 6972, '1967-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165552, 'The Macra Terror, Episode Two', 'The Doctor is unable to convince the colonists that the Macra exist and an attempt to brainwash his companions results in Ben betraying his friends. ', 121, 28, 165552, 6972, '1967-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165564, 'The Macra Terror, Episode Three', 'The Doctor, Polly and Jamie are sentenced to work in the pits and an escape attempt sees Ben''s loyalties called into question again. ', 121, 29, 165564, 6972, '1967-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165563, 'The Macra Terror, Episode Four', 'The Doctor and Polly manage to save Jamie from the Macra and then try to show the Pilot who is really in charge of the colony. ', 121, 30, 165563, 6972, '1967-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165489, 'The Faceless Ones, Episode One', 'The TARDIS materialises on the runway of Gatwick Airport, where Polly witnesses a murder only to be kidnapped before she can report it. ', 121, 31, 165489, 6972, '1967-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165479, 'The Faceless Ones, Episode Two', 'With Polly having apparently forgotten them, the Doctor, Ben and Jamie decide to carry out their own investigation of Chameleon Tours. ', 121, 32, 165479, 6972, '1967-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955395, 'The Faceless Ones, Episode Three', 'The Doctor, Jamie and Sam manage to convince Crossland to trust them and he persuades the Commandant to let them continue their investigation. ', 121, 33, 955395, 6972, '1967-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165538, 'The Faceless Ones, Episode Four', 'When Spencer attempts to kill them, the Doctor, Jamie and Sam become convinced Chameleon Tours are hiding something and Sam decides to book a ticket on one of their flights. ', 121, 34, 165538, 6972, '1967-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165543, 'The Faceless Ones, Episode Five', 'Jamie finds himself aboard the Chameleons'' satellite and meets their Director while the Doctor forces the Chameleon Meadows to tell him the aliens'' plans. ', 121, 35, 165543, 6972, '1967-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165549, 'The Faceless Ones, Episode Six', 'The Doctor and Pinto are captured by the Chameleons but the Doctor manages to use their dependence on their human originals to create dissent in their ranks. ', 121, 36, 165549, 6972, '1967-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975876, 'The Evil of the Daleks: Episode One', 'Trying to find the stolen TARDIS, the Second Doctor and Jamie are lured into a trap by the Doctor''s old enemies the Daleks.', 121, 37, 975876, 6972, '1967-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165566, 'The Evil of the Daleks, Episode Two', 'The Doctor and Jamie investigate Waterfield''s antiques shop, where they are knocked unconscious and transported back to the 19th century. ', 121, 38, 165566, 6972, '1967-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165565, 'The Evil of the Daleks, Episode Three', 'As part of the Daleks'' experiment, the Doctor manipulates Jamie into attempting to rescue Victoria. ', 121, 39, 165565, 6972, '1967-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165577, 'The Evil of the Daleks, Episode Four', 'Jamie and Kemel team up to try and find Victoria, while the Doctor and the Daleks continue to monitor their progress. ', 121, 40, 165577, 6972, '1967-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165508, 'The Evil of the Daleks, Episode Five', 'With the experiment at an end, the Doctor begins to suspect the key to rescuing Jamie, Victoria and Kemel from the Daleks lies with Terrall. ', 121, 41, 165508, 6972, '1967-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955396, 'The Evil of the Daleks, Episode Six', 'The Doctor, Jamie and Waterfield follow the Daleks to Skaro, where they discover an unforeseen consequence to their experiment. ', 121, 42, 955396, 6972, '1967-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165500, 'The Evil of the Daleks, Episode Seven', 'The Daleks are poised to spread the Dalek Factor throughout the history of Earth and begin by implanting the Doctor. ', 121, 43, 165500, 6972, '1967-07-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975877, 'The Tomb of the Cybermen, Episode One', 'The Doctor, Jamie and Victoria arrive on Telos, where an archaeological group are exploring the Tomb of the Cybermen. But are the Cybermen as dormant as they believe?', 121, 1, 975877, 6973, '1967-09-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165764, 'The Tomb of the Cybermen, Episode Two', 'The archaeologists learn they are stranded on Telos and Klieg suggests they use the opportunity to explore the Cybermen''s tombs. ', 121, 2, 165764, 6973, '1967-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165702, 'The Tomb of the Cybermen, Episode Three', 'The Cybermen have been revived and plan to convert the archeologists into their own kind, prompting Hopper to attempt a rescue. ', 121, 3, 165702, 6973, '1967-09-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165774, 'The Tomb of the Cybermen, Episode Four', 'Klieg attempts to do a deal with the Cybercontroller while the Doctor tries to find a way to refreeze the Cybermen permanently. ', 121, 4, 165774, 6973, '1967-09-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165759, 'The Abominable Snowmen, Episode One', 'When the TARDIS materialises in the Himalayas, the Doctor decides to pay a return visit to the nearby Det-Sen monastery only to be accused of murder. ', 121, 5, 165759, 6973, '1967-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165666, 'The Abominable Snowmen, Episode Two', 'Jamie and Victoria make their way to the monastery shortly before it is attacked by the Yeti. ', 121, 6, 165666, 6973, '1967-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165800, 'The Abominable Snowmen, Episode Three', 'While the Doctor and Jamie return to the TARDIS for equipment, the control sphere Jamie brought to the monastery is reactivated. ', 121, 7, 165800, 6973, '1967-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165786, 'The Abominable Snowmen, Episode Four', 'The Yeti escapes from the monastery and Victoria and Thonmi are accused of assisting it, while the Doctor and Jamie endure a perilous journey back across the mountains. ', 121, 8, 165786, 6973, '1967-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344187, 'Episode 16', '', 70452, 16, 1344187, 85559, '2017-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975878, 'The Abominable Snowmen: Episode Five', 'Victoria falls under the mental influence of Padmasambhva as the Yeti attack in order to drive the monks from the area.', 121, 9, 975878, 6973, '1967-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165807, 'The Abominable Snowmen, Episode Six', 'With the Great Intelligence on the verge of becoming corporeal, the Doctor challenges Padmasambhva to a mental battle in order to defeat it. ', 121, 10, 165807, 6973, '1967-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165822, 'The Ice Warriors, Episode One', 'The Doctor, Jamie and Victoria are brought to a base which is attempting to halt the flow of the Second Ice Age. ', 121, 11, 165822, 6973, '1967-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165928, 'The Ice Warriors, Episode Two', 'Varga revives and takes Victoria hostage as he works to revive his crew while the Doctor and Jamie find Penley stealing medical supplies. ', 121, 12, 165928, 6973, '1967-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165915, 'The Ice Warriors, Episode Three', 'Jamie and Arden venture out to rescue Victoria only to find the rest of the Ice Warriors are now active. ', 121, 13, 165915, 6973, '1967-11-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165853, 'The Ice Warriors, Episode Four', 'The Doctor leaves the base to try and find Jamie and Victoria while Storr tries to do a deal with the Ice Warriors.', 121, 14, 165853, 6973, '1967-12-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975879, 'The Ice Warriors, Episode Five', 'The Doctor and Victoria are both held prisoner by the Ice Warriors as Varga decides to take over Brittanicus.', 121, 15, 975879, 6973, '1967-12-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165911, 'The Ice Warriors, Episode Six', 'The Doctor and Victoria attempt to force the Ice Warriors to surrender control of the ioniser before the ice flow destroys them. ', 121, 16, 165911, 6973, '1967-12-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955397, 'The Enemy of the World, Episode One', 'After the Doctor is attacked by a group of mysterious gunmen, he discovers he is the physical double of the famous scientist Salamander. ', 121, 17, 955397, 6973, '1967-12-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165976, 'The Enemy of the World, Episode Two', 'Jamie and Victoria agree to accompany Astrid to Hungary to observe Salamander''s activities. ', 121, 18, 165976, 6973, '1967-12-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165968, 'The Enemy of the World, Episode Three', 'Jamie and Victoria join Astrid into attempting to rescue Denes but Salamander becomes suspicious of them. ', 121, 19, 165968, 6973, '1968-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975880, 'The Enemy of the World: Episode Four', 'Fariah brings the Doctor and Kent evidence of Salamander''s activities but then they come under attack from Benik.', 121, 20, 975880, 6973, '1968-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165933, 'The Enemy of the World, Episode Five', 'The Doctor persuades Bruce to help him infiltrate Salamander''s research centre while Salamander takes drastic action to prevent Swann finding out the truth. ', 121, 21, 165933, 6973, '1968-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165983, 'The Enemy of the World, Episode Six', 'The Doctor discovers the true link between Salamander and Kent while Astrid tries to convince the shelter inhabitants they have been lied to. ', 121, 22, 165983, 6973, '1968-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166004, 'The Web of Fear, Episode One', 'The TARDIS becomes trapped in space before ending up in an underground station of a mysteriously deserted London. ', 121, 23, 166004, 6973, '1968-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166003, 'The Web of Fear, Episode Two', 'Jamie and Victoria are reunited with Travers before Jamie joins the soldiers in attempting to find out what has happened to the Doctor. ', 121, 24, 166003, 6973, '1968-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165988, 'The Web of Fear, Episode Three', 'The Doctor and Victoria are taken back to the Goodge Street base by Colonel Lethbridge-Stewart where the Doctor becomes convinced there is a traitor in their midst. ', 121, 25, 165988, 6973, '1968-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165998, 'The Web of Fear, Episode Four', 'With Travers having been captured by the Yeti, the Doctor attempts to find a way to gain control of the robots while Lethbridge-Stewart tries to recover the TARDIS. ', 121, 26, 165998, 6973, '1968-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (165994, 'The Web of Fear, Episode Five', 'Victoria and Travers are held prisoner by the Great Intelligence, who is planning to drain the Doctor''s mind. ', 121, 27, 165994, 6973, '1968-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166028, 'The Web of Fear, Episode Six', 'The Doctor and his friends are held prisoner by the Intelligence and their only hope lies with Jamie, Arnold and a reprogrammed Yeti. ', 121, 28, 166028, 6973, '1968-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166007, 'Fury from the Deep, Episode One', 'The Doctor, Jamie and Victoria are taken prisoner by the staff of a gas refinery, who have lost contact with their drilling rigs and experienced mysterious drops in pressure. ', 121, 29, 166007, 6973, '1968-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166024, 'Fury from the Deep, Episode Two', 'Harris asks for the Doctor''s help with Maggie with Van Lutyens and the Chief Engineer attempt to find out what is blocking the impeller.', 121, 30, 166024, 6973, '1968-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166031, 'Fury from the Deep, Episode Three', 'While the Doctor begins his investigation into the weed creatures, Robson is attacked by one at the refinery. ', 121, 31, 166031, 6973, '1968-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166037, 'Fury from the Deep, Episode Four', 'Van Lutyens'' investigation of the base of the impeller places the Doctor and Jamie in danger from the Weed Creature. ', 121, 32, 166037, 6973, '1968-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166081, 'Fury from the Deep, Episode Five', 'With the Weed Creature poised to burst out of the pipeline and attack the base, an encounter with Oak and Quill gives the Doctor a vital clue about its weakness. ', 121, 33, 166081, 6973, '1968-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166078, 'Fury from the Deep, Episode Six', 'The Doctor and Jamie rescue Victoria from Robson and realise they can destroy the Weed Creature with sound waves. ', 121, 34, 166078, 6973, '1968-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166083, 'The Wheel in Space, Episode One', 'The Doctor and Jamie arrive on a mysterious spacecraft whose only occupant is a dangerous Servo Robot. ', 121, 35, 166083, 6973, '1968-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166042, 'The Wheel in Space, Episode Two', 'The Doctor and Jamie are brought aboard the Wheel where Jamie is horrified to learn the crew plan to destroy the Silver Carrier with the TARDIS on board. ', 121, 36, 166042, 6973, '1968-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166091, 'The Wheel in Space, Episode Three', 'Jamie sabotages the Wheel''s x-ray laser, unknowingly giving the Cybermen an opportunity to reach the Wheel. ', 121, 37, 166091, 6973, '1968-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166102, 'The Wheel in Space, Episode Four', 'The Cybermen instruct their human slaves to smuggle them onto the Wheel while the Doctor attempts to convince Bennett of the threat they pose. ', 121, 38, 166102, 6973, '1968-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166104, 'The Wheel in Space, Episode Five', 'The Cybermen gain control of more members of the Wheel crew and the Doctor realises the only way to stop them is for Jamie and Zoe to make a dangerous space walk. ', 121, 39, 166104, 6973, '1968-05-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166103, 'The Wheel in Space, Episode Six', 'Jamie and Zoe attempt to recover the time vector generator while the Cybermen realise the Doctor is on the Wheel and make him their prime target. ', 121, 40, 166103, 6973, '1968-06-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166108, 'The Dominators, Episode One', 'The TARDIS arrives on the planet Dulkis where the Doctor, Zoe and Jamie decide to have a quiet holiday. Only to find the Evil Dominators and their robotic slaves, The Quarks have arrived on a radioactive island, where they plan to detonate a bomb in the planet''s core, which will turn the entire planet as source of radioactive fuel for their invasion fleet. ', 121, 1, 166108, 6974, '1968-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166112, 'The Dominators, Episode Two', 'The Doctor and Jamie are captured by the Dominators, who subject them to an intelligence test, while Zoe and Cully attempt to convince the Dulcian council of the threat. ', 121, 2, 166112, 6974, '1968-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975881, 'The Dominators, Episode Three', 'Zoe and Cully are captured by the Dominators and put to work alongside the survey team while the Doctor and Jamie decide to return to the island to help.', 121, 3, 975881, 6974, '1968-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281570, 'Episode 28', '', 70583, 28, 1281570, 85893, '2015-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166123, 'The Dominators, Episode Four', 'The Doctor and Zoe are interrogated by Rago, who is planning to present his terms to the Dulcian council, while Jamie and Cully try to find a way to strike back against the Quarks.', 121, 4, 166123, 6974, '1968-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166146, 'The Dominators, Episode Five', 'Jamie and Cully manage to rescue the Doctor''s party and together they try to find a way to stop the Dominators before they destroy the entire planet. ', 121, 5, 166146, 6974, '1968-09-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166155, 'The Mind Robber, Episode One', 'The TARDIS arrives in a white void, when the TARDIS makes a emergency take-off to escape the volcanic eruption on Dulkis. Where the Doctor, Jamie and Zoe find themselves in the Land of Fiction, where fictional characters from the imagination come to life and The Master, the mysterious ruler of The Land of Fiction chooses the Doctor to take his place. ', 121, 6, 166155, 6974, '1968-09-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166182, 'The Mind Robber, Episode Two', 'With the TARDIS destroyed, the Doctor, Jamie and Zoe find themselves in a strange forest patrolled by mysterious soldiers. ', 121, 7, 166182, 6974, '1968-09-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166200, 'The Mind Robber, Episode Three', 'The Doctor realises that the travelers are trapped in a world where fiction is real and where creatures are a threat if people believe in them. ', 121, 8, 166200, 6974, '1968-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166206, 'The Mind Robber, Episode Four', 'The Doctor, Jamie and Zoe reach the citadel at the centre of the land, where they finally encounter the Master of the Land of Fiction. ', 121, 9, 166206, 6974, '1968-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166213, 'The Mind Robber, Episode Five', 'With Jamie and Zoe having been turned into fiction, the Doctor must find a way to save them without suffering the same fate or becoming part of the Master Brain. ', 121, 10, 166213, 6974, '1968-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166239, 'The Invasion, Episode One', 'The Doctor and the newly formed UNIT must stop a Cybermen Invasion and a Sinister Industrialist in league with them ', 121, 11, 166239, 6974, '1968-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166253, 'The Invasion, Episode Two', 'The Doctor and Jamie are taken prisoner by their mysterious observers and have a reunion with an old friend while Zoe and Isobel carry out their own investigation of IE. ', 121, 12, 166253, 6974, '1968-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166255, 'The Invasion, Episode Three', 'The Doctor and Jamie return to the IE factory in search of Zoe and Isobel, where they meet with Professor Watkins and fall foul of Vaughn. ', 121, 13, 166255, 6974, '1968-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166263, 'The Invasion, Episode Four', 'The Doctor and Jamie enlist the help of UNIT to rescue Zoe and Isobel before trying to find out what Vaughn is really up to. ', 121, 14, 166263, 6974, '1968-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955398, 'The Invasion, Episode Five', 'The Doctor and Jamie tell the Brigadier about the Cybermen but with Rutledge under Vaughn''s control he is powerless to act. ', 121, 15, 955398, 6974, '1968-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166275, 'The Invasion, Episode Six', 'Captain Turner manages to rescue Jamie and the others, while the Doctor begins working on a way to protect everyone from the Cybermen''s hypno-sound signal.', 121, 16, 166275, 6974, '1968-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166286, 'The Invasion, Episode Seven', 'With the entire world unconscious apart from the Doctor and his friends, the Cybermen are poised to invade and only Zoe, the Brigadier and a missile crew can stop them. ', 121, 17, 166286, 6974, '1968-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166294, 'The Invasion, Episode Eight', 'The Cybermen have launched their deadly megatron bomb which will destroy all life on Earth unless the Doctor can deactivate the homing signal.', 121, 18, 166294, 6974, '1968-12-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975885, 'The Krotons, Episode One', 'The TARDIS lands on a nameless desolate planet where The Doctor, Jamie and Zoe learn the native Gonds are ruled by the mysterious and unseen Krotons, where The Krotons chooses their top students to join The Krotons in their machine as their companions. But The Doctor, Jamie and Zoe discover The Krotons are crystalline alien beings and are turning The Gonds mental power into energy and are feeding off it.', 121, 19, 975885, 6974, '1968-12-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166303, 'The Krotons, Episode Two', 'Zoe is selected as a companion for the Krotons and the Doctor insists on joining her. ', 121, 20, 166303, 6974, '1969-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166308, 'The Krotons, Episode Three', 'Jamie is held prisoner by the Krotons who intend to recapture the Doctor and Zoe for their mental energy. ', 121, 21, 166308, 6974, '1969-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955399, 'The Krotons, Episode Four', 'Selris succeeds in drawing the Krotons out of the Dynatrope but Eelek agrees to hand the Doctor and Zoe over to them in return for their leaving the planet. ', 121, 22, 955399, 6974, '1969-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166316, 'The Seeds of Death, Episode One', '21st century Earth is entirely dependent on the T-Mat transport system but the control centre on the moon has stopped functioning. Meanwhile, the Doctor, Jamie and Zoe meet the one man who can solve the crisis. ', 121, 23, 166316, 6974, '1969-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166334, 'The Seeds of Death, Episode Two', 'Eldred agrees to supply a rocket for travel to the moon and the Doctor, Jamie and Zoe volunteer to crew it. ', 121, 24, 166334, 6974, '1969-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166339, 'The Seeds of Death, Episode Three', 'The Doctor, Jamie and Zoe make it to the moon and join forces with Phipps but the Ice Warriors have gained control of T-mat. ', 121, 25, 166339, 6974, '1969-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166344, 'The Seeds of Death, Episode Four', 'The Ice Warriors'' seed pods beginning materialising all over the globe while Slaar decides to kill the Doctor by T-matting him into space. ', 121, 26, 166344, 6974, '1969-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166354, 'The Seeds of Death, Episode Five', 'The Doctor and his allies manage to return to Earth via T-mat only to find the Ice Warrior has attacked the weather control station. ', 121, 27, 166354, 6974, '1969-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166363, 'The Seeds of Death, Episode Six', 'The Doctor manages to create a rain storm to destroy the Martian fungus before trying to find a way to stop the Ice Warriors'' invasion fleet. ', 121, 28, 166363, 6974, '1969-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166373, 'The Space Pirates, Episode One', 'Space beacons are being destroyed by pirates, who are salvaging the argonite metal. When the Doctor, Jamie and Zoe arrive on one of the beacons, they are mistaken for pirates. ', 121, 29, 166373, 6974, '1969-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166379, 'The Space Pirates, Episode Two', 'With the Doctor, Jamie and Zoe trapped on a beacon segment, Hermack becomes suspicious of the unruly prospector Milo Clancey.', 121, 30, 166379, 6974, '1969-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166381, 'The Space Pirates, Episode Three', 'The Doctor, Jamie and Zoe flee from the Space Corps with Clancey, who decides to seek refuge on Ta. ', 121, 31, 166381, 6974, '1969-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166385, 'The Space Pirates, Episode Four', 'The Doctor, Jamie and Zoe are held prisoner by the space pirates while Caven comes up with a plan to throw suspicion onto Clancey.', 121, 32, 166385, 6974, '1969-03-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166389, 'The Space Pirates, Episode Five', 'Madeleine is revealed to be working with Caven, who comes up with a way to kill the Doctor and his friends whilst framing them for the piracy. ', 121, 33, 166389, 6974, '1969-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166392, 'The Space Pirates, Episode Six', 'With Clancey and Issigri trapped aboard the LIZ, the Doctor, Jamie and Zoe try to convince Madeleine to help them before Caven destroys Ta. ', 121, 34, 166392, 6974, '1969-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166395, 'The War Games, Episode One', 'The Doctor, Jamie and Zoe realise they have arrived in the trenches of the First World War, where the sinister General Smythe accuses them of espionage. ', 121, 35, 166395, 6974, '1969-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166424, 'The War Games, Episode Two', 'The Doctor and Zoe manage to escape from Ransom and attempt to rescue Jamie from the military prison. ', 121, 36, 166424, 6974, '1969-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281571, 'Episode 29', '', 70583, 29, 1281571, 85893, '2015-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281572, 'Episode 30', '', 70583, 30, 1281572, 85893, '2015-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166427, 'The War Games, Episode Three', 'The Doctor and his friends realise the area is divided into different time zones and decide to return to the château to obtain a map from Smythe. ', 121, 37, 166427, 6974, '1969-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166432, 'The War Games, Episode Four', 'The Doctor and Zoe are transported to the control centre of the war games while Jamie and Lady Jennifer fall foul of American Revolution soldiers. ', 121, 38, 166432, 6974, '1969-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166445, 'The War Games, Episode Five', 'The Doctor attempts to rescue Zoe and Carstairs while Jamie and Lady Jennifer try to convince the resistance of the true nature of Von Weich and the others. ', 121, 39, 166445, 6974, '1969-05-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166449, 'The War Games, Episode Six', 'The scientist examines the captured resistance fighters and realises Jamie is a new arrival on the planet while the Doctor, Zoe and Carstairs try to rescue their friends. ', 121, 40, 166449, 6974, '1969-05-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166458, 'The War Games, Episode Seven', 'The Doctor, Jamie and Carstairs manage to return to the 1917 zone only to be captured by Smythe, who orders the Doctor executed. ', 121, 41, 166458, 6974, '1969-05-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975886, 'The War Games, Episode Eight', 'The Doctor and the processing machine have been taken by the Aliens but the resistance are making plans to attack the control centre.', 121, 42, 975886, 6974, '1969-06-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166468, 'The War Games, Episode Nine', 'To prove his loyalty to the Aliens, the Doctor is ordered to reprocess his friends while the Security Chief finally uncovers evidence of the War Chief''s treachery. ', 121, 43, 166468, 6974, '1969-06-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166474, 'The War Games, Episode Ten', 'The TARDIS is drawn to the planet of the Time Lords where both the Doctor and the War Lord are placed on trial. ', 121, 44, 166474, 6974, '1969-06-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166479, 'Spearhead from Space, Episode One', 'As the newly-regenerated Doctor arrives on Earth, so does the Nestene too. ', 121, 1, 166479, 6975, '1970-01-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166523, 'Spearhead from Space, Episode Two', 'UNIT''s attempts to locate the meteorites are hampered by the mysterious plastic Autons, being constructed by Channing at a nearby factory, while the Doctor makes another attempt to escape from the hospital. ', 121, 2, 166523, 6975, '1970-01-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166566, 'Spearhead from Space, Episode Three', 'Ransome manages to escape from the plastics factory and alert UNIT, prompting the Doctor and the Brigadier to start an investigation. ', 121, 3, 166566, 6975, '1970-01-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166581, 'Spearhead from Space, Episode Four', 'With UNIT''s investigation being blocked by the Replica of Scobie, the Doctor and Liz visit Madame Tussaud''s to try and find out more as Channing prepares to activate the Autons. ', 121, 4, 166581, 6975, '1970-01-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166570, 'Doctor Who and the Silurians, Episode One', 'The Doctor and Liz are summoned to the Wenley Moor Research Centre by the Brigadier, after several staff members suffer nervous breakdowns. ', 121, 5, 166570, 6975, '1970-01-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166578, 'Doctor Who and the Silurians, Episode Two', 'The Doctor attempts to convince people there are monsters in the caves, prompting Major Baker to start shooting at a reptile man. ', 121, 6, 166578, 6975, '1970-02-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166567, 'Doctor Who and the Silurians, Episode Three', 'The Silurians contact Quinn for help in retrieving their fellow while the Doctor and the Brigadier organise a search of the moors. ', 121, 7, 166567, 6975, '1970-02-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166599, 'Doctor Who and the Silurians, Episode Four', 'With Quinn dead, the Brigadier decides to take an armed party into the caves, prompting the Doctor to contact the Silurians himself. ', 121, 8, 166599, 6975, '1970-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166616, 'Doctor Who and the Silurians, Episode Five', 'Worried about the Old Silurian''s growing friendship with the Doctor, the Young Silurian has the scientist infect Baker with a virus and then release him. ', 121, 9, 166616, 6975, '1970-02-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166621, 'Doctor Who and the Silurians, Episode Six', 'While the Doctor and Liz try to find a cure to the virus spread by Baker, the Young Silurian kills the Old Silurian and takes control of his people. ', 121, 10, 166621, 6975, '1970-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166612, 'Doctor Who and the Silurians, Episode Seven', 'While Liz distributes the cure to the virus, the Doctor discovers the Silurians now plan to wipe out humanity by destroying the Van Allen Belt. ', 121, 11, 166612, 6975, '1970-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166606, 'The Ambassadors of Death, Episode One', 'While the Brigadier investigates a loss of contact with Mars Probe 7, the Doctor realises signals coming from the probe are of extra-terrestrial origin. ', 121, 12, 166606, 6975, '1970-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166661, 'The Ambassadors of Death, Episode Two', 'UNIT retrieve the returned Recovery 7 but then Carrington hijacks it while the Doctor and Liz try to decode the signal he sent. ', 121, 13, 166661, 6975, '1970-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166651, 'The Ambassadors of Death, Episode Three', 'Carrington is holding the astronauts at a secret location but when he takes the Doctor, Liz and the Brigadier there they find they have been kidnapped.', 121, 14, 166651, 6975, '1970-04-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166653, 'The Ambassadors of Death, Episode Four', 'Liz has been captured by Reegan''s men and the Doctor begins to suspect Taltalian is more involved than he appeared. ', 121, 15, 166653, 6975, '1970-04-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166665, 'The Ambassadors of Death, Episode Five', 'The Doctor decides to take Recovery 7 back into space to search for the missing astronauts but Reegan sabotages the launch. ', 121, 16, 166665, 6975, '1970-04-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166673, 'The Ambassadors of Death, Episode Six', 'The Doctor speaks with the alien captain and learns the astronauts sent to Earth were ambassadors.However, before he can alert the authorities he is kidnapped by Reegan. ', 121, 17, 166673, 6975, '1970-04-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166684, 'The Ambassadors of Death, Episode Seven', 'Carrington is planning to expose the aliens on live television and call for an interplanetary war and the Brigadier must rescue the Doctor and Liz in time to stop him. ', 121, 18, 166684, 6975, '1970-05-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166681, 'Inferno, Episode One', 'England, the near future. UNIT is providing security and scientific support for the Stahlman project, an attempt to tap the Earth''s core for energy. But things are already going wrong…', 121, 19, 166681, 6975, '1970-05-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166685, 'Inferno, Episode Two', 'Strange deaths, men changing into monsters, hot green slime pouring out of the waste pipes – but Professor Stahlman is determined to press ahead with the Inferno project no matter what the cost!', 121, 20, 166685, 6975, '1970-05-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166683, 'Inferno, Episode Three', 'The Doctor has vanished from the Inferno project… or has he? He finds himself in the same place, but everyone has changed… and the drilling is closer to its deadly conclusion.', 121, 21, 166683, 6975, '1970-05-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166682, 'Inferno, Episode Four', 'In a parallel England, the Doctor tries desperately to convince his captors of the immense peril they are in. But they are convinced he is a spy. And penetration zero is getting close…', 121, 22, 166682, 6975, '1970-05-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166687, 'Inferno, Episode Five', 'The parallel Inferno has broken through the Earth''s crust, unleashing terrible seismic forces and dooming the planet. The Doctor hopes to return and save his world. But the bestial primords are closing in...', 121, 23, 166687, 6975, '1970-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166686, 'Inferno, Episode Six', 'The Doctor is trapped in a parallel world that is going up in flames. Can he escape in time to save Earth in his own universe?', 121, 24, 166686, 6975, '1970-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166688, 'Inferno, Episode Seven', 'The Doctor has escaped the catastrophic destruction of a parallel world. But can he stop Stahlman before he destroys this one?', 121, 25, 166688, 6975, '1970-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281573, 'Episode 31', '', 70583, 31, 1281573, 85893, '2015-12-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281574, 'Episode 32', '', 70583, 32, 1281574, 85893, '2016-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166691, 'Terror of the Autons, Episode One', 'When a Nestene Energy Unit is stolen and a radio telescope sabotaged, the Doctor is contacted by a Time Lord who tells him his old rival the Master is responsible. ', 121, 1, 166691, 6976, '1971-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166689, 'Terror of the Autons, Episode Two', 'Attempting to find out where Jo encountered the Master, the Doctor heads to the circus where he falls foul of Rossini. ', 121, 2, 166689, 6976, '1971-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166690, 'Terror of the Autons, Episode Three', 'The Doctor and the Brigadier head to Farrel''s factory but the Master and the Autons have already left and are distributing plastic daffodils around the country. ', 121, 3, 166690, 6976, '1971-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166694, 'Terror of the Autons, Episode Four', 'The Doctor discovers the plastic daffodils are designed to fire a spray that asphyxiates people, causing havoc prior to the Nestene''s arrival, but before he can alert anyone he and Jo are captured by the Master. ', 121, 4, 166694, 6976, '1971-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166692, 'The Mind of Evil, Episode One', 'The Doctor and Jo head to Stangmoor Prison to investigate the Keller Machine, which drains the evil impulses from prisoners'' minds, while UNIT are handling security at the first world peace conference.', 121, 5, 166692, 6976, '1971-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166693, 'The Mind of Evil, Episode Two', 'The Doctor is recalled by UNIT to help investigate Cheng-Tiek''s murder but is unaware that Chin-Lee is under the control of the Master. ', 121, 6, 166693, 6976, '1971-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166699, 'The Mind of Evil, Episode Three', 'Realising Chin-Lee has been using the power of the Keller Machine to carry out assassinations, the Doctor heads back to Stangmoor, only to find the Master has teamed up with Mailer to stage another riot. ', 121, 7, 166699, 6976, '1971-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166697, 'The Mind of Evil, Episode Four', 'With the Doctor and Jo being held prisoner, the Master convinces Mailer to help him steal the Thunderbolt. ', 121, 8, 166697, 6976, '1971-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166696, 'The Mind of Evil, Episode Five', 'The Doctor is forced to help the Master control the mind parasite while Yates finds out where the Thunderbolt has been taken only to be captured by the Master''s men. ', 121, 9, 166696, 6976, '1971-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166695, 'The Mind of Evil, Episode Six', 'The Brigadier has recaptured Stangmoor but the Master still has control of the Thunderbolt and the Doctor must find a way to stop him and destroy the Keller Machine. ', 121, 10, 166695, 6976, '1971-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166698, 'The Claws of Axos, Episode One', 'When a mysterious object lands near the Nuton power complex, UNIT investigate and encounter the Axons, a group of aliens who offer the mineral axonite, which can duplicate matter, as a gift.', 121, 11, 166698, 6976, '1971-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166701, 'The Claws of Axos, Episode Two', 'The Doctor and Winser begin to analyse axonite while Chinn plots to secure its use exclusively for Britain. ', 121, 12, 166701, 6976, '1971-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166704, 'The Claws of Axos, Episode Three', 'The Doctor and Jo are being held prisoner by Axos while Chinn is forced to organise the worldwide distribution of axonite and the Master returns to the power complex to try and steal the TARDIS.', 121, 13, 166704, 6976, '1971-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166702, 'The Claws of Axos, Episode Four', 'The Doctor and Jo escape from Axos but then the Doctor offers the Master a deal; if he helps him repair the TARDIS, they can flee Earth together. ', 121, 14, 166702, 6976, '1971-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166703, 'Colony in Space, Episode One', 'The Time Lords takes control of the TARDIS and the Doctor and Jo arrive on a Earth Colony in the 25th Century, where a ruthless mining company are using a dinosaur-like creature to force the colonists to leave the planet. Where the Doctor and Jo learn that The Master is on the planet and is in search of a doomsday weapon that is hidden somewhere on the planet. ', 121, 15, 166703, 6976, '1971-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166700, 'Colony in Space, Episode Two', 'The Doctor discovers an Interplanetary Mining Corporation ship has landed on the planet in order to mine its duralinium, while Norton begins causing trouble at the colony. ', 121, 16, 166700, 6976, '1971-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166709, 'Colony in Space, Episode Three', 'The Doctor makes it back to the colony and warns Ashe what Dent is up to but when Jo and Winton try to find proof they are captured. ', 121, 17, 166709, 6976, '1971-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166707, 'Colony in Space, Episode Four', 'The Doctor descends into the Primitive city to try and find Jo while the colonists receive a visit from the Adjudicator.', 121, 18, 166707, 6976, '1971-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166706, 'Colony in Space, Episode Five', 'The Master offers to help the colonists in exchange for information on the Primitive city and forces the Doctor to act as a guide by taking Jo hostage. ', 121, 19, 166706, 6976, '1971-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166705, 'Colony in Space, Episode Six', 'The Doctor and the Master are taken into the Primitive city, where the Master hopes to find the doomsday weapon, while Dent forces the colonists to leave the planet even though their ship is likely to explode. ', 121, 20, 166705, 6976, '1971-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166708, 'The Dæmons, Episode One', 'Earth, the near future. When an archaological dig at the village of Devil''s End goes disastrously wrong, an ancient power begins to revive. Can even the Doctor withstand the power of the Daemons? And just what is the local vicar up to in his spare time?', 121, 21, 166708, 6976, '1971-05-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166713, 'The Dæmons, Episode Two', 'With the Doctor frozen by the energy release from the barrow, Jo calls Yates and Benton for help, but when the Brigadier tries to join them he finds the village surrounded by a heat barrier. ', 121, 22, 166713, 6976, '1971-05-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166731, 'The Dæmons, Episode Three', 'The Doctor explains to his friends that the Master is trying to gain the power of the last of the Daemons, a race who influenced Earth''s development, while the Master brings the rest of the village under his control. ', 121, 23, 166731, 6976, '1971-06-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166734, 'The Dæmons, Episode Four', 'The Master orders Bert to set a trap for the Doctor at the village while a concussed Jo makes for the cavern.', 121, 24, 166734, 6976, '1971-06-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166716, 'The Dæmons, Episode Five', 'The Master decides to sacrifice Jo to Azal and when the Doctor and his friends try to intervene they come under attack from Bok. ', 121, 25, 166716, 6976, '1971-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166736, 'Day of the Daleks, Episode One', 'When someone tries to assassinate diplomat Sir Reginald Styles, UNIT investigate the possibility his attacker came from the future. ', 121, 1, 166736, 6977, '1972-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166744, 'Day of the Daleks, Episode Two', 'Jo uses the guerrillas'' time machine to travel to the 22nd century where the Controller tricks her into telling the Daleks where she''s come from. ', 121, 2, 166744, 6977, '1972-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166747, 'Day of the Daleks, Episode Three', 'The Doctor forces the guerrillas to take him to the 22nd century where he is soon captured by the Controller. ', 121, 3, 166747, 6977, '1972-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166750, 'Day of the Daleks, Episode Four', 'The guerrillas infiltrate the Daleks'' base to rescue the Doctor and Jo and ask them to return to their own time and alter history before the 20th century is plunged into a Third World War. ', 121, 4, 166750, 6977, '1972-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166752, 'The Curse of Peladon, Episode One', 'The Doctor and Jo arrive on the medieval planet Peladon, where the Doctor is mistaken for the Earth Delegate of the Galactic Federation and Jo is mistaken for a princess. Where the Doctor uncovers a conspiracy, as he exposes the evil scheme of the high-priest Hepesh who bids to prevent King Peladon from joining the galactic Federation. ', 121, 5, 166752, 6977, '1972-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281575, 'Episode 33', '', 70583, 33, 1281575, 85893, '2016-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281576, 'Episode 34', '', 70583, 34, 1281576, 85893, '2016-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166763, 'The Curse of Peladon, Episode Two', 'The Doctor is convinced the Ice Warriors are trying to sabotage the conference but his attempts to prove it see him accused of sacrilege. ', 121, 6, 166763, 6977, '1972-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166764, 'The Curse of Peladon, Episode Three', 'The Doctor is sentenced to fight Grun to the death and his attempt to escape leads to an encounter with Aggedor. ', 121, 7, 166764, 6977, '1972-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166766, 'The Curse of Peladon, Episode Four', 'Hepesh''s plan has been exposed but he is still determined to prevent Peladon joining the Galactic Federation by leading a rebellion against the King. ', 121, 8, 166766, 6977, '1972-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166767, 'The Sea Devils, Episode One', 'The Doctor and Jo visit the Master at his island prison where the Doctor becomes curious about a number of ships sinking in the area. ', 121, 9, 166767, 6977, '1972-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166768, 'The Sea Devils, Episode Two', 'The Doctor and Jo are trapped on the fort by a Sea Devil while the Master convinces Trenchard to help him steal some electronic components. ', 121, 10, 166768, 6977, '1972-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166770, 'The Sea Devils, Episode Three', 'The Doctor is held prisoner by Trenchard while the Master attempts to contact the Sea Devils. ', 121, 11, 166770, 6977, '1972-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166774, 'The Sea Devils, Episode Four', 'The Sea Devils attack the island prison and rescue the Master, prompting the Doctor to venture underwater to try and contact them. ', 121, 12, 166774, 6977, '1972-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166778, 'The Sea Devils, Episode Five', 'The Doctor is taken to the Sea Devils'' underwater colony where he tries to make peace with the creatures, only for the navy to attack the base. ', 121, 13, 166778, 6977, '1972-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166782, 'The Sea Devils, Episode Six', 'The Sea Devils take over the naval base and the Doctor is forced to help the Master find a way to revive their colony. ', 121, 14, 166782, 6977, '1972-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166784, 'The Mutants, Episode One', 'The Doctor and Jo arrive on the planet Solos, on a assignment by the Time Lords. Where the Doctor and Jo learn that the native Solonians are mutating into ant-like mutant creatures and they uncover a conspiracy, where the evil Marshal of the Earth Empire plots to rule Solos for himself and plans to convert Solos atmosphere, since the planet''s atmosphere is poisonous, so the planet can be colonized by the humans and he plans to wipe out all the mutated Solonians, who are evolving into a advanced super race. ', 121, 15, 166784, 6977, '1972-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166785, 'The Mutants, Episode Two', 'Ky transports himself and Jo down to Solos and the Marshal only agrees to help her if the Doctor assists Professor Jaeger in altering Solos'' atmosphere. ', 121, 16, 166785, 6977, '1972-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166786, 'The Mutants, Episode Three', 'The Doctor and Varan travel down to Solos to search for Jo and Ky but the Marshal orders his men to pursue them. ', 121, 17, 166786, 6977, '1972-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166788, 'The Mutants, Episode Four', 'The Doctor and his friends are led to safety by Professor Sondergaard, who tries to help the Doctor translate the tablets.', 121, 18, 166788, 6977, '1972-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166792, 'The Mutants, Episode Five', 'The Marshal''s premature use of Jaeger''s experiment is threatening to destroy Solos'' atmosphere and the Doctor returns to Skybase to try and correct the damage. ', 121, 19, 166792, 6977, '1972-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166793, 'The Mutants, Episode Six', 'The Doctor is forced to help the Marshal cover up his actions with the Investigator but Jo and the others attempt to escape to expose him. ', 121, 20, 166793, 6977, '1972-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166794, 'The Time Monster, Episode One', 'UNIT are invited to observe a demonstration of the new TOMTIT machine, unaware its creator, Professor Thascales, is actually the Master. ', 121, 21, 166794, 6977, '1972-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166795, 'The Time Monster, Episode Two', 'The Doctor realises the Master is trying to harness the power of Kronos, last of the Chronovores, but is unaware Percival is harbouring him at the institute. ', 121, 22, 166795, 6977, '1972-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166796, 'The Time Monster, Episode Three', 'The Master enlists the help of Krasis to control Kronos while Yates tries to bring the TARDIS to the institute only to come under attack from dangers from the past. ', 121, 23, 166796, 6977, '1972-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166800, 'The Time Monster, Episode Four', 'The Master prepares to travel back to Atlantis but the Doctor links his TARDIS to the Master''s to try and stop him. ', 121, 24, 166800, 6977, '1972-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166803, 'The Time Monster, Episode Five', 'Both TARDISes reach Atlantis, where the Doctor befriends King Dalios while the Master enlists the help of Queen Galleia to try and obtain the crystal of Kronos. ', 121, 25, 166803, 6977, '1972-06-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975887, 'The Time Monster, Episode Six', 'The Doctor enters the labyrinth to try and protect Jo from the minotaur but the Master has seized control of Atlantis and prepares to summon Kronos again.', 121, 26, 975887, 6977, '1972-06-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166810, 'The Three Doctors, Episode One', 'England, the near future. A strange anti-matter creature arrives on Earth and attacks UNIT HQ. It seems to be specifically seeking the Doctor out - but why? With the Time Lords themselves unable to help, it seems the only person who can help the Doctor is himself - or selves...', 121, 1, 166810, 6978, '1972-12-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166811, 'The Three Doctors, Episode Two', 'The third Doctor and Jo find themselves on an artificial world inside the black hole while the second Doctor tries to find a way to control the organism. ', 121, 2, 166811, 6978, '1973-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166812, 'The Three Doctors, Episode Three', 'The Time Lord Omega reveals himself to the third Doctor along with plans for vengeance against his own kind. ', 121, 3, 166812, 6978, '1973-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166813, 'The Three Doctors, Episode Four', 'Omega reveals the purpose behind bringing the Doctor to his antimatter world, but the Doctor(s) discover a startling fact about Omega that he didn''t know himself and eventually strike a bargain.', 121, 4, 166813, 6978, '1973-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166814, 'Carnival of Monsters, Episode One', 'The Doctor attempts to test his new dematerialisation circuit by taking Jo to Metebelis Three but instead the TARDIS arrives in the hold of a 1920s cargo ship. ', 121, 5, 166814, 6978, '1973-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166815, 'Carnival of Monsters, Episode Two', 'The Doctor and Jo attempt to find a way out of the Scope but, when Vorg attempts to entertain the Minorans, the crew of the Bernice suddenly become a lot more dangerous. ', 121, 6, 166815, 6978, '1973-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166816, 'Carnival of Monsters, Episode Three', 'The Doctor and Jo return to the Bernice to try and aid their escape but find themselves pursued by the Drashigs. ', 121, 7, 166816, 6978, '1973-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166817, 'Carnival of Monsters, Episode Four', 'The Doctor escapes from the Scope and joins forces with Vorg to try and save its inhabitants but Kalik is still determined to use the Drashigs to start a rebellion. ', 121, 8, 166817, 6978, '1973-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166880, 'Frontier in Space, Episode One', 'The Doctor and Jo discover The Master and the Ogrons are the masterminds behind the Galactic war between the Earth Federation and the Reptillian Draconian Empire and the Master has framed The Doctor and Jo as spies working for the Draconians. Only to discover The Master is also working with the Doctor''s greatest enemies, The Daleks, who are also behind the galactic war. ', 121, 9, 166880, 6978, '1973-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166819, 'Frontier in Space, Episode Two', 'The Doctor and Jo are taken to Earth, where both humans and Draconians believe them to be a spy for the other side. ', 121, 10, 166819, 6978, '1973-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166828, 'Frontier in Space, Episode Three', 'The Doctor is sentenced to life imprisonment at a lunar penal colony while Jo encounters an old enemy. ', 121, 11, 166828, 6978, '1973-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281577, 'Episode 35', '', 70583, 35, 1281577, 85893, '2016-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166829, 'Frontier in Space, Episode Four', 'The Master rescues the Doctor from the lunar penal colony, aiming to take him and Jo to the Ogrons'' planet, and the Doctor''s attempt to escape leaves him stranded in space. ', 121, 12, 166829, 6978, '1973-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166831, 'Frontier in Space, Episode Five', 'The Doctor, Jo and the Master are taken to Draconia, where the Doctor tries to convince the Draconians of the truth. But then the Ogrons attack. ', 121, 13, 166831, 6978, '1973-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166834, 'Frontier in Space, Episode Six', 'The Doctor, Williams and the Draconian Prince head to the Ogrons'' planet to find evidence of the Master''s actions but the Master tricks Jo into leading them into a trap. ', 121, 14, 166834, 6978, '1973-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166837, 'Planet of the Daleks, Episode One', 'The planet Spiridon, the year 2540. The Doctor and Jo arrive on the trail of the Daleks, and find unexpected allies in the shape of a Thal suicide squad. But what has brought the Daleks here in the first place?', 121, 15, 166837, 6978, '1973-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166839, 'Planet of the Daleks, Episode Two', 'The Doctor is captured by the Daleks, while Jo is rescued by a friendly Spridon named Wester. ', 121, 16, 166839, 6978, '1973-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166840, 'Planet of the Daleks, Episode Three', 'The Doctor and Codal escape from their cell and meet up with the Thal commandos who are trying to get into the Dalek base. ', 121, 17, 166840, 6978, '1973-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166842, 'Planet of the Daleks, Episode Four', 'The Doctor and his friends escape from the Dalek base, prompting the Daleks to devise a plan to wipe them out. ', 121, 18, 166842, 6978, '1973-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166844, 'Planet of the Daleks, Episode Five', 'The Doctor and his friends ambush two Daleks as part of their planet to get back into the city but the Daleks are on the verge of unleashing their virus. ', 121, 19, 166844, 6978, '1973-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166845, 'Planet of the Daleks, Episode Six', 'The Doctor and his friends prepare to refreeze the Dalek army but the Dalek Supreme has arrived on the planet determined to destroy them all. ', 121, 20, 166845, 6978, '1973-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166857, 'The Green Death, Episode One', 'While the Doctor plans a holiday to Metebelis Three, Jo and the Brigadier are intrigued by a mysterious death at a coal mine in Llanfairfach, which is being blamed on local company Global Chemicals. ', 121, 21, 166857, 6978, '1973-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166846, 'The Green Death, Episode Two', 'The Doctor and the Brigadier attempt to rescue Jo and Bert from the mine but Global Chemicals prove distinctly uncooperative. ', 121, 22, 166846, 6978, '1973-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166849, 'The Green Death, Episode Three', 'The Doctor and Jo manage to escape from the mine with a maggot egg but Stevens is determined to stop them analysing it. ', 121, 23, 166849, 6978, '1973-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166850, 'The Green Death, Episode Four', 'The Brigadier calls in a full UNIT force to deal with the giant maggots while the Doctor infiltrates Global Chemicals to find out what is really going on. ', 121, 24, 166850, 6978, '1973-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166853, 'The Green Death, Episode Five', 'The Doctor manages to escape from BOSS with help from Yates and discovers Cliff has been infected by a giant maggot. ', 121, 25, 166853, 6978, '1973-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166855, 'The Green Death, Episode Six', 'The Doctor attempts to destroy the giant maggots and cure Cliff but the real threat is BOSS, who is poised to take over all the world''s computers.', 121, 26, 166855, 6978, '1973-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (166895, 'The Time Warrior, Part One', 'England, the 12th century. Robber baron Irongron is recruited by Linx, a Sontaran warrior whose starship has been forced down on Earth. Linx is forced to use a time-travel device to steal resources and scientists from the future to repair his ship, but in doing so involves UNIT and the Doctor...', 121, 1, 166895, 6979, '1973-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167044, 'The Time Warrior, Part Two', 'The Doctor tracks the missing scientists to Irongron''s castle, where Linx is using them to repair his spaceship and construct advanced weapons for Irongron.', 121, 2, 167044, 6979, '1973-12-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167045, 'The Time Warrior, Part Three', 'The Doctor escapes the castle with Sarah and Hal and must persuade Sir Edward to trust him before Irongron launches an attack on them. ', 121, 3, 167045, 6979, '1973-12-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167046, 'The Time Warrior, Part Four', 'The Doctor attempts to return the scientists to their own time, before Linx tries to use his spaceship and destroys the entire castle. ', 121, 4, 167046, 6979, '1974-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167047, 'Invasion, Part One', 'The Doctor and Sarah return to London in the present day only to find the city strangely deserted, while nearby UNIT are dealing with a series of monster appearances. ', 121, 5, 167047, 6979, '1974-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167048, 'Invasion of the Dinosaurs, Part Two', 'Assisting U.N.I.T in the emergency, The Doctor and Sarah discovers corrupt politician Sir Charles Grover MP, renegade scientists Butler and Professor Whitaker and military officer General Finch are using a time machine to bring the dinosaurs from the past to the present as part of they scheme to bring the human race back to a "Golden Age" before the world was polluted.', 121, 6, 167048, 6979, '1974-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167049, 'Invasion of the Dinosaurs, Part Three', 'Yates sabotages the Doctor''s equipment to stop him finding the location of Whitaker''s base but then the tyrannosaur escapes, placing Sarah in danger.', 121, 7, 167049, 6979, '1974-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167050, 'Invasion of the Dinosaurs, Part Four', 'Sarah attempts to find a way off the spaceship while the Doctor tries to track down the source of the time displacements.', 121, 8, 167050, 6979, '1974-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167051, 'Invasion of the Dinosaurs, Part Five', 'The Doctor has been framed as the monster maker by Finch and is on the run from the army, while Sarah attempts to alert UNIT to what Grover is up to.', 121, 9, 167051, 6979, '1974-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167052, 'Invasion of the Dinosaurs, Part Six', 'The Doctor is rescued from Finch by the Brigadier and Benton and tries to persuade them to stop Grover before millions of people are erased from history.', 121, 10, 167052, 6979, '1974-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167053, 'Death to the Daleks, Part One', 'The barren planet Exxilon, some time in the future. The TARDIS is forced down by a total power failure and the Doctor and Sarah meet a stranded Earth crew who came here to mine for priceless medical supplies. But what is causing the power failures? And why have the Daleks come here too?', 121, 11, 167053, 6979, '1974-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167054, 'Death to the Daleks, Part Two', 'The Doctor and the MSC crew join forces with the Daleks to mine the parrinium, only to come under attack from the Exxilons.', 121, 12, 167054, 6979, '1974-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167055, 'Death to the Daleks, Part Three', 'The Doctor and Sarah meet up with Bellal, who helps them escape from the Daleks and explains the origin of the City.', 121, 13, 167055, 6979, '1974-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167056, 'Death to the Daleks, Part Four', 'The Doctor and Bellal continue to penetrate the City''s defences while Sarah and Jill try to stop the Daleks leaving with the parrinium.', 121, 14, 167056, 6979, '1974-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167057, 'The Monster of Peladon, Part One', 'The planet Peladon, some time in the future. Mining disputes threaten the peace of the planet, and as the Doctor and Jo arrive, it seems that the ghost of Aggedor walks once more...', 121, 15, 167057, 6979, '1974-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167058, 'The Monster of Peladon, Part Two', 'The Doctor is rescued by Gebek, prompting him to try and help the miners, but his advice results in Ettis launching another attack on the armoury.', 121, 16, 167058, 6979, '1974-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167059, 'The Monster of Peladon, Part Three', 'The Doctor and Sarah pacify Aggedor and the Doctor encourages the Queen to make peace with the miners, but Ortron soon has him under arrest again.', 121, 17, 167059, 6979, '1974-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281578, 'Episode 36', '', 70583, 36, 1281578, 85893, '2016-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167060, 'The Monster of Peladon, Part Four', 'The Ice Warriors take control of the planet and force the miners to return to work but Ettis takes the opportunity to try and destroy the citadel.', 121, 18, 167060, 6979, '1974-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167061, 'The Monster of Peladon, Part Five', 'Sarah and Alpha Centauri decide to try and alert the Federation to what the Ice Warriors are up to but first they have to escape from the throne room.', 121, 19, 167061, 6979, '1974-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167062, 'The Monster of Peladon, Part Six', 'The Doctor turns the Aggedor spirit against the Ice Warriors to aid the Peladonians in their battle but Eckersley attacks him with the security system.', 121, 20, 167062, 6979, '1974-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167063, 'Planet of the Spiders, Part One', 'While the Doctor carries out an investigation into ESP, Mike Yates asks Sarah to look into some strange goings on at a meditation centre he''s attending.', 121, 21, 167063, 6979, '1974-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167064, 'Planet of the Spiders, Part Two', 'Lupton forms an alliance with the spider to steal the Doctor''s blue crystal, while Sarah and Mike attempt to alert people to what they''ve seen.', 121, 22, 167064, 6979, '1974-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167065, 'Planet of the Spiders, Part Three', 'The Doctor and Sarah head to the meditation centre to try and get the crystal back while Lupton prepares to return it to Metebelis Three. But all their plans are disrupted when it is stolen by Tommy.', 121, 23, 167065, 6979, '1974-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167067, 'Planet of the Spiders, Part Four', 'Sarah is captured by the spiders'' guards while the Doctor tries to help Arak and the others strike back against the spiders.', 121, 24, 167067, 6979, '1974-05-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167070, 'Planet of the Spiders, Part Five', 'The Doctor escapes from the spiders'' larder only to encounter the Great One, while Sarah makes a deal with the Queen Spider.', 121, 25, 167070, 6979, '1974-06-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167071, 'Planet of the Spiders, Part Six', 'K''Anpo persuades the Doctor he must face his fear and return the crystal to the Great One.But first they need to get past Barnes and his men.', 121, 26, 167071, 6979, '1974-06-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975892, 'Robot, Part One', 'Can the Doctor, now in his fourth incarnation. Recover from his seriesReview regenerative trauma to save the Earth from Think Tank and their plot for world domination.', 121, 1, 975892, 6980, '1974-12-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955400, 'Robot, Part Two', 'The Doctor and Sarah become convinced Think Tank are behind the electronic component thefts but are unable to stop them carrying out another raid. ', 121, 2, 955400, 6980, '1975-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167101, 'Robot, Part Three', 'Sarah and Kettlewell infiltrate an SRS meeting to try and find out what Miss Winters is up to but there is a surprise in store.', 121, 3, 167101, 6980, '1975-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167112, 'Robot, Part Four', 'UNIT attempt to get into the bunker to stop Miss Winters setting off the world''s nuclear missiles but first they have to get past the K1.', 121, 4, 167112, 6980, '1975-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167124, 'The Ark in Space, Part One', 'The Doctor''s attempt to give Harry a trip in the TARDIS sees the two of them and Sarah arriving onboard a space station in the far future, with some rather deadly security mechanisms. ', 121, 5, 167124, 6980, '1975-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167141, 'The Ark in Space, Part Two', 'The Doctor and Harry revive the Ark''s medtech, Vira, to help Sarah.But when station commander Noah is revived, he becomes suspicious of the newcomers. ', 121, 6, 167141, 6980, '1975-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167142, 'The Ark in Space, Part Three', 'Knowing that Noah has been infected by the Wirrn, the Doctor persuades Vira to halt the reviving of her people, knowing it will place them in danger as well. ', 121, 7, 167142, 6980, '1975-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167143, 'The Ark in Space, Part Four', 'The Doctor tries to protect the humans still in cryogenic suspension from the Wirrn, who are determined to use Earth as their new breeding ground.', 121, 8, 167143, 6980, '1975-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167144, 'The Sontaran Experiment, Part One', 'The Doctor, Sarah and Harry teleports to Earth to ensure the planet is safe for the survivors on-board Nerva Beacon to return to Earth and re-inhabit their world. Only to find a Sontaran named Styre has captured a group of humans and conducting experiments on them to discover the human body''s weaknesses, as part of the Sontaran''s goal for domination of the galaxy. ', 121, 9, 167144, 6980, '1975-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167145, 'The Sontaran Experiment, Part Two', 'The Doctor learns that Styre has been experimenting on the Galsec crewmembers to pave the way for a Sontaran invasion of Earth and decides the only way to halt his plans is to challenge him to a duel.', 121, 10, 167145, 6980, '1975-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167146, 'Genesis of the Daleks, Part One', 'The planet Skaro, the distant past. The Time Lords divert the Doctor, Sarah and Harry to this war-torn world, and give the Doctor a mission: the evil of the Daleks is about to be born here, and the Doctor is to try to ensure they evolve into less lethally aggressive beings - or, failing that, to avert their creation altogether. But has even the Doctor the right to commit genocide?', 121, 11, 167146, 6980, '1975-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167159, 'Genesis of the Daleks, Part Two', 'The Doctor and Harry are taken to the Kaled bunker where Davros is preparing to demonstrate the Daleks, while Sarah is captured by the Thals and taken to their city as a slave worker.', 121, 12, 167159, 6980, '1975-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167166, 'Genesis of the Daleks, Part Three', 'The Doctor and Harry head to the Kaled city to alert the authorities to Davros'' plans while Sarah and Sevrin are forced to work on the completion of the Thals'' rocket.', 121, 13, 167166, 6980, '1975-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167234, 'Genesis of the Daleks, Part Four', 'The Doctor fails to prevent the Thals from destroying the Kaled city but they don''t have long to enjoy their victory before the Daleks attack.', 121, 14, 167234, 6980, '1975-03-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167260, 'Genesis of the Daleks, Part Five', 'The Doctor is forced to give Davros full details of future Dalek victories but opposition to Davros'' plans is growing among the Kaleds and soon there is open rebellion.', 121, 15, 167260, 6980, '1975-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167278, 'Genesis of the Daleks, Part Six', 'Gharman tries to convince the Kaleds to vote against the Dalek project but Davros has a trick up his sleeve, while the Doctor works to destroy the tape recording of Dalek victory and the Thals plan an intervention of their own.', 121, 16, 167278, 6980, '1975-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167288, 'Revenge of the Cybermen, Part One', 'The orbit of Jupiter, the 25th century. Arriving back on the Nerva Beacon much earlier in history, the Doctor and his friends discover the satellite beset by space plague while its crew struggles to keep space traffic away from Voga, the newest moon of Jupiter. But what is the connection between Voga, the plague, and some old enemies of the Doctor?', 121, 17, 167288, 6980, '1975-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167301, 'Revenge of the Cybermen, Part Two', 'The Doctor transmits Sarah and Harry down to Voga to cure Sarah of the Cybermat''s poison but Kellman''s sabotage means he is unable to bring them back.', 121, 18, 167301, 6980, '1975-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975893, 'Revenge of the Cybermen, Part Three', 'The Cybermen force the Doctor, Stevenson and Lester to carry bombs to the centre of Voga while Sarah, Harry and Tyrum decide to contact Vorus.', 121, 19, 975893, 6980, '1975-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167312, 'Revenge of the Cybermen, Part Four', 'The Doctor, Harry and Lester try to destroy the Cybermen''s relay device, while the Vogans prepare to destroy Nerva even though Sarah is still on board.', 121, 20, 167312, 6980, '1975-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167315, 'Terror of the Zygons, Part One', 'Scotland, the near future. Something is smashing oil rigs off the Scottish coast, and UNIT have been called in to investigate. The Brigadier summons the Doctor to Earth to help in the investigation, but it soon becomes clear some kind of alien presence is at work...', 121, 1, 167315, 6981, '1975-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167326, 'Terror of the Zygons, Part Two', 'The Zygon traps the Doctor and Sarah in a decompression chamber while Harry is taken to the aliens'' underwater ship.', 121, 2, 167326, 6981, '1975-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975895, 'Terror of the Zygons, Part Three', 'The Doctor and the Brigadier begin to realise who the Zygon imposters among them are while Sarah discovers a secret tunnel to the underwater ship.', 121, 3, 975895, 6981, '1975-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975896, 'Terror of the Zygons, Part Four', 'UNIT attempt to track down the Zygon ship while Broton prepares to have the Skarasen attack London.', 121, 4, 975896, 6981, '1975-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167349, 'Planet of Evil, Part One', 'The Doctor and Sarah answer a distress call and find themselves on Zeta Minor, the last planet of the known universe, where a Morestran expedition has gone missing. ', 121, 5, 167349, 6981, '1975-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167350, 'Planet of Evil, Part Two', 'The Doctor realises that Zeta Minor lies on the boundary between the universes of matter and anti-matter and something on the planet won''t let the Morestrans leave. ', 121, 6, 167350, 6981, '1975-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167351, 'Planet of Evil, Part Three', 'The Doctor makes a deal with the Anti-Matter Beast to return all the anti-matter to the planet but Sorenson is determined to continue his research. ', 121, 7, 167351, 6981, '1975-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167352, 'Planet of Evil, Part Four', 'The Doctor tries to convince Sorenson to sacrifice himself for the rest of the crew but Salamar''s attempt to deal with the situation causes their problem to multiply. ', 121, 8, 167352, 6981, '1975-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167353, 'Pyramids of Mars, Part One', 'The Doctor and Sarah are drawn off course and, instead of UNIT HQ, they arrive on the same site in 1911.', 121, 9, 167353, 6981, '1975-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167355, 'Pyramids of Mars, Part Two', 'The Doctor, Sarah and Laurence try to find a way to sever Sutekh''s link to the mummies while poacher Ernie Clements finds the priory surrounded by a forcefield. ', 121, 10, 167355, 6981, '1975-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167358, 'Pyramids of Mars, Part Three', 'The Doctor and Sarah try to destroy Sutekh''s rocket but the Osiran''s mental powers prove too great for them.', 121, 11, 167358, 6981, '1975-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167361, 'Pyramids of Mars, Part Four', 'Sutekh forces the Doctor to transport Scarman and a mummy to Mars, where the Doctor and Sarah try to stop them destroying the Eye of Horus.', 121, 12, 167361, 6981, '1975-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167363, 'The Android Invasion, Part One', 'The Doctor and Sarah return to Earth in the present day to find a strangely deserted village and woods stalked by white-clad figures.', 121, 13, 167363, 6981, '1975-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167368, 'The Android Invasion, Part Two', 'The Doctor suspects Crayford brought something to Earth in his rocket, as he and Sarah find themselves hunted by UNIT.', 121, 14, 167368, 6981, '1975-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167370, 'The Android Invasion, Part Three', 'The Doctor is captured by Styggron and left to die in the destruction of the fake village but Sarah escapes from the disorientation chamber to try and rescue him.', 121, 15, 167370, 6981, '1975-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167373, 'The Android Invasion, Part Four', 'The Doctor and Sarah reach Earth and try to warn the research centre about the Kraal invasion before Styggron unleashes his virus.', 121, 16, 167373, 6981, '1975-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167374, 'The Brain of Morbius, Part One', 'The storm-lashed planet Karn. Near a graveyard of crashed starships, the demented surgeon Solon hides in his castle, the last acolyte of the Time Lord despot Morbius. He only needs one final item to make his master live again... and then the Doctor and Sarah arrive...', 121, 17, 167374, 6981, '1976-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167375, 'The Brain of Morbius, Part Two', 'The Doctor is captured by the Sisterhood, and Sarah Jane is blinded freeing him. The Doctor has no choice but to go back for a cure, unaware that he is leaving Sarah Jane in the hands of a treacherous Dr. Solon and the renegade Time Lord Morbius.', 121, 18, 167375, 6981, '1976-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167380, 'The Brain of Morbius, Part Three', 'While the Doctor goes to confront the Sisterhood to seek a cure for Sarah Jane''s blindness, Solon realizes that he must transfer Morbius'' brain into a new body before it is too late.', 121, 19, 167380, 6981, '1976-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167382, 'The Brain of Morbius, Part Four', 'Morbius lives once more, but as a rampaging beast. The Doctor is forced to ally with Dr. Solon to bring him to heel, but the two disagree about what should happen to Morbius.', 121, 20, 167382, 6981, '1976-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167384, 'The Seeds of Doom, Part One', 'The Antarctic, the near future. A strange seed-pod is unearthed from 20-thousand-year-old ice. The Doctor and Sarah go to investigate, but are too late to prevent the pod infecting a scientist and unleashing a threat to all animal life on Earth...', 121, 21, 167384, 6981, '1976-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167385, 'The Seeds of Doom, Part Two', 'Two employees of the millionnaire Harrison Chase arrive at the Antarctic base, and they will stop at nothing to get hold of the second seed-pod.', 121, 22, 167385, 6981, '1976-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167387, 'The Seeds of Doom, Part Three', 'England: The 20th Century. After they return from England after their Antarctic ordeal, Chase tries to eliminate the Doctor and Sarah Jane, but they escape and track him down at his estate, where he is preparing to open the Krynoid pod.', 121, 23, 167387, 6981, '1976-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167390, 'The Seeds of Doom, Part Four', 'England: The 20th century. The Doctor is captured by Chase, who plans to breed the stolen Krynoid pod. The Doctor is placed in an automated compost hopper and only Sarah Jane can save him...but will she make it before the Krynoid grows to fruition?', 121, 24, 167390, 6981, '1976-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167391, 'The Seeds of Doom, Part Five', 'England, the near future. The Krynoid grows to monstrous size and traps the Doctor and the others in a cottage. The creature demands they turn over the Doctor, while Chase seeks to make an alliance with the alien vegetation.', 121, 25, 167391, 6981, '1976-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167394, 'The Seeds of Doom, Part Six', 'England, the near future. The Doctor, Sarah Jane, and Scorby are trapped in the manor as a possessed Chase stalks them from within, while the gigantic Krynoid prepares to crush them from without. Worse, the alien plant is ready to germinate, spreading its seeds across England.', 121, 26, 167394, 6981, '1976-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167399, 'The Masque of Mandragora, Part One', 'Italy, 1492. Not realising the TARDIS has been infiltrated by the malevolent Mandragora Helix, the Doctor and Sarah arrive in the tiny duchy of San Martino. With the locals preoccupied by the struggle for the Dukedom, will the time travellers be able to resist a force that threatens to drag Earth into a new Dark age?', 121, 1, 167399, 6982, '1976-09-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167419, 'The Masque of Mandragora, Part Two', 'Italy, 1492. The Mandragora Helix establishes its power base with the Brotherhood of Demnos, while Count Federico plots against his nephew Giuliano, unaware of the danger that threatens them all.', 121, 2, 167419, 6982, '1976-09-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167420, 'The Masque of Mandragora, Part Three', 'Italy, 1492. Not realising the TARDIS has been infiltrated by the malevolent Mandragora Helix, the Doctor and Sarah arrive in the tiny duchy of San Martino. With the locals preoccupied by the struggle for the Dukedom, will the time travellers be able to resist a force that threatens to drag Earth into a new Dark Age?', 121, 3, 167420, 6982, '1976-09-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167421, 'The Masque of Mandragora, Part Four', 'Italy, 1492. Not realising the TARDIS has been infiltrated by the malevolent Mandragora Helix, the Doctor and Sarah arrive in the tiny duchy of San Martino. With the locals preoccupied by the struggle for the Dukedom, will the time travellers be able to resist a force that threatens to drag Earth into a new Dark Age?', 121, 4, 167421, 6982, '1976-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281579, 'Episode 37', '', 70583, 37, 1281579, 85893, '2016-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167422, 'The Hand of Fear, Part One', 'England, the near future. The TARDIS materialises in a quarry and Sarah is trapped under a rockfall. But what is the origin of the fossilized hand she is found gripping? And who is the Eldrad she keeps mumbling about?', 121, 5, 167422, 6982, '1976-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167425, 'The Hand of Fear, Part Two', 'The Doctor and Professor Watson struggle to stop first Sarah Jane and then Driscoll from obeying the strange and dangerous orders of the stone hand, which has suddenly come to life.', 121, 6, 167425, 6982, '1976-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167430, 'The Hand of Fear, Part Three', 'The energy of the reactor has returned the mysterious Eldrad to life. The Doctor agrees to take her back to Kastria. But what is waiting for them there?', 121, 7, 167430, 6982, '1976-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167431, 'The Hand of Fear, Part Four', 'The Doctor and Sarah race to save the mortally wounded Eldrad. But they find that everything is not quite as she told them.', 121, 8, 167431, 6982, '1976-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167432, 'The Deadly Assassin, Part One', 'Gallifrey, planet of the Time Lords. Summoned home by a premonition of murder, the Doctor discovers a dark conspiracy at the highest levels of Time Lord society... and his oldest enemy, who poses a threat to the existence of Gallifrey itself...', 121, 9, 167432, 6982, '1976-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167433, 'The Deadly Assassin, Part Two', 'The President of the High Council has been killed and the Doctor is the prime suspect. The Time Lords are eager to dispense quick justice and the Doctor must race agains the clock to discover the truth... and an old enemy.', 121, 10, 167433, 6982, '1976-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955401, 'The Deadly Assassin, Part Three', 'The Doctor has entered the computation Matrix to prove his innocence. But his opponent is prepared for him and the two engage in a mental duel to the death.', 121, 11, 955401, 6982, '1976-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167436, 'The Deadly Assassin, Part Four', 'The Doctor has won his fight in the Matrix and revealed the assassin. But the Master is not defeated and sets a plan in motion that could destroy the Time Lords.', 121, 12, 167436, 6982, '1976-11-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167437, 'The Face of Evil, Part One', 'An unnamed planet, the distant future. Arriving in a place that seems oddly familiar, the Doctor finds the savage Sevateem tribe battling to free their captive god, Xoanon, from the Evil One and his Tesh servants. But can the whole situation really be the Doctor''s fault?', 121, 13, 167437, 6982, '1977-01-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167438, 'The Face of Evil, Part Two', 'The Sevateem launch another attack to try to free Xoanon as the Doctor tries to figure out his role in their past. But his only chance to win their trust is to face a deadly test.', 121, 14, 167438, 6982, '1977-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167439, 'The Face of Evil, Part Three', 'The Doctor has broken through the barrier and found the Tesh. But he comes to an awful realization about Xoanon.', 121, 15, 167439, 6982, '1977-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167440, 'The Face of Evil, Part Four', 'The Doctor tries to fix the mad computer Xoanon. But it is determined to stop him – even if it must destroy the entire world!', 121, 16, 167440, 6982, '1977-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167450, 'The Robots of Death, Part One', 'An unnamed world, an unknown time. A vast mining vessel trawls a sea of mineral sand for valuable ores, the tiny human crew served by an army of humanoid robots. But as the Doctor and Leela arrive, one of the crew is found murdered... and if they didn''t do it, who did?', 121, 17, 167450, 6982, '1977-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167481, 'The Robots of Death, Part Two', 'The Doctor and Leela are suspected of murder. But the real foe is using robots to cut down the crew – and even sabotage the sand miner itself!', 121, 18, 167481, 6982, '1977-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975898, 'The Robots of Death, Part Three', 'Hearing about a man who grew up only around robots and who has threatened to start a robot revolution, and who may be aboard the sandminer under an assumed name, the Doctor takes D.84 to seek out a possible secret workshop where he would be restructuring robot programming. Meanwhile, as one crew member suffers a complete mental breakdown, reprogrammed robots are ordered to kill all remaining humans', 121, 19, 975898, 6982, '1977-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167491, 'The Robots of Death, Part Four', 'The Doctor and the surviving humans fight for their lives againt Teran Capel and his growing army of deadly robots.', 121, 20, 167491, 6982, '1977-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167495, 'The Talons of Weng-Chiang, Part One', 'London, the 1890s. As magician Li H''Sen Chang captivates audiences, a spate of disappearances amongst young women goes largely unnoticed. But almost upon their arrival, the Doctor and Leela find themselves confronting the feared Tong of the Black Scorpion, and a menace from another time. And there''s something fishy in the sewers, too...', 121, 21, 167495, 6982, '1977-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167502, 'The Talons of Weng-Chiang, Part Two', 'The Doctor and Leela investigate the strange events in Victorian London. But a mysterious masked figure lurks in the shadows.', 121, 22, 167502, 6982, '1977-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955402, 'The Talons of Weng-Chiang, Part Three', 'As Li H''Sen Chang works to secure the time cabinet, Leela pursues and investigates his master – the mysterious and murderous Weng-Chiang.', 121, 23, 955402, 6982, '1977-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167514, 'The Talons of Weng-Chiang, Part Four', 'The Doctor and Leela attend Li H''Sen Chang''s performance, hoping to confront the magician. But his master Weng-Chiang has other plans…', 121, 24, 167514, 6982, '1977-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167518, 'The Talons of Weng-Chiang, Part Five', 'The Doctor and his allies try to track down Weng-Chiang before he can activate the time cabinet and possibly destroy London.', 121, 25, 167518, 6982, '1977-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167521, 'The Talons of Weng-Chiang, Part Six', 'The Doctor and Weng-Chiang have their final confrontation in the mysterious House of the Dragon -- watched by the evil duplicitous Mr. Sin.', 121, 26, 167521, 6982, '1977-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167529, 'Horror of Fang Rock, Part One', 'The English channel, the 1900s AD. The TARDIS lands on barren Fang Rock, inhabited until now only by three light-house keepers. But what is the strange fog covering the island, and can it be connected to the falling star sighted earlier that night?', 121, 1, 167529, 6983, '1977-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167554, 'Horror of Fang Rock, Part Two', 'The survivors of a wrecked ship are stranded with the lighhouse crew on Fang Rock as a deadly menace slithers through the fog. Has the Beast of Fang Rock returned?', 121, 2, 167554, 6983, '1977-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167560, 'Horror of Fang Rock, Part Three', 'The Doctor barricades everyone in the lighthouse to protect them from the mysterious deadly creature in the fog. But it may already be inside, biding its time…', 121, 3, 167560, 6983, '1977-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167573, 'Horror of Fang Rock, Part Four', 'The Rutan starts picking off the surviving humans one by one as the Doctor and Leela struggle to defeat not only the alien but an entire fleet waiting to occupy Earth.', 121, 4, 167573, 6983, '1977-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167583, 'The Invisible Enemy, Part One', 'Deep space, 5000AD. An Earth supply shuttle is infected by a strange sentient space-borne virus, which quickly spreads to the crew of the refuelling station on the moon Titan. Even worse, the Doctor himself falls victim. But why is Leela immune, and what is the virus''s ultimate goal?', 121, 5, 167583, 6983, '1977-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167617, 'The Invisible Enemy, Part Two', 'Leela and Lowe take the Doctor to the Bi-Al Foundation for help. But how can they cure an infection of the mind?', 121, 6, 167617, 6983, '1977-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167629, 'The Invisible Enemy, Part Three', 'Miniaturized clones of the Doctor and Leela are injected into his brain. But they must now fight the virus on its own level. And its servants are closing in around them.', 121, 7, 167629, 6983, '1977-10-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281582, 'Episode 38', '', 70583, 38, 1281582, 85893, '2016-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281583, 'Episode 39', '', 70583, 39, 1281583, 85893, '2016-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167630, 'The Invisible Enemy, Part Four', 'The Nucleus, now grown to human size, is determined to spawn and take over the Galaxy. Only the Doctor and Leela can stop it.', 121, 8, 167630, 6983, '1977-10-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167631, 'Image of the Fendahl, Part One', 'England, the late 1970s. At Fetch Priory, Dr Fendelman''s experiments with the new Time Scanner are disrupted by the mysterious death nearby of a hiker. Then there''s the mysterious skull, also being used as part of his work--a skull that seems to predate the evolution of mankind. What is the true role of the Fendahl in humanity''s evolution?', 121, 9, 167631, 6983, '1977-10-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167636, 'Image of the Fendahl, Part Two', 'The mystery surrounding the strange skull deepens. Thea is slowly succumbing to its influence while the Doctor prepares to battle a creature from mythology.', 121, 10, 167636, 6983, '1977-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167644, 'Image of the Fendahl, Part Three', 'While Max prepares to tap supernatural forces beyond imagining, the Doctor and Leela investigate the legend of the Fendahl.', 121, 11, 167644, 6983, '1977-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167649, 'Image of the Fendahl, Part Four', 'The Fendahl is returning to life, ready to consume everything in its path. Can the Doctor find a way to kill death itself?', 121, 12, 167649, 6983, '1977-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167655, 'The Sun Makers, Part One', 'Pluto, the distant future. The planet has been terraformed and is now orbited by artificial suns, provided by the rapacious company who ruthlessly exploit the relocated human workforce. The Doctor, Leela, and K9 arrive and befriend a luckless drone worker, but they must flee with him to the dark undercity...', 121, 13, 167655, 6983, '1977-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167719, 'The Sun Makers, Part Two', 'The Doctor has been captured by the Gatherer. Leela works to free him but the Gatherer is already laying his own plans…', 121, 14, 167719, 6983, '1977-12-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167739, 'The Sun Makers, Part Three', 'Now Leela is the prisoner of the Collector. He knows of the Doctor and is determined to rid himself of both of them.', 121, 15, 167739, 6983, '1977-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167749, 'The Sun Makers, Part Four', 'The Doctor now moves to completely overthrow the Company. But the Collector has one last trump card to play.', 121, 16, 167749, 6983, '1977-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167758, 'Underworld, Part One', 'Deep space, an unknown time. The Doctor encounters the Minyans, survivors of a race the Time Lords unwittingly obliterated early in their own history. The Minyans are searching for their race''s lost gene banks, a quest which takes them to the edge of the galaxy…', 121, 17, 167758, 6983, '1978-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167866, 'Underworld, Part Two', 'After 100,000 years, the Minyans have found the long-lost P7E. But what awaits them on the ship, long buried in the core of a newborn planet?', 121, 18, 167866, 6983, '1978-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167881, 'Underworld, Part Three', 'The Minyans have, at long last, found the P7E. But a host of guards and robotic seers stand between them and the race banks.', 121, 19, 167881, 6983, '1978-01-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167882, 'Underworld, Part Four', 'The Minyons struggle to gain the precious race banks from the Oracle. But perhaps it is giving in a little too easily ...', 121, 20, 167882, 6983, '1978-01-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167883, 'The Invasion of Time, Part One', 'Gallifrey, world of the Time Lords. The Doctor returns and claims the vacant presidency. But his behaviour is erratic and his motives mysterious.', 121, 21, 167883, 6983, '1978-02-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167891, 'The Invasion of Time, Part Two', 'Now President of Gallifrey, the Doctor puts a plan motion to apparent betray his people to an alien menace.', 121, 22, 167891, 6983, '1978-02-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167892, 'The Invasion of Time, Part Three', 'Gallifrey, world of the Time Lords. The Doctor has claimed the presidency of the planet (on a technicality, following events in the previous season''s The Deadly Assassin) and his behaviour is even more eccentric than usual in other ways, too: he refuses to speak to Leela and seems only to trust K9. But has he really betrayed Gallifrey to a Vardan invasion force? And is there a further power behind the Vardans?', 121, 23, 167892, 6983, '1978-02-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167893, 'The Invasion of Time, Part Four', 'The Doctor works to free his planet of the Vardan menace. How can he defeat an enemy who can read his very thoughts? And does their invasion conceal a greater menace?', 121, 24, 167893, 6983, '1978-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167897, 'The Invasion of Time, Part Five', 'The Sontarans have invaded Gallifrey, seeking to seize the incredible power of the Time Lords. The Doctor''s first step is to cut them off from their fleet. But Kelner is helping the enemy…', 121, 25, 167897, 6983, '1978-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167906, 'The Invasion of Time, Part Six', 'The Sontarans finally invade the TARDIS itself, seeking the Great Key. The Doctor, however, has other uses for this powerful object…', 121, 26, 167906, 6983, '1978-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167909, 'The Ribos Operation, Part One', 'The Magellanic Clouds, the planet Ribos, an unknown time. Ordered by the White Guardian to collect the pieces of the omnipotent Key to Time, The Doctor, K-9 and his new assistant Romana arrive. Collecting the first segment is not going to be easy…', 121, 1, 167909, 6984, '1978-09-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167932, 'The Ribos Operation, Part Two', 'Trying to obtain the first segment of the Key to Time, the Doctor and Romana are swept up in an elaborate con. The target – the homicidal Graff Vynda K.', 121, 2, 167932, 6984, '1978-09-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167937, 'The Ribos Operation, Part Three', 'Prisoners of the maniacal Graff Vynda K, the Doctor and Romana must break out and pursue the first segment – even as Unstoff takes it into the most dangerous place on Ribos.', 121, 3, 167937, 6984, '1978-09-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167943, 'The Ribos Operation, Part Four', 'Trapped in the catacombs between a mad warlord and ravenous monsters, the Doctor and Romana work desperately to obtain the segement of the Key to Time - and escape alive.', 121, 4, 167943, 6984, '1978-09-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (167949, 'The Pirate Planet, Part One', 'Planet Zanak, unknown time. The Doctor and Romana are seeking the planet Calufrax where the second segment waits. They are in the right place and the right time… but on the wrong planet.', 121, 5, 167949, 6984, '1978-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168003, 'The Pirate Planet, Part Two', 'The Doctor begins to investigate the mysteriously wealthy planet Zanak. Mentiads, a deranged Captain, strange omens, miraculous mines – what does it all mean? And what does it have to do with the Key to Time?', 121, 6, 168003, 6984, '1978-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972558, 'The Pirate Planet, Part Three', 'The Mentiads take the Doctor, Romana and Kimus to a reunion with K9 and Mula, where they set about trying to defeat the Captain.', 121, 7, 972558, 6984, '1978-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168019, 'The Pirate Planet, Part Four', 'The Captain and Xanxia work toward their secret goals. Both depends on the pirate planet consuming one more victim - Earth.', 121, 8, 168019, 6984, '1978-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168030, 'The Stones of Blood, Part One', 'England, the late 1970s. The Doctor and Romana arrive in search of the third segment. But the Tracer readings are erratic and something ominous is happening with an ancient stone circle...', 121, 9, 168030, 6984, '1978-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168042, 'The Stones of Blood, Part Two', 'The quest for the Third Segment has landed the Doctor and Romana in the midst of a druidic cult centered on a stone circle. But the stones are not what they seem. And somewhere out there is a blood-thirsty celtic godess.', 121, 10, 168042, 6984, '1978-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168044, 'The Stones of Blood, Part Three', 'Chase by blood-thirsty stones, the Doctor must find a way to rescue Romana. What awaits him in the theoretical absurdity of hyperspace?', 121, 11, 168044, 6984, '1978-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168045, 'The Stones of Blood, Part Four', 'Facing a sentence of death from merciless justice machines, the Doctor must play for time while Romana tries to discover just who Vivian Fey really is.', 121, 12, 168045, 6984, '1978-11-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975899, 'The Androids of Tara, Part One', 'When Romana goes fishing for the fourth segment to the Key to Time, the Doctor just goes fishing. While on the planet of Tara, both are taken in (somewhat against their will) by two factions, both trying to achieve the throne of Tara. While Romana is mistaken for an android by Count Grendel, the Doctor and the Prince are drugged after the Doctor agrees to help repair his android.', 121, 13, 975899, 6984, '1978-11-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168053, 'The Androids of Tara, Part Two', 'The Doctor must employ a desperate gambit to keep the evil Grendel off the throne. And the Count has a new pawn to play - Romana.', 121, 14, 168053, 6984, '1978-12-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168054, 'The Androids of Tara, Part Three', 'The Doctor and Romana are swept up in the political machinations of Tara. The Doctor must keep the android "king" running while Grendel plots to use Romana to destroy him.', 121, 15, 168054, 6984, '1978-12-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168055, 'The Androids of Tara, Part Four', 'Grendel plans two weddings and a funeral to cement his hold over Tara. The Doctor and K-9 race to foil him and save the Time Lady''s life.', 121, 16, 168055, 6984, '1978-12-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168056, 'The Power of Kroll, Part One', 'The Third Moon of Delta Magna, The Future. The Doctor and Romana arrive in search of the fifth segment and are immediately swept up in a conflict between the crew of a new refinery and the embittered natives…', 121, 17, 168056, 6984, '1978-12-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168057, 'The Power of Kroll, Part Two', 'The Doctor and Romana try to avoid being sacrificed to Kroll – just in time for the real monster to appear.', 121, 18, 168057, 6984, '1978-12-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168058, 'The Power of Kroll, Part Three', 'The massive Kroll is awake and killing anyone in its path. And the swampies are determined to appease it – by sacrificing the Doctor and Romana.', 121, 19, 168058, 6984, '1979-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168061, 'The Power of Kroll, Part Four', 'The Doctor and Romana are trapped between the monstrous Kroll and the insane refinery commander. And there is no sign of the fifth segment of the Key to Time.', 121, 20, 168061, 6984, '1979-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168063, 'The Armageddon Factor, Part One', 'Searching for the sixth segment, the Doctor and Romana land in the midst of a brutal nuclear wear between the planets Atrios and Zeos.', 121, 21, 168063, 6984, '1979-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168081, 'The Armageddon Factor, Part Two', 'Swept up in an apocalyptic war, the Doctor must help the Marshall defend his planet. But who or what controls the Marshall?', 121, 22, 168081, 6984, '1979-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168085, 'The Armageddon Factor, Part Three', 'The Doctor meets a new enemy – the Shadow – who wants the Key to Time. And the Atrian-Zeon war is approaching an awful climax.', 121, 23, 168085, 6984, '1979-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168095, 'The Armageddon Factor, Part Four', 'The Doctor is forced into a desperate gambit to prevent a massacre. But it is getting harder to tell friend from foe.', 121, 24, 168095, 6984, '1979-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168098, 'The Armageddon Factor, Part Five', 'The Doctor and Romana finally venture into the Shadow''s lair. The Shadow appears to hold all the cards but the Doctor has found an old friend.', 121, 25, 168098, 6984, '1979-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168103, 'The Armageddon Factor, Part Six', 'The Doctor and the Shadow have their final confrontation to take control of the Key to Time. Completing it may entail an awful sacrifice. And the Black Guardian will do anything to obtain it and plunge the Universe into chaos.', 121, 26, 168103, 6984, '1979-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168110, 'Destiny of the Daleks, Part One', 'Skaro, the Dalek homeworld, some time in the future. The TARDIS lands in the irradiated ruins of the old Kaled city and something is moving underneath the wasted surface of the planet…', 121, 1, 168110, 6985, '1979-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168116, 'Destiny of the Daleks, Part Two', 'Romana has been captured by the Daleks, the Doctor is the guest of the Movellans. The Daleks are drilling deep into Skaro for something and the Doctor has an awful suspicion about their objective…', 121, 2, 168116, 6985, '1979-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168117, 'Destiny of the Daleks, Part Three', 'The Daleks have awoken Davros in the heart of Skaro. Only the Doctor and the Movellans stand between them and their objective. But are the Movellans really on the Doctor''s side?', 121, 3, 168117, 6985, '1979-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168118, 'Destiny of the Daleks, Part Four', 'Trapped between the Movellans and the Daleks, the Doctor must find a way to defeat both. Meanwhile, vast space fleets await new orders.', 121, 4, 168118, 6985, '1979-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168119, 'City of Death, Part One', 'Paris, 1979. The Doctor and Romana are here on holiday, but something is disturbing the flow of time. Could the time travel experiments of Count Scarlioni be to blame?', 121, 5, 168119, 6985, '1979-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168124, 'City of Death, Part Two', 'Captured by the Count, the Doctor and Romana uncover an elaborate plan to steal the Mona Lisa. But there is more to Scarlioni''s plans than a simple theft.', 121, 6, 168124, 6985, '1979-10-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168127, 'City of Death, Part Three', 'The Doctor and Romana unwrap an intricate plot involving aliens, time travel and the Mona Lisa. How is Count Scarlioni living in two times at once? And what does he want?', 121, 7, 168127, 6985, '1979-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168130, 'City of Death, Part Four', 'Scaroth is determined to go back 400 million years in time to prevent a mistake. But the Doctor must stop him – because the consequences would be disastrous.', 121, 8, 168130, 6985, '1979-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168133, 'The Creature from the Pit, Part One', 'The planet Chloris. Drawn here by a mysterious distress signal, the Doctor becomes the prisoneres of the ruthless Adrasta. A strange and deadly pit await those who displease her.', 121, 9, 168133, 6985, '1979-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168134, 'The Creature from the Pit, Part Two', 'The Doctor is in a pit with a deadly creature. And Adrasta has plans for Romana and K-9.', 121, 10, 168134, 6985, '1979-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168140, 'The Creature from the Pit, Part Three', 'The Doctor has come face to face with a massive green creature. Adrasta goes into the mines to kill the monster. But everything is not as it appears…', 121, 11, 168140, 6985, '1979-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168142, 'The Creature from the Pit, Part Four', 'The truth about the creature is revealed. But its imprisonment may have already set in motion a terrible revenge.', 121, 12, 168142, 6985, '1979-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164109, 'Nightmare of Eden, Part One', 'The orbit of the holiday planet, Azure, the year 2116. The starships Empress and Hecate are fused together after an accident in hyperspace. Naturally the Doctor thinks he can find a solution, but has the accident unleashed a far more deadly menace?', 121, 13, 164109, 6985, '1979-11-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164101, 'Nightmare of Eden, Part Two', 'Two ships have collided above Azure but that may be the least of the Doctor''s problems. Monsters and drug smugglers are loose on the ship. And it all seems to tie in with Tryst''s electronic zoo…', 121, 14, 164101, 6985, '1979-12-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168144, 'Nightmare of Eden, Part Three', 'The Doctor and Romana begin to uncover the truth about the strange events aboard the luxury liner Empress. They first have to separate the two ship from each other. But they''ve got Mandrells, drug smugglers and police chasing after them.', 121, 15, 168144, 6985, '1979-12-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168146, 'Nightmare of Eden, Part Four', 'The Doctor finally discovers the truth about the drug smuggling ring. But the villains are still one step ahead.', 121, 16, 168146, 6985, '1979-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168152, 'The Horns of Nimon, Part One', 'Deep space, an unknown time. The TARDIS encounters a disabled Skonnon battlecruiser transporting Anethan ''tribute''. The co-pilot is determined to reach Skonnos at any cost.', 121, 17, 168152, 6985, '1979-12-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168162, 'The Horns of Nimon, Part Two', 'Having reached Skonnos, Romana is sent with the Anethians to face the deadly Nimon.', 121, 18, 168162, 6985, '1979-12-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168165, 'The Horns of Nimon, Part Three', 'The Doctor and Romana are trapped in the Nimon''s lair. Is he really the last of his race? What are his real intentions toward Skonnos?', 121, 19, 168165, 6985, '1980-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168168, 'The Horns of Nimon, Part Four', 'Romana is trapped on a ruined planet. The Nimons are launching their invasion of Skonnos. Can the Doctor stop the "Great Journey of Life"?', 121, 20, 168168, 6985, '1980-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168172, 'Shada, Part One', 'The Doctor and company drop in on the planet Atrios, whose inhabitants are in an interplanetary war with their twin planet Zeos. Although Astra, Princess of Atrios, wishes for peace, the Marshal, her commander of the military, does not share her views. So, while the TARDIS is in orbit around the planet, the Marshal targets the Doctor for destruction.', 121, 21, 168172, 6985, '1980-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168182, 'Shada, Part Two', 'In an effort to escape the Marshal, the Doctor finds the TARDIS buried under rubble, and figures that he may have stumbled across the missing princess, who has now been abducted by someone else. But he does find a new ally in her love, who believes that the Doctor did not have anything to do with her disappearance', 121, 22, 168182, 6985, '1980-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168183, 'Shada, Part Three', 'The Shadow kidnaps the Doctor and tries to secure the Key to Time, while the Marshal prepares for an all-out assault against Zeos. Meanwhile, the Doctor''s companions try to locate the missing TARDIS.', 121, 23, 168183, 6985, '1980-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168184, 'Shada, Part Four', 'The Doctor sends Shapp and Merak back to Atrios to try and halt the Marshal''s attack, while he and Romana attempt to disable Mentalis.', 121, 24, 168184, 6985, '1980-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168185, 'Shada, Part Five', 'The Shadow, now with control of K-9, awaits the arrival of the Doctor and company in the cave where he took control of the princess. Meanwhile, Princess Astra joins Romana and the Doctor in the TARDIS, where he had locked the Marshal in a continual time loop just before attacking Astrios. Returning to the cave where Princess Astra was held captive, K-9 pursues the Doctor, while Astra captures Romana.', 121, 25, 168185, 6985, '1980-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168186, 'Shada, Part Six', 'The Doctor, having met another Time Lord named Drax in the caves, teams up with him to try and defeat the Shadow, but Drax shrinks him instead of his Mute captor then turns the shrinking ray on himself, allowing the Shadow to claim the Key to Time. Meanwhile, everyone finds out that Princess Astra, herself, is the sixth and final segment of the Key to Time. And once it is assembled, nothing stands between the Shadow and absolute power of the Universe...except the Doctor!', 121, 26, 168186, 6985, '1980-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168187, 'The Leisure Hive, Part One', 'The planet Argolis, around the year 2290. The Argolins live in a huge shielded city, protected from the irradiated wasteland outside. The planet''s survival depends on the tourists their Leisure Hive attracts. But a series of horrific deaths seems to jeopardise that future - can the Doctor and Romana find a solution?', 121, 1, 168187, 6986, '1980-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168192, 'The Leisure Hive, Part Two', 'Another man is found dead, strangled by the Doctor''s scarf, so the Doctor is put on trial. By some of the archaic rules of law, he''s made to "prove" his innocence by becoming a test subject in a new tachyon experiment with time. The result will prove his innocence or guilt, so they say. ', 121, 2, 168192, 6986, '1980-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168194, 'The Leisure Hive, Part Three', 'With the Doctor suffering from the time experiment, the clandestine schemes of others start coming to light, along with the secreted purposes to which the tachyonic generator has been used.', 121, 3, 168194, 6986, '1980-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168195, 'The Leisure Hive, Part Four', 'With the saboteur and murderer revealed and arrested, peace should now be restored, but a new threat emerges - a war-monger who''s both ready and eager to aggress upon other worlds with a newly manufactured warrior army.', 121, 4, 168195, 6986, '1980-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168196, 'Meglos, Part One', 'The desert planet Zolpha-Thura, the 1980s. Giant intelligent megalomaniac cactus Meglos is planning to conquer the galaxy but first it needs the dodecahedron, a powerful energy source currently on the planet Tigella. To get it back Meglos recruits a band of galactic mercenaries and hatches a cunning scheme requiring it to impersonate the Doctor...', 121, 5, 168196, 6986, '1980-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168197, 'Meglos, Part Two', 'With the TARDIS occupants trapped in a chronic histeratic loop (forever reliving the same moment in time), the devious Meglos - disguised as the Doctor - gains the trust of the Tigellans along with full and private access to their power chamber.', 121, 6, 168197, 6986, '1980-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168201, 'Meglos, Part Three', 'With the dodecahedron gone, the city goes power critical. Its death, imminent. With Romana seeking escape from Meglos'' pirates, and Meglos seeking escape from the sealed-up city, and the Doctor himself seeking to understand what''s been going on (and why everybody wants him arrested), religious factions move in to take over the city.', 121, 7, 168201, 6986, '1980-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168203, 'Meglos, Part Four', 'With the Doctor about to be ritualistically sacrificed to appease the god Ti for stealing the dodecahedron, Meglos and the pirates return to Zolfa-Thura with the dodecahedron to fire up an ancient weapon and blast Tigella out of existence.', 121, 8, 168203, 6986, '1980-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168205, 'Full Circle, Part One', 'Deep space, an unknown time - on course for Gallifrey, the TARDIS passes through a strange disruption. When they materialise, the scanner shows the Time Lord homeworld... but the travellers have passed into the negative pocket universe of E-Space and are in fact on the planet Alzarius, where evolution works very differently...', 121, 9, 168205, 6986, '1980-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168223, 'Full Circle, Part Two', 'As the humanoid community takes refuge in their crashed spaceship, venomous marsh spiders begin to hatch from the local fruit while bestial marshmen emerge from the waters to walk the land. It is quite apparent that the marshmen desire entry into the spaceship. Meanwhile, as a curious marshchild shadows the Doctor, a group of teen rebels decides to take over the TARDIS.', 121, 10, 168223, 6986, '1980-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168224, 'Full Circle, Part Three', 'Infection from a spider bite causes Romana''s personality to change. Meanwhile the Doctor, after discovering that the spaceship society is in a perpetual state of repair and upgrade, has morality issues with the ship''s leading scientist who readies himself to perform gruesome experiments on the live marshchild while it''s fully conscious.', 121, 11, 168224, 6986, '1980-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168225, 'Full Circle, Part Four', 'Marshmen invade the Terradonian ship thanks to Romana, who seems to be in communion with them. While the ship''s inhabitants flee for their lives, the Doctor discovers a crucial fact why these humanoids can never return to the planet Terradon.', 121, 12, 168225, 6986, '1980-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168226, 'State of Decay, Part One', 'Still trapped in negative E-Space, the TARDIS lands on an unnamed world to find a society sliding back into feudalism. What is the secret of the Three Who Rule? And what ancient enemy of the Time Lords is stirring again on this world...?', 121, 13, 168226, 6986, '1980-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168229, 'State of Decay, Part Two', 'The Doctor and Romana are escorted to the tower to meet the royal leaders, hoping they can find answers to why this society evolves backwards. The Doctor recognizes the tower as an old Earth spaceship, and further finds that the old fuel tanks, far from empty, are full - but with blood. Meanwhile, Councilor Aukon senses intelligence in Adric and selects him to be the their first "Chosen One."', 121, 14, 168229, 6986, '1980-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281584, 'Episode 40', '', 70583, 40, 1281584, 85893, '2016-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168230, 'State of Decay, Part Three', 'The Doctor finds archive material in the TARDIS that tells him he''s dealing with an ancient enemy of the Time Lords, a nearly indestructible king vampire who''s ready to revive and reenter normal space, spreading death, once again, across the universe.', 121, 15, 168230, 6986, '1980-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168231, 'State of Decay, Part Four', 'The Doctor joins the villagers'' revolt against their vampire rulers, unsure how to kill the king vampire. Meanwhile Adric is first in line to join the new vampire order while Romana is laid out as a sacrificial Time Lord for the awakening king vampire and his swarm of bats.', 121, 16, 168231, 6986, '1980-12-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168233, 'Warriors'' Gate, Part One', 'Nowhere, literally - the Zero Point between the positive and negative universes. The TARDIS materialises in a white void, but the travellers are not alone. A stone gateway, filled with ageing warrior robots and a very strange hall of mirrors, is also in the void. As is a slaver ship filled with the time-riding Tharils, and captained by the increasingly unstable Rorvik...', 121, 17, 168233, 6986, '1981-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168234, 'Warriors'' Gate, Part Two', 'Three humorless men from a damaged bulk freighter find the TARDIS. Wearily, Romana returns with them to appraise the situation of their damaged ship but, because she''s a time sensitive, winds up as a living navigational component to replace their time-sensitive Tharil (lion-man) who escaped. Meanwhile the Doctor, having found a gateway, is having a time with Gundans, robot soldiers programmed to kill.', 121, 18, 168234, 6986, '1981-01-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168236, 'Warriors'' Gate, Part Three', 'While Biroc leads the Doctor to a view of the Tharil''s lordly past, Romana learns more about the damaged freighter and the coldheartedness of its crew. Meanwhile Commander Rorvik, confounded by the time mirror inside the universal center gateway, ignores evidence that it''s no simple mirror and decides to blast it, imperiling the lives of everyone.', 121, 19, 168236, 6986, '1981-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168238, 'Warriors'' Gate, Part Four', 'The Doctor deduces that the freighter is a slave ship loaded up with Tharils to be sold as time machine components, but the immense weight of Rorvik''s damaged ship, designed to contain the Tharils, is now collapsing the fragile void of the micro-universe in which they''re all stuck, pulling everything inside ever closer.', 121, 20, 168238, 6986, '1981-01-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168239, 'The Keeper of Traken, Part One', 'The planet Traken. The Traken union is a society living in perfect harmony, watched over by the powerful but benign Keeper. But now the Keeper is dying, and he senses a great evil within his protectorate. Can the Doctor help him discover the secret of the Melkur?', 121, 21, 168239, 6986, '1981-01-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168245, 'The Keeper of Traken, Part Two', 'Tremas claims counselor privilege to protect the Doctor and Adric from execution, though it binds his fate to theirs if they''re found guilty of murder. Melkur strengthens his hold over Kassia while Seron decides to have rapport with The Keeper to learn truth, and Adric finds evidence of another TARDIS in the area.', 121, 22, 168245, 6986, '1981-02-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168246, 'The Keeper of Traken, Part Three', 'With Tremas falling under suspicion, due to his association with the Doctor, a new Keeper Nominate is named. Now, with everything in place, Melkur has only a short wait before his full malevolence can unfold.', 121, 23, 168246, 6986, '1981-02-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168248, 'The Keeper of Traken, Part Four', 'With the merciless Melkur in control of The Source, the Doctor and his allies have only a slim chance of deposing him, which also puts the peace of the Traken Union in severe jeopardy.', 121, 24, 168248, 6986, '1981-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168250, 'Logopolis, Part One', 'Southern England, 1981. Air hostess Tegan''s first day on the job does not go as planned when she pulls over by a police box with a flat tyre en route to the airport. Why is the Doctor suddenly interested in genuine police boxes? And what is the terrible secret of the planet Logopolis?', 121, 25, 168250, 6986, '1981-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168255, 'Logopolis, Part Two', 'With the threat of doom ever-present, the Doctor and Adric press on for Logopolis, where the muttered mathematical incantations of its people can completely overhaul the TARDIS. En route they discover an accidental yet demanding passenger on board while, all the while, the Master secretively journeys with them to ensnare the Doctor in a diabolical trap.', 121, 26, 168255, 6986, '1981-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168256, 'Logopolis, Part Three', 'With Nyssa from Traken unexpectedly rejoining the group, Adric aids the Monitor of Logopolis in trying to save the Doctor before time runs out. The Master, at liberty to prepare, is finally ready to reveal his true target, which unknowingly sets off the biggest catastrophe of all time.', 121, 27, 168256, 6986, '1981-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168258, 'Logopolis, Part Four', 'With the universe collapsing, the Doctor forms an uneasy alliance with the Master to save it. In case all does not go well, the Watcher takes the Doctor''s companions to a safe place, but his plans for them don''t stop there. The one hope for all lies back on Earth.', 121, 28, 168258, 6986, '1981-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168261, 'Castrovalva, Part One', 'Southern England, 1981. The universe has been saved, but at the cost of the fourth Doctor''s life. The newly-regenerated fifth Doctor must rely on his friends to survive as the regeneration threatens to fail…', 121, 1, 168261, 6987, '1982-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168263, 'Castrovalva, Part Two', 'The TARDIS is plunging toward destruction. But even if the Doctor can escape, is yet another trap waiting?', 121, 2, 168263, 6987, '1982-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168264, 'Castrovalva, Part Three', 'The Doctor has arrived in the supposed safety of Castrovalva. But something is odd about the seemingly tranquil city…', 121, 3, 168264, 6987, '1982-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168266, 'Castrovalva, Part Four', 'The TARDIS crew are caught in a space-time trap. Escaping will mean a final confrontation with the Master.', 121, 4, 168266, 6987, '1982-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168267, 'Four to Doomsday, Part One', 'Deep space, four days from Earth, 1981. The TARDIS materialises aboard a massive Urbankan starship. What is the real agenda of Monarch, master of the vessel?', 121, 5, 168267, 6987, '1982-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168268, 'Four to Doomsday, Part Two', 'The Doctor and his companions explore Monarch''s vessel. But what is the secret of the ancient Earthlings aboard?', 121, 6, 168268, 6987, '1982-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168270, 'Four to Doomsday, Part Three', 'Bigon reveals Monarch''s terrible plan to the Doctor. Can he act in time to save Nyssa? And which side is Adric on?', 121, 7, 168270, 6987, '1982-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168271, 'Four to Doomsday, Part Four', 'The Doctor has little time left to stop the evil Monarch. But he is losing allies — and the TARDIS is gone.', 121, 8, 168271, 6987, '1982-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168272, 'Kinda, Part One', 'The TARDIS lands on the jungle planet Deva Loka, where an Earth expedition has been sent to study the Kinda, a tribe of primitive people. Three team members have already vanished. Are the Kinda as primitive as they seem?', 121, 9, 168272, 6987, '1982-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168273, 'Kinda, Part Two', 'Left in charge by Sanders, Security Man Hindle - unhinged and in complete control of the two Kinda hostages - locks up the others while he primes the dome for a 50 mile perimeter of deforestation through acid and fire, having "reasoned out" that the trees and plants are a threat. Adric perpetrates a ruse to help the Doctor and Todd but is caught and about to be punished when Sanders returns, a changed man. Sanders bears a gift for Hindle - a box given him by a Kinda mystic elder, which may be dangerous and which the Doctor is forced to open. Meanwhile, Tegan is shown herself in the dream world and left to determine which of her selves is real.', 121, 10, 168273, 6987, '1982-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281585, 'Episode 41', '', 70583, 41, 1281585, 85893, '2016-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168274, 'Kinda, Part Three', 'Todd and the Doctor receive a telepathic invitation to visit the Kinda''s blind matriarch and her ward in a cave. Meanwhile, Hinkle is finally set to reduce the dome to its "base chemical constituents" but stops to relax and build a toy city. Tegan is out cold after the snake tattoo of the Mara leaves her arm to possess Aris, giving Aris voice and, through it, the ability to lead his people to their destruction.', 121, 11, 168274, 6987, '1982-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164120, 'Kinda, Part Four', 'With a frightening vision of what''s to come from Panna (the Kinda''s blind visionary), the Doctor must break Hindle''s control over the Kinda hostages and stop his deforestation plan, then send the Mara back to The Dark Places of the Inside from whence it came before it can destroy the Kinda and head out to topple civilizations.', 121, 12, 164120, 6987, '1982-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168280, 'The Visitation, Part One', 'As plague sweeps 17th century England, the Doctor discovers a more exotic threat at work - shipwrecked Terileptil convicts, intent on making the planet their own.', 121, 13, 168280, 6987, '1982-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168285, 'The Visitation, Part Two', 'To rescue Tegan and Adric, captured and interrogated by the Terileptil fugitive leader, the Doctor must get past the locals under alien control and overcome Death (an android servant dressed up as The Grim Reaper).', 121, 14, 168285, 6987, '1982-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168289, 'The Visitation, Part Three', 'The Doctor makes the fugitive Terileptils a rare offer they shouldn''t refuse; but, though few in numbers, they have a plan in the works for the quick and complete domination of Earth and mean to see it through.', 121, 15, 168289, 6987, '1982-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168290, 'The Visitation, Part Four', 'With Tegan and Richard under alien control, and the manor sealed against anyone leaving or entering, it''s a question whether or not the Doctor can get to London before the Terileptils release their improved strain of black death upon the world', 121, 16, 168290, 6987, '1982-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168291, 'Black Orchid, Part One', 'The TARDIS arrives on Earth in 1925 where, due to a case of mistaken identity, the Doctor ends up playing in a local cricket match, but events take on a more sinister tone at the country home of their host Lord Cranleigh.', 121, 17, 168291, 6987, '1982-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168296, 'Black Orchid, Part Two', 'Ann escapes her Harlequin-clad abductor but it''s The Doctor whom she accuses. Strangled bodies mount and The Doctor is arrested along with "accessories" Tegan, Nyssa and Adric. Will Lady Cranleigh''s secret come out?', 121, 18, 168296, 6987, '1982-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168297, 'Earthshock, Part One', 'The TARDIS crew arrives on Earth in the 26th Century in a cave system where a military force is investigating the disappearance of a palaentological expedition.', 121, 19, 168297, 6987, '1982-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168298, 'Earthshock, Part Two', 'With the Doctor cornered in the underground caves by androids, Adric ventures outside of the TARDIS and manages to destroy one of them. They get control of the situation and the Doctor manages to open the door they''ve located - but in doing so, he''s activated a bomb. They set off to find who is behind it all and arrive on board a spaceship on its way to Earth. Unknown to them as yet is that it''s all down to the Cybermen, who are determined to destroy the Earth.', 121, 20, 168298, 6987, '1982-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168319, 'Earthshock, Part Three', 'The Doctor and Adric are taken prisoner aboard the freighter after they''ve discovered one of the crewmen dead. Captain Briggs is upset at the delay the disappearance of three crew members has caused but the Doctor denies having anything to do with that. Meanwhile, the Cyber leader activates the Cybermen they''ve placed in the ship''s hold and sets off to take control of the ship. Unbeknown to anyone, a member of the crew is assisting the Cybermen in their quest but the Doctor finds a way to hold them off, at least temporarily.', 121, 21, 168319, 6987, '1982-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168326, 'Earthshock, Part Four', 'The Cybermen are now in control of the ship and they have eliminated their human accomplice. The Doctor, Adric and several members of the crew are now their prisoners. Tegan finds herself separated from Lt.Scott and she too is soon taken prisoner and is reunited with the Doctor who realizes just what the Cybermen are going to do: use the spaceship as a flying bomb. Scott and the other troopers make a rescue attempt. Adric tries desperately desperately to stop the ship from crashing into Earth. ', 121, 22, 168326, 6987, '1982-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168330, 'Time-Flight, Part One', 'A Concorde loaded with passengers and crew vanishes into thin air. The still-grieving TARDIS crew arrive at Heathrow Airport in 1981 as the Doctor volunteers his services to solve the mystery.', 121, 23, 168330, 6987, '1982-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168333, 'Time-Flight, Part Two', 'The Doctor''s TARDIS is stolen, and tracking it down reveals the existence of an alien named Kalid controlling events in the past. While the Doctor challenges Kalid''s motives for being there, Tegan and Nyssa discover the source of Kalid''s power - an even greater threat for the Doctor. ', 121, 24, 168333, 6987, '1982-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168340, 'Time-Flight, Part Three', 'The Master commandeers the Doctor''s TARDIS, leaving the stranded Time Lord time to work out the mystery of the alien sanctum he''s been trying to enter. Inside lies an immense power - the entire Xeraphin race, thought long lost but distilled into a single living essence, ready for rebirth but now suffering a dual gestalt personality, good versus bad, thanks to the Master''s meddling with it. As the two Xeraphin halves enter into a struggle for dominance of the whole, the Doctor works for a favorable outcome before the Master can succeed at turning them into his new power source.', 121, 25, 168340, 6987, '1982-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168341, 'Time-Flight, Part Four', 'Incorporating the Xeraphin race into his TARDIS power system, the Master has won, but technical obstacles and a bit of sabotage from friendlies give the Doctor a bargaining chip for the lives of the hijacked and enslaved airline passengers and crews - with maybe, just maybe, some hope for the Xeraphin race as well.', 121, 26, 168341, 6987, '1982-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168344, 'Arc of Infinity, Part One', 'On Gallifrey, someone on the high council is perpetrating a treasonous act - transmitting the Doctor''s bio-extract from the space/time matrix to an anti-matter being. On Earth, two English lads spend their last night in Amsterdam sleeping in a crypt where they''re attacked by an alien creature under the same anti-matter being''s control.', 121, 1, 168344, 6988, '1983-01-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168356, 'Arc of Infinity, Part Two', 'With an anti-matter being trying to enter the universe through the Doctor, risking the destruction of everything, there is only one clear course of action for the High Council of Time Lords to take: execute the Doctor. Meanwhile, Tegan arrives in Amsterdam and hear about what''s become of her cousin from his unscathed friend.', 121, 2, 168356, 6988, '1983-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168357, 'Arc of Infinity, Part Three', 'Something seemed amiss about the Doctor''s execution, so the Castellan has Commander Maxil discreetly but fully look it. Meanwhile, as the Doctor meets the anti-matter being inside the Time Lord Matrix, Tegan and her cousin''s friend run afoul of a bird-like alien back on Earth. ', 121, 3, 168357, 6988, '1983-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975902, 'Arc of Infinity, Part Four', 'The High Council creates a distraction so the Doctor and Nyssa can find Omega on Earth and prevent his reentry into our universe.', 121, 4, 975902, 6988, '1983-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164121, 'Snakedance, Part One', 'Tegan steers the TARDIS to the planet Manussa, without meaning to - but why? And is it a coincidence that the planet is about to celebrate the 500th anniversary of the expulsion of the insidious Mara?', 121, 5, 164121, 6988, '1983-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281586, 'Episode 42', '', 70583, 42, 1281586, 85893, '2016-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168358, 'Snakedance, Part Two', 'The Doctor talks to Ambril and Chela to try and stop the 500th anniversary celebrations. A possessed Tegan finds herself in Dugdale''s Hall of Mirrors to where she summons Lon. The Doctor and Nyssa return to the caves. ', 121, 6, 168358, 6988, '1983-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975904, 'Snakedance, Part Three', 'The possessed Tegan and Lon try to find the whereabouts of the Great Crystal. The Doctor finds himself in prison, with only Nyssa to try and get him out. Chela tells the Doctor tales of Dojjen.', 121, 7, 975904, 6988, '1983-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (164119, 'Snakedance, Part Four', 'The Doctor and the original snakedancer Dojeen work to rid the planet of the Mara.', 121, 8, 164119, 6988, '1983-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168365, 'Mawdryn Undead, Part One', 'The Doctor discovers a starship trapped in a time warp over Earth. Meanwhile, public schoolboy - and secret alien emigré - Turlough learns he can have that which he most desires, in return for the murder of the Doctor...', 121, 9, 168365, 6988, '1983-02-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168377, 'Mawdryn Undead, Part Two', 'The TARDIS lands on Earth six years out of date, stranding the Doctor in 1983 while leaving Tegan and Nyssa to look for him in 1977, eventually to discover a badly injured man that may very well be the Doctor. Both parties also encounter former Doctor-companion Brigadier Lethbridge-Stewart, though in 1983 he curiously has no memory of the Doctor at all', 121, 10, 168377, 6988, '1983-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168381, 'Mawdryn Undead, Part Three', 'Danger and discovery await the Doctor back aboard the alien ship, where a modified piece of Time Lord technology awaits his discovery. The Black Guardian is pleased with the Doctor''s return and uses Turlough to awaken the ship''s undead inhabitants to lead the Doctor to his death. The one uniting factor for all is the unforeseen presence of two Brigadier Lethbridge-Stewarts aboard ship, which could put a sudden end to everyone''s plans if they''re not kept apart. ', 121, 11, 168381, 6988, '1983-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168383, 'Mawdryn Undead, Part Four', 'Mawdryn and his fellow immortals - stuck in ceaseless cycles of mutation and deterioration - are quite determined on the Doctor sacrificing his future for their sakes, giving him the choice between helping them or stranding Teagan and Nyssa with them on their infinite journey. The Doctor, however, seeks a third option.', 121, 12, 168383, 6988, '1983-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168386, 'Terminus, Part One', 'Deep space, some time in the future. Still following the Black Guardian''s orders, Turlough sabotages the TARDIS, forcing an emergency fusion with an apparently deserted starship. But the ship is headed for the notorious plague colony, Terminus. Surrounded by plague victims and space pirates, is the Doctor too preoccupied to notice the greatest threat of all - a threat connected to the position of Terminus at the exact centre of the universe?', 121, 13, 168386, 6988, '1983-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168388, 'Terminus, Part Two', 'The Doctor''s party remains divided and scattered as the immense transport docks at the Terminus space station, which turns out to be a leper colony at the exact center of the known universe. As they find their way around and investigate, Nyssa shows signs of contracting the disease. ', 121, 14, 168388, 6988, '1983-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168389, 'Terminus, Part Three', 'Since the Doctor''s party represents neither lazars nor handlers, they''re presumed to be investigators, which is enough to spark the disgruntled Valgard into challenging Eirak over leadership of the handlers. Meanwhile, as the giant, dog-like Garm takes a terrified Nyssa off for "treatment," Bor returns from the forbidden zone with interesting news about the ship.', 121, 15, 168389, 6988, '1983-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168390, 'Terminus, Part Four', 'In attempting to reopen a doorway into the TARDIS, Turlough activates Terminus'' automated fuel-jettisoning sequence. The first time this sequence was engaged, it flung its first of two massive loads of unstable fuel into the distant past, producing the Big Bang that created the universe. This second sequence - if the Doctor can''t find a way to shut it down - will release a second massive load, the explosion of which will entirely negate the effects of the first. ', 121, 16, 168390, 6988, '1983-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168391, 'Enlightenment, Part One', 'After receiving a warning from the White Guardian, the Doctor initially believes the TARDIS has landed aboard an Edwardian clipper ship - but all is not as it seems. While the time travellers are caught up in the omnipotent Eternals'' race for the ultimate prize, the Black Guardian''s scheme to destroy the Doctor enters the end-game - but which side is Turlough a pawn of?', 121, 17, 168391, 6988, '1983-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168401, 'Enlightenment, Part Two', 'Captain Striker and his officers reveal themselves to be Eternals, mind-reading creatures who live outside of time and who require Ephemerals (humans and other "time dwellers") to relieve them of their emptiness. They race against other Eternals for the grand prize of Enlightenment, by which to grant their deepest wishes. That can''t be good for the universe, but how can the Doctor strategize against beings adept at reading his every thought?', 121, 18, 168401, 6988, '1983-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168402, 'Enlightenment, Part Three', 'Turlough''s panic puts him aboard a pirate ship where Captain Wrack uses his presence to invite all the other captains over for dinner. She''s been picking off a few of her greatest rivals in the race and now sees an opportunity to clear the field once and for all and become the clear winner.', 121, 19, 168402, 6988, '1983-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168403, 'Enlightenment, Part Four', 'Tegan isn''t aware she been outfitted with a devise to destroy Captain Striker''s ship. While the detonation will merely slip the indestructible Eternals back into the realm of eternity, nothing nearly so elegant or as tidy awaits the Ephemerals aboard the ship.', 121, 20, 168403, 6988, '1983-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975905, 'The King''s Demons, Part One', 'In 1215 at the castle of Ranulf Fitzwilliam, son Hugh is jousting on a matter of honor against Sir Gillis Estram, the champion of King John, when the TARDIS appears. The Doctor, Turlough and Tegan are immediately hailed as demons and welcomed warmly by the King. Something is wrong with this picture, observes the Doctor.', 121, 21, 975905, 6988, '1983-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168418, 'The King''s Demons, Part Two', 'England, 1215. With the historic signing of the Magna Carta supposedly only days away, the Doctor is startled to find King John apparently intent on provoking civil war - and seemingly in two places at once...', 121, 22, 168418, 6988, '1983-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168419, 'Warriors of the Deep, Part One', 'Earth''s ocean floor, 2084. With two superpowers poised on the brink of a devastating photonic war, a missile base comes under attack from the reptilian Sea Devils and Silurians, intent on eradicating the upstart human race and reclaiming the planet…', 121, 1, 168419, 6989, '1984-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168421, 'Warriors of the Deep, Part Two', 'Just are the Doctor gains a tentative trust from the humans, a Silurian battle cruiser approaches. The Doctor warns Commander Vorsha to hold his fire and find out what they want, but is the level-headed commander one who''ll listen?', 121, 2, 168421, 6989, '1984-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168423, 'Warriors of the Deep, Part Three', 'With Silurians and Sea Devils attacking the air locks, the saboteurs use the distraction to launch plans for disabling vital functions of the base. With all the strife going on around him, and an electricity-generating myrka on the loose, the Doctor endeavors to bring a little sunshine into their unhappy undersea lives.', 121, 3, 168423, 6989, '1984-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168424, 'Warriors of the Deep, Part Four', 'With Silurians in control of the base, Icthar reveals his plan for a final solution to Earth''s human problem, which presents the Doctor a great moral dilemma.', 121, 4, 168424, 6989, '1984-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281587, 'Episode 43', '', 70583, 43, 1281587, 85893, '2016-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168427, 'The Awakening, Part One', 'The sleepy English village of Little Hodcombe, 1984. The village re-enactment of the English Civil War is in full swing, but a malign alien presence intends the mock-battles to be rather more realistic than planned...', 121, 5, 168427, 6989, '1984-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168438, 'The Awakening, Part Two', 'The Malus, an alien that''s purely evil, needs the civil war re-enactments to become authentic so it can feed off the psychic energy of dying and embattled men and fully revive. Not if the Doctor can derail things, of course. ', 121, 6, 168438, 6989, '1984-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168442, 'Frontios, Part One', 'The planet Frontios, in the distant future. Following Earth''s destruction, a tiny colony struggles to eke out a life on this desolate world. But where do the bombardments that threaten them originate from? Little does the Doctor suspect that somewhere nearby lurks a power capable of ripping even the TARDIS apart…', 121, 7, 168442, 6989, '1984-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168444, 'Frontios, Part Two', 'Following the destruction of the TARDIS, the only part of it left is the hat stand. So Turlough uses it as a weapon! Plantagenet gets swallowed by the earth, and Norna and Turlough discover the Tractators.', 121, 8, 168444, 6989, '1984-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168445, 'Frontios, Part Three', 'Trying to rescue the Doctor from the Tractator''s trap, Tegan finds herself and the Doctor in even more trouble. Turlough goes a bit mad, and reckons he knows the evil of the Tractators from old. ', 121, 9, 168445, 6989, '1984-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168446, 'Frontios, Part Four', 'The Doctor tries to deal with the Tractator''s cunning plan, despite Turlough''s best intervention. They discover the splintered TARDIS in the tunnels beneath the planet''s surface, but how will they put it together again?', 121, 10, 168446, 6989, '1984-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168447, 'Resurrection of the Daleks, Part One', 'London''s Docklands, 1984. Why are uniformed policemen gunning down strangely-dressed vagrants in broad daylight? A prison ship in the far future - who is the sole prisoner aboard the craft? And why are these two locations linked by the time corridor the TARDIS has been sucked into?', 121, 11, 168447, 6989, '1984-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168459, 'Resurrection of the Daleks, Part Two', 'Lytton''s men revive Davros as the Doctor fights off the Dalek in the warehouse. But alliances are shifting with each passing moment. Can anyone be trusted?', 121, 12, 168459, 6989, '1984-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168462, 'Resurrection of the Daleks, Part Three', 'As the surviving station crew work to destroy the space station, Davros consolidates his power and the Daleks launch a fiendish scheme to use the Doctor against the Time Lords.', 121, 13, 168462, 6989, '1984-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168464, 'Resurrection of the Daleks, Part Four', 'The Doctor and his companions strive to defeat both Davros and the Daleks. But their victory may come at a terrible price.', 121, 14, 168464, 6989, '1984-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168465, 'Planet of Fire, Part One', 'Lanzarote, 1985. Archaeologist Howard Foster raises a strange metal artefact from the sea floor. But how is it linked to the signal the TARDIS received? Why is Turlough suddenly so worried? And why is Kamelion acting so erratically?', 121, 15, 168465, 6989, '1984-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168466, 'Planet of Fire, Part Two', 'While the Master, victim of his own attempt to improve his TCE weapon, seeks restoration through Sarn''s numismaton gas, the truth of Turlough''s past comes out at last, though to guarantee the safety of his brother and the Sarn people, Turlough must consider a great personal sacrifice.', 121, 16, 168466, 6989, '1984-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168467, 'Planet of Fire, Part Three', 'Sarn prophesy foretells of an outsider who will come to aid the people. It''s a role the Master is more than delighted to fill, which finally presents Timanov, the Sarn religious leader, the unbridled support he''s sought in his campaign to cull the faithless from among his people. Turlough''s secret past, however, is somehow intricately involved in all this, and the reluctance of its disclosure is enough to threaten all friendly ties with the Doctor.', 121, 17, 168467, 6989, '1984-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168468, 'Planet of Fire, Part Four', 'While the Master, victim of his own attempt to improve his TCE weapon, seeks restoration through Sarn''s numismaton gas, the truth of Turlough''s past comes out at last, though to guarantee the safety of his brother and the Sarn people, Turlough must consider a great personal sacrifice. ', 121, 18, 168468, 6989, '1984-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168470, 'The Caves of Androzani, Part One', 'The planet Androzani Minor, the distant future. In the planets'' caves war rages between government troops and the android warriors of the mysterious Sharaz Jek. But what makes spectrox, the substance they battle to control, so valuable? And how far will the Doctor go to protect his companion?', 121, 19, 168470, 6989, '1984-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168481, 'The Caves of Androzani, Part Two', 'The Doctor and Peri have been rescued from the firing squad by the mysterious Sharaz Jek. But he has his own plans for them. And why are they suddenly feeling ill?', 121, 20, 168481, 6989, '1984-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168482, 'The Caves of Androzani, Part Three', 'The situation on Androzani Minor is building toward a violent confrontation. And the Doctor and Peri are slowly succumbing to spectrox toxemia.', 121, 21, 168482, 6989, '1984-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168483, 'The Caves of Androzani, Part Four', 'Events on Androzani reach a bloody climax. Will the Doctor and Peri survive the carnage? And at what cost?', 121, 22, 168483, 6989, '1984-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168485, 'The Twin Dilemma, Part One', 'Earth, the future. The genius Sylvest twins, child prodigies, are kidnapped by the mysterious Professor Edgeworth and taken to the planet Jaconda. But who is Edgeworth? Why does he serve the giant slug Mestor? And what is Mestor''s plan?', 121, 23, 168485, 6989, '1984-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168499, 'The Twin Dilemma, Part Two', 'The Doctor takes Peri to Titan 3, a desolate hunk of rock in space where he hopes to find some solitude for awhile. Instead he finds the lone but unconscious survivor of a recent spaceship crash in sight of a mound-shaped complex where no formalized structure should exist.', 121, 24, 168499, 6989, '1984-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168502, 'The Twin Dilemma, Part Three', 'The Doctor arrives on Jaconda, once lush and green, to find it completely devastated by giant gastropods. Old legends about the planet''s half-human/half-slugs weren''t just myths after all. With or without help from the Doctor and his unpredictable mood swings, Lt. Lang is up for rescuing the twins, who are finally informed of the grand purpose they''ve been brought to Jaconda to accomplish.', 121, 25, 168502, 6989, '1984-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168503, 'The Twin Dilemma, Part Four', 'The Doctor and Edgeworth deduce that the real plan of Mestor, the gastropod ruler of Jaconda, will not only destroy Jaconda but lead to the devastation of other planets. Together they hope to thwart him despite his formidable ability at slipping into people''s minds and controlling them. ', 121, 26, 168503, 6989, '1984-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168504, 'Attack of the Cybermen, Part One', 'London, 1985. The alien mercenary Lytton has been stranded here for nearly a year, but now he has a plan to escape. But how does it involve the Doctor''s old enemies - and why are they on Earth at this point in history?', 121, 1, 168504, 6990, '1985-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168515, 'Attack of the Cybermen, Part Two', 'The Doctor is captured by the Cybermen and taken back to their home planet. There he discovers the source of the signal. Cyrons, original inhabitants of the Cybermen''s world survive and they want the Cybermen gone. The Doctor learns the full extent of the Cybermen''s plans. Not only are the Cyrons threatened but so too the very future of the human race. This is no war of conquest, but total destruction.', 121, 2, 168515, 6990, '1985-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281588, 'Episode 44', '', 70583, 44, 1281588, 85893, '2016-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281589, 'Episode 45', '', 70583, 45, 1281589, 85893, '2016-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168516, 'Vengeance on Varos, Part One', 'The former prison planet Varos, the future. The downtrodden population of miners are kept happy by real-life violence and murder broadcast live from the Punishment Dome. But then the TARDIS materialises inside the Dome...', 121, 3, 168516, 6990, '1985-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168524, 'Vengeance on Varos, Part Two', 'The Governor forces the Doctor to tell him the true value of zeiton-7 but Sil attempts to derail his plans by subjecting Peri and Areta to an enforced mutation. ', 121, 4, 168524, 6990, '1985-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168529, 'The Mark of the Rani, Part One', 'England, the 1820s. As the Industrial Revolution gathers pace, the village of Killingworth is disturbed by crazed Luddite miners intent on smashing all machinery and engineers. But is there another cause of the situation?', 121, 5, 168529, 6990, '1985-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168536, 'The Mark of the Rani, Part Two', 'The Master uses The Rani''s mind-controlling parasites to keep a meeting of Earth''s leading scientists from being canceled, and helps The Rani plant transformation land mines for The Doctor as he continues to propose an alliance with her in ruling over Earth. ', 121, 6, 168536, 6990, '1985-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168538, 'The Two Doctors, Part One', 'The alien space station J7, the mid-1980s Earth time. The Time Lords have sent the second Doctor and Jamie here to try to stop dangerous experiments into time travel. But the station comes under attack from the Sontarans and far away in space and time the sixth Doctor goes into psychic shock...', 121, 7, 168538, 6990, '1985-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168545, 'The Two Doctors, Part Two', 'With carnage and decay all about the space station, Doctor No. 6 and Peri continue to avoid the automated defense system trying to kill them, but there''s also something alive lurking about with an eye on them as well. Evidence suggests the Time Lords are responsible for all this, but the Doctor refuses to believe it. He may be wrong, and he also fears a pinhole has been poked into the bubble that is the universe, with total and unstoppable annihilation to follow. Far away, Doctor No. 2 is about to be dissected by the Sontarans and the Androgum in order to find the symbiotic nuclei that makes time travel for Time Lords possible.', 121, 8, 168545, 6990, '1985-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168550, 'The Two Doctors, Part Three', 'Closing in on the goal of time travel, the Androgum and Sontarans get set to double-cross each other. With Peri and Jamie alternately in danger of winding up on the bill of fare, the decision is made to genetically transform Doctor No. 2 into an insatiably carnivorous Androgum, which causes Doctor No. 6 to develop a sudden taste for house cats as he races to not let this change become permanent. ', 121, 9, 168550, 6990, '1985-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168554, 'Timelash, Part One', 'The planet Karfel, in the distant future. The tyrannical Borad rules with an iron fist, and any who oppose him are cast into the Timelash - a space-time tunnel leading to the past of an alien world called Earth...', 121, 10, 168554, 6990, '1985-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168570, 'Timelash, Part Two', 'For his impending confrontation with the mysterious and cloistered Borad, dictator of Karfel, the Doctor takes kontrom crystals from the Timelash to build a 10-second time break device, not knowing of the Borad''s mutation and breeding plans for Peri or the interplanetary war he''s sparked with the Bandrils, who are on their way to destroy all mammalian life on Karfel.', 121, 11, 168570, 6990, '1985-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168571, 'Revelation of the Daleks, Part One', 'The planet Necros, the future. The Doctor arrives for the cryogenic interrment of an old friend at Tranquil Repose, a vast repository of bodies in suspended animation. But what does the ''Great Healer'' really have in mind for them...?', 121, 12, 168571, 6990, '1985-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168577, 'Revelation of the Daleks, Part Two', 'The Davros running Tranquil Repose has only been a figurehead - literally just a head, created and animated by Davros himself. Now, the real Davros wheels forth to face the Doctor, but his own immoral dealings have fostered an uneasy surrounding situation, riddled with treachery, that only a few might escape.', 121, 13, 168577, 6990, '1985-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168810, 'The Trial of a Time Lord, Part One (The Mysterious Planet, Episode One)', 'The Doctor is taken "out of time" by the Time Lords and made to face an enquiry into his meddling in the affairs of others, overseen by the Inquisitor. The prosecutor, the Valeyard, soon has the proceedings upgraded to a trial for the Doctor''s life. Evidence takes the form of recordings of the Doctor''s recent adventures, beginning with his visit to the mysterious world of Ravalox and an encounter with Andromedan space pirates...', 121, 1, 168810, 6994, '1986-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168833, 'The Trial of a Time Lord, Part Two (The Mysterious Planet, Episode Two)', 'The Doctor finds that the subterranean UK Habitat is run by a cloistered robot named Drathro, whom the inhabitants call "The Immortal." Their black light energy converters are destabilizing, unaware that it''s the result of two space pirates mucking about on the surface with designs on looting their dwelling.', 121, 2, 168833, 6994, '1986-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168837, 'The Trial of a Time Lord, Part Three (The Mysterious Planet, Episode Three)', 'The Doctor escapes to rejoin Peri on the surface but shortly becomes the prisoner of a surface-dwelling tribe called The Free. Ravalox isn''t Ravalox after all, but before the Doctor can learn much more an irresistible agent from UK Habitat comes to fetch him back. ', 121, 3, 168837, 6994, '1986-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168838, 'The Trial of a Time Lord, Part Four (The Mysterious Planet, Episode Four)', 'All those on Ravolox are in exponentially greater peril than anyone can comprehend. If anything in the entire universe is to survive, it may come down to the Doctor arguing against machine logic over the value of life.', 121, 4, 168838, 6994, '1986-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (955403, 'The Trial of a Time Lord, Part Five (Mindwarp, Episode One)', 'The Doctor''s trial continues. The Valeyard''s next piece of evidence for the prosecution concerns the Doctor''s recent trip to Thoros Beta. Though originally investigating arms dealing, the Doctor and Peri become embroiled in their old enemy Sil''s alarming neurological experiments...', 121, 5, 955403, 6994, '1986-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168841, 'The Trial of a Time Lord, Part Six (Mindwarp, Episode Two)', 'Having been put through a makeshift truth extractor, the Doctor appears damaged, apt to mimic the personalities of those with whom he has eye contact. He eventually abandons Peri and a gung-ho warrior king in favor of joining in with Sil and Dr. Crozier in the latest of their perverse projects. ', 121, 6, 168841, 6994, '1986-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168857, 'The Trial of a Time Lord, Part Seven (Mindwarp, Episode Three)', 'While the Doctor helps Dr. Crozier transfer Lord Kiv''s brain into a new host skull, Peri accompanies King Yrcanos as he searches for the Alpha Resistance fighters whom he feels, most certainly, will follow him into glorious battle against the Mentors and the Doctor.', 121, 7, 168857, 6994, '1986-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168889, 'The Trial of a Time Lord, Part Eight (Mindwarp, Episode Four)', 'The first transfer is flawed, so Dr. Crozier needs to transfer Lord Kiv into another host body. Unfortunately, Peri meets all the requirements for the subsequent candidate. Since the Doctor''s been helpful and has somewhat of a personal interest in Peri, he''s permitted to locate an equally suitable substitute candidate, if he can. The prosecution rests. ', 121, 8, 168889, 6994, '1986-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168902, 'The Trial of a Time Lord, Part Nine (Terror of the Vervoids, Episode One)', 'With the prosecution case concluded, the Doctor begins his defence, an adventure from his own future. Aboard the starliner Hyperion 3 in the year 2986, trouble is brewing. A murderer is aboard - and something very nasty''s stirring in the hydroponics bay...', 121, 9, 168902, 6994, '1986-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168899, 'The Trial of a Time Lord, Part Ten (Terror of the Vervoids, Episode Two)', 'A lethal booby-trap in the Hydroponic Center awakens the genetically engineered fruit pods in storage, and passengers and crewmen alike start disappearing without trace. There''s a murderer on board and the Doctor means to find out who he or she is.', 121, 10, 168899, 6994, '1986-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168862, 'The Trial of a Time Lord, Part Eleven (Terror of the Vervoids, Episode Three)', 'A course change that takes the Hyperion III closer to a black hole could prove unwise when there are so many aboard ship with hidden agendas. Disappearances continue, a murderer remains at large, and one person finally crumbles under the strain of harboring a guilty secret. ', 121, 11, 168862, 6994, '1986-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168883, 'The Trial of a Time Lord, Part Twelve (Terror of the Vervoids, Episode Four)', 'With factions vying for control of the ship, the Vervoids are found to be responsible for the many disappearances. Only the Doctor sees the fundamental but missed point as to why they can''t be reasoned with or why they can''t be allowed to arrive on Earth. ', 121, 12, 168883, 6994, '1986-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168894, 'The Trial of a Time Lord, Part Thirteen (The Ultimate Foe, Episode One)', 'With the Doctor now reluctantly admitting to genocide, things look bad. But the Doctor''s nemesis, the Master, intervenes, and the real truth behind the trial comes to light - and with it, the shocking secret of the Valeyard''s true identity...', 121, 13, 168894, 6994, '1986-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168897, 'The Trial of a Time Lord, Part Fourteen (The Ultimate Foe, Episode Two)', 'So much ado by the Valeyard and the Master over the Doctor''s death makes the Doctor wary of being made decoy for some other, truer target. Continuing in the Matrix itself, he may find both them and the answers he seeks. ', 121, 14, 168897, 6994, '1986-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168581, 'Time and the Rani, Part One', 'The alien world of Lakertya. With the aid of the savage Tetraps, the Rani has conquered this planet to allow her to continue her depraved biochemical experiments. But she finds herself needing the Doctor''s assistance...', 121, 1, 168581, 6991, '1987-09-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168598, 'Time and the Rani, Part Two', 'The Rani''s deviousness inadvertently sets the Doctor and Mel against each other - she having yet seen the Doctor in his new regeneration, he believing Mel is the Rani disguised, and each thinking the other is an agent of utmost evil to be brought down. Two unanswered questions linger: Why has the Rani collected geniuses, and why is she messing around with "strange matter."', 121, 2, 168598, 6991, '1987-09-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168601, 'Time and the Rani, Part Three', 'The solstice nears, making it time for the Rani to bring her plans into fruition. The Doctor''s sympathies for Beyus, ruler of the Lykertyans, are rather qualified. Beyus'' heart is for his people yet something prompts him to collaborate fully in helping the Rani reach all her objectives. The answer, he''s told, lies within the Center of Leisure. ', 121, 3, 168601, 6991, '1987-09-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168604, 'Time and the Rani, Part Four', 'The Rani, at last, links the Doctor into her great brain machine, the crowning jewel in her component packet of geniuses brought together to turn Lakertya itself into one vast cerebral mass capable of redirecting time anywhere in the universe, giving her absolute power over all creation. ', 121, 4, 168604, 6991, '1987-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975911, 'Paradise Towers, Part One', 'The Doctor and Mel visit Paradise Towers, a apartment complex in the 21st century, only to find it rat-infested and ruined. Paradise Towers is inhabited by Rezzies (elderly women, at least some of whom are cannibals), Kangs (roving gangs of teenage girls), Pex (a cowardly young warrior who proclaims himself the local hero) and Caretakers led by a Chief whose job is to keep the apartment complex in order. But the Doctor and Mel find that robotic cleaners are killing off everyone in Paradise Towers, one-by-one. The culprit is Kroagnon, the building''s award-winning architect, who plots to rid Paradise Towers of all those who live within it.', 121, 5, 975911, 6991, '1987-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168628, 'Paradise Towers, Part Two', 'The Doctor reunites with the Red Kangs to question why no one questions the steady number of deaths at Paradise Towers. Elsewhere, Mel meets the Blue Kangs who reveal that Pex, the lone young male in the complex (who talks a good game while flanking Mel), is not nearly the heroic and capable fighter he continually boasts of being. ', 121, 6, 168628, 6991, '1987-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168629, 'Paradise Towers, Part Three', 'The Doctor discovers that Paradise Towers'' great architect, Kroagnon, was also responsible for Miracle City, an infamous killer habitat. Though chance circumstances permit Mel to avoid a dinner date with a couple of grandmotherly cannibals, the Doctor realizes everyone must band together or be destined for the menu of a greater infamy lurking in the basement. ', 121, 7, 168629, 6991, '1987-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168630, 'Paradise Towers, Part Four', 'Meeting up at the pool, the Doctor leads the surviving Rezzies, Kangs and Caretakers as they draw the line together on the 245th floor against the systematic cleansing of all life by Kroagnon and his robotic Cleaners. ', 121, 8, 168630, 6991, '1987-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168631, 'Delta and the Bannermen, Part One', 'Wales, 1959. A top-secret US satellite has mysteriously gone missing. This could have something to do with the arrival of a party of alien tourists en route to Disneyland, amongst their number Mel and the Doctor, and the Queen of the Chimerons - who''s fleeing the Bannermen and their genocidal leader Gavrok...', 121, 9, 168631, 6991, '1987-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168659, 'Delta and the Bannermen, Part Two', 'The Bannermen are coming to Earth thanks to a signal from an opportunistic bounty hunter recognizing Delta. DIsneyland is safe due to a collision with a satellite that redirects the vacationers to the Shangri-La Holiday Camp in South Wales. There, the camp mechanic is smitten by the Queen Delta and her newly hatched green baby. ', 121, 10, 168659, 6991, '1987-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168662, 'Delta and the Bannermen, Part Three', 'The Doctor''s party rallies to the house of an elderly beekeeper where the young Chimeron princess hits another growth spurt that reveals the reason why the Bannermen want the Chimeron wiped out. Meanwhile, Gavrok sets a deadly booby-trap right outside the Doctor''s TARDIS, and Billy makes a heedless and irrevocable decision. ', 121, 11, 168662, 6991, '1987-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168664, 'Dragonfire, Part One', 'The deep-space trading seriesReview of Iceworld, the far future. The Doctor, Mel, their old friend Glitz and time-lost waitress Ace go in search of a fabulous treasure, supposedly guarded by a fire-breathing dragon. But what is the link between the treasure and Iceworld''s proprietor, the frosty Mr Kane?', 121, 12, 168664, 6991, '1987-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168665, 'Dragonfire, Part Two', 'While Mel and Ace run from Glitz''s former crewmen (whom he sold to Kane), officers Belazs and Kracauer conspire to overthrow Kane. The Doctor, meanwhile, discovers there really is a dragon in the ice caverns, which turns out to be a bio-mechanoid with a very interesting function. ', 121, 13, 168665, 6991, '1987-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168670, 'Dragonfire, Part Three', 'At last learning the location of the missing key to his spaceship, Kane has the dragon hunted down and Iceworld brutally purged of all visitors; but, the Doctor, visiting the Ice Garden, learns something significant that will put the chagrin on Kane''s grand plans for home world vengeance.', 121, 14, 168670, 6991, '1987-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168678, 'Remembrance of the Daleks, Part One', 'London, 1963. Returning to the scenes of his first televised adventure, the Doctor and new companion Ace play a tricky game of bluff and deceit involving two rival Dalek factions, local soldiers, and the awesomely powerful Gallifreyan artefact, the Hand of Omega...', 121, 1, 168678, 6992, '1988-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168684, 'Remembrance of the Daleks, Part Two', 'With two factions of Daleks involved in a race war on Earth, the Doctor takes care of old business by having the Hand of Omega ceremoniously but quietly buried in a churchyard. His actions do not go unobserved, and leaving behind a bored Ace without a purposeful outlet could spell trouble as well. ', 121, 2, 168684, 6992, '1988-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168685, 'Remembrance of the Daleks, Part Three', 'The Doctor plans to let one of the Dalek factions have the Hand of Omega (but not too easily, of course) while keeping Gilmore and his military men preoccupied in a safe territory, but that plan could be threatened by a mole in their midst and a miscalculation on the Doctor''s part. ', 121, 3, 168685, 6992, '1988-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975912, 'Remembrance of the Daleks, Part Four', 'The Imperial Dalek Emperor reveals himself to be an old, familiar adversary of the Doctor. Now with the Hand of Omega, the Imperial Daleks expect to rule over both time and the Time Lords. The only snag in the Doctor''s plan to thwart this may come from the fascist mole in Gilmore''s unit - discovered and detained but escaped to cause mischief, putting both Ace''s life and the Doctor''s plan at risk.', 121, 4, 975912, 6992, '1988-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168690, 'The Happiness Patrol, Part One', 'The Earth colony Terra Alpha, the future. With the aid of her sweet-natured executioner, Helen A, ruler of the planet, has ensured the population is happy - on pain of death! The Doctor and Ace decide to fight for the right to be miserable.', 121, 5, 168690, 6992, '1988-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168696, 'The Happiness Patrol, Part Two', 'The Doctor and Earl manage to escape from the Kandy Man and join up with the planet''s natives, the Pipe People, enlisting their help to rescue Ace. ', 121, 6, 168696, 6992, '1988-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168697, 'The Happiness Patrol, Part Three', 'Helen A has sentenced Ace and Susan Q to the last show at the forum but the Doctor has a plan to rescue them and topple Helen A''s regime. ', 121, 7, 168697, 6992, '1988-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168703, 'Silver Nemesis, Part One', 'The Doctor and Ace battle the time traveller Lady Peinforte and the Cybermen for possession of the incredibly powerful Nemesis statue, which is on its way back to the planet Earth to rendevous with a destiny set in stone by the Doctor himself.', 121, 8, 168703, 6992, '1988-11-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168713, 'Silver Nemesis, Part Two', 'As hostilities break out between factions vying for ownership of the comet, the Doctor goes after the worst of the lot - Cybermen, using Ace''s upgraded boom box to flood Cyber Communications with jazz music while trying to locate the whereabouts of the fleet beyond this mere scouting party. ', 121, 9, 168713, 6992, '1988-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168725, 'Silver Nemesis, Part Three', 'With the Cyber Fleet poised nearby, the Doctor may have no choice but to let them have Nemesis. Meanwhile, Lady Peinforte and Richard navigate modern society, De Flores encounters an open betrayal, and Ace combats Cybermen with a slingshot. ', 121, 10, 168725, 6992, '1988-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168726, 'The Greatest Show in the Galaxy, Part One', 'The Doctor and Ace visit the Psychic Circus on the planet Segonax, where they find the standard of judging at the talent contest distressingly astringent.', 121, 11, 168726, 6992, '1988-12-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168728, 'The Greatest Show in the Galaxy, Part Two', 'The Doctor and Ace reach the Psychic Circus, where the Doctor is imprisoned with the other contestants while Ace draws the attention of the Chief Clown. ', 121, 12, 168728, 6992, '1988-12-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168731, 'The Greatest Show in the Galaxy, Part Three', 'Mags helps the Doctor escape and Deadbeat leads him to Ace, where Bellboy tells them what happened to the Psychic Circus.', 121, 13, 168731, 6992, '1988-12-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975913, 'The Greatest Show in the Galaxy, Part Four', 'Mags goes to find Ace and Kingpin, pursued by the Chief Clown, while the Doctor confronts the power behind the Psychic Circus.', 121, 14, 975913, 6992, '1989-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168753, 'Battlefield, Part One', 'Knights from a parallel universe arrive on Earth to find the legendary sword Excalibur. And only the Doctor and Ace with the assistance of Brigadier Lethbridge Stewart and save the Earth from total catastrophe. ', 121, 1, 168753, 6993, '1989-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168780, 'Battlefield, Part Two', 'The Doctor and Ace discover a stone spaceship underneath Warmsley''s archaeological dig while Mordred summons Morgaine to Earth''s dimension.', 121, 2, 168780, 6993, '1989-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168784, 'Battlefield, Part Three', 'The Brigadier rescues the Doctor from the stone spaceship before they set out to locate Morgaine before she gains Excalibur.', 121, 3, 168784, 6993, '1989-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168786, 'Battlefield, Part Four', 'Morgaine forces Ace and Shou Yuing to hand over Excalibur by threatening to release the Destroyer, so the Doctor and the Brigadier enter a dimensional portal to stop her. ', 121, 4, 168786, 6993, '1989-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168790, 'Ghost Light, Part One', 'The Doctor take Ace to an old ''haunted'' house called Gabriel Chase in the year 1883. 100 years before events that took place within that very house in her personal past.', 121, 5, 168790, 6993, '1989-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168795, 'Ghost Light, Part Two', 'The Doctor manages to rescue Ace from the husks and then tries to uncover the truth about the goings on in Josiah''s house.', 121, 6, 168795, 6993, '1989-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168798, 'Ghost Light, Part Three', 'The Doctor attempts to convince Light to put an end to Smith''s schemes but instead Light aims to put an end to Earth''s evolution.', 121, 7, 168798, 6993, '1989-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168800, 'The Curse of Fenric, Part One', 'England, the 1940s. The TARDIS brings the Doctor and Ace to a secret naval base during WWII. There, the time-travellers battle vampiric Haemovores and an ancient Viking curse!', 121, 8, 168800, 6993, '1989-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168801, 'The Curse of Fenric, Part Two', 'The Doctor and Ace manage to convince Sorin to release them while Millington and Judson attempt to translate the Viking runes.', 121, 9, 168801, 6993, '1989-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168802, 'The Curse of Fenric, Part Three', 'The Doctor and his friends come under attack from the Haemavores, allowing Millington to retrieve the flask containing Fenric''s essence.', 121, 10, 168802, 6993, '1989-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168803, 'The Curse of Fenric, Part Four', 'Fenric is loose and planning to use the Ancient Haemovore to poison the Earth with chemicals, unless the Doctor can defeat him in their centuries old game. ', 121, 11, 168803, 6993, '1989-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168804, 'Survival, Part One', 'Perivale, England, the late 1980s. People are vanishing into thin air under the baleful stare of a very strange cat. The Doctor and Ace learn that, in the battle for survival, success can carry a terrible price...', 121, 12, 168804, 6993, '1989-11-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168805, 'Survival, Part Two', 'The Doctor and Paterson manage to escape from the Master and join up with Ace and her friends, where the Doctor tries to find a way to get them all off the planet before it explodes. ', 121, 13, 168805, 6993, '1989-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (168806, 'Survival, Part Three', 'Ace manages to transport the Doctor and the others back to Perivale but the Master is also there, preparing for a final showdown with the Doctor.', 121, 14, 168806, 6993, '1989-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866357, 'Magic Is Coming', 'The special will take a look at Emma Swan’s journey into Storybrooke and her destiny to break the Evil Queen’s curse, which sent the fairytale characters into our world with no memory of who they once were. Backstories and secrets of Snow White, Prince Charming, Rumplestiltskin, Red Riding Hood and others will also be revealed.', 39272, 1, 866357, 50703, '2012-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866358, 'The Price of Magic', 'How Storybrooke''s residents have fared since their fairytale memories were restored; the mythology of the show; a preview of the season''s final four episodes.', 39272, 2, 866358, 50703, '2013-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866359, 'Journey to Neverland', 'A series recap includes Mary Margaret and Emma''s separation from their new-found family, Regina''s plan to become The Dark One and Henry''s kidnapping.', 39272, 3, 866359, 50703, '2013-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1013325, 'Wicked Is Coming', 'A look at the series so far; interview with the cast and executive producers Eddy Kitsis and Adam Horowitz.', 39272, 4, 1013325, 50703, '2014-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1013326, 'Storybrooke Has Frozen Over', 'ABC invites new and devoted "Once Upon a Time" viewers to take another look at this popular fantasy series in anticipation of the exciting fourth season premiere. The special will take a look at the role that family plays in the show, our heroes'' journey from breaking the curse to the ramifications of magic in our world, travelling to Neverland to save Henry from an evil Peter Pan, their battle with The Wicked Witch of the West, and the upcoming presence of Elsa, the Ice Queen from Arendelle, in Storybrooke.', 39272, 5, 1013326, 50703, '2014-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1043749, 'Secrets of Storybrooke', 'Viewers are presented with an exclusive, behind-the-scenes look at some of the characters that reside in Storybrooke, and the recent happenings in the town.', 39272, 6, 1043749, 50703, '2015-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1106303, 'Dark Swan Rises: A Once Upon a Time Fan Celebration', 'ABC invites new and loyal “Once Upon a Time” fans to celebrate the magical fifth season premiere with an in-depth look at the series in the unique special, “Dark Swan Rises: A Once Upon a Time Fan Celebration,” which will explore what will happen next as Emma Swan becomes the Dark One and will highlight the characters fans love, including the incredible stories that have created an extraordinarily passionate fan base. Cast members will answer fan-submitted questions and discuss favorite moments as voted on by fans, giving viewers an authentic perspective as they dish on various characters, relationships and backstories. The special also features interviews with executive producers Edward Kitsis and Adam Horowitz with exclusive insights about the season fans won’t want to miss.', 39272, 7, 1106303, 50703, '2015-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226408, 'Evil Reigns Once More', 'The special looks at the role family plays in the show and our heroes'' journey through the past 5 seasons, featuring interviews with executive producers Edward Kitsis and Adam Horowitz.', 39272, 8, 1226408, 50703, '2016-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866307, 'Pilot', 'Emma''s life turns upside down when she is visited by Henry, the 10-year-old child she long ago gave up for adoption; Emma brings Henry back to his foster mother in a strange town called Storybrooke.', 39272, 1, 866307, 50700, '2011-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866308, 'The Thing You Love Most', 'Regina does everything in her power to force Emma out of Storybrooke and out of her and Henry''s lives forever. Meanwhile, the chilling circumstances of how the Evil Queen released the curse upon the fairytale world is revealed.', 39272, 2, 866308, 50700, '2011-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866305, 'Snow Falls', 'At Henry''s urging, Emma convinces Mary Margaret to pay a visit to a comatose John Doe in the hospital and to read to him from the storybook. But Mary Margaret is stunned at the outcome of her visit. Meanwhile, back in the fairytale world, Prince Charming meets Snow White for the first time in a most unexpected way.', 39272, 3, 866305, 50700, '2011-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866306, 'The Price of Gold', 'Emma tries to help a young pregnant woman escape from the clutches of Mr. Gold. Meanwhile, back in the fairytale world that was, Cinderella makes a regrettable deal with Rumplestiltskin.', 39272, 4, 866306, 50700, '2011-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866326, 'That Still Small Voice', 'As Sheriff Graham deputizes Emma, the ground shakes and a giant sinkhole mysteriously appears at the edge of town. But a curious Henry’s life is placed in danger when he decides to explore the innards of the sinkhole to see if its contents can link the inhabitants of Storybrooke to the fairytale world. Meanwhile, back in the fairytale world, Jiminy Cricket yearns to leave the family business and transform into the person he wants to be.', 39272, 5, 866326, 50700, '2011-11-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866309, 'The Shepherd', 'David - aka John Doe - must choose between staying with Kathryn or leaving her to be with Mary Margaret, with whom he''s fallen deeply, and inexplicably, in love; and Emma catches Sheriff Graham in a lie. Meanwhile, back in the fairytale world that was, Prince Charming is about to encounter a life-changing event that will forever alter his destiny.', 39272, 6, 866309, 50700, '2011-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866310, 'The Heart is a Lonely Hunter', 'One of the town''s residents begins to remember their fairytale past, and Storybrooke mourns the loss of one of their own. Meanwhile, in the fairytale world that was, the Evil Queen attempts to find a heartless assassin to murder Snow White.', 39272, 7, 866310, 50700, '2011-12-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866311, 'Desperate Souls', 'Regina and Mr. Gold play dirty politics and take opposite sides when Emma runs for a coveted Storybrooke public office against Sidney. Meanwhile, back in the fairytale world that was, Rumplestiltskin tries to track down the ultimate power source in order to help his son avert the horrors of a meaningless war.', 39272, 8, 866311, 50700, '2012-01-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866312, 'True North', 'Feeling their pain from having lived through the same experience, Emma desperately tries to help two homeless children find their birth father before they’re separated and put into the foster care system. Meanwhile, back in the fairytale world that was, the Evil Queen coerces Hansel and Gretel into stealing an important artifact from a blind witch.', 39272, 9, 866312, 50700, '2012-01-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866313, '7:15 A.M.', 'Mary Margaret and David continue to grapple with their unrequited love, and Emma and Regina grow suspicious over a mysterious new stranger in town. Meanwhile, in the fairytale land that was, Snow White yearns to ease her breaking heart as Prince Charming’s wedding to King Midas’s daughter approaches.', 39272, 10, 866313, 50700, '2012-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866314, 'Fruit of the Poisonous Tree', 'A dejected Sidney enlists the aid of Emma to help uncover evidence that could expose Mayor Regina as the corrupt person she really is to the townspeople of Storybrooke. Mary Margaret and David continue their secret rendezvous while trying to figure out a way to unleash their forbidden love.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866315, 'Skin Deep', 'After Mr. Gold''s house is robbed, Emma keeps a close eye on him when it looks like he wants to track down the criminal and dole out some vigilante justice as payback, and Valentine''s Day finds Mary Margaret, Ruby and Ashley having a girls'' night out. Meanwhile, in the fairytale land that was, Belle agrees to a fateful deal to give up her freedom in order to save her town from the horrors of the Ogre war.', 39272, 12, 866315, 50700, '2012-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866316, 'What Happened to Frederick', 'With their love for each other growing stronger, David finally agrees to tell Kathryn about his relationship with Mary Margaret and put an end to his loveless marriage.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866348, 'Welcome to Storybrooke', 'David, Emma and Mr. Gold try to protect Mary Margaret from a vengeful Regina; a man and his son find their way into Storybrooke.', 39272, 17, 866348, 50701, '2013-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866342, 'Selfless, Brave and True', 'While off on her own to deal with what happened with Cora, Mary Margaret comes across an entirely wooden August; Neal invites his fiancee to Storybrooke.', 39272, 18, 866342, 50701, '2013-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866318, 'Dreamy', 'Unlikely allies Mary Margaret and Leroy team together for a good cause to help the Storybrooke nuns sell their candles during the town''s Miner''s Day festival. But Leroy makes a promise to a nun, Astrid, that he may not be able to keep; and Emma looks into the mysterious disappearance of David''s wife, Kathryn.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866317, 'Red-Handed', 'After Ruby quits Granny''s diner and with her self-esteem at an all-time low, Emma hires her as an assistant in order to help Ruby discover what it is in life that she''s good at; and Emma continues questioning David about the disappearance - and possible murder - of Kathryn.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866319, 'Heart of Darkness', 'Mary Margaret hires Mr. Gold as her attorney when Emma is forced to arrest her for the suspected murder of David’s wife, Kathryn. Meanwhile, back in the fairytale land that was, Prince Charming sets out to stop a determined and unhinged Snow White, whose memory is still clouded by Rumplestiltskin’s potion, from assassinating the Evil Queen.', 39272, 16, 866319, 50700, '2012-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866320, 'Hat Trick', 'While searching for a missing Mary Margaret, Emma is kidnapped by a man whose affinity for hats has him teetering on the edge of madness. Meanwhile, viewers will be transported outside of the fairytale land that was for the first time when the Evil Queen persuades a skillful man of magic to come work for her one last time and travel to Wonderland in order to help steal something from the Queen of Hearts.', 39272, 17, 866320, 50700, '2012-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866322, 'The Stable Boy', 'Emma continues her exhaustive search for evidence that will prove Mary Margaret''s innocence in the murder of David''s wife, Kathryn. Meanwhile, in the fairytale land that was and before evil blackened her soul, Regina must choose between betraying her mother, Cora, and marrying for true love, or betrothing royalty and living a regal - but loveless - life; and the event that caused the Evil Queen to loathe Snow White is revealed.', 39272, 18, 866322, 50700, '2012-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866321, 'The Return', 'Mr. Gold attempts to uncover the true identity of August, Emma confronts Regina about her involvement in Kathryn''s disappearance, and David tries to apologize and reconcile with Mary Margaret. Meanwhile, in the fairytale land that was, Rumplestiltskin agrees to comply and do whatever it takes if his son can find a way for him to safely give up his powers and turn back into the loving man he used to be.', 39272, 19, 866321, 50700, '2012-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866324, 'The Stranger', 'August tells Emma how to beat Regina and how she can get custody of Henry, while Regina hatches a plot to seduce David now that Mary Margaret is back at work. In the fairy-tale world, a plan to save Snow White and Prince Charming’s daughter unfolds and is agreed to by Geppetto, who has his own child’s safety in mind.', 39272, 20, 866324, 50700, '2012-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866325, 'An Apple Red As Blood', 'Henry pleads with Emma to stay in Storybrooke and continue her quest as the savior of the fairytale dwellers, and Regina concocts a plan that could rid her of Emma forever. Meanwhile, back in the fairytale land that was, Snow White enlists the aid of her fellow fairytale cohorts to attack the Evil Queen and save Prince Charming''s life.', 39272, 21, 866325, 50700, '2012-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866323, 'A Land Without Magic', 'Emma and Regina team together in order to find a way to save Henry''s life. Meanwhile, in the fairytale land that was, Prince Charming attempts to escape from the Evil Queen''s clutches in order to reunite with Snow White who, unbeknownst to him, has already taken a bite of the Queen''s poison apple.', 39272, 22, 866323, 50700, '2012-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866347, 'Broken', 'As fairytale characters awaken from Queen Regina''s curse, they are not transported back to their home; Prince Phillip and his traveling companion realize they will be facing a deadly foe.', 39272, 1, 866347, 50701, '2012-09-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866327, 'We Are Both', 'Regina continues to seek a way to regain her powers; David continues his quest to find Mary Margaret and Emma; the seven dwarves discover what happens when one of the townspeople tries to leave Storybrooke''s city limits.', 39272, 2, 866327, 50701, '2012-10-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866328, 'Lady of the Lake', 'Emma and Mary Margaret try to find a portal that would bring them back to Storybrooke; Henry tries to talk Jefferson into reuniting with his daughter; on the eve of meeting Prince Charming''s mother, King George poisons Snow White.', 39272, 3, 866328, 50701, '2012-10-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866329, 'The Crocodile', 'Belle threatens to leave Mr. Gold if he doesn''t change his ways; the dwarves try to find fairy dust in the Storybrooke mine; Rumplestilskin tries to save his wife from a band of pirates.', 39272, 4, 866329, 50701, '2012-10-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866330, 'The Doctor', 'As Regina tries to refrain from using her magic in order to regain Henry''s trust, she starts seeing a ghost from her past; Mary Margaret and Emma find a survivor from an Ogre massacre; Regina struggles to learn the dark arts.', 39272, 5, 866330, 50701, '2012-10-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866331, 'Tallahassee', 'Emma follows Capt. Hook up a beanstalk in hope of finding a magical compass; a fellow thief wants to make an honest woman out of Emma.', 39272, 6, 866331, 50701, '2012-11-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866332, 'Child of the Moon', 'Ruby''s fear about turning into a wolf is confirmed when she becomes the prime suspect for a vicious murder; Leroy finds treasure in a Storybrooke mine that could help Emma and Mary Margaret.', 39272, 7, 866332, 50701, '2012-11-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866333, 'Into the Deep', 'Cora tries to steal the compass from Emma and Mary Margaret; Regina and Mr. Gold must put David''s life in danger in the hope that he will be able contact Mary Margaret.', 39272, 8, 866333, 50701, '2012-11-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866334, 'Queen of Hearts', 'Hook and Cora face off with Emma and Mary Margaret in a race for the compass; Mr. Gold and Regina plan to kill anyone who enters the portal.', 39272, 9, 866334, 50701, '2012-12-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866335, 'The Cricket Game', 'When Regina is accused of murdering a beloved fairy-tale character, Emma thinks she is innocent; Prince Charming and Snow White plan the evil queen''s execution.', 39272, 10, 866335, 50701, '2013-01-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866336, 'The Outsider', 'Mr. Gold tries to use an unwilling test subject to see if his spell works; Belle runs into vengeful Capt. Hook; David and Mary Margaret look for a bigger house.', 39272, 11, 866336, 50701, '2013-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866337, 'In the Name of the Brother', 'A stranger may be a threat to the true identity of the townspeople; Cora tries to reunite with Regina.', 39272, 12, 866337, 50701, '2013-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866338, 'Tiny', 'Cora brings the giant to Storybrooke, where he unleashes vengeance on the town; Emma and Henry go with Mr. Gold to search for his son; Greg asks Belle what she saw on the night of his accident; Anton the Giant befriends humans.', 39272, 13, 866338, 50701, '2013-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866339, 'Manhattan', 'Emma, Henry and Mr. Gold search for Gold''s son in New York; Hook, Cora and Regina look for one of Rumplestiltskin''s most precious possessions.', 39272, 14, 866339, 50701, '2013-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866340, 'The Queen Is Dead', 'When Mary Margaret learns of Cora and Regina''s plan for the dagger, she resolves to find it first; Mr. Gold continues his search for Bae; the Blue Fairy offers Snow White an enchantment to save her mother.', 39272, 15, 866340, 50701, '2013-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866341, 'The Miller''s Daughter', 'Cora and Regina try to overpower Mr. Gold; dark magic tempts Mary Margaret; Rumplestiltskin offers his services to Cora.', 39272, 16, 866341, 50701, '2013-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866344, 'The Evil Queen', 'Hook helps Regina with a plan to transport her and Henry back to Fairytale land; Emma grows increasingly suspicious of Tamara; the queen asks Rumpelstiltskin to transform her so that she can kill Snow White.', 39272, 20, 866344, 50701, '2013-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866345, 'Second Star to the Right', 'Mary Margaret, David and Emma embark on a search when Regina and some magic beans go missing; Mr. Gold considers revealing the truth to Lacey; Bae winds up in 19th century London.', 39272, 21, 866345, 50701, '2013-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866346, 'And Straight on ''til Morning', 'Storybrooke''s inhabitants brace themselves as Greg and Tamara activate the trigger within the curse; Mr. Gold mourns; Hook rescues Bae, who is being pursued by the Lost Boys.', 39272, 22, 866346, 50701, '2013-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866349, 'The Heart of the Truest Believer', 'Emma, Mary Margaret, David, Regina, Mr. Gold and Hook enter Neverland to search for a kidnapped Henry, they''re greeted by a school of not-to-friendly mermaids who threaten to end their search before it begins; Henry finds himself on the run from the Lost Boys with another escapee from Peter Pan''s encampment; and Neal, recovering from his wounds, travels through the Enchanted Forest with Mulan in an attempt to learn the fates of Emma and Henry.', 39272, 1, 866349, 50702, '2013-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866350, 'Lost Girl', 'While Emma, Mary Margaret, David, Regina and Hook continue their search for Henry in Neverland, Peter Pan appears before a startled Emma and offers her a map that will reveal her son’s whereabouts. But the only way to make the map appear is for Emma to stop denying who she really is and come to grips with her true feelings about her identity – and Mr. Gold receives some unexpected advice from a friend that could lead him to understand his life’s journey while in Neverland. Meanwhile, in the Fairy Tale Land that was, when the Evil Queen presents Snow White with an offer to live her life with Charming in peace – with the caveat that she give up her claim to the throne – Charming makes it his mission to ensure that Snow doesn’t take the offer.', 39272, 2, 866350, 50702, '2013-10-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866354, 'Quite a Common Fairy', 'In their continuing quest to find Peter Pan''s hideout and save Henry, Hook suggests tracking down Tinker Bell in the hope that she will lead them straight to his camp. Pan reveals to Henry why he has brought him to Neverland and in the Enchanted Forest, Neal has a plan that could transport him to Emma, but it would involve using one of Robin Hood''s most precious possessions. Meanwhile, in the Fairy Tale Land that was, Tinker Bell offers to help Regina improve her life.', 39272, 3, 866354, 50702, '2013-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866351, 'Nasty Habits', 'Mr. Gold makes a decision to confront Pan, but will he go there to save Henry or give in to the prophecy that the boy will be his undoing? Neal finds himself back in Neverland and in the custody of one of Pan’s most loyal Lost Boys. And David struggles for his life as the poison continues to take its toll on him. Meanwhile, in the Fairy Tale Land that was, Rumplestiltskin goes in search of a missing Bae, who has followed a mysterious figure who steals away children with his music.', 39272, 4, 866351, 50702, '2013-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866353, 'Good Form', 'With the deadly Dreamshade coursing through David’s body and close to death, Hook takes him on one last journey to find a sextant that could help them decipher a map that would lead them off Neverland. Meanwhile, in the Fairy Tale Land that was, Killian Jones – aka Hook – and his brother, Captain Liam, sail off under orders of the King to find a powerful indigenous plant on an uncharted land that could help heal any injury.', 39272, 5, 866353, 50702, '2013-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866352, 'Ariel', 'Back in the Fairy Tale Land that was, when Ariel saves Snow White from drowning in the ocean''s depths, Snow returns the favor by helping her new friend get acquainted with Prince Eric, with whom she has fallen madly in love with. Meanwhile, Emma, Mary Margaret, David and Hook attempt to save Neal, who is imprisoned in one of Pan''s encampments, and Regina and Mr. Gold begrudgingly team up to find a way to take down Pan.', 39272, 6, 866352, 50702, '2013-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866355, 'Dark Hollow', 'Mr. Gold and Regina send Ariel back to Storybrooke with an item that will allow Belle to locate a hidden artifact that could help take down Pan. But unbeknownst to them, two men have broken into the town with the intent to stop them - at all costs. Meanwhile, Emma, Neal and Hook attempt to find Dark Hollow, where Peter Pan''s shadow dwells, in order to capture it, and Mary Margaret is upset with David for keeping his poisoning a secret from her.', 39272, 7, 866355, 50702, '2013-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (866356, 'Think Lovely Thoughts', 'Pan leads Henry to a secret cave, where he has convinced the boy that he alone can save magic – and Neverland itself. But a showdown between good and evil is about to go down as Emma, Mary Margaret, David, Regina, Mr. Gold, and Hook find themselves directly on a path to Pan in an effort to save Henry.', 39272, 8, 866356, 50702, '2013-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968795, 'Save Henry', 'The race to stop Pan is on as Henry''s life hangs in the balance; with Mr. Gold''s help, Regina decides to adopt a baby.', 39272, 9, 968795, 50702, '2013-12-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969236, 'The New Neverland', 'Pan''s plan threatens the citizens of Storybrooke''s joy over Henry''s return; Snow and Charming spend their honeymoon searching for a mythical being that could stop Regina.', 39272, 10, 969236, 50702, '2013-12-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969394, 'Going Home', 'The residents of Storybrooke race to stop Pan from placing another curse on the town.', 39272, 11, 969394, 50702, '2013-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969554, 'New York City Serenade', 'In New York, Hook tries to get Emma to remember who she really is. In the past, the Storybrooke residents return to the Enchanted Forest and are threatened by a threat like no other.', 39272, 12, 969554, 50702, '2014-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969555, 'Witch Hunt', 'In New York, Hook tries to make Emma remember by something very powerful: true love. In the Enchanted Forest, Regina, Snow, and Charming all team up to defeat a very powerful witch. In another world''s past, a young girl learns how to use wizardry only to be hunted by a mob.', 39272, 13, 969555, 50702, '2014-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973567, 'The Tower', 'While Emma, David, Regina and Hook continue their search for the Wicked Witch, she, in turn, is planning a dark surprise for David, and Zelena’s prisoner is powerless under her watch as she plots her next course of action against the townspeople. Meanwhile, in the Fairy Tale Land that was in the previous year, Prince Charming stumbles upon Rapunzel, who is trapped inside a tower, and must help her confront her fears in order for her to be free.', 39272, 14, 973567, 50702, '2014-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973947, 'Quiet Minds', 'Neal finds himself back in Storybrooke and yearns for a way to reconnect with his son Henry, whose memories of his father are gone, while also trying to find his own father, Rumplestiltskin, whom he has just learned is alive but missing, and Regina discovers a possible connection with Robin Hood. Meanwhile, in the Fairy Tale Land that was over the past year, agonizing over the death of his father, Neal - with the help of Belle and enchanted candelabra Lumiere - attempts to find a magical solution to bring back Rumplestiltskin from the dead.', 39272, 15, 973947, 50702, '2014-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974155, 'It''s Not Easy Being Green', 'With Rumplestiltskin as her slave, Zelena challenges Regina to a fight to the death and shocks the Evil queen with the reveal of their familial connection, and the town lays Neal to rest. Meanwhile, back in the past in the land of Oz, a jealous Zelena asks the Wizard to send her to Fairy Tale Land after discovering that she has a sister, Regina, and that Rumplestiltskin is training her to become a powerful force to be reckoned with.', 39272, 16, 974155, 50702, '2014-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281590, 'Episode 46', '', 70583, 46, 1281590, 85893, '2016-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974426, 'The Jolly Roger', 'Ariel returns to Storybrooke and pleads with Hook to help her find Prince Eric, who never returned to the town when the new curse was invoked. Emma agrees to let Regina teach her how to use magic so that she can help defeat Zelena, and Mary Margaret and David try to prove that they can be just as much fun as Hook is with Henry -- who thinks they are boring. Meanwhile, in Fairy Tale Land during the past year, an angry Ariel confronts Hook over her missing Prince Eric, who she assumes was kidnapped and possibly killed by the swarthy pirate. But when Hook confesses that the Jolly Roger has been stolen and Eric is most likely the thief’s prisoner, Ariel unknowingly provides him with a clue as to who the culprit is, and Hook – with Ariel in tow - goes off in search of his ship.', 39272, 17, 974426, 50702, '2014-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974713, 'Bleeding Through', 'After Zelena steals Regina''s heart, Regina casts a spell so that she can speak across the realms to her dead mother, Cora, to discover the truth about why she abandoned Zelena, and Belle stumbles across what Zelena''s ultimate end game is. Meanwhile, in the Fairy Tale Land that was, young Cora is duped by a man claiming to be a prince and finds herself alone and pregnant. But a chance meeting with a real prince could lead Cora to the royal life she''s always craved, but she must keep her pregnancy a secret or risk losing everything.', 39272, 18, 974713, 50702, '2014-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975331, 'A Curious Thing', 'Zelena threatens to kill Henry if Hook - whose lips have been cursed by the Wicked Witch -- doesn''t proceed with kissing Emma, which will drain all of her magical powers away, and things begin to heat up between Regina and Robin Hood. Meanwhile, back in the Fairy Tale Land that was during the past year, Snow and Charming go in search of Glinda, The Good Witch of the South, to see if she can help them defeat Zelena, and the curse that will ultimately send the Fairy Tale characters back to Storybrooke is cast -- but from an unlikely source.', 39272, 19, 975331, 50702, '2014-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975580, 'Kansas', 'With Mary Margaret in labor and due to give birth at any moment, the residents of Storybrooke go on high alert in an attempt to ensure that Zelena doesn''t try to steal her newborn baby for use in her ultimate game plan to turn back time and change her destiny -- while obliterating Regina''s existence. Meanwhile, in the land of Oz of the past, Glinda tries to convince Zelena to fight her evil tendencies and join her and her sister witches as a protector of Oz. But the appearance of a young girl from Kansas could turn out to be her undoing.', 39272, 20, 975580, 50702, '2014-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (976000, 'Snow Drifts', 'While Mary Margaret and David celebrate the naming of their son at a coronation in Granny''s Diner, Emma and Hook are pulled into Zelena''s time portal and find themselves in the Enchanted Forest of the past. But in their quest to discover a way back, they must be careful not to change anything or risk altering the lives of their friends and family - as well as their very own existence.', 39272, 21, 976000, 50702, '2014-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (976001, 'There''s No Place Like Home', 'Hook and Emma try to find their way back to the present and correct the mistakes they made in the past.', 39272, 22, 976001, 50702, '2014-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010130, 'A Tale of Two Sisters', 'A scared and confused Elsa from Arendelle finds herself in Storybrooke and creates a powerful snow monster for protection. Regina wonders if her relationship with Robin Hood has been completely quashed now that Marian''s back in the picture. Elsa''s sister wants to complete their parent''s fateful journey and discover if their quest may have held the secret to containing Elsa''s out of control ice powers.', 39272, 1, 1010130, 62835, '2014-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010183, 'White Out', 'While desperately trying to find her sister Anna, Elsa accidentally traps them both inside an ice cave. Regina secludes herself from the town and Henry. With the townspeople considering Mary Margaret their leader, she faces her first leadership task in trying to re-start a generator and restore the town’s electricity after Elsa freezes and damages the power lines. Anna tries to teach a meek David to fight Bo Peep.', 39272, 2, 1010183, 62835, '2014-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010184, 'Rocky Road', 'Marian falls under a freezing curse and the townspeople believe that Elsa is responsible. When Emma and David go to Robin''s camp to look for clues, they find Will Scarlet, who leads them to the culprit. Meanwhile, in the Arendelle of the past, Elsa and Kristoff go to find the urn that Hans plans to use to imprison Elsa, and encounter the Snow Queen.', 39272, 3, 1010184, 62835, '2014-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010185, 'The Apprentice', 'Hook discovers that magic always comes with a price after he makes a deal with Mr. Gold to re-attach his hand so that he can embrace Emma with both hands on their first real date. And back in the fairy tale land of the past, Rumplestiltskin uses Anna to help him acquire a magical box from the sorcerer’s apprentice.', 39272, 4, 1010185, 62835, '2014-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010186, 'Breaking Glass', 'Emma tries to convince a reluctant Regina to help her find the Snow Queen, only to discover that Regina is lying to her about Sidney''s whereabouts. Meanwhile, David convinces Mary Margaret to go on a date, but the date turns into a hunt when Will escapes his jail cell. In the past, Emma befriends another young orphan who isn''t all that she seems.', 39272, 5, 1010186, 62835, '2014-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010187, 'Family Business', 'The race is on to track down the elusive Snow Queen in order to discover what her ultimate end game is for Elsa and the residents of Storybrooke. Unaware that she does not possess the real blade that controls The Dark One, Belle attempts to use it to get her reluctant husband to show her where the Snow Queen is hiding. Belle travels to Arendelle and, with Anna''s help, seeks out Grand Pabbie to help her regain her lost memories in order to discover the fate of her mother.', 39272, 6, 1010187, 62835, '2014-11-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010188, 'The Snow Queen', 'Emma captures the Snow Queen and learns that they are more alike then she can possibly imagine. In arendelle of the past, Ingrid discovers her deadly ice powers and makes a pact with her two sisters to protect and always be there for one another – no matter what.', 39272, 7, 1010188, 62835, '2014-11-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1010189, 'Smash the Mirror (1)', 'Emma’s powers run amok and she turns to Gold for help, Elsa and Anna’s relationship is tested, and the Snow Queen’s agenda is revealed.', 39272, 8, 1010189, 62835, '2014-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018696, 'Smash the Mirror (2)', 'Emma’s powers run amok and she turns to Gold for help, Elsa and Anna’s relationship is tested, and the Snow Queen’s agenda is revealed.', 39272, 9, 1018696, 62835, '2014-11-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018530, 'Fall', 'The Snow Queen attempts to pit Anna and Elsa against each other; with her powers out of control, Emma seeks assistance from Gold; Regina''s quest takes a surprising turn.', 39272, 10, 1018530, 62835, '2014-11-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018531, 'Shattered Sight', 'As Storybrooke descends into chaos as the Snow Queen''s spell takes hold, Emma and Elsa try to trick Regina into destroying the ribbons so that they can attack the Queen. In the past, Ingrid adopts Emma and attempts to show the girl that she''s a powerful sorceress.', 39272, 11, 1018531, 62835, '2014-12-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018532, 'Heroes and Villains', 'In the aftermath of the Snow Queen’s spell, our heroes try to pick up the pieces and Regina has to make a difficult choice. Hook’s fate hangs in the balance as Gold’s quest for power threatens everything he holds dear. And, in the Enchanted Forest flashback, an intrusion during Belle''s stay at Rumplestiltskin''s dark castle will wreak havoc in both the past and the future.', 39272, 12, 1018532, 62835, '2014-12-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281591, 'Episode 47', '', 70583, 47, 1281591, 85893, '2016-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281592, 'Episode 48', '', 70583, 48, 1281592, 85893, '2016-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281593, 'Episode 49', '', 70583, 49, 1281593, 85893, '2016-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1018533, 'Darkness on the Edge of Town', 'With Gold banished from town, the residents of Storybrooke attempt to resume their normal lives. Hook and Belle search for a way to release the fairies from the Sorcerer’s hat, while Emma, Henry and Regina continue to look for clues that could lead them to the Author. But when a terrifying darkness descends on the town, Emma and Regina are forced to confront the true nature of evil. Meanwhile, in New York, Gold and Ursula enlist Cruella De Vil to join their cause.', 39272, 13, 1018533, 62835, '2015-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1021477, 'Unforgiven', 'David and Mary Margaret suspect Cruella and Ursula have come to Storybrooke looking for something more than their own happy endings – something that threatens to reveal a secret they thought was long buried. Emma begins her own investigation of Cruella and Ursula, but she can’t shake the feeling that her friends and family are keeping something from her. Regina and Henry continue their search for the Author, turning to Pinocchio and Marco in the hope Pinocchio might remember a clue that will help them. Meanwhile, in a flashback to Fairy Tale Land, Snow and Charming cross paths with the Queens of Darkness as the threat of the Evil Queen’s Dark Curse hangs over all of them.', 39272, 14, 1021477, 62835, '2015-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1046604, 'Enter the Dragon', ' In order to infiltrate the Queens of Darkness as a spy for the heroes, Regina must prove she’s still willing to get her hands dirty. Meanwhile, Emma, David and Mary Margaret scramble to keep tabs on their undercover operative. Hook requests an unusual favor from Belle as Henry makes progress on his search for the Author. In a Fairy Tale Land flashback, Regina befriends Maleficent and helps her to rekindle her lost spark.', 39272, 15, 1046604, 62835, '2015-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1047999, 'Poor Unfortunate Soul', 'Hook leverages his complicated history with Ursula to find out what she knows about Gold’s endgame. Gold and the Queens of Darkness torture August for information about the Author as Emma, Mary Margaret and David race to find them. Regina grows concerned for Robin Hood’s safety while she struggles to maintain her cover with the villains. In a Fairy Tale Land flashback, when a restless young Ursula enlists Hook’s help to run away from home, she soon learns it isn’t wise to trust a pirate.', 39272, 16, 1047999, 62835, '2015-03-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1048711, 'Best Laid Plans', 'Hook tells Emma that her fate is at stake in Gold’s plan while Regina leads the villains on a wild goose chase. Henry makes a breakthrough in his search to find the Author, but Mary Margaret and David need a moment to reconsider the best course of action. In a Fairy Tale Land flashback, Snow and Charming search for a way to ensure their child will grow-up to be a hero. When a traveling peddler directs them to visit a kindly old hermit, Snow and Charming are presented with a choice that could secure their child’s goodness, but at a price that will haunt them for years to come.', 39272, 17, 1048711, 62835, '2015-03-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1051887, 'Heart of Gold', 'Emma is still reeling after learning the truth of her parents’ history with Maleficent, but she must focus on finding the Author, who is running loose in Storybrooke, before Gold does. When Gold’s quest for his happy ending grows more urgent, he blackmails Regina into helping him. In a Fairy Tale Land flashback, Robin Hood learns what it means to be an honorable thief when he accepts a proposition by Rumpelstiltskin to travel to Oz to steal a valuable magic elixir from the Wicked Witch.', 39272, 18, 1051887, 62835, '2015-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1053821, 'Sympathy for the De Vil', 'In fictional 1920s England, viewers meet a young Cruella, whose oppressive mother uses her Dalmatians to terrorize her daughter. Cruella is confined to her mother’s attic until a mysterious stranger arrives and empowers her to challenge her captor. In Storybrooke, Regina gains leverage to keep Gold from interfering with her plan to rescue Robin, but her trip to New York takes the backseat when she and Emma learn that Cruella has kidnapped Henry.', 39272, 19, 1053821, 62835, '2015-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1056370, 'Lily', 'Emma’s potential for darkness is looming over everyone, but when Emma realizes Maleficent’s daughter Lily is in fact her closest friend from her foster care days, she resolves to find Lily and reunite her with her mother. Regina joins forces with Emma and together they set out to track down Lily and to warn Robin about Zelena. However, neither of them is prepared for the harsh realities they’ll encounter in the outside world. Meanwhile, in Storybrooke, Gold faces a crisis involving Belle. In a foster care flashback, things are looking up for young Emma with her new family until Lily’s appearance threatens to destabilize everything.', 39272, 20, 1056370, 62835, '2015-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1058288, 'Mother', 'Emma returns to Storybrooke to reunite Lily with Maleficent while Regina and Robin struggle to cope with the implications of Zelena''s pregnancy. When Gold''s health takes a turn for the worse, Isaac looks to a new ally for help procuring the magic ink he needs to re-write history. In a Fairy Tale Land flashback, Cora returns from Wonderland to beg Regina''s forgiveness on the anniversary of Daniel''s murder. Cora vows to help her daughter find true love, but Regina remains suspicious of her mother''s intentions.', 39272, 21, 1058288, 62835, '2015-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1060557, 'Operation Mongoose Part 1', 'The Author proves to be a formidable wild card and forges an alliance with Gold. Emma, her parents, Hook and Regina scramble to stop them, but when Gold and the Author turn the tables on heroes and villains alike, the prospect of any happy outcome appears worlds away. Henry discovers he has big shoes to fill as he steps up to save his family before the story’s final page is turned. It’s a race to the finish, and everything culminates with a shocking twist that will leave the residents of Storybrooke reeling.', 39272, 22, 1060557, 62835, '2015-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1060559, 'Operation Mongoose Part 2', 'The Author proves to be a formidable wild card and forges an alliance with Gold. Emma, her parents, Hook and Regina scramble to stop them, but when Gold and the Author turn the tables on heroes and villains alike, the prospect of any happy outcome appears worlds away. Henry discovers he has big shoes to fill as he steps up to save his family before the story’s final page is turned. It’s a race to the finish, and everything culminates with a shocking twist that will leave the residents of Storybrooke reeling', 39272, 23, 1060559, 62835, '2015-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1082250, 'The Dark Swan', 'Immediately after becoming the Dark One, Emma disappears and the heroes must band together to save her, but first they have to find her, which will require the help of an unlikely ally. Meanwhile, in the Enchanted Forest, Emma struggles to resist her dark urges as she searches for Merlin in the hope that he can stop her transformation. Along the way to Camelot, she gets help from the plucky and brave warrior princess Merida, as well as King Arthur and his Knights of the Round Table.', 39272, 1, 1082250, 68211, '2015-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1089894, 'The Price', ' In an effort to protect Emma, Regina steps up in a surprising way that will test her mettle as a force for good. King Arthur and Queen Guinevere throw a royal ball to welcome the heroes to Camelot, but when the celebration takes a deadly turn, David and Robin must leap into action or lose a crucial asset in the fight to save Emma. Back in Storybrooke, Hook deploys a tried-and-true technique in hopes of bringing Emma back to the light while the heroes discover that some unexpected baggage has followed them home from Camelot.', 39272, 2, 1089894, 68211, '2015-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276568, 'I Love Daylan', 'At long last it''s time for Daylan to move out of Kellie and Kyle''s house and back to his own home. Meanwhile, Kellie goes above and beyond to help Daylan turn his place into something respectable.', 70425, 12, 1276568, 85476, '2016-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1092678, 'Siege Perilous', 'In Camelot, the heroes feverishly work to free Merlin. Determined to help Emma, David embarks on a quest to retrieve a magical relic that Regina could use to communicate with the imprisoned sorcerer, but, when David leaves, Arthur insists on joining him because the dangers ahead are greater than he can imagine. Meanwhile, Mary Margaret discovers the fate of her old friend Lancelot. Back in Storybrooke, Arthur seeks David’s help to catch a thief who threatens the safety of the citizens of Camelot. Across town, Emma reaches out to a conflicted Hook as she sets about her plan to draw Excalibur from the stone.
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1096531, 'The Broken Kingdom', 'After receiving a cryptic warning from Lancelot about Arthur''s intentions, Mary Margaret realizes Arthur may be the heroes'' biggest threat, but when she is unable to convince David of the danger, she takes matters into her own hands. Meanwhile, Hook''s unwavering love for Emma provides a glimmer of hope in her struggle against the unrelenting voice of Rumplestiltskin. In a Camelot flashback, Guinevere senses that Arthur is losing his way, consumed by his obsession with making Excalibur whole, so she sets out with Lancelot on her own quest into the heart of darkness. In Storybrooke, Dark Emma unleashes a secret weapon in the next phase of her plan to find the brave soul she needs to draw Excalibur from the stone.', 39272, 4, 1096531, 68211, '2015-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1100428, 'Dreamcatcher', 'In Camelot, as Mary Margaret and David attempt to retrieve the Dark One dagger, Emma uses a Dreamcatcher to look into the past to see how Merlin was transformed into a tree. Together, Emma and Regina figure out the critical ingredient they must acquire to free Merlin, but it''s a race against Arthur, who does not want Merlin released. Meanwhile, with encouragement from his moms, Henry musters up the courage to ask Violet on a date. Back in Storybrooke, the heroes break into Emma''s house hoping to locate Gold, but what they find will give them a glimpse of Emma''s end game. Far from prying eyes, Merida sets about the mission Emma has tasked her with and begins molding Gold into the hero they need to draw Excalibur.', 39272, 5, 1100428, 68211, '2015-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1103781, 'The Bear and the Bow', 'In a Camelot flashback, a chance encounter with Merlin, David, Hook and Belle gives Merida new hope in her quest to save her brothers from the usurping clans of DunBroch. Unwilling to leave anything up to fate, Merida brings Belle along on a dangerous journey that culminates with an invaluable lesson in bravery. In Storybrooke, Regina, Mary Margaret and David discover the spell that would allow one of Merlin’s chosen to communicate with him, but when Arthur fails to reach the missing sorcerer the heroes grow suspicious. Meanwhile, Emma commands Merida to kill Belle in hopes of forcing Mr. Gold’s heroic transformation. With Merida unable to disobey Emma’s orders.', 39272, 6, 1103781, 68211, '2015-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1107217, 'Nimue', 'In Camelot, Merlin spearheads a mission to reunite the dagger with Excalibur so he can use the weapon to save Emma from the darkness threatening her soul. With Zelena in tow, Hook, Mary Margaret, David, Regina and Robin steal into Arthur’s castle to take the broken sword from the maniacal king. Meanwhile, Merlin brings Emma along on a journey to confront his ancient nemesis and retrieve the sacred spark he’ll need to reforge Excalibur. Both parties are tested, but one suffers a blow that could derail the entire operation. In a flashback to long before the Age of Arthur, young Merlin finds purpose after he is blessed with magic and immortality, but when he falls in love with a young refugee named Nimue, everything changes for Merlin, as their romance starts a chain of events that touches every one of our present day heroes.', 39272, 7, 1107217, 68211, '2015-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1110919, 'Birth', 'Tensions in Camelot come to a head when Merlin, now under Arthur’s control, delivers an ultimatum to Emma: hand over the Dark One dagger and the Promethean spark or he will kill her entire family. Refusing to give in, Emma and our heroes face off against Arthur, Merlin and Zelena in an epic battle of magic and will. Just when the end is in sight, Emma is forced to make a gut-wrenching choice that no one saw coming. Back in Storybrooke, Zelena’s pregnancy mysteriously accelerates and Hook goes to new and desperate lengths to get answers from the Dark Swan.', 39272, 8, 1110919, 68211, '2015-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1110920, 'The Bear King', 'Zelena and Arthur journey to DunBroch on a mission to retrieve an enchanted relic that will provide the advantage they need to vanquish Emma and our heroes. Their path will cross with Merida’s, who is on a journey of her own to pay a debt that her father, King Fergus, owed to the Witch when he died. Merida enlists the help of two friends, Mulan and Ruby, but, in order to satisfy the Witch and save DunBroch, she first must discover the identity of the knight who killed her father. In flashbacks, Merida learns about bravery and honor as she trains for combat and rides alongside Fergus into the infamous battle that claims his life.', 39272, 9, 1110920, 68211, '2015-11-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1130790, 'Broken Heart', 'In a Camelot flashback, Hook becomes a Dark One and his lust for revenge against Rumplestiltskin is reignited. When Emma and Hook disagree about their best course of action, the final pieces of the puzzle are revealed as events in Camelot catch up to the present and we witness a charged confrontation between the forces of light and dark that sends our heroes on a collision course with destiny. Meanwhile, in Storybrooke, Hook’s centuries old lust for revenge against Gold puts both of their fates in jeopardy while Emma’s love faces the ultimate test as she tries to convince Hook to turn away from the darkness before she, Mary Margaret, David and Regina embark on a new mission as an unsuspected evil is released.', 39272, 10, 1130790, 68211, '2015-11-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1130791, 'Swan Song', 'The dark siege of Storybrooke is underway as all of the resurrected Dark Ones target a living soul for sacrifice so that they can return to the realm of the living. With doom imminent, Gold advises Mary Margaret, David and the rest of the heroes to spend their last fleeting moments enjoying the company of their loved ones. Emma, however, refuses to give up, knowing that she is responsible for righting all the poor choices she made as Dark One - there''s only one problem, Dark Hook. When they face-off with the fate of Storybrooke at stake, Hook''s actions will devastate Emma in a way no one saw coming. In a Fairy Tale Land flashback, the Evil Queen tests Hook''s mettle by forcing him to confront a demon from his past before contracting him to dispatch one from hers.', 39272, 11, 1130791, 68211, '2015-12-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1136948, 'Souls of the Departed', 'Emma, Regina, Mary Margaret, David, Robin, Henry and Gold arrive in the Underworld, on a mission to rescue Hook, only to discover that their search will be more difficult than they had anticipated. The inhabitants of the Underworld — all souls with unfinished business and many with quite personal vendettas — hound our heroes at every turn. Meanwhile, in an Enchanted Forest flashback, a familiar face from the Evil Queen’s past returns to present Regina with the perfect birthday gift.', 39272, 12, 1136948, 68211, '2016-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1136949, 'Labor of Love', 'The heroes join forces with an old friend of Snow''s to defeat an  obstacle standing in the way of finding Hook. Meanwhile, Hook encounters  challenges of his own.', 39272, 13, 1136949, 68211, '2016-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226276, 'Street Rats', 'Princess Jasmine recruits Aladdin to help her recover a secret weapon capable of breaking Jafar''s hold on the Sultan and saving the city from ruin. In Storybrooke, the Evil Queen tricks Hook and the Charmings and forces Emma to reveal her secret in an effort to divide the family.', 39272, 5, 1226276, 79788, '2016-10-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172012, 'Devil''s Due', 'Hook''s captivity takes a dark turn when Hades threatens to condemn him to the River of Lost Souls after Hook refuses to choose which three of his friends will have to remain in the Underworld. Meanwhile, Gold is suddenly eager to help Emma, Snow, David, Regina, Robin and Henry find Hook so he can return home to Belle; but in order to do so, he must find his ex-wife Milah in the Underworld and ask for her help. In Fairy Tale Land flashbacks, Rumple and Milah face a life-or-death crisis concerning their son, Baelfire, that forces Rumple to make a deal that will haunt him.', 39272, 14, 1172012, 68211, '2016-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172013, 'The Brothers Jones', 'In Underbrooke, Hook questions whether he is worthy of forgiveness after meeting his brother Liam. In the past, Liam makes a deal of his own to save himself and his brother... at the cost of a ship''s worth of men. Meanwhile, Henry meets the Apprentice and learns of his true power.', 39272, 15, 1172013, 68211, '2016-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172014, 'Our Decay', 'Emma, Snow, David, Regina, Robin, Henry and Hook continue to search for a way to free everyone from the Underworld. At the mercy of Hades, Gold creates a portal to Storybrooke, which transports Belle, Zelena and Baby Hood to the Underworld. While Zelena and Regina get into a sibling squabble, Belle is reunited with Rumple only to learn some tremendously shocking news that will change her life forever. Meanwhile, Snow and David hopelessly attempt to send a message from the Underworld to their son, Neal. In flashbacks, Hades learns about Zelena’s very special spell and pays her a visit in Oz with the intention of striking an alliance, but finds himself with more than just a partner in crime.', 39272, 16, 1172014, 68211, '2016-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172015, 'Her Handsome Hero', 'Belle turns to Rumplestiltskin with hope of finding a way to protect their child from Hades. However, they disagree over whether to use dark magic, as Belle forbids Rumplestiltskin from using his powers for evil. Meanwhile, Hades secretly meets with Gaston in the Underworld and encourages him to seek revenge on Rumplestiltskin. As the heroes try to find a way to defeat Hades, Emma has a terrifying nightmare that she realizes is beginning to come true. And in flashbacks, Belle and Gaston meet for the first time, but their blossoming romance comes to a halt on the eve of the Ogre wars.', 39272, 17, 1172015, 68211, '2016-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1172016, 'Ruby Slippers', 'In flashbacks, Ruby and Mulan find themselves in Oz, where they meet Dorothy. After the three witness Zelena’s return to Oz, they look for a way to defeat her once and for all. However, Dorothy mysteriously disappears, and Ruby’s search for her new friend lands her in the Underworld. Reunited with the heroes, Ruby teams up with Emma, Regina and Snow to continue looking for Dorothy.  Meanwhile, Snow and David struggle with not being able to be with their son, Neal, and devise a plan so that one of them can escape the Underworld.', 39272, 18, 1172016, 68211, '2016-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1188288, 'Sisters', 'Now that Hades and Zelena are reunited, Hades tells Zelena that he wants a future with her outside of the Underworld. All she needs to do is heal his heart with True Love’s Kiss so they can leave the Underworld and trap the heroes there for eternity. When Regina overhears of this plan, she enlists Cora’s help to find a way to separate Zelena from Hades. However, Cora reveals a family secret that could change Regina and Zelena’s lives forever. Meanwhile, David finally meets James, only to realize that his twin is determined to seek revenge on him for stealing the life he could have had.', 39272, 19, 1188288, 68211, '2016-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1188289, 'Firebird', 'Hades turns to the heroes to ask for help with getting Zelena back from Rumplestiltskin and Peter Pan. In return, he offers to take all their names off their tombstones. However, when Hook is still unable to leave, he and Emma must journey into the depths of the Underworld. Meanwhile, Cruella De Vil is determined to keep the heroes trapped in the Underworld. In flashbacks, Emma searches for answers about her family and makes an unexpected friendship.', 39272, 20, 1188289, 68211, '2016-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1190864, 'Last Rites', 'Emma, David, Regina, Robin and Henry are finally back home in Storybrooke and reunited with Snow, but, unfortunately, they still have to contend with Hades, who continues to deceive Zelena as he lays out his plan to use the all-powerful Olympian Crystal to take over the town. The heroes desperately search for a way to defeat Hades while Hook does the same in the Underworld, looking for those missing storybook pages. Regina and Robin take a more direct approach, which culminates in an epic showdown that will leave our heroes forever changed.', 39272, 21, 1190864, 68211, '2016-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1190865, 'Only You', 'Regina reels from the death of Robin Hood, and everyone tries to give her room to grieve, but when the heroes discover Gold has stolen Hades’ Olympian Crystal and tethered all of Storybrooke’s magic to it, they set out to stop him. Henry decides he no longer can stand all the pain magic has caused his family, so he goes rogue, with Violet in tow, to destroy magic once and for all. Meanwhile, Zelena, Snow, David, and Hook attempt to open a portal that will return Merida and the other Storybrooke guests to their homes, but things go awry, and the group winds up in a deranged new world.', 39272, 22, 1190865, 68211, '2016-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1190866, 'An Untold Story', 'With the possibility of magic being destroyed and the fate of Storybrooke hanging in the balance, it’s a race for Emma and Regina to track down Henry before Gold can find him first. Regina continues to struggle with her frustrations over her former evil-self and, elsewhere, Snow, David, Hook, and Zelena are imprisoned and must contend with two very disturbed individuals that may give Gold a run for his money.', 39272, 23, 1190866, 68211, '2016-05-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1219544, 'The Savior', 'As our heroes set out to stop Hyde, Emma develops a mysterious side effect, and Storybrooke becomes a haven for refugees from the Land of Untold Stories. Meanwhile, Regina and Zelena embrace their newfound sisterhood by becoming roommates, while Rumple tries to free Belle from the sleeping Curse with the help of a stranger. In flashback, Jafar confronts an afflicted Aladdin in Agrabah, and a secret about the Savior is revealed.', 39272, 1, 1219544, 79788, '2016-09-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226273, 'A Bitter Draught', 'When a mysterious man from the Land of Untold Stories, who has a past with the Evil Queen, arrives in Storybrooke, David and Snow work together with Regina to neutralize the threat. Belle seeks Hook''s help finding a safe place to hide away from her husband, Mr. Gold. The Evil Queen continues to try to win Zelena over to her side, while Emma resumes her therapy sessions with Archie and shares her terrifying vision of the future.', 39272, 2, 1226273, 79788, '2016-10-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226274, 'The Other Shoe', 'As Storybrooke continues to welcome the new arrivals from the Land of Untold Stories, families, friends and enemies are reunited once again. When Cinderella searches for her step-family, intent on settling their unfinished business, Emma, Hook and Henry scramble to help her before it''s too late. Meanwhile, Regina attempts to bribe Mr. Hyde for information about how to defeat the Evil Queen, and Snow helps Dr. Jekyll find a laboratory for his work.', 39272, 3, 1226274, 79788, '2016-10-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226275, 'Strange Case', 'The Evil Queen and Hyde continue on their quest to steal Dr. Jekyll''s serum; Snow looks forward to her first day back as a school teacher; and while Emma looks forward to Hook moving in with her, Hook finds himself trying to protect Belle from Mr. Gold, who has made sure she can''t leave the confines of the pirate ship.', 39272, 4, 1226275, 79788, '2016-10-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1325667, 'Episode 2', '', 70452, 2, 1325667, 85559, '2017-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333900, 'Episode 3', '', 70452, 3, 1333900, 85559, '2017-07-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333901, 'Episode 4', '', 70452, 4, 1333901, 85559, '2017-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1226277, 'Dark Waters', 'Emma tries to convince Aladdin to work with Jasmine to help Agrabah, while Regina teams up with Snow and David to free Archie from Zelena. Meanwhile, in the past, Hook finds himself kidnapped by the mysterious Captain Nemo and held captive aboard his submarine, the Nautilus.', 39272, 6, 1226277, 79788, '2016-10-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236236, 'Heartless', 'In Storybrooke, the Evil Queen threatens to destroy the town and everyone in it unless Snow and David surrender their hearts. As Emma, Hook, and Henry prepare to defend Storybrooke, Snow, David, and Regina search for a magical sapling created by the first spark of true love.', 39272, 7, 1236236, 79788, '2016-11-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236237, 'I''ll Be Your Mirror', 'Emma and Regina formulate a plan to trap the Evil Queen in a prison of their own making, while Snow and David adjust to life without each other. Meanwhile, Zelena agrees to help Belle, and together they enlist Aladdin to steal a magical object from Mr. Gold that could protect Belle and her unborn child from him forever.', 39272, 8, 1236237, 79788, '2016-11-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236238, 'Changelings', 'Gold tells the Evil Queen she must kill Zelena, and the Queen makes a decision that will change her relationship with her sister forever. When Belle discovers Gold''s plans for their son, she convinces Hook and Emma to help her steal squid ink that can immobilize him. Meanwhile, Jasmine finds a genie-less lamp that she hopes to use to save Agrabah.', 39272, 9, 1236238, 79788, '2016-11-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236239, 'Wish You Were Here', 'When she learns the heroes possess a weapon capable of defeating her, the Evil Queen steals Aladdin''s magic lamp from Jasmine and makes a wish that could sideline the Savior forever. Unwilling to wake Snow while Emma is missing, David works with Hook and Henry to hold the Evil Queen at bay in Storybrooke.', 39272, 10, 1236239, 79788, '2016-12-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1236240, 'Tougher Than the Rest', 'With Snow still asleep in Storybrooke, David and Hook race to stop Gideon before he can confront Emma. Meanwhile, Regina struggles with the realization that everyone, even Robin, is better off in the alternate world where the Evil Queen was defeated. And when Emma inspires a familiar face to help her and Regina return home, she discovers the power to change her fate.', 39272, 11, 1236240, 79788, '2017-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1245146, 'Murder Most Foul', 'Before Hook takes the next step in his relationship with Emma, he wants to make sure David sees him as more than just a pirate. When David asks Hook to help him uncover the truth about his father''s death, Hook agrees. Meanwhile, Regina works to acclimate Robin to life in Storybrooke, but soon discovers he has a dark side that makes the task much more complicated than she anticipated.', 39272, 12, 1245146, 79788, '2017-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1245147, 'Ill-Boding Patterns', 'When Gideon resumes his mission to kill Emma and become the Savior, Gold steps in to ensure that the use of dark magic does not poison his son. Meanwhile, Robin proves willing to ally himself with anyone offering the possibility of escape from Regina and Storybrooke. Hook gathers the courage to come clean to Emma, but not before she discovers he''s been keeping a secret.', 39272, 13, 1245147, 79788, '2017-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1245148, 'Page 23', 'Believing there isn''t room in Storybrooke for both her and Regina, the Evil Queen sets out to eliminate her other half. Hook, determined to make things work with Emma, turns to his old friend Captain Nemo for advice, but Gideon torpedoes the plan before he''s able to set things right.', 39272, 14, 1245148, 79788, '2017-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259625, 'A Wondrous Place', 'When Hook finds himself trapped in another realm along with the Nautilus and her crew, he races to return to Emma before Gideon can execute the rest of his plan. In Storybrooke, Regina and Snow take Emma out to get her mind off Hook''s disappearance. And in a flashback to Agrabah, Jasmine befriends Ariel, and together they set out to locate Prince Eric as the threat from Jafar intensifies.', 39272, 15, 1259625, 79788, '2017-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259626, 'Mother''s Little Helper', 'Gold and Belle convince Emma to help Gideon, explaining that together they can stop the Black Fairy. Henry experiences a disorienting shift in his powers that forces Regina to seek counsel from the previous Author. Meanwhile, in Fairy Tale Land, Hook attempts to win the assistance of an old adversary by betting his most prized possession on a game of cards. And, in a flashback, the Black Fairy tortures young Gideon in hopes of molding him into the perfect apprentice.', 39272, 16, 1259626, 79788, '2017-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1259627, 'Awake', 'Trapped in Neverland, Hook aligns himself with Tiger Lily, hoping to find a way back to Emma. In Storybook, Regina works to break the sleeping curse that David and Snow are under, and Gold denies The Black Fairy, which brings the two of them to a fearsome impasse.', 39272, 17, 1259627, 79788, '2017-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1265153, 'Where Bluebirds Fly', 'Zelena decides to take on the Black Fairy and put a stop to her, once and for all, against Regina''s wishes, and the Charmings disagree over Emma and Hook''s wedding plans.', 39272, 18, 1265153, 79788, '2017-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1273043, 'The Black Fairy', 'After Rumple''s mother learns from his fairy godmother that his destiny is prophesized, she does everything in her power to keep it from happening. Meanwhile, in Storybrooke, Rumple faces a similar delimma.', 39272, 19, 1273043, 79788, '2017-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277999, 'The Song in Your Heart', 'In flashback, Snow and Charming make a special wish that Emma will be protected. The result of their wish has the whole kingdom bursting into song which infuriates the Evil Queen. Meanwhile in Storybrooke, the Black Fairy announces her plans to unleash another curse on the town while Emma and Hook prepare for their wedding.', 39272, 20, 1277999, 79788, '2017-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1288245, 'The Final Battle Part 1', 'Henry wakes up in a strangely changed Storybrooke where Emma is a mental patient and the rest of his family has disappeared.', 39272, 21, 1288245, 79788, '2017-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1304035, 'The Final Battle Part 2', 'Emma regains her memory but discovers that the Black Fairy has set the perfect trap for her. Meanwhile, the Evil Queen makes the ultimate sacrifice to save her former kingdom, and Gold is forced to choose between Good and Evil.', 39272, 22, 1304035, 79788, '2017-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1353333, 'Hyperion Heights', 'Henry leaves Storybrooke in search of his own story. Years later in another realm, he encounters a troubled Cinderella, changing the trajectory of his quest forever. When Cinderella''s evil step-mother, Lady Tremaine, poses a threat, Henry discovers that following his heart will require him to make more difficult choices than he ever could have imagined. Years later, a young Lucy finds a disillusioned Henry at his home in Seattle, determined to make him remember his true self in order to defeat the curse afflicting the fairytale characters of "Hyperion Heights."', 39272, 1, 1353333, 91667, '2017-10-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1356497, 'A Pirate''s Life', 'Henry’s Storybrooke family help him search for Cinderella, and Hook encounters an unexpected foe who threatens the group’s success. Meanwhile, in Hyperion Heights, Jacinda searches for a way to see Lucy with some unwelcome assistance from Henry.', 39272, 2, 1356497, 91667, '2017-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1356499, 'The Garden of Forking Paths', 'Cinderella joins forces with a new friend; Jacinda tries to protect Lucy''s community garden; Lucy tries to convince Henry that Victoria is after more than just a plot of land; Victoria makes a discovery that could alter everyone''s fate.', 39272, 3, 1356499, 91667, '2017-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1356500, 'Beauty', 'It’s Halloween in Hyperion Heights and Victoria forces Ivy to take Lucy trick-or-treating. Meanwhile, Tilly appears to be waking up from the curse and is intent on leading Weaver to the truth – but not if Victoria can help it. In a flashback, Rumple and Belle seek the answer to a prophecy that could cement their happy ending.', 39272, 4, 1356500, 91667, '2017-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1356501, 'Greenbacks', 'Tana seeks help from a traveling soothsayer, the iconic Dr. Facilier, in an attempt to save her kingdom. But when it’s revealed that he has an ulterior motive she’s forced to take matters into her own hands. In Hyperion Heights, Sabine and Jacinda take on a risky business venture, but the strength of their friendship is tested when Victoria interferes with their plans. Meanwhile, Ivy recruits Henry to investigate Victoria, and Roni makes a discovery that could change her relationship with Henry forever. Rogers uncovers a crucial clue in his search for Eloise Gardener.', 39272, 5, 1356501, 91667, '2017-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1391222, 'Wake Up Call', 'Feeling like a third wheel as Henry and Cinderella''s relationship strengthens, Regina is surprised to find herself needed by Drizella, who is searching for magic. But when a brutal truth is revealed, it could lead Drizella down a dangerous path. In Hyperion Heights, Roni seeks Weaver''s help in finding answers, and Tilly offers Rogers some intriguing advice concerning Eloise Gardener.', 39272, 6, 1391222, 91667, '2017-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1391223, 'Eloise Gardener', 'In pursuit of revenge, Hook seeks a dark and powerful magic, but an encounter with Rapunzel could alter his fate forever. Meanwhile, in Hyperion Heights, Ivy’s plot to take down Victoria intensifies and has unexpected consequences for Jacinda and Lucy. Rogers enlists Henry and Tilly’s help in his ongoing quest to find the missing Eloise Gardner, but what he discovers isn’t what meets the eye.', 39272, 7, 1391223, 91667, '2017-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1391224, 'Pretty in Blue', 'In an attempt to prevent a distressed Alice from running away, Henry and Ella follow her into Wonderland. Once there, Henry realizes that Ella has a surprising connection to this strange world. In Hyperion Heights, Jacinda reconnects with an old friend in a last ditch effort to regain custody of Lucy, but her decision to enlist outside help could put a strain on her burgeoning relationship with Henry.', 39272, 8, 1391224, 91667, '2017-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1402018, 'One Little Tear', 'Victoria strikes a deal with Weaver in an attempt to free herself from jail and wake Anastasia, but the cost of saving one life could mean the loss of another. In a flashback, we learn Lady Tremaine’s surprising connection to another classic fairytale when Mother Gothel offers to help her family. Meanwhile, Jacinda and Nick share an exchange that could alter her future with Henry.', 39272, 9, 1402018, 91667, '2017-12-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1402019, 'The Eighth Witch', 'When Drizella threatens the realm with a dark curse, Henry and Ella take extreme actions to protect Lucy and the others; and Regina is forced into making an unimaginable choice. In Hyperion Heights, Roni recruits Henry to travel to San Francisco to search for her sister, but when he learns Lucy has fallen unconscious, Henry rushes to be by her side. Meanwhile, Gothel earns the trust of Anastasia and the consequences of their budding relationship could prove to be fatal.', 39272, 10, 1402019, 91667, '2017-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1402020, 'Secret Garden', 'Eager to harness her burgeoning magical skills, Robin engages in a risky relationship with Mother Gothel. Meanwhile in Hyperion Heights, Roni and Kelly strike a deal with Eloise, desperate to save Lucy from her mysterious illness. But nothing comes without a price. As things finally come to a head between Victoria and Ivy, someone may have to pay with their life.', 39272, 11, 1402020, 91667, '2018-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1448164, 'A Taste of the Heights', 'On the day of Tiana’s coronation, a confrontation with Dr. Facilier compels her to take a trip through the Bayou, where a surprising encounter changes her life and the hunt for an alligator takes a dark turn. In Hyperion Heights, Sabine reconnects with an old friend whose plans could jeopardize her culinary dreams. Meanwhile, Rogers and Weaver investigate a Blind Witch, leading them to a shocking discovery about The Coven.', 39272, 12, 1448164, 91667, '2018-03-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1448166, 'Knightfall', 'Rogers strikes a deal with Eloise despite Tilly’s fair warning, while Ivy struggles to find herself after Victoria’s death. Meanwhile, in a faraway realm, Hook confronts Captain Ahab over a legendary magical talisman which can free Alice, only to learn that his quest may have unintended consequences.', 39272, 13, 1448166, 91667, '2018-03-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1448167, 'The Girl in the Tower', 'Rogers works to prove Tilly’s innocence in the case of the Blind Baker’s death, while Ivy attempts to make amends with Anastasia, and Samdi makes a revealing confession to Roni. Meanwhile, in a faraway realm, Alice forms an unbreakable bond.', 39272, 14, 1448167, 91667, '2018-03-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1462643, 'Sisterhood', 'When the Candy Killer attacks, Ivy will have to risk what remains of her family, while Jacinda and Henry grow closer and Roni questions her relationship with Samdi. Meanwhile, Drizella faces an unthinkable challenge in her attempt to join the Witch''s Coven.', 39272, 15, 1462643, 91667, '2018-03-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464131, 'Breadcrumbs', 'Henry grapples with an important decision when a job prospect in New York threatens to take him away from Jacinda and Lucy, but a revelation in the case of The Candy Killer could make it even harder to leave Hyperion Heights. Meanwhile, Margot confides in Tilly, and in a flashback, Hook helps Henry find a way to prove himself to Ella.', 39272, 16, 1464131, 91667, '2018-04-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464132, 'Chosen', 'Kelly comes face-to-face with The Candy Killer after someone she loves is taken hostage. Meanwhile, Samdi uses Drew to execute a deadly plan. In a flashback, Zelena learns a harsh lesson after an encounter with Hansel and Gretel goes awry.', 39272, 17, 1464132, 91667, '2018-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464133, 'The Guardian', 'Following Nick''s death, Weaver discovers the Dark One Dagger has been taken and sets out to get it back, even if it means betraying Roni''s trust. Meanwhile, Margot takes Tilly on a date, but their time together takes an unexpected twist. In a flashback, Rumple, desperate to be reunited with Belle, pays Alice a visit.', 39272, 18, 1464133, 91667, '2018-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464134, 'Flower Child', 'Tilly and Rogers find themselves in danger after an encounter with Eloise, forcing Tilly to make a life-altering decision when Rogers’ life is threatened. Meanwhile, Henry and Jacinda’s relationship takes a step forward, but despite Lucy’s efforts, their union doesn’t provide the answers she’s seeking. In a flashback, young Gothel seeks revenge after her home is destroyed', 39272, 19, 1464134, 91667, '2018-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464136, 'Is This Henry Mills?', 'Roni enlists Lucy’s help to wake Henry and stop Gothel, but things don’t go as planned. Meanwhile, Rogers and Weaver go to Margot in hopes of freeing Tilly before her magic can be used to power the spell. In a flashback, Young Henry struggles to decide what path to follow until a mysterious phone call helps put him on track.', 39272, 20, 1464136, 91667, '2018-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1464137, 'Homecoming', 'As the residents of Hyperion Heights celebrate the breaking of the curse, Henry is visited by Wish Rumple, who’s hatched an evil plan to use Ella and Lucy to keep Weaver from destroying the Dark One powers. In order to stop him, Henry, Roni, Weaver and Rogers must travel to the Wish Realm, home to versions of some of our most beloved and fearsome characters. In a flashback, a discouraged Young Henry is visited by Wish Rumple and offered a deal that could have tragic consequences.', 39272, 21, 1464137, 91667, '2018-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1463272, 'Leaving Storybrooke', 'Wish Rumple’s evil plan is revealed and Regina realizes the only hope to stop him is by turning Wish Henry from his path for vengeance. Meanwhile, Tilly and Margot try to get help in Storybrooke. With his hope of ever being reunited with Belle fading, Weaver struggles to find a way to defeat his evil alter ego; and when Rogers’ life is threatened, he is faced with the ultimate sacrifice. Series Finale.', 39272, 22, 1463272, 91667, '2018-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (944703, 'Down the Rabbit Hole', 'Alice''s tales of her adventures in Wonderland result in her father committing her to a mental asylum where she was about to be lobotomised to cure her supposed insanity, but the Knave of Hearts and the White Rabbit rescue her and bring her back to Wonderland when they reveal that her true love Cyrus is still alive. As Alice begins a quest to find him, the Red Queen and Jafar plot against her.', 57754, 1, 944703, 58913, '2013-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (944702, 'Trust Me', 'Alice formulates a plan to rescue Cyrus by retrieving his bottle. Meanwhile, the Red Queen begins to question her role in Jafar''s plan while they try to find the bottle as well. Also, the story behind how Cyrus got to Wonderland and how he fell in love with Alice is revealed.', 57754, 2, 944702, 58913, '2013-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (944704, 'Forget Me Not', 'With the Genie''s bottle in her clutches, the Red Queen sends the Bandersnatch after Alice since Jafar needs her in order to use Cyrus (who is discovered to have contacted her). Alice and the Knave of Hearts head to the house of the Grendel in the Whispering Woods to obtain the Forget-Me-Knot so that they can find out who stole Cyrus''s bottle before Jafar could steal it. In the Knave of Hearts''s flashback, it is shown that he joined up with Robin Hood''s Merry Men back when he was Will Scarlet. It is also revealed that Wonderland''s Red Queen was once his love Anastasia.', 57754, 3, 944704, 58913, '2013-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967979, 'The Serpent', 'When the Knave''s life is in danger, Alice has to make the tough decision on whether to use one of her three precious wishes and what that would mean for her and Cyrus. Her new friendship with Lizard reveals some of the Knave''s backstory and Cyrus plots to escape. Meanwhile, Jafar''s plan to kill the Knave puts the Red Queen in a difficult position as she grapples with her feelings for him and her desire to get what she wants. In flashback, we explore Jafar''s origins and find out what he truly wants from Cyrus.', 57754, 4, 967979, 58913, '2013-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (967980, 'Heart of Stone', 'In a flashback, Will Scarlet and Anastasia jump through the looking glass to enter Wonderland against her mother''s wishes, since she disapproves of Will. They both soon realize that life in Wonderland isn''t exactly what they had both imagined. After being humiliated while attending a ball at the palace, Ana convinces Will to steal the crown jewels in order to get them out of poverty, but in an instant, Ana is caught red handed by the King who makes her a proposition she can''t refuse – to marry him and be his Queen to avoid prosecution. Meanwhile, in current Wonderland, the Red Queen convinces Alice to help her acquire magic dust in exchange for information about Cyrus, who in turn has managed to skillfully escape Jafar''s castle leaving the White Rabbit in a compromising situation.', 57754, 5, 967980, 58913, '2013-11-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968729, 'Who''s Alice', 'Jafar heads to the asylum to find information on Alice; Alice travels to the black forest; Cyrus tries to avoid the Red Queen.', 57754, 6, 968729, 58913, '2013-11-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (968838, 'Bad Blood', 'When Alice discovers that her father is in Wonderland, they begin healing their broken relationship, which leads to her having to make a difficult decision. In flashback, a young Jafar is emotionally distraught after his mother dies and we find out what drove him to become the unforgiving villain he is today.', 57754, 7, 968838, 58913, '2013-12-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (969271, 'Home', 'A flashback reveals Cyrus'' origin; Alice wants answers from the White Rabbit; disdain between the Red Queen and Jafar comes to a head.', 57754, 8, 969271, 58913, '2013-12-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (970963, 'Nothing to Fear', 'Cyrus and Alice reluctantly work with the Red Queen to find Will but must also be prepared to defend themselves from Jafar. Will has troubles of his own when the caterpillar finds the bottle.', 57754, 9, 970963, 58913, '2014-03-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972553, 'Dirty Little Secrets', 'Cyrus remembers the events that led to the binding price he and his brothers have to pay; the Red Queen and the Knave are faced with the Jabberwocky.', 57754, 10, 972553, 58913, '2014-03-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (972934, 'Heart of the Matter', 'Cyrus and Alice uncover alarming information; the Knave must surrender information to Jafar in order to help the Red Queen.', 57754, 11, 972934, 58913, '2014-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973303, 'To Catch a Thief', 'In flashback, the Knave hunts Alice per Cora’s directive and he finds himself striking a deal to get his heart back, while in present day Wonderland, Alice and the Knave’s friendship is tested as he does Jafar’s bidding and steals from her. Meanwhile, the Jabberwocky attempts to free herself from Jafar’s control and Jafar is confronted by his former partner.', 57754, 12, 973303, 58913, '2014-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (973576, 'And They Lived...', 'The all-powerful Jafar succeeds in making his father love him and forcing Anastasia into thinking she loves him. After Alice, Amara and Cyrus escape, Jafar imprisons the Jabberwocky and calls upon an army of dead soldiers to do his bidding. Meanwhile, Alice and the White Rabbit raise their own army to fight Jafar for the realm and a final confrontation between Alice and Jafar takes place at the Well of Wonders.', 57754, 13, 973576, 58913, '2014-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276555, 'I Love Kellie Pickler', 'Welcome to an inside look at the life of country star Kellie Pickler and her husband Kyle. Tonight, Kellie brings home four chickens but Kyle is left taking care of them.', 70425, 1, 1276555, 85476, '2015-11-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276557, 'I Love Coming Home', 'When Kellie comes home after a few days on the road, Kyle looks for any opportunity to get some alone time with his wife.', 70425, 2, 1276557, 85476, '2015-11-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276558, 'I Love Sweat', 'After spending the summer recording in the studio, Kyle feels like he''s out of shape. Daylan volunteers to be his personal trainer and hits Kyle with an intense "country" workout.', 70425, 3, 1276558, 85476, '2015-11-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276559, 'I Love Lutefisk', 'Kellie is sure her anxious dog, Pixie, has emotional issues and must figure out how to help it calm down. Kyle tries to convince Kellie that Minnesota cuisine trumps Southern food.', 70425, 4, 1276559, 85476, '2015-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276560, 'I Love NASCAR', 'Kellie sings The Star Spangled Banner at a NASCAR race in Indianapolis and brings the gang along for fun. To Kyle’s surprise, Kellie comes home with a need for speed and a competitive streak that Kyle can’t put a stop to.', 70425, 5, 1276560, 85476, '2015-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276561, 'I Love Baseball', 'Kellie sings "Take Me Out to the Ballgame" at a minor league baseball game. She''s sworn off the song and the sport since she butchered the lyrics several years ago at a Cubs game.', 70425, 6, 1276561, 85476, '2015-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276562, 'I Love to Dance', 'Kyle''s big mouth gets him and Kellie involved in a dance competition with friends.', 70425, 7, 1276562, 85476, '2015-12-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276563, 'I Love the Holidays', 'Coming off a successful launch of her housewares line, Selma Drye, Kellie must immediately come up with something for the holiday line, in the middle of summer.', 70425, 8, 1276563, 85476, '2015-12-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276564, 'I Love Dollywood', 'In need of some girl time, Kellie hits the road with her best girlfriends and heads to Dollywood. Meanwhile, Kyle uses a Kellie-less house as a chance to battle Daylan in their Olympics of idiocy, The Man Games.', 70425, 9, 1276564, 85476, '2015-12-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276565, 'I Love the USO', 'A very special episode of ILKP has Kellie, Kyle, and Kellie’s band headed to Fort Riley in Kansas to play for troops at a USO event. Along the way, Kellie and Kyle get to try out some VIP experiences.', 70425, 10, 1276565, 85476, '2016-01-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276566, 'I Love Ghosts', 'Convinced the house is haunted, Kellie enlists the help of her friends and goes ghost hunting. Meanwhile, Kyle catches up on his “Honey Do” list and suspects this may have something to do with the “haunting.”', 70425, 11, 1276566, 85476, '2016-01-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276567, 'I Love Surprises', 'Kellie and Kyle are coming up on their fifth wedding anniversary. They eloped the first time but decide to renew their vows in Rosemary Beach, FL, and bring the whole gang with them but make the ceremony a surprise.', 70425, 13, 1276567, 85476, '2016-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276569, 'I Love My Husband', 'Kyle surprises Kellie with a day full of adrenaline and bungee jumping, but Kellie''s fears kick in a. Meanwhile, Kyle decides to play matchmaker for Kellie''s friend, Jen.', 70425, 1, 1276569, 85477, '2016-08-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276570, 'I Love Competition', 'Kellie and Kyle are thrilled when they are invited to compete against Lance Bass'' family on Celebrity Family Feud. They decide to put their friends through some unconventional tests to see who has the skills to join their team.', 70425, 2, 1276570, 85477, '2016-09-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276571, 'I Love Driving', 'Hilarity ensues when Kellie drives an Uber around Nashville to raise money for charity. Meanwhile, we get an inside look as Kyle works with his good friend and famous country singer/song-writer, Lee Brice.', 70425, 3, 1276571, 85477, '2016-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276572, 'I Love Sleeping', 'After learning about Ken''s outlandish fear of cotton balls, Kellie, Kyle and their friends decide to face their fears head on. Meanwhile, Kyle refuses to believe he has a snoring problem forcing Kellie to teach him a lesson.', 70425, 4, 1276572, 85477, '2016-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276573, 'I Love Family', 'Kellie and Kyle welcome Kyle''s parents to the neighborhood after their move to Nashville. Kellie, Kyle and their friends compete in a battle of the sexes.', 70425, 5, 1276573, 85477, '2016-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276574, 'I Love Japan', 'On a very special episode, Kellie and Kyle travel across the world to live with a host family in Tokyo! They navigate the subway, taste the authentic cuisine and attempt to speak Japanese, all while having the adventure of a lifetime.', 70425, 6, 1276574, 85477, '2016-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276575, 'I Love Science', 'Kellie''s good friend Jen is feeling apprehensive about freezing her eggs and asks Kellie to accompany her to the fertility clinic to see the doctor and learn about the process.', 70425, 7, 1276575, 85477, '2016-10-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276576, 'I Love Takeout', 'Kellie and Kyle attempt to cook with the help of Little Big Town''s Kimberly Schlapman, despite their aversion to doing anything in the kitchen. Can they pull it off? Kellie decides to get some new ink to display her love for Kyle.', 70425, 8, 1276576, 85477, '2016-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276577, 'I Love Giving Back', 'Kellie, Kyle, Andi and Ken prep for a meaningful performance at the Vanderbilt Children''s Hospital. Meanwhile, Kellie wants to get her motorcycle license, but Kyle doesn''t trust her on the road.', 70425, 9, 1276577, 85477, '2016-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276578, 'I Love My Roots', 'Kellie dusts off her old Sonic uniform and marches into Sonic ready to prove she can still do the job -- but can she handle the pressure? Meanwhile, Kyle can''t let go of his precious chair but Kellie wants the eye sore out of the house.', 70425, 10, 1276578, 85477, '2016-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276579, 'I Love Adrenaline', 'Kellie and Kyle are getting into shape and their trainer suggests a mud run to get them there -- can they handle the intensity? Kellie and Kyle are invited to do an extreme skydive with the Golden Knights.', 70425, 11, 1276579, 85477, '2016-11-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276580, 'I Love the Military', 'Kellie is invited to perform for the Chris Kyle Memorial Benefit but is overcome with nerves. Can she conquer her fear and give an epic performance?', 70425, 12, 1276580, 85477, '2016-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1342005, 'I Don’t Love Squirrels', 'Kyle and his trusted BFF, Ken, set out on a DIY mission to fix the squirrel problem in Kellie and Kyle’s attic.', 70425, 1, 1342005, 90855, '2017-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344338, 'I Love Being An Aunt', 'A night of babysitting Kellie’s adorable 4-year-old niece Adalynn inspires Kyle to go above and beyond to make sure Adalynn is having fun.', 70425, 2, 1344338, 90855, '2017-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1351808, 'I Love Being an Aunt', 'A night of babysitting Kellie’s adorable 4-year-old niece Adalynn inspires Kyle to go above and beyond to make sure Adalynn is having fun.', 70425, 3, 1351808, 90855, '2017-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1355230, 'I Love Noodling', 'Kyle’s frat buddies visit from Minnesota and they, along with Kellie, make the most of their weekend by taking on a new adventure.', 70425, 4, 1355230, 90855, '2017-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1359427, 'I Love St. Jude’s Marathon', 'Kellie is invited to build a team of runners for a fundraising marathon for St. Jude Children’s Research Hospital and hopes to build the squad from her closest friends.', 70425, 5, 1359427, 90855, '2017-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1363199, 'I Love Celebrity Softball', 'Kellie plays in a celebrity softball game for charity but as luck would have it, one of her childhood friends comes to town hoping to enjoy a girls'' weekend.', 70425, 6, 1363199, 90855, '2017-09-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1366660, 'I Love Dogs', 'Kellie and Kyle are going paw to paw to see which one of their dogs is the cutest as they enter Peanut and Pixie in the Nashville Cover Dog competition.', 70425, 7, 1366660, 90855, '2017-09-14');
