INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276971, 'How Does Night Happen?', 'The StoryBots visit mountaintops, the deep sea and even outer space to understand how night happens. Jay Leno guest stars as a helpful knight.', 70437, 1, 1276971, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1276972, 'How Do Airplanes Fly?', 'The StoryBots embark on a high-flying adventure to learn how airplanes fly. Kevin Smith guest stars as the superhero Super Mega Awesome Ultra Guy.', 70437, 2, 1276972, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277162, 'Why Do I Have to Brush My Teeth?', 'To understand why humans need to brush their teeth, the StoryBots travel to a mouth taken over by a gang of bad bacteria. Whoopi Goldberg guest stars.', 70437, 3, 1277162, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333902, 'Episode 5', '', 70452, 5, 1333902, 85559, '2017-07-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1333903, 'Episode 6', '', 70452, 6, 1333903, 85559, '2017-07-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277163, 'Why Is the Sky Blue?', 'To learn why the sky is blue, the StoryBots get a science lesson in colors. Garfunkel and Oates'' Riki Lindhome and Kate Micucci guest star.', 70437, 4, 1277163, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277164, 'Where Do French Fries Come From?', 'The mysterious Molepheus takes the StoryBots on an underground journey to learn how French fries are made."Weird Al" Yankovic guest stars.', 70437, 5, 1277164, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277165, 'Where Does Rain Come From?', 'The StoryBots visit an amusement park in the sky to learn where rain comes from. Tim Meadows and Chris Parnell guest star as a pair of silly reindeer.', 70437, 6, 1277165, 85524, '2016-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557271, 'How Do Computers Work?', 'The StoryBots climb inside a computer to learn about input, output and processing. Snoop Dogg guest-stars as a tech-savvy operating system.', 70437, 1, 1557271, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557272, 'Why Can''t I Eat Dessert All the Time?', 'A piece of broccoli and a rebellious cupcake teach the StoryBots about proper nutrition. Christina Applegate guest-stars as a bakery owner.', 70437, 2, 1557272, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557273, 'How Many Types of Animals Are There?', 'The StoryBots take on an awfully big task: counting every kind of animal there is. Kristen Schaal guest-stars as a biologist.', 70437, 3, 1557273, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557274, 'How Do Ears Hear?', 'A talking boombox turns it up to show the StoryBots how ears help us hear. Ali Wong guest-stars as an all-knowing brain.', 70437, 4, 1557274, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557275, 'How Do Volcanoes Work?', 'The StoryBots help the lead of a subterranean musical deal with the pressures of fame. David Koechner guest-stars as a pirate.', 70437, 5, 1557275, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557276, 'What Is Electricity?', 'To find out where electricity comes from, the StoryBots go straight to the source. Edward Norton guest-stars as an electronics salesman.', 70437, 6, 1557276, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557277, 'How Do Flowers Grow?', 'The StoryBots get a bug''s-eye view of a flower''s journey, from seed to bloom. David Cross guest-stars as Bang''s free-spirited pal.', 70437, 7, 1557277, 108344, '2018-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557278, 'How Do People Catch a Cold?', 'The StoryBots travel to the Land of the Lymph to learn how a cold virus spreads. Wanda Sykes guest-stars as a doctor with the sniffles.', 70437, 8, 1557278, 108344, '2018-08-24');
