INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1490334, 'Vanish', 'St. Louis Chronicle reporter Camille Preaker returns to her rural hometown of Wind Gap, Mo., to file a story about two missing girls, one of whom was found dead and presumed murdered. The assignment, which reunites Camille with her overbearing mother, Adora, brings back traumatic childhood memories, including the death of her younger sister, Marian, when both were schoolgirls.', 70453, 1, 1490334, 85560, '2018-07-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1502541, 'Dirt', 'Camille searches for clues at the funeral and wake for Wind Gap''s latest victim, and clashes with her mother about Camille''s presence in the town. Richard finds a surprising way to arrive at a conclusion about the murderer''s profile. Camille pays a visit to the working-class home of a young boy who says he witnessed the abduction, and confronts Chief Vickery.', 70453, 2, 1502541, 85560, '2018-07-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507015, 'Fix', 'Camille relives a recent tragedy as she struggles to piece together the murders in Wind Gap. Richard grows frustrated with Chief Vickery''s assumptions regarding potential suspects. A defiant Amma shows off her wild side to Camille, but Adora admonishes Camille for meddling in the investigation and a town in mourning.', 70453, 3, 1507015, 85560, '2018-07-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1511240, 'Ripe', 'Camille agrees to show Richard some of Wind Gap’s crime scenes, though the tour opens up old wounds. Alan confronts Adora about her sharing confidences with Chief Vickery, who is concerned about the Crellins hosting the annual "Calhoun Day" attended by Wind Gap''s youth. Fired from his job at Preaker Farms, John shares off-the-record revelations with Camille that raise fresh concerns for her.', 70453, 4, 1511240, 85560, '2018-07-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512981, 'Closer', 'Despite a potential serial killer on the loose in the community, Wind Gap residents gather for Calhoun Day, an annual southern-pride festival hosted by Adora on the grounds of her house. As Amma and her friends act out a traditional play depicting the sacrifices made by the wife of a Confederate soldier, Adora shares confidences with Richard that may impact his relationship with Camille.', 70453, 5, 1512981, 85560, '2018-08-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1517276, 'Cherry', 'Adora provides Chief Vickery with a key piece of evidence in the Ann Nash murder case. Richard probes for details about Camille’s dark past. John’s girlfriend, Ashley, looks to make news for herself. Amma bonds with Camille during and after a wild party.', 70453, 6, 1517276, 85560, '2018-08-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1517278, 'Falling', 'Camille crosses a line in her investigation of the prime suspect. Richard coaxes Jackie to offer up info about Marian Preaker’s death. Adora takes pains to keep an ailing Amma under her roof and in her care.', 70453, 7, 1517278, 85560, '2018-08-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1526154, 'Milk', 'Concerned for the safety of Amma, Camille puts her own life in jeopardy as she gets closer to the truth behind the shocking mysteries surrounding the Wind Gap killings.', 70453, 8, 1526154, 85560, '2018-08-26');
