INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277237, 'Out of Eden', '', 70456, 1, 1277237, 85563, '2005-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277238, 'Conquest', '', 70456, 2, 1277238, 85563, '2005-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277239, 'Tropics', '', 70456, 3, 1277239, 85563, '2005-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277274, 'The Libido', 'When we talk about libido, it?s often described as an impulse linked to our hormones. But how does it really work? Lili meets with Normand Voyer, a professor of organic chemistry at Laval University, to concoct a love potion. What is the connection between our thoughts and what happens physically when it comes to sex and desire? A psychotherapist guides us towards the answer to this question, as Lily gently explores the world of sex addicts, asexuals, and the polyamorous.', 70460, 1, 1277274, 85568, '2016-01-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785977, 'The Orgasm', 'When it comes to the orgasm, we know it feels good as soon as we have one. But we can?t explain why it feels so good. In this episode, Lili meets with a renowned professor of neuroscience and psychology at Concordia University, who has been studying this subject for years with lab rats. She also works with a sex coach to find the G-spot, and meets with a tantric sex teacher and her students.', 70460, 2, 1785977, 85568, '2016-01-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785978, 'Masturbation', 'Masturbation has many benefits. It reduces stress, promotes sleep, and calms migraines and menstrual pain. Masturbation stimulates the heart rate as much as a brisk walk. Lili meets with three Montreal girls who are exploring masturbation with their website and magazine devoted to the subject, Magic Caresses. Everybody does it, but the where and the how are unique to everyone - and Lili helps reveal the mystery.', 70460, 3, 1785978, 85568, '2016-02-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785979, 'The Vulva', 'The vulva has a way of making people uncomfortable. Just saying the word makes some people uncomfortable. We can talk about breasts and the vagina no problem, so what is it about the vulva? Lili explores the vulva in all its glory by making an appointment with her gynaecologist. What better way to interview than lying on a doctor?s table? She also meets with a transsexual to talk about vaginoplasty, and with a porn actress to better understand the phenomenon of female ejaculation.', 70460, 4, 1785979, 85568, '2016-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281594, 'Episode 50', '', 70583, 50, 1281594, 85893, '2016-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281595, 'Episode 51', '', 70583, 51, 1281595, 85893, '2016-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785980, 'Fetishism', 'Is fetishism a sexual perversion? Are we all a little fetishist to some degree or another? In this episode, we take you by the hand and immerse you in this little-known universe laced with misconceptions. Lili meets with neuropsychologist Christian Joyal, who conducted a study on the subject for the prestigious Journal of Sexual Medicine. To test the theory, Lili visits a daycare for adults, observes rats dressed in tiny lab coats, and meets with a couple that likes to play with ropes. Don’t worry; it’s all done with love!', 70460, 5, 1785980, 85568, '2016-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785981, 'The Penis', 'Is there such a thing as the perfect penis? Lili launches her investigation by meeting with biologists to talk about the penis in mammals and insects. Penis size and performance are common obsessions among men. We talk about the Quebec porn actor with the biggest penis in the sex industry. And to complete her tour of man’s most precious organ, Lili meets with a pro-foreskin activist.', 70460, 6, 1785981, 85568, '2016-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785982, 'The Ass', 'Has the butt become the new sexual Mecca? With more and more people enhancing their derrieres, (thank you, Kim Kardashian!), the ass has become society’s number one sexual asset. Among the most popular plastic surgeries of our time, the famous Brazilian butt lift is now practiced well beyond the borders of Latin America. And how about those belfies (a.k.a. butt selfies) that get hundreds of thousands of hits on social media? As she explores the growing craze for this popular part of our anatomy, Lili also meets with therapist and speaker Carlyle Jansen to demystify the practice of anal sex, considers the risks of sodomy with gastroenterologist Michael Bensoussan, and debunks the myth that all homosexuals are into anal.', 70460, 1, 1785982, 123863, '2017-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785983, 'STDs', 'In the age of social media and online hook-ups, are STDs making a comeback? There’s been an upsurge in cases of chlamydia, gonorrhoea and syphilis in recent times. Lili tackles the problem with sexologist Sarah-Mathieu Chartier, co-author of the most recent study on the sexual health of young people in Quebec. And what does it mean to live with an STD today? Guy Leduc, founder of the website ITSRencontres.com, who himself has contracted herpes, weighs in. We can all agree that more needs to be done to spread the STD message, and that we need to reinvent our preventative strategies. Could mobile apps and video games be the answer in 2016?', 70460, 2, 1785983, 123863, '2017-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785984, 'Breasts', 'Are breasts synonymous with sex? Have they always played such an important role in our culture? Lili meets with historian Evelyne Ferron, a specialist in the history of breasts throughout the ages. She also talks to 23-year-pld Instagram sensation Kristyna Martelli, who boasts a 32JJ cup size (the result of six surgeries) and makes a living from her ample bosom. Never one to shy away from misconceptions, Lili takes the opportunity to explore the bra … how many women will she convince to take theirs off?', 70460, 3, 1785984, 123863, '2017-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785985, 'Performance', 'According to a recent study, sexual performance is one of the biggest concerns among us. But most of the time, these worries are unfounded, based on a completely biased view of what a “normal” sexual relationship should be. Lili takes stock of the myths and facts surrounding sexual performance.', 70460, 4, 1785985, 123863, '2017-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785986, 'Masculine Pleasure', 'Do men exploit the full sexual potential of their bodies? Beyond the precious penis, are they aware that there is more than one path that leads to orgasm? Lili invites men to discover their bodies by introducing them to sex toys for men and their multiple erogenous zones, the P-spot and the mysterious prostatic orgasm. She explores the subject with sexologist Vincent Quesnel, sexual therapist Carlyle Jansen, and David Francis-Cassidy, founder of Montreal’s Temple Priapus.', 70460, 5, 1785986, 123863, '2017-02-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785987, 'Domination', 'Is the act of sex another power game brought to the bedroom? Is there always one dominant partner in the relationship? And when a couple voluntarily introduces power games into the bedroom, is it possible to explore aggression without abuse? Lili seeks answers to these questions with, among others, well-known psychologist Meredith Chivers, neuropsychologist Christian Joyal, sexology researcher and author of the BDSM book The Rules of the Game, Jessica Caruso, and a professional dominatrix. Sexual domination: healthy fun or a dangerous game?', 70460, 6, 1785987, 123863, '2017-03-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785988, 'Menopause | Andropause', 'Is it possible to have a sex life after menopause and andropause? Menopause has been well documented for years. But what about andropause, the inevitable loss of libido that occurs after the age of 50, which we’ve only been talking about for the past 15 years? Can it be treated or is it a natural part of aging that we must learn to live with? Lili explores these questions with andropause specialist Luc Bessette. She also talks to Laurie Betito, psychologist, radio host and author of The Sex Bible for people over 50, and Valérie Gibson, the world’s first “cougar” and the official guide for women stepping out with younger men.', 70460, 7, 1785988, 123863, '2017-03-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785989, 'Porn', 'While porn is everywhere today, consumed frequently as a cultural product, is it still shameful to talk about? Lili explores the world of pornography without taboos, exploring its effects on the body and the mind with Eric Falardeau, a doctoral student in pornographic studies. She also talks with Magik, producer and designer of immersive porn, neuroscientist Jim Pfaus, and Mélody Kush, a popular Quebec webcam girl. Beyond the few minutes of pleasure it promises, is porn harmful or beneficial?', 70460, 8, 1785989, 123863, '2017-03-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785990, 'Abstinence', 'Where there is sex, there is inevitably the absence of it. Lili explores all things abstinence: what motivates it, the effects in can have on the body (blue balls, blue bean), the social and cultural pressures associated with it (hymen reconstruction), and puts it to the test herself. After a month of total abstinence, she shares her reflections.', 70460, 9, 1785990, 123863, '2017-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785991, 'Bisexuality', 'Is bisexuality just a matter of opportunism? Do we all have a little bisexual in us? Is our sexual orientation genetic? Lili unravels the answers with the help of psychologist Meredith Chivers, who has explored the question “Are women naturally bisexual?” and meets with sexologist and researcher Jessica Caruse, who has been thinking about the distinction between sexual orientation and social trends.', 70460, 10, 1785991, 123863, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785992, 'The Mouth', 'The mouth fulfills many functions, some of which are vital to our existence, but it is also used for kissing and making love. Lili meets with doctor Tareck Ayad to understand this complex organ. She continues her quest for knowledge with French writer and essayist Alexandre Lacroix, who shares his views on kissing, and with Nicholas Charbonneaux, actor and stage director, who helps Lili as she tries to discover her sexy voice.', 70460, 1, 1785992, 123864, '2018-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785993, 'Monogamy', 'Is it today’s culture that makes monogamy such a difficult concept? Or is monogamy simply a social experiment gone wrong? Lili meets with Luc-Alain Giraldeau, a behavioural ecologist and Dean of Science at UQAM, along with Chiara Piazzesi, a sociologist at the UQAM Institute for Research and Feminist Studies. After exploring the theory, Lili goes into the field to discover the fascinating world of unicorns—men and women devoted to helping couples spice up their sex lives.', 70460, 2, 1785993, 123864, '2018-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879531, 'Hot Tub Club', 'On a day off, Sam teaches Ruth how to gamble, Bash struggles to take care of an ailing Rhonda, and Arthie and Yolanda face an intimate dilemma.', 70573, 2, 1879531, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785994, 'Sex and Tech', 'From dating apps and virtual reality to the imminent arrival of robots and connected toys, technology plays a key role in our new sexual reality. Lili heads to France to visit a workshop that makes sex dolls. She speaks with Kathleen Richardson, Professor of Robot Ethics. She also meets a Transhumanist, Yannick Roy, who defends the idea that we all have the right to modify our own bodies by integrating electronic components.', 70460, 3, 1785994, 123864, '2018-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785995, 'Skin and Sex', 'It’s curious that in terms of sexuality, we often talk about erogenous zones like the breasts and butt, but we rarely talk about the largest erogenous zone of all: our epidermis. Lili meets with a woman who lost her sight, for whom touch has become a way of interacting with men. She also talks to rejuvenation specialist and massage therapist Melanie Massouty, who helps people that have been sexually abused rediscover their sense of touch.', 70460, 4, 1785995, 123864, '2018-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785996, 'Fertility', 'In a time when fertility is declining, is it possible that we will all need help procreating in the near future? Lili interviews leading specialists including William Buckett of the Reproductive Centre at McGill University. She also tests the sperm of one of our team members, meets with a surrogate mother in Mexico, and talks with Véronick Raymond about her many attempts to conceive.', 70460, 5, 1785996, 123864, '2018-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1785997, 'Body Hair', 'There is nothing more natural than body hair … but us humans don’t always strive for natural! One thing for sure is that our relationship with body hair changes with the times and trends, and shaving and waxing have been common practices since the dawn of time. Lili meets with Maipoils founder Pamela Dumont and history teacher Laurent Turcot. She also talks with a bearded woman, a furry and a bear to discuss their relationship with the fuzz.', 70460, 6, 1785997, 123864, '2018-03-09');
