INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1277718, 'Maze 1: Emu, is dead?', 'Emu Hōjō, the alter-ego of Kamen Rider Ex-Aid, wakes up and finds himself locked in a mysterious room. Suddenly, five people appear before him. These five people are previous Kamen Riders were supposed to have died or disappeared. Someone has resurrected the Riders as part of a trap!', 70476, 1, 1277718, 85604, '2017-03-25');
