INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1398421, 'Episode 1', 'In 43 AD, a nation is rocked by the arrival of an Empire.', 70484, 1, 1398421, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420301, 'Episode 2', 'Having marked Rome''s arrival with blood, Aulus sends envoys to parlay with the tribes of Britannia, while also looking to learn more about the Druids.', 70484, 2, 1420301, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420302, 'Episode 3', 'Aulus is reborn, but his destiny remains unclear. Cait is able to locate her father, but she can''t free him from the Roman camp alone.', 70484, 3, 1420302, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420303, 'Episode 4', 'King Pellanor disowns Kerra and leaves her life in the hands of the Druids. But the gods'' judgement is not what he expected.', 70484, 4, 1420303, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420304, 'Episode 5', 'The gods have spoken, but Kerra must decide if she will accept their ruling. Antedia seals an alliance with Rome - on one condition.', 70484, 5, 1420304, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420306, 'Episode 6', 'After their long ordeal, Cait and her father finally arrive at the safety of the Cantii citadel, but a demon is on her trail.', 70484, 6, 1420306, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420307, 'Episode 7', 'Cait and her father seek shelter in the ruins of their old home, where she is visited by someone she never expected to see again.', 70484, 7, 1420307, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420305, 'Episode 8', 'The battle of wills between Kerra and Antedia intensifies, as the Regni play their trump card. Aulus enlists deadly exiles to find Cait.', 70484, 8, 1420305, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1420308, 'Episode 9', 'The end appears to be close for the Cantii, and Aulus unveils how the Roman Empire truly conducts business.', 70484, 9, 1420308, 85627, '2018-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278125, 'Pilot', 'Two years after retiring, former homicide detective Bill Hodges is still haunted by his last case. When the demented culprit begins to torment Hodges, he embarks on a crusade to bring the killer to justice.', 70485, 1, 1278125, 85628, '2017-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1341866, 'On Your Mark', 'As Hodges struggles to maintain his sanity, both Pete and Ida take notice. Deborah worries about Brady, who gives her a window into his latest work. Hodges connects with Olivia Trelawney''s sister Janey, who hires him as a private detective.', 70485, 2, 1341866, 85628, '2017-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344730, 'Cloudy, With a Chance of Mayhem', 'Hodges and Janey dig deeper into the circumstances surrounding Olivia''s death. Hodges uses Debbie''s Blue Umbrella to turns the tables on Brady. Jerome''s father intervenes in his relationship with Hodges.', 70485, 3, 1344730, 85628, '2017-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344731, 'Gods Who Fall', 'Ida is hurt as Hodges and Janey''s relationship intensifies. Lou is disturbed by an interaction with a customer. Deborah takes Brady to the cemetery and the two reflect on their difficult past.', 70485, 4, 1344731, 85628, '2017-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344732, 'The Suicide Hour', 'The cat and mouse game between Hodges and Brady escalates. Hodges has an upsetting conversation with Janey''s mother. Deborah''s drinking almost causes an accident at the Hartsfield home.', 70485, 5, 1344732, 85628, '2017-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344733, 'People in the Rain', 'Hodges struggles with the past as it concerns his daughter, Allie. As Deb attempts to make a change for the better, Brady interferes. Robi continues pressuring Brady to impress their bosses. Hodges connects with Janey''s niece, Holly.', 70485, 6, 1344733, 85628, '2017-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344734, 'Willow Lake', 'As Hodges helps Janey through a difficult time, their connection deepens. Realizing he still needs their help, Hodges brings Jerome and Holly back into the investigation. Deborah confronts Brady with her concerns.', 70485, 7, 1344734, 85628, '2017-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344735, 'From the Ashes', 'A critical error puts Brady in the center of a crisis of his own making. Holly and Jerome make a pivotal discovery. After a tragedy sends Hodges reeling, he goes to visit his daughter, Allie.', 70485, 8, 1344735, 85628, '2017-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344736, 'Ice Cream, You Scream, We All Scream', 'Jerome and Holly tell Hodges their concerns about the Mercedes Killer. Tensions continue to escalate between Brady and Robi. As details about the investigation emerge, Hodges, Pete, and Izzy close in on their suspect.', 70485, 9, 1344736, 85628, '2017-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1344737, 'Jibber-Jibber Chicken Dinner', 'When another murder victim is discovered, suspicions about Brady are confirmed. As the police prepare for another massacre, Hodges fears for the safety of those he loves.', 70485, 10, 1344737, 85628, '2017-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1493083, 'Missed You', 'With Brady hospitalized, Hodges and Holly rebuild, opening private investigative agency Finders Keepers. Brady''s care falls to Dr. Babineau, an ambitious neurosurgeon, with input from his brilliant wife, Cora.', 70485, 1, 1493083, 104044, '2018-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557495, 'Let''s Go Roaming', 'Hodges struggles with his cases at Finders Keepers, putting him at odds with a concerned Holly. Sadie senses a shift in Brady''s medical state and informs Dr. Babineau. Jerome arrives home from Harvard for the summer.', 70485, 2, 1557495, 104044, '2018-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557496, 'You Can Go Home Now', 'Brady welcomes a visitor from his past. Sensing Holly''s growing frustration, Hodges includes her in his unofficial investigation. Cora continues to apply pressure to Babineau.', 70485, 3, 1557496, 104044, '2018-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557497, 'Motherboard', 'Hodges is rattled by the unexpected death of a hospital staff member. Jerome offers much needed help in Hodges’s quest to uncover the truth. Brady works to master the limitations of his newfound ability. Already struggling to cope, Lou suffers additional setbacks.', 70485, 4, 1557497, 104044, '2018-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557498, 'Ándale', 'Eager to prosecute Brady, Montez turns up the heat on Dr. Babineau. Holly feels betrayed when Hodges’ meddling threatens the future of Finders Keepers. When violence hits close to home, Montez seeks help from Hodges.', 70485, 5, 1557498, 104044, '2018-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557499, 'Proximity', 'When a visit from Lou elicits an unprecedented response from Brady, Dr. Babineau pushes him to communicate. Holly begins to come around to Hodges’ thinking about Brady. Armed with new intel, Hodges reaches out to Babineau and Cora.', 70485, 6, 1557499, 104044, '2018-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557500, 'Fell on Black Days', 'Hodges and Donna look toward a new future; Jerome contemplates his place in the world; under pressure from Cora and Vitalta, Babineau performs brain surgery on Brady; Montez and Hodges effort to get Brady transferred out of Mercy General.', 70485, 7, 1557500, 104044, '2018-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557501, 'Nobody Puts Brady in a Crestmore', 'After Hodges suffers an attack, Ida, Holly, and Jerome rally around him, but Donna is reminded of her deepest fears. As support of Babineau''s treatment methods dwindle, Babineau goes over Montez''s head.', 70485, 8, 1557501, 104044, '2018-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557502, 'Walk Like a Man', 'Babineau divulges the details of Brady''s treatment, confirming Hodges'' worst fears. As news about Brady spreads, Hodges faces intense scrutiny, and Babineau and Cora find themselves in jeopardy.', 70485, 9, 1557502, 104044, '2018-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1557503, 'Fade to Blue', 'The community reels from recent news about Brady, and the Mercedes Killer''s future lands in the hands of the few people who have survived him.', 70485, 10, 1557503, 104044, '2018-10-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1891667, 'No Good Deed', 'The murder of iconic local author John Rothstein devastates Hodges. When unpublished works of Rothstein''s are suspected to be stolen from his home, Hodges launches an investigation.', 70485, 1, 1891667, 130096, '2019-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1926348, 'Madness', 'As she is evaluated for mental competency, Lou continues to be haunted by Brady. Morris and Alma hatch a plan to recover their spoils.', 70485, 2, 1926348, 130096, '2019-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1940754, 'Love Lost', '', 70485, 3, 1940754, 130096, '2019-09-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1940755, 'Trial and Terror', 'Alma and Morris zero in on a suspect. Jerome continues to make strides in the Rothstein case. Hodges shares his guilt over Lou''s current situation with Ida. Lou''s trial officially begins, and she has some suggestions for Finkelstein.', 70485, 4, 1940755, 130096, '2019-10-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1940756, 'Episode 5', '', 70485, 5, 1940756, 130096, '2019-10-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278271, 'Bunsen Is a Beast!', 'Bunsen attends his first day of human middle school in hopes of proving that beasts and humans can happily co-exist.', 70491, 1, 1278271, 85642, '2017-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278272, 'Body and the Beast', 'Bunsen literally loses his head on picture day and Mikey has to help him find it before picture time.', 70491, 2, 1278272, 85642, '2017-02-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278267, 'Hide and Go Freak', 'Amanda disguises herself as a beast to trick Bunsen, and they play "Hide and Go Freak" together.', 70491, 3, 1278267, 85642, '2017-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278270, 'Bunsen Screams for Ice Cream', 'Amanda tries to get Bunsen expelled by using an ice cream truck to lure him out of school.', 70491, 4, 1278270, 85642, '2017-01-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278273, 'Bearly Acceptable Behavior', 'Amanda tries to get Bunsen kicked out of school when he brings a dangerous bear to class.', 70491, 5, 1278273, 85642, '2017-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278274, 'Beast Busters', 'Bunsen and Mikey must save Amanda from mischievous sneeze beasts that escape from Bunsen''s nose.', 70491, 6, 1278274, 85642, '2017-02-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278275, 'Spelling Beast', 'Bunsen proves bees are the best spellers when he turns into one and wins the spelling bee.', 70491, 7, 1278275, 85642, '2017-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278276, 'Mikey Is a Beast', 'An MMA fighter picks Bunsen to be his new mascot, so Mikey tries to prove that he is a beast too.', 70491, 8, 1278276, 85642, '2017-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278277, 'Fright at the Museum', 'After discovering Bunsen''s uncle in a museum, Bunsen and Mikey try to sneak him out before Amanda catches them.', 70491, 9, 1278277, 85642, '2017-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278278, 'Handsome Beast', 'After Bunsen sprays himself with fancy body spray, he transforms into a hunk and becomes Amanda''s desire.', 70491, 10, 1278278, 85642, '2017-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278279, 'Tooth or Consequences', 'Mikey explains that Bunsen will be richer than Amanda after the tooth fairy leaves him money for all the teeth he loses during teeth losing season, so Amanda vows to catch the tooth fairy.', 70491, 11, 1278279, 85642, '2017-02-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278280, 'Beast of Friends', 'Bunsen is excited to take Mikey to Dimmsdale to meet Cosmo on Friend-iversary, but trouble arises when Amanda secretly follows them and teams up with Mr. Crocker.', 70491, 12, 1278280, 85642, '2017-03-04');
