INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278492, 'Episode 1', 'After newlywed Georgina''s billionaire husband Constantine is killed in a yacht explosion, she is shocked to discover the fortune and lifestyle he maintained was surrounded by violence, lies and murder. She soon must step out of her comfort zone to protect the family...and herself.', 70496, 1, 1278492, 85658, '2017-06-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327496, 'Episode 2', 'Georgina is informed that Constantine''s dealings are under investigation by Interpol, while Irina makes a deal with a prominent figure in the Riviera underworld.', 70496, 2, 1327496, 85658, '2017-06-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327497, 'Episode 3', 'Georgina searches for answers by reviewing Constantine''s movements on the day of the explosion. Christos''s hedonistic behaviour spirals out of control.', 70496, 3, 1327497, 85658, '2017-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327498, 'Episode 4', 'Following her discovery in the safe room, Georgina attempts to track down her husband''s elusive art collector. Delormes finds a way to bring Negrescu to justice.', 70496, 4, 1327498, 85658, '2017-07-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327499, 'Episode 5', 'A frustrated Georgina uses the Clios Foundation''s lavish gala as an opportunity to pin down a person of interest, but the party receives an uninvited guest.', 70496, 5, 1327499, 85658, '2017-07-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327500, 'Episode 6', 'The Clios family are questioned by police after the events of the gala. Meanwhile, Delormes uncovers wreckage from the yacht that may change everything.', 70496, 6, 1327500, 85658, '2017-07-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327501, 'Episode 7', 'With Interpol''s net closing in on Georgina, she and Carver set out to close the investigation once and for all. Irina reveals a family secret to Negrescu.', 70496, 7, 1327501, 85658, '2017-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327502, 'Episode 8', 'Georgina must join forces with an unlikely ally when she receives a threat from a stranger. Christos''s rehab goes well, but a new relationship put him in danger.', 70496, 8, 1327502, 85658, '2017-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327503, 'Episode 9', 'To keep her family safe, Georgina crosses a line she can never return from. Delormes uncovers the identity of his opponent and attempts to take them down.', 70496, 9, 1327503, 85658, '2017-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327504, 'Episode 10', 'In the face of tragedy, Georgina resolves to free her family from danger and faces her opponents head-on. Series finale.', 70496, 10, 1327504, 85658, '2017-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1707417, 'Episode 1', 'After a member of the Clios family goes missing, Georgina makes a turbulent return to the Riviera, only to find a sinister message awaits.', 70496, 1, 1707417, 118848, '2019-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796098, 'Episode 2', 'Georgina is desperate to get her life back on track, but a friend''s murder brings the police to her door. Meanwhile, a familiar face returns to the Riviera.', 70496, 2, 1796098, 118848, '2019-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796099, 'Episode 3', 'A suspicious Irina calls in for help help in the search for Adam. In America, Georgina''s uncle helps her unravel her family''s mysterious downfall.', 70496, 3, 1796099, 118848, '2019-05-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796097, 'Episode 4', 'A heated conversation between Irina and Georgina threatens to change the future of the Clios family as Irina edges closer to discovering the truth about Adam.', 70496, 4, 1796097, 118848, '2019-06-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796101, 'Episode 5', 'Georgina''s search for Noah''s lost painting leads her to shocking realisation. Meanwhile, Adriana and Nico Eltham get closer, despite Christos''s warnings.', 70496, 5, 1796101, 118848, '2019-06-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796107, 'Episode 6', 'Georgina horrifies Jeff when she confesses her darkest truth. Cassandra''s explosive secret gets out, and a familiar face calls brings Georgina to the fort.', 70496, 6, 1796107, 118848, '2019-06-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796102, 'Episode 7', 'Nico drops a bombshell as he sets his sights on the Clios empire. Meanwhile, Georgina learns that Noah isn''t all he seems.', 70496, 7, 1796102, 118848, '2019-06-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796103, 'Episode 8', 'Georgina is forced to reveal a dark and difficult truth as she tries to protect the empire from Nico. In the resulting chaos, she resorts to desperate measures.', 70496, 8, 1796103, 118848, '2019-07-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796104, 'Episode 9', 'Things take a horrifying turn after Georgina learns some surprising news about Nico. The pressure gets to Irina, and Jeff''s loyalty is pushed to the limit.', 70496, 9, 1796104, 118848, '2019-07-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1796105, 'Episode 10', 'rina''s fate forces Georgina to face up to the damage she''s inflicted on the family. Elsewhere, Christos starts to piece together her lies. Series finale.', 70496, 10, 1796105, 118848, '2019-07-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278828, 'The Mission Begins', 'As World War II begins, five of Hollywood''s top directors leave success and homes behind to join the armed forces and make films for the war effort.', 70508, 1, 1278828, 85677, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278829, 'Combat Zones', 'Now in active service, each director learns his cinematic vision isn''t always attainable within government bureaucracy and the variables of war.', 70508, 2, 1278829, 85677, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278830, 'The Price of Victory', 'At the war''s end, the five come back to Hollywood to re-establish their careers, but what they''ve seen will haunt and change them forever.', 70508, 3, 1278830, 85677, '2017-03-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278934, 'Pilot', 'When MIT grad student Liam Cole discovers an asteroid is set to collide with Earth in 186 days, he joins forces with tech billionaire Darius Tanz and the U.S. government to try and stop it – and together they stumble onto the greatest conspiracy never told.', 70513, 1, 1278934, 85684, '2017-07-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1318080, 'Another Trip Around the Sun', 'Darius and Liam work to invent a theoretically impossible piece of technology to divert the asteroid, and Grace risks everything to help Darius. Also, Liam heads home to Boston to track down critical research, but finds something shocking instead.', 70513, 2, 1318080, 85684, '2017-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1337403, 'Truth or Darius', 'It’s a race against time as Darius must accelerate his plan to stop the asteroid before the Pentagon shuts him down. Also, Grace has to make difficult decisions that could have life or death consequences for millions of people, and Liam and Jillian reunite under surprising circumstances.', 70513, 3, 1337403, 85684, '2017-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1337404, 'The Human Strain', 'In order to prove to Harris and Grace that he’s not a traitor, Darius must reveal one of his most closely guarded secrets. Also, Liam helps Jillian adjust to her new job at Tanz.', 70513, 4, 1337404, 85684, '2017-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1337406, 'Keeping the Faith', 'While Darius works to discover who killed his friend Lazlo, he is forced to reckon with his past, and Liam discovers who’s been selling secrets to the Russians.', 70513, 5, 1337406, 85684, '2017-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1338280, 'Chip Off the Ol’ Block', 'Darius recruits Grace, Harris and Liam for a dangerous mission, and Jillian confronts Liam about his secret.', 70513, 6, 1338280, 85684, '2017-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1342804, 'Seeing Red', 'Grace and Darius slip off to Russia behind Harris’ back in an attempt to stop a potential nuclear conflict. Also, Liam seeks solace with Amanda.', 70513, 7, 1342804, 85684, '2017-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1342806, 'From Russia, With Love', 'Framed for murder, Darius and Grace must try to escape from Russia, and Liam tries to convince Jillian to come back to Tanz.', 70513, 8, 1342806, 85684, '2017-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1351432, 'Patriot Games', 'Grace narrowly escapes a deadly assassin and Darius and Liam forge unlikely alliances.', 70513, 9, 1351432, 85684, '2017-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1352036, 'Coup de Grace', 'Grace and Darius seek answers from the President and Harris discovers deadly secrets.', 70513, 10, 1352036, 85684, '2017-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1353930, 'All In', 'Grace and Harris must forge an alliance when their children’s lives are in jeopardy. Also, Liam presents Jillian with an unusual proposal.', 70513, 11, 1353930, 85684, '2017-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1355352, 'The Wormwood Prophecy', 'Darius, Grace and Harris join forces to prove the president was murdered. Also, Grace tells Zoe the truth.', 70513, 12, 1355352, 85684, '2017-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1359727, 'The Plot Against America', 'Harris, Grace and Darius must topple the illegitimate government, and Darius makes final plans for the ark.', 70513, 13, 1359727, 85684, '2017-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879532, 'Desert Pollen', 'Fed up with the ladies'' sloppy performances and lack of training, Cherry takes them to a showgirl dance class, which stokes Debbie''s insecurities.', 70573, 3, 1879532, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1494487, 'Fall Out', 'After a nuclear incident, the secret of the asteroid becomes public, setting the world on a dangerous course. Darius, Grace, Liam and Harris must adapt to new roles in an ever-shifting landscape of fear and civil unrest.', 70513, 1, 1494487, 104194, '2018-06-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1507690, 'Detente', 'Darius and Grace must forge an emotional détente to get international cooperation. Liam meets a new scientist who has a mysterious past.', 70513, 2, 1507690, 104194, '2018-07-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1517751, 'Crimes and Punishment', 'Grace is asked to lie under oath. Darius tasks Liam with a dangerous mission. A shocking act of violence plunges the nation into chaos.', 70513, 3, 1517751, 104194, '2018-07-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1518605, 'Indivisible', 'Grace embarks on a dangerous mission, and Liam and Darius’ relationship is tested.', 70513, 4, 1518605, 104194, '2018-07-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1526910, 'White House Down', 'Grace forges a dangerous alliance with Claire’s brother, Alonzo. Also, Harris and Darius must work together to face down Bennett’s forces', 70513, 5, 1526910, 104194, '2018-07-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1526911, 'Let the Chips Fall', 'Darius and Grace’s relationship is tested, and President Mackenzie attempts to bring the fractured country together while the hacktivist group ReSyst issues a deadly edict.', 70513, 6, 1526911, 104194, '2018-07-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1532210, 'The Madness of King Tanz', 'Darius vows revenge on the hacktivist group ReSyst, no matter what the cost. Also, Harris discovers a dark secret and Grace reveals one of her own.', 70513, 7, 1532210, 104194, '2018-08-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1540626, 'Abre Sus Ojos', 'Desperate to defuse a nuclear standoff, Liam receives help from an unlikely source. Also, with Darius missing, Harris and Grace take matters into their own hands.', 70513, 8, 1540626, 104194, '2018-08-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1540627, 'The Manchurian Candidate', 'Darius, Grace and Harris uncover the darkest secret yet, and Liam reconnects with Jillian.', 70513, 9, 1540627, 104194, '2018-08-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1540628, 'Prisoners', 'Darius forms a dangerous alliance in order to destroy the dark money forces of Q17. Also, Grace takes action when surprising news jolts her world.', 70513, 10, 1540628, 104194, '2018-08-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1562912, 'Celebration Day', 'A stand-off at the COPE compound leads to tragic results', 70513, 11, 1562912, 104194, '2018-09-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1562913, 'Hail Marry', 'The government’s final plans for a doomsday scenario set in motion a surprising chain of events for Grace, Darius and Harris.', 70513, 12, 1562913, 104194, '2018-09-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1562914, 'Get Ready', 'One last mystery holds the key to saving the world, and Grace must choose how she spends her final days.', 70513, 13, 1562914, 104194, '2018-09-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278966, 'Episode 1', 'Ellen hires Paula as her maternity cover and soon fears she has made a terrible mistake.', 70514, 1, 1278966, 85686, '2017-02-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278967, 'Episode 2', 'Ellen goes back to work in order to prove Paula has committed a crime.', 70514, 2, 1278967, 85686, '2017-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278968, 'Episode 3', 'Ellen believes she finally has proof that Paula is disturbed.', 70514, 3, 1278968, 85686, '2017-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1278971, 'Ten Candidates, One Partner', 'Ten candidates arrive in Chicago to compete for a position working alongside Marcus Lemonis and a stake in his multimillion-dollar company.', 70515, 1, 1278971, 85688, '2017-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1287878, 'What''s Your Story?', 'Marcus challenges candidates to create a marketing campaign to show who they are as a brand and to make a complex investment assessment.', 70515, 2, 1287878, 85688, '2017-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290840, 'Tripwires & Trapdoors', 'Marcus gives the candidates their most difficult task yet: teamwork! Their leadership, salesmanship, and communication skills are put to the test during two group challenges. But as pressure rises, the candidates begin to turn on each other.', 70515, 3, 1290840, 85688, '2017-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1297209, 'A Day in the Life of Marcus Lemonis', 'Marcus puts the candidates to work in his current Chicago stores, where they face real-life business challenges.', 70515, 4, 1297209, 85688, '2017-03-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1297210, 'People, Process, Product, Partner', 'Marcus chooses the final two candidates and gives them their most important challenge yet: walking a day in his shoes. The finalists are tasked with assessing a struggling local business and putting together an investment plan. Based on this information, Marcus will finally determine who The Partner will be.', 70515, 5, 1297210, 85688, '2017-04-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279457, 'Episode 1', '', 70525, 1, 1279457, 85714, '2014-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279458, 'Episode 2', '', 70525, 2, 1279458, 85714, '2014-08-17');
