INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279611, 'Shishi Red & Chameleon Green Chapter', 'Hammy is seen maintaining her Transformation Controller Seiza Blaster. Lucky arrives after having gone around Orion. He asks Hammy to teach him how to pose when doing the "Star Change" (transformation). Hammy agrees.', 70527, 1, 1279611, 85719, '2017-02-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279614, 'Tenbin Gold & Hebitsukai Silver Chapter', 'Balance and Naga Rei are enjoying the headquarters and they want to Star Change and have an idea to do the roll call together. Lucky walks in on them and he tries to judge their roll call.', 70527, 2, 1279614, 85719, '2017-02-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279615, 'Ookami Blue & Oushi Black Chapter', 'Champ and Garu have a training battle, that quickly escalates.', 70527, 3, 1279615, 85719, '2017-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281283, 'Washi Pink & Kajiki Yellow Chapter', 'Raptor and Spada have a bit of a problem with romance.', 70527, 4, 1281283, 85719, '2017-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1287094, 'Sasori Orange Chapter', 'Stinger is interrupted as he looks for one of Earth''s greatest secrets.', 70527, 5, 1287094, 85719, '2017-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290322, 'Pegasus Shishi Red Chapter', 'Lucky is having a bit of a problem taming the Pegasus Armor.', 70527, 6, 1290322, 85719, '2017-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1502146, 'Special Chapter', 'Shou Ronpo tries to show his transformation into Ryu Commander while new member Tsurugi Ohtori easily shows his transformation into Houou Soldier before Kotaro shows his transformation as Koguma Skyblue.', 70527, 7, 1502146, 85719, '2017-08-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279612, 'Episode 1', 'Se Ju is a popular writer who needs nothing but more time to write his novels that are recognized and loved by the public. Jeon Seol, the legendary girl being good at everything, is a big fan of Se Ju and she would give anything to meet with Se Ju. And one day, she is asked to deliver a mysterious box to Se Ju.', 70528, 1, 1279612, 85720, '2017-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279613, 'Episode 2', 'Jeon Seol subdues the intruder that tries to harm Se Ju. While grabbing the gun, she sees her past life. The police arrive and the stalker gets arrested. Apparently, the intruder is the culprit of another shooting incident. However, he suddenly commits suicide while being locked up in his prison cell. The public goes on a spree with rumors of how Se Ju’s writing is tightly connected with the crimes of the culprit.', 70528, 2, 1279613, 85720, '2017-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300193, 'Episode 3', 'Se Ju is unable to write anything while he’s in his slump. He almost gets himself killed in an accident. At the detrimental moment, Jeon Seol comes to help. She takes Se Ju to her father’s cabin. Se Ju keeps an eye out for any kind of danger and coincidently saves Seol from harm. Se Ju keeps on having weird dreams and Seol always appears in them.', 70528, 3, 1300193, 85720, '2017-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300194, 'Episode 4', 'Se Ju is confused as Jin Oh keeps following him and saying he is Se Ju’s ghost writer. Se Ju finally finds out that Seol has tried to be helpful while they get caught and reported as lovers. Jin Oh finds out that Se Ju was a ghost writer for Tae Min before. Se Ju finds out that there were encounters between Seol and Tae Min. He starts to feel a bit jealous.', 70528, 4, 1300194, 85720, '2017-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300195, 'Episode 5', 'Se Ju and Seol are highlighted by the media and public mistaken for having a relationship. Seol keeps on getting phone calls from Se Ju’s fans every day, who threaten her welfare. Still having the writer’s block, Se Ju is unable to write out any good quality episodes for his serial material. In the end, he decides to hold a conference to make an announce about his ghost writer.', 70528, 5, 1300195, 85720, '2017-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300196, 'Episode 6', 'Se Ju finally finds out Jin Oh is an actual ghost, and Jin Oh explains that he, Se Ju, and Seol were friends in the past. However, no one believes Se Ju sees Jin Oh, the ghost. Jin Oh tries to persuade Se Ju to finish the novel “Chicago Typewriter” together saying that the novel was actually written by Se Ju 80 years ago.', 70528, 6, 1300196, 85720, '2017-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300197, 'Episode 7', 'Se Jin rejects the idea of continuing with his writing, but gets concerned that it might ruin his career forever. Seol brings Gyun Woo to Tae Min, but Se Jin takes Gyun Woo away. Se Jin finally accepts the idea of writing with Jin Oh under one condition: Se Jin must keep men away from Seol.', 70528, 7, 1300197, 85720, '2017-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300198, 'Episode 8', 'Se Ju is torn between just pretending to like Seol or really having a feeling for her. The dilemma all starts because Jin Oh asks Se Ju to be around her to protect and care for her. Se Ju needs a story to write and Jin Oh wants to get closer to Seol. They end up writing a contract to settle their needs. Se Ju feels awkward because he does not know how to act around Seol and makes her upset by saying the wrong things.', 70528, 8, 1300198, 85720, '2017-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300199, 'Episode 9', 'Jin Oh gets amazed at how much Seoul has changed and asks Se Ju to go on a tour around the city. They bring Seol along with them. When Jin Oh sees that Seoul has finally gained the independence he longed for, he wishes to live his youth again in 2017. Meanwhile, Do Ha tells Tae Min that Se Ju has the original copy of “Fate”. Do Ha suggests Tae Min to start anew, but Tae Min refuses.', 70528, 9, 1300199, 85720, '2017-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300200, 'Episode 10', 'Jin Oh gets amazed at how much Seoul has changed and asks Se Ju to go on a tour around the city. They bring Seol along with them. When Jin Oh sees that Seoul has finally gained the independence he longed for, he wishes to live his youth again in 2017. Meanwhile, Do Ha tells Tae Min that Se Ju has the original copy of “Fate”. Do Ha suggests Tae Min to start anew, but Tae Min refuses.', 70528, 10, 1300200, 85720, '2017-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311592, 'Episode 11', 'Seol decides to leave Se Ju because she believes that they are ill-fated. However, Se Ju doesn’t let her go easily. Seol tells Tae Min that she can’t help with his work and Tae Min gets furious. Meanwhile, Se Ju gets invited by Ms. Hong to have dinner at her house. There, Se Ju meets Do Ha and tells him that he gave Tae Min the first draft of “Fate”.', 70528, 11, 1311592, 85720, '2017-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311593, 'Episode 12', 'Seol decides to leave Se Ju because she believes that they are ill-fated. However, Se Ju doesn’t let her go easily. Seol tells Tae Min that she can’t help with his work and Tae Min gets furious. Meanwhile, Se Ju gets invited by Ms. Hong to have dinner at her house. There, Se Ju meets Do Ha and tells him that he gave Tae Min the first draft of “Fate”.', 70528, 12, 1311593, 85720, '2017-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311594, 'Episode 13', 'Seol and Se Ju travel to the past and meet their past selves. After escaping the gunfight that broke out in Kyungsung, Seol and Se Ju find out that there is a secret agent hiding among Joseon Youth Alliance. Meanwhile, Sang Mi continues her plot against Seol, and Se Ju finds out that Sang Mi’s target is Seol, not him.', 70528, 13, 1311594, 85720, '2017-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311595, 'Episode 14', 'Seol’s first morning at Se Ju’s house turns into a fierce competition between Jin Oh and Se Ju. They try their best to win Seol’s heart. Meanwhile, Tae Min makes Sang Mi to lure Seol into her house and makes Seol a hostage. Se Ju runs to rescue Seol, but finds Tae Min waiting for him.', 70528, 14, 1311595, 85720, '2017-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311596, 'Episode 15', 'Su Hyeon is captured and tortured by Heo Young Min. When Jin Oh finds out that Su Hyeon had been captured, he decides to go and save her. However, Hui Young does not allow him to go. Meanwhile, Tae Min flees from the scene and leaves Se Ju injured. The police break into Jo Sang Mi’s house and finds Seol tied up to a chair.', 70528, 15, 1311596, 85720, '2017-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879533, 'Say Yes', 'Fed up with the ladies'' sloppy performances and lack of training, Cherry takes them to a showgirl dance class, which stokes Debbie''s insecurities.', 70573, 4, 1879533, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281596, 'Episode 52', '', 70583, 52, 1281596, 85893, '2016-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311597, 'Episode 16', 'When Su Hyeon learns that Hui Young was captured and killed, she goes her own ways to execute the wrongdoers. She assassinates every betrayer, including Shin Yul. In the present time, Jin Oh finds out how he was killed in his past life and gets shocked. Jin Oh’s body keeps flickering, signaling that it’s almost time for him to leave.', 70528, 16, 1311597, 85720, '2017-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1279620, 'Lofty Goals', 'Adam Carolla reunites with friend Jimmy Kimmel as they build a loft live while viewers build at home all across the country. Plus Adam solves home renovation questions and plays Name That Tool.', 70530, 1, 1279620, 85724, '2017-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302540, 'No Need to Panic', 'Adam Carolla is live with Adam Sandler as they prepare for the end of the world by building a panic room. Fans can build with Adam and ask questions live.', 70530, 2, 1302540, 85724, '2017-03-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302541, 'Greenhouse Party', 'Adam Carolla is live with Michael Rapaport as they attempt to build a greenhouse and shoot some bricks. Plus Adam answers all your home and build related questions live.', 70530, 3, 1302541, 85724, '2017-03-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314864, 'Make Your Backyard Great Again', 'Adam Carolla is joined by country music star Trace Adkins as they makeover your backyard on a budget in time for summer. Plus Adam answers all your home and build related questions.', 70530, 4, 1314864, 85724, '2017-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314865, 'Garage Rescue', 'Jenna Elfman joins Adam Carolla in an all-things garage related episode. Plus Adam answers all your home and build related questions.', 70530, 5, 1314865, 85724, '2017-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314866, 'Recipe for a Kitchen Remodel', 'Adam Carolla and guest Howie Mandel show you how to give your kitchen a kickass makeover without breaking the bank. Plus Adam answers all your home improvement and build questions.', 70530, 6, 1314866, 85724, '2017-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314867, 'Ace of Basements', 'Adam Carolla and guest Joel McHale transform a basement into the ultimate hang out area. Plus Adam answers all your home improvement and build questions.', 70530, 7, 1314867, 85724, '2017-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314868, 'Raising The Bar', 'Terry Crews joins Adam Carolla with special guests Jo Koy and Lynette Carolla to show you how to build the ultimate home bar. Plus Adam takes pitches from pint size designers & answers all your home improvement questions.', 70530, 8, 1314868, 85724, '2017-05-08');
