INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1280590, 'Episode 1', 'Mel and Sue are joined by Radio 1 DJ Matt Edmondson, stargazer Russell Grant, funny girl Sara Pascoe, DJ''s Rickie and Melvin and Absolutely Fabulous actresses Helen Lederer and Harriet Thorpe, and some very special guests.', 70559, 1, 1280590, 85818, '2017-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1280594, 'Episode 2', 'Mel and Sue are joined by the stars of Holby and Casualty, dancing stars James and Ola, EastEnders hunk Danny-Boy Hatchard and more. Plus, a panel of television legends, Claudia Winkleman, Citizen Khan and Russell Kane.', 70559, 2, 1280594, 85818, '2017-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290151, 'Episode 3', 'Joining Mel and Sue are This Morning''s Alison Hammond, magician Pete Firman, comedian Ellie Taylor, actress Sally Lindsay, The One Show hosts, and more. The judges are Jennifer Saunders, Julian Clary, Miranda Hart and Tameka Empson.', 70559, 3, 1290151, 85818, '2017-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1290152, 'Episode 4', 'It is the final, and six star acts who have been voted for by the public and the panel sing again, hoping to be crowned champion. The panel is made up of Rufus Hound, Katy Brand and Jason Manford, and there is music from Zara Larsson and Dua Lipa.', 70559, 4, 1290152, 85818, '2017-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1280998, 'Episode 1', '', 70564, 1, 1280998, 85839, '2016-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281163, 'Episode 1', 'Two childhood best friends go to university together and find their closeness tested.', 70566, 1, 1281163, 85851, '2017-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879534, 'Freaky Tuesday', 'Tammé''s back problems lead to a major shake-up in the ring. An offer to extend the show divides the producers. Justine asks Sam to read her screenplay.', 70573, 5, 1879534, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1287093, 'Episode 2', 'After shocking events, Holly finds herself more suspicious than ever that something is wrong at Solasta Finance and at the heart of the clique. Georgia is more distant than ever and everyone seems to be pretending there’s a perfectly reasonable explanation for everything that’s happened.', 70566, 2, 1287093, 85851, '2017-03-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1289633, 'Episode 3', 'Despite her trepidation, Holly begins to enjoy her new life as a part of the clique.', 70566, 3, 1289633, 85851, '2017-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1295856, 'Episode 4', 'When a shock discovery makes Holly’s concerns a reality, Jude and her girls double down to protect Solasta. With Georgia acting odder than ever, Holly has to break ranks.', 70566, 4, 1295856, 85851, '2017-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1298394, 'Episode 5', 'As Holly’s alliances shift and groups close ranks, she finds herself torn between relationships old and new, and unsure who - if anyone - she can trust.', 70566, 5, 1298394, 85851, '2017-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1301910, 'Episode 6', 'Holly clings to Rachel in the wake of a shocking escalation. But to get to the dark heart of what’s happened and pull Georgia back from the brink, there’s one final twist to come.', 70566, 6, 1301910, 85851, '2017-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1615835, 'Episode 1', 'Holly is back for her second year of university. She’s trying to keep her head down but when she meets a new Clique of boys led by Jack, she is drawn into a dangerous new world.', 70566, 1, 1615835, 112392, '2018-11-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1622663, 'Episode 2', 'Everything is different the morning after the night before. The boys close ranks as blame is placed at their door and Holly finds herself at odds with her flatmates.', 70566, 2, 1622663, 112392, '2018-11-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1622664, 'Episode 3', 'With Rayna missing, Holly can’t get the answers she needs. The boys take on the Dean of Students and the events of that night on the beach send out a new shockwave.', 70566, 3, 1622664, 112392, '2018-11-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1628800, 'Episode 4', 'In the light of tragic events, everyone is thrown. New evidence emerges at Twitcher about the night on the beach and Holly and Louise come together to find the truth about Rayna.', 70566, 4, 1628800, 112392, '2018-12-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1628801, 'Episode 5', 'Holly decides to take matters into her own hands finding solace in her own dark past. As Jack questions his own role in events, he looks for comfort in his family.', 70566, 5, 1628801, 112392, '2018-12-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1628802, 'Episode 6', 'Holly attempts to mete out her own justice. As events build to a climax, the dark truths at the hearts of these relationships explode with devastating consequences.', 70566, 6, 1628802, 112392, '2018-12-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281179, 'Hired Guns', 'Picard resorts to a spot of blacklegging to get out of O''Brady''s bad books', 70570, 1, 1281179, 85856, '1987-09-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293732, 'One Night In Grimsby', 'Cowboy gets more than his heart broken in Grimsby...', 70570, 2, 1293732, 85856, '1987-09-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293733, 'Shoot, If You''ll Pardon My French', '', 70570, 3, 1293733, 85856, '1987-09-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293734, 'Breaking The Eggman', '', 70570, 4, 1293734, 85856, '1987-09-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293735, 'Stinking Fish', '', 70570, 5, 1293735, 85856, '1987-10-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293737, 'Rollo Solo', '', 70570, 6, 1293737, 85856, '1987-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293739, 'The Heat of the Moment', '', 70570, 7, 1293739, 85856, '1987-10-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293740, 'Going Under', '', 70570, 8, 1293740, 85856, '1987-10-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281180, 'Pilot', 'Desperate to jump-start her career, struggling actress Ruth heads to a casting call at an LA gym -- and quickly realizes it''s not a typical audition.', 70573, 1, 1281180, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300405, 'Slouch. Submit.', 'Cherry tries to whip the final group into shape, while Sam sets out in pursuit of a star for his show. Ruth acts out an uncomfortable scene.', 70573, 2, 1300405, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300406, 'The Wrath of Kuntar', 'Sam''s flashy young producer drops in and whisks the girls off to Malibu to party. But artistic differences soon threaten to spoil the fun.', 70573, 3, 1300406, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300407, 'The Dusty Spur', 'With just five weeks left to crank out a show, Sam and Bash move all the ladies into a motel. Ruth struggles to nail down a memorable character.', 70573, 4, 1300407, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300408, 'Debbie Does Something', 'Debbie attends her first wrestling match and has a major epiphany. Meanwhile, Ruth finally finds the inspiration for her alter ego.', 70573, 5, 1300408, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300409, 'This Is One of Those Moments', 'Sam searches for the perfect "heel" to fight Debbie, but she''s tough to please. To hone her act, Ruth tags along with Gregory to a family function.', 70573, 6, 1300409, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300410, 'Live Studio Audience', 'As the women prepare for their first live match, Debbie and Ruth seek outside help with their moves, and Rhonda gives Sam a good-luck gift.', 70573, 7, 1300410, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300411, 'Maybe It''s All the Disco', 'Jenny whips up a party for Sheila''s birthday while Sam helps Ruth deal with a new complication in her personal life. Mark changes his tune with Debbie.', 70573, 8, 1300411, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300412, 'The Liberal Chokehold', 'With the show''s future in jeopardy, Bash and the ladies search for creative way to drum up cash. A pair of revelations leaves Sam reeling.', 70573, 9, 1300412, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1300413, 'Money''s in the Chase', 'On the day of the big taping, Sam attends to unfinished personal business, while Ruth scrambles to make last-minute changes to the lineup.', 70573, 10, 1300413, 85859, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1504985, 'Viking Funeral', 'Nerves run high as the ladies return to work and meet a new cast member. To boost morale, Ruth takes the gang on a raucous outing to the mall.', 70573, 1, 1504985, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512984, 'Candy of the Year', 'The ladies get creative when Sam forces them to compete for airtime. Debbie discovers the producer life isn''t quite what she''d hoped.', 70573, 2, 1512984, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512985, 'Concerned Women of America', 'Ruth connects with a fellow film lover and helps Debbie cook up a PSA to appease an angry women''s group. Cherry struggles on the set of her new show.', 70573, 3, 1512985, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512986, 'Mother of All Matches', 'On the day of the big match between Welfare Queen and Liberty Belle, Tammé visits her son at Stanford, and Debbie hits an emotional wall.', 70573, 4, 1512986, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512987, 'Perverts Are People, Too', 'A request from the network puts the producers on edge, the wrestlers capitalize on their growing fan base, and Ruth receives a surprising invitation.', 70573, 5, 1512987, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512988, 'Work the Leg', 'Facing new competition, the women vow to amp up their wrestling. A startling discovery changes Sam''s outlook on the show.', 70573, 6, 1512988, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512989, 'Nothing Shattered', 'After an injury on set, Sam and the wrestlers rush to the hospital and wait anxiously for news. A long-simmering feud finally boils over.', 70573, 7, 1512989, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512990, 'The Good Twin', 'It''s the moment you’ve been waiting for: A straight-to-the-airwaves episode of “GLOW,” complete with dream sequences, music videos and epic wrestling.', 70573, 8, 1512990, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512991, 'Rosalie', 'As the ladies begin to plan for life after the show, Justine''s mom shows up on Sam''s doorstep, and Bash and Debbie scheme to woo buyers at a TV expo.', 70573, 9, 1512991, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1512992, 'Every Potato Has a Receipt', 'Wedding bells are ringing as the wrestlers step through the ropes for the big finale. But last-minute twists catch everyone off guard.', 70573, 10, 1512992, 105067, '2018-06-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1822761, 'Up, Up, Up', 'Hours before GLOW''s opening show at the Fan-Tan casino in Las Vegas, a national tragedy unfolds on live TV, leaving everyone spooked.', 70573, 1, 1822761, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281568, 'Episode 26', '', 70583, 26, 1281568, 85893, '2015-11-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281569, 'Episode 27', '', 70583, 27, 1281569, 85893, '2015-11-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879535, 'Outward Bound', 'A camping trip in the desert canyons outside Vegas spirals into a night of soul-searching, bitter showdowns and bombshell revelations.', 70573, 6, 1879535, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879536, 'Hollywood Homecoming', 'Sam takes Justine to meet with studio execs, Birdie arrives in Las Vegas to spend time with her daughter-in-law, and Debbie makes a new friend.', 70573, 7, 1879536, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879537, 'Keep Ridin''', 'As Ruth grapples with major doubts about her path in life, Bash and Rhonda go on a spending spree, and Cherry and Carmen pick up a new side gig.', 70573, 8, 1879537, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879538, 'The Libertines', 'Ruth heads to LA for her big audition, Debbie helps Bobby take the Libertine Ball to the next level, and Rhonda plots to rekindle Bash''s interest.', 70573, 9, 1879538, 126074, '2019-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1879539, 'A Very GLOW Christmas', 'With morale running low, Carmen convinces the team to perform "A Christmas Carol" in the ring. Debbie and Bash strike up an unlikely new partnership.', 70573, 10, 1879539, 126074, '2019-08-09');
