INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281520, 'Rumor Has It', 'Nestled halfway between Bangor and the Canadian border, Webster Plantation has a population of less than 70 people. When two of its residents, Michael and Valerie Miller are found brutally murdered in their home, fear overwhelms everyone in town.', 70582, 1, 1281520, 85882, '2014-01-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293417, 'The Devil Wears Sneakers', 'A tight-knit Illinois farming town is rocked when a family of five is found beaten to death in their home. When the bodies of the Gee family are discovered, the tiny town of Beason, IL finds itself in the midst of a gruesome murder mystery.', 70582, 2, 1293417, 85882, '2014-01-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293418, 'All-American Sweethearts', 'Eighteen-year-old Kelly Eckart disappears one night after finishing up her shift at a local hardware store. Hours later her car is discovered abandoned by the side of the road, still running, but Kelly is nowhere to be found.', 70582, 3, 1293418, 85882, '2014-01-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293419, 'Mr. & Mrs. Fantastic', 'When elderly couple Charles and Grace Lewis vanish from the family farm along with their pickup truck, their children realize that something is terribly wrong. As word spreads, fear envelopes the quiet religious community of Bonne Terre, MO.', 70582, 4, 1293419, 85882, '2014-02-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293420, 'No Average Trouble Maker', 'When teenager Bridgett Frisbie sneaks out of her Katy, TX home one night, her parents assume it''s just typical teenage rebellion. But the next day, a group of boys find her body in the woods just outside of town.', 70582, 5, 1293420, 85882, '2014-02-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293421, 'End of an Era', 'When a beloved local business owner is murdered while minding his store in idyllic Cumberland Gap, TN, no one wants to think that the killer could be one of their own. Could the killer have been a stranger or someone a little closer to home?', 70582, 6, 1293421, 85882, '2014-02-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293397, 'Lurking in the Hollers', 'Family means everything to folks who live in the mountain hollers of Townsend, TN. When one member of the large Griffin clan is found murdered and another goes missing, investigators begin to suspect that a family feud may have taken a deadly turn.', 70582, 1, 1293397, 85883, '2014-12-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293398, 'Horror in the Heartland', 'Neighbors are sometimes miles apart in the tiny town of Horton, Kansas, but news travels fast when Patricia Kimmi disappears from her home. Evidence leads investigators to believe she may not be found alive. And worse, that her killer still lurks.', 70582, 2, 1293398, 85883, '2015-01-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293399, 'Who Killed Thanksgiving?', 'When a mother of four is found tortured and brutally murdered in her home, the people of Northport, Washington discover that their isolation doesn''t guarantee their safety.', 70582, 3, 1293399, 85883, '2015-01-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293400, 'Stipps Hill Massacre', 'Most of the 500 or so folks who call Laurel, IN home are either kin or have known each other their whole lives. So when the Napier family is found massacred in their home, residents are terrified that a mass killer lurks somewhere in Laurel''s fields.', 70582, 4, 1293400, 85883, '2015-01-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293401, 'He''d Do It Again', 'When the well-liked South Bend native, Tim Moore, seemingly vanishes one cold November night, residents begin to realize they may not know the folks next door as well as they thought.', 70582, 5, 1293401, 85883, '2015-01-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293402, 'Friend or Foe', 'When longtime resident Sharron Erickson is found raped and murdered in the tiny Midwestern town of Colon, Nebraska, the community is stunned that the recent retiree could be the victim of such a savage crime.', 70582, 6, 1293402, 85883, '2015-02-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293403, 'Secrets of a Country Store', 'As the last dry county in the state of Alabama, Clay County is a place stuck in time. When bootlegger Billy Triplett and his wife turn up dead in the town of Barfield, locals suspect it must have had something to do with his illegal side-business.', 70582, 7, 1293403, 85883, '2015-02-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293404, 'Cowboys from Hell', 'When Diana Algar and Jose Molina are found brutally murdered in rural Hollenback Township, Pennsylvania, three letters scrawled across Algar''s living room wall become the central clue in a nationwide manhunt.', 70582, 8, 1293404, 85883, '2015-02-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293405, 'Lord of the Rockies', 'Residents of Guffey, Colorado cherish their tiny mountain outpost for one reason - the peaceful Rocky Mountain surroundings. That peace is shattered one January night when Carl and JoAnna Dutcher are massacred alongside their grandson, Tony.', 70582, 9, 1293405, 85883, '2015-02-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293406, 'My Dearest Diary', 'When Angela and Ashley Hyke go missing one hot summer night and candles are found burning in their home, those close to them know that something is horribly wrong.  The key to solving the mystery may lie in Angela’s cryptic diary.', 70582, 10, 1293406, 85883, '2015-03-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293387, 'A Place She''d Call Home', 'Police are baffled when Melissa White is found murdered in the backyard of her Viola, Illinois home. But when investigators take a closer look at Melissa''s neighbors, they unearth a secret. Could this be the key to apprehending Melissa''s murderer?', 70582, 1, 1293387, 85884, '2016-01-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293388, 'Who Killed the Music?', 'When John Tarwacki Sr. discovers the bodies of his son and daughter-in-law, the only story told at the scene is found in the snow. Boot prints reveal the path the killer took, but the search for motive will lead police in a startling direction.', 70582, 2, 1293388, 85884, '2016-01-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293389, 'The Message in Red', 'When a couple is gunned down in the presence of children, a cryptic message scrawled across the home leads police to suspect the crime may be drug related. The only problem is, there''s no evidence the victims had any involvement in the drug trade.', 70582, 3, 1293389, 85884, '2016-01-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293390, 'Mommy, Please Come Home', 'The tiny town of Glendive, Montana is paralyzed with fear when mother of four Susan Casey vanishes. The ensuing investigation leaves everyone to wonder if one of her former flames is harboring a sinister secret?', 70582, 4, 1293390, 85884, '2016-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293391, 'Mom Makes Four', 'When Carla Fuqua vanishes after a night out with friends, her family panics. She''s a dedicated mother who would never leave her son behind.  Even worse, Carla has become the fourth missing person in a town of less than 5,000.', 70582, 5, 1293391, 85884, '2016-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293392, 'The Nightmare After Christmas', 'Rumors fly in the small town of Auburn, New Hampshire after well-known local George Jodoin is found murdered in his bed and the top three suspects are his close friends.', 70582, 6, 1293392, 85884, '2016-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293393, 'The Night Stalker Attacks', 'When Cindy Borton is found brutally stabbed to death in her home, authorities immediately suspect those closest to her. But a note left at the site of a local arson lights a trail that turns the investigation on its head.', 70582, 7, 1293393, 85884, '2016-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293394, 'Lookin'' for Souls to Steal', 'When two college students are gunned down while parked in a quiet lovers'' lane in Juliette, Georgia, the tiny community is beside itself with panic.', 70582, 8, 1293394, 85884, '2016-02-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293395, 'Prints of Darkness', 'When Michael and Melisa Augustson move to little Alma, Georgia they''re soon taken in by the community. But on December 14th, Michael comes home to a scene of unspeakable horror. His wife has been murdered, and only one person in the town knows why.', 70582, 9, 1293395, 85884, '2016-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293396, 'Last Walk to Bad Creek', 'The discovery of the bullet-riddled bodies of Skyla Whitaker and Taylor Placker in tiny Weleetka, Oklahoma sends the community into a state of panic. If two of Weleetka''s most innocent can fall victim to the sadistic killer, no one in town is safe.', 70582, 10, 1293396, 85884, '2016-03-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281521, 'Wicked Witness', 'What begins as a frantic 911 call to help an assaulted neighbor ends in the most bizarre investigation the small town of Walsenburg, Colorado has ever seen - complete with a twisted tale of torture, family secrets, and a fallen Jehovah''s Witness.', 70582, 1, 1281521, 85885, '2017-03-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281522, 'Open Door Policy', 'The brutal murder of Mike and Terri Greene hits close to home in Grand Ledge, Michigan. The couple was beloved by everyone in the small town and Mike was a retired police officer. Evidence of a personal grudge, but could the motive so clear cut?', 70582, 2, 1281522, 85885, '2017-03-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281523, 'Coal Miner''s Slaughter', 'A respected businesswoman in the placid town of Madisonville, KY is found bludgeoned and stabbed to death in her home. Detectives follow a long path to pursue her killer, but will their trail of suspects eventually lead right back home?', 70582, 3, 1281523, 85885, '2017-03-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281524, 'Who''s Missing Now', 'When beloved young waitress Zilpha Lowery goes missing, foul play is immediately suspected. Rumors of her fate drift through town and tie her to another mysterious disappearance. The question on everyone''s mind: what evil has invaded Marion, N.C.', 70582, 4, 1281524, 85885, '2017-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281525, 'Answering the Call', 'When a brush fire is reported in rural Winchester, Tenn., first responders are horrified to find the body of young Megan Sharp at the center of the blaze. Beaten, raped, burned, police race to bring justice before the attacker hunts down his next victim.', 70582, 5, 1281525, 85885, '2017-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1293374, 'Roses Are Red, Murder Is Too', 'When a town counsel member is found murdered in her home, residents of Berryville, Virginia are appalled. With the only evidence being the single bullet that took her life, the slaying begins to look more and more like a professional hit.', 70582, 6, 1293374, 85885, '2017-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1501296, 'Trailing the Devil', 'A nightmare wreaks havoc on the village of Armada, Michigan when 14-year-old April Millsap is found murdered on the community''s most popular bike trail. Very little evidence leaves investigators running down clues to bring this monster to justice.', 70582, 1, 1501296, 104797, '2018-06-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1501297, 'No Witnesses', 'When two young ladies don''t return home after a run to the local drive-thru, their concerned parents immediately set out on a search to find them.  However it will be a fisherman that will give police their first clue that something evil has happened.', 70582, 2, 1501297, 104797, '2018-06-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1501298, 'Hellfire in the Hollow', 'A 21-year-old mother doesn''t return from night classes and her car is found burned. Investigators immediately suspect foul play. However, no one is prepare for the web of lies that ultimately unfold due to her disappearance.', 70582, 3, 1501298, 104797, '2018-06-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1501299, 'Friendly Foes', 'The double homicide of a young mother and her 21-month-old daughter sends Galax''s tiny police force on a frenzied mission to stop unspeakable evil in its tracks.', 70582, 4, 1501299, 104797, '2018-06-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1515336, 'Tragedy Comes in Pairs', 'Lightning strikes twice in the desert town of Socorro, N.M., where Crystal Houston is found murdered just 14 months after her older sister, Stephanie, is killed in a suspicious accident.', 70582, 5, 1515336, 104797, '2018-07-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1518600, 'The Dangers of Success', 'Awakened by noises, a couple''s worst nightmare becomes a reality as intruders shoot and kill their beloved daughter, Terri Ann McCoy; investigators work through leads and lies to discover the perpetrators are closer than they realized.', 70582, 6, 1518600, 104797, '2018-07-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1525009, 'Something''s Not Right', 'When a popular cheerleader goes missing in rural Arkansas, the small town is sent into a panic; after her sports car is found abandoned, investigators are sure something is not right, but no one expects the horror that ensues.', 70582, 7, 1525009, 104797, '2018-07-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1535102, 'End of Watch', 'The town of Cleveland, Okla., experiences overwhelming heartbreak when its esteemed sheriff is mysteriously gunned down in the night. As the community wrestles with its safety, law enforcement is determined to find justice for their fellow officer.', 70582, 8, 1535102, 104797, '2018-07-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1535103, 'The Sinner and the Saint', 'Beloved teacher Margaret Jack Sliger is murdered on her farm in the sleepy town of Mooresburg, Tenn. Hawkins County detectives are charged with finding the sinister perpetrator to bring their community justice.', 70582, 9, 1535103, 104797, '2018-07-31');
