INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1281914, 'The Sword Princess and the Elf', 'Lefiya dreams of fighting in the dungeon beside someone she admires: Ais Wallenstein! When monsters attack the Loki Familia camp, will Lefiya be able to prove her worth?', 70590, 1, 1281914, 85910, '2017-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1306027, 'Fittings and Purchases', 'The members of the Loki Familia recover from their most recent adventure. After a long day of errands, they visit Loki''s favorite tavern where Ais runs into a familiar face.', 70590, 2, 1306027, 85910, '2017-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1309167, 'Festivals and Courage', 'A day at Monsterphilia turns deadly when some of the monsters escape. While Ais tracks them down, a powerful monster attacks Lefiya and the twins.', 70590, 3, 1309167, 85910, '2017-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1313252, 'The Murder and the Jewel', 'Ais and the others get tangled in a brutal murder on the 18th floor. Meanwhile, Loki and Bete investigate the strange plant creatures involved in the Monsterphilia incident.', 70590, 4, 1313252, 85910, '2017-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1316872, 'The Red-head and the Lone Ruler', 'Loki attempts to get answers from Lord Uranus. Meanwhile, as the battle rages in the dungeon, Ais finds herself crossing swords with the murderer in a fight to the death.', 70590, 5, 1316872, 85910, '2017-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1318737, 'Subjugation and Escape', 'Riveria chaperones Ais as she takes on a brutal boss alone. On their way out, Ais discovers an unconscious, but familiar, white haired boy, and decides to take care of him.', 70590, 6, 1318737, 85910, '2017-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1321086, 'Requests and Divisions', 'A mysterious figure sends Ais to investigate the 24th floor where she teams up with the Hermes Familia. Meanwhile, Dionysus sends Filvis with Lefiya and Bete into the dungeon.', 70590, 7, 1321086, 85910, '2017-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1323642, 'The Corruption and The Maiden', 'Bete confronts Filvis about her past bloody while Lefiya tries harder to integrate her into their team. Meanwhile, the Hermes Familia tries to reclaim Ais from the Tamer.', 70590, 8, 1323642, 85910, '2017-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1326516, 'Training and Jealousy', 'Ais finally gets her chance to speak to Bell, and the two agree to train together. When a brokenhearted Lefiya catches them, she becomes determined to get Ais to notice her!', 70590, 9, 1326516, 85910, '2017-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1329516, 'The Boy and the Hero', 'The Loki Familia prepares for its expedition deep into the dungeon. Amid the excitement, Ais prepares for what she may find past Level 59.', 70590, 10, 1329516, 85910, '2017-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1331282, 'Adventure and the Unknown', 'The Loki Familia expedition reaches Level 50. Armed with new weapons and determination, they delve in the dungeon''s hellish depths. Meanwhile, Revis lies in wait for Ais.', 70590, 11, 1331282, 85910, '2017-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1332939, 'Kin of the Gods', 'The Loki Familia run into a formidable foe, even together, will they still be able to defeat the monster?', 70590, 12, 1332939, 85910, '2017-06-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282044, 'Episode 1', 'Officials find notices in Hanyang alleging the king is dead. Crown Prince Lee Chang tries to check on his father, but the young queen stands in his way.', 70593, 1, 1282044, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1614301, 'Episode 2', 'Prince Chang and Mu-yeong arrive at Jiyulheon, where they make a horrific discovery. Seo-bi’s story of what she saw eerily resonates with Prince Chang.', 70593, 2, 1614301, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1614302, 'Episode 3', 'Night leads to chaos in Dongnae. Cho Hak-ju and the queen oversee the king’s care. Prince Chang reaches a disquieting conclusion and vows to fight back.', 70593, 3, 1614302, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1645043, 'Episode 4', 'On his way to seek Lord Ahn Hyeon’s help, Prince Chang encounters a group of stranded survivors and leads them to Jiyulheon, following Seo-bi’s advice.', 70593, 4, 1645043, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1645044, 'Episode 5', 'Prince Chang’s group comes across a village that oddly seems to be well-fed. While taking refuge at Lord Ahn Hyeon’s, Seo-bi notes something peculiar.', 70593, 5, 1645044, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1645045, 'Episode 6', 'Cho Hak-ju has chilling words for the queen, who’s hiding a sinister secret. Prince Chang orders Sangju’s defenses, but Seo-bi senses something awry.', 70593, 6, 1645045, 85914, '2019-01-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1869680, 'Alice and Zoroku Special: Looking Ahead to Part 2', 'Recap of episodes 1-6.', 70594, 1, 1869680, 128737, '2017-05-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282060, 'The Red Queen Escapes', 'In a deep, remote forest, a blond-haired girl runs amidst heavy rain and wind. Some pursue her, while others extend a hand to help her. As various motives tangle together, the girl, named Sana, makes her flight to the outside world for the first time in her life. In the end, Sana arrives at the bustling district of Kabukicho in Tokyo''s Shinjuku Ward. In a convenience store there, she meets Kashimura Zoroku, the quintessential "stubborn old man."', 70594, 1, 1282060, 85915, '2017-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302313, 'Dreams of Alice', 'Since Sana had nowhere to go, Zoroku decided to let her stay in his own home for the time being. After he finds out that the previous day''s incident isn''t being covered by any media, he makes a call to an old friend. Meanwhile, Sana awakens to find Zoroku''s granddaughter, Sanae, watching over her. Sanae says her grandpa asked her to keep an eye on Sana while he went to work. Sana was untrusting at first, but they eventually warm up to each other. Then Sana recalls her time spent at the research facility...', 70594, 2, 1302313, 85915, '2017-04-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1303931, 'Cards', 'Kashimura Floral is in an uproar after Sana uses her Dream of Alice, suddenly landing herself and Sanae in the shop. Even after things quiet down, Zoroku scolds Sana for breaking her promise not to use her power. Then Naito, an old acquaintance of Zoroku''s, enters the scene with a proposal for Zoroku. Meanwhile, Kito and his team in pursuit of Sana are steadily closing in...', 70594, 3, 1303931, 85915, '2017-04-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1306880, 'Something Not Human', 'Minnie C and her group took advantage of a moment''s negligence to kidnap Sana. Left behind at his office, Zoroku demands answers from Naito as to just what Sana really is. Meanwhile, the giant "arms" controlled by Minnie C have Sana completely trapped, and Minnie C asks her, "Did you think that you were human?" Just when it seems all hope is lost, Sana''s powerful thoughts take the situation in an unexpected direction...', 70594, 4, 1306880, 85915, '2017-04-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1310430, 'A Home to Return to', 'When Sana and Zoroku are loaded onto a cargo ship, the one who appears to rescue them is Cabinet Information Research Office agents Ichijo Shizuku and Yamada Noriko. As they all plan their escape, Minnie C stand before them once again. As she attacks with the invisible arms that she can control freely, Ichijo links with Yamada to unleash various abilities of her own. As this battle between Dreams of Alice rages on, Sana tells Zoroku what she truly wishes for.', 70594, 5, 1310430, 85915, '2017-04-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1317374, 'The Kashimura Family', 'The seasons have quickly turned to winter. The matter of the research facility has been resolved, and life is normal again in Zoroku''s household. Sana seems to have fully adjusted to being a member of the Kashimura family, as well. After seeing Sanae off on her way to school, she heads for the flower shop with Zoroku, where she sometimes helps with his work. She still has some trouble with stamina, but she has adapted well to the outside world. Then, one day, Sana goes out with Zoroku to get her overgrown hair cut...', 70594, 6, 1317374, 85915, '2017-05-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1319331, 'Friends', 'Zoroku is making a trip to Yokohama to meet a client, so he takes Sana with him. Accompanied by Ichijo, Sana is impressed by the sight of the ocean and the robot-operated factory that she visits, and enjoys her day out to the fullest. Rejoined by Zoroku, the trio visits Chinatown, but then Asahi and Yonaga suddenly appear after being unseen ever since the research facility incident was resolved. The twins run away as Sana and Ichijo chase after them...', 70594, 7, 1319331, 85915, '2017-05-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1321835, 'The Evil Witch', 'Shikishima Hatori is a completely ordinary grade school girl. Then, one day, she develops a "Dream of Alice" power. Hurt by the sight of her parents constantly fighting over her future schooling, Hatori prays that they''ll go back to being her kind mom and dad again... and that dream is realized in a way she never expected. Meanwhile, Sana is helping out at the flower shop as usual, waiting excitedly for Asahi and Yonaga to come for a visit...', 70594, 8, 1321835, 85915, '2017-05-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1324112, 'Where the Cheshire Cat Smiles', 'Sana collapsed after meeting Hatori and Ayumu, and Asahi and Yonaga brought her back to Zoroku''s house. The three girls are now having a great time playing together for the first time in so long. Then Sana comes up with a plan to teach Hatori a lesson for doing something so awful to Zoroku. Meanwhile, Hatori''s emotional state has changed yet again after her encounter with Sana. She tells her best friend, Ayumu, that she''s used her power too much and can''t go to school again. So a concerned Ayumu returns to Harajuku to search for Sana.', 70594, 9, 1324112, 85915, '2017-06-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1327429, 'The Little Queen', 'A collision with a "Dream of Alice" power has left Sana and Hatori trapped in the deepest part of Wonderland. They wander all over this world so unlike their own, but there''s no sign of an exit anywhere. Meanwhile. after learning what''s happened to Sana, Zoroku and Sanae head to Wonderland with Ichijo. They can''t help gazing with wonder at their first sight of Wonderland, the place where Sana was born. But they''ve barely begun the search before Ichijo...', 70594, 10, 1327429, 85915, '2017-06-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1330126, 'The Queen and the Witch', 'Ten days have passed in the outside world since Sana and Hatori got trapped in Wonderland. Ayumu, remembering a promise they once made, begins to worry that Hatori won''t ever come back. As he and Sanae search, Zoroku looks back on on all the things that have happened since they met Sana. Meanwhile, Sana and Hatori finally find an exit out of Wonderland, but it has already begun expanding at an accelerated rate, to the point that it''s affecting the outside world...', 70594, 11, 1330126, 85915, '2017-06-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1331733, 'I''m Home', 'As Hatori''s parents desperately search for Hatori, it is revealed that she and Sana have been missing for ten days in the real world. In Wonderland, the two girls attempt to find a new exit and come across a rabbit that is holding Hatori''s cell phone.', 70594, 12, 1331733, 85915, '2017-06-25');
