INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1602864, 'The Aftermath', 'After Kerry became embroiled in a criminal enterprise with her father, this one-off special investigates the fallout and the impact on the village.', 70596, 1, 1602864, 111462, '2018-10-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282289, 'Scarecrow', 'Kurtan is focusing his attentions on the annual village scarecrow festival, a key event in the village calendar that can both unite and divide the community. Tensions run high when his chances of winning the competition are compromised by being given a less than ideal plot to display his scarecrow. Meanwhile, Kerry faces a challenge to her authority.', 70596, 1, 1282289, 85921, '2017-02-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302531, 'Mandy', 'When Kerry''s neighbour Mandy Harris starts a tattoo business, Kerry is delighted to be one of her first customers. Meanwhile, Kurtan fixates on trying to track down a long-lost school friend.', 70596, 2, 1302531, 85921, '2017-02-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302532, 'Oven Space', 'Kerry and Kurtan await the release of their uncle, Steve ''Nugget'' Nuggins, who they believe was wrongfully imprisoned for ''having a laugh''.', 70596, 3, 1302532, 85921, '2017-02-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302534, 'King of the Nerds', 'Kerry and Kurtan attend a talk at the village hall with a business woman who runs what may or may not be a pyramid scheme. Kerry is inspired and starts a career as a door-to-door saleswoman. However, her focus on the business leads to disharmony with Kurtan, and this is only compounded when he makes some new friends in the village.', 70596, 4, 1302534, 85921, '2017-03-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302535, 'Peeping Tom', 'Kerry''s father, Martin, is accused of being a peeping Tom. Meanwhile, Kurtan romantically pursues a girl who has just moved into the village, but he finds he has a rival for her affections in his friend Slugs.', 70596, 5, 1302535, 85921, '2017-03-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1302536, 'GNVQ', 'Kerry and Kurtan explore the possibility of moving away from their village. Kurtan receives the exciting news that he could go to college to study for a GNVQ - news that Kerry is devastated by.', 70596, 6, 1302536, 85921, '2017-03-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484125, 'Random Acts of Kindness', 'Kerry has turned over a new leaf and is trying to give back to her community. Meanwhile, Kerry''s cousin, Kurtan, is coming to terms with his decision not to go to Swindon College and is struggling to get back into the swing of village life.', 70596, 1, 1484125, 103472, '2018-02-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484126, 'Threatening Letters', 'Kerry starts to receive some threatening letters that cause her to feel unsettled. Thankfully, Kerry''s neighbour, Mandy, is on hand to help. Kurtan takes a labouring job with Kerry''s father, Martin, and learns some invaluable life lessons.', 70596, 2, 1484126, 103472, '2018-03-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484127, 'Minor Injuries', 'Kurtan wants to make a pilgrimage to Swindon to buy new clothes. However, engineering works on the bus route and a lack of alternative transport disrupts his plans. Meanwhile, Kerry is helping the vicar run the local football practice.', 70596, 3, 1484127, 103472, '2018-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484128, 'The Vicar''s Son', 'When the vicar''s son Jacob returns from living in Bristol, can Kurtan help him re-adjust to village life? Meanwhile, Kerry continues to try and give back to the local community by visiting an elderly neighbour.', 70596, 4, 1484128, 103472, '2018-03-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484129, 'Steam Fair', 'It''s the most important day of the year for Kerry: the annual steam fair. As a bonus, this year it falls on her birthday and Kurtan has organised her a surprise present. However, the present involves a cross-country trek.', 70596, 5, 1484129, 103472, '2018-03-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1484130, 'Family Loyalties', 'Kerry is thrilled when her dad asks her to help him store some wares in a lock-up garage. Meanwhile, a job at the local bowls club gives Kurtan a new sense of purpose, but when Kerry entangles him in her new job, things start to unravel.', 70596, 6, 1484130, 103472, '2018-04-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282426, 'Episode 1', 'Tells the story of Suri, acting by Erra, spinster whose heart was closed when dropped fiancee 15 years ago. Suddenly now ex-fiance Ridzal acting psycho Norman Hakim had him come back to win her love. Besides appearing girls named Ammar casting Hisham Hamid, who wants to try to win over Suri. Can Ammar to get love Suri has long been that cold.', 70599, 1, 1282426, 85933, '2017-03-06');
