INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282797, 'Old Faces', 'The Real Housewives of Toronto follows six of the city’s most privileged, powerful and glamorous women as they navigate the elite social scene of Canada’s largest city. This must-see first season introduces Kara Alloway, Roxy Earle, Gregoriane (Grego) Minot, Ann Kaplan Mulholland, Joan Kelley Walker and Jana Webb. Toronto is their playground and they have the real estate, cars, and the diamonds to prove it. Watch as the ladies open up their extravagant lives, and show every shocking moment as they deal with the ups and downs of relationships, careers and family.', 70612, 1, 1282797, 85964, '2017-03-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1287536, 'Fasten Your Seatbelts', '', 70612, 2, 1287536, 85964, '2017-03-14');
