INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1296706, 'Midsummer''s Nightmare', 'While the other housewives recover from Joan''s dock blow-out, Kara frets over the details of her upcoming dinner party. But with an amazing chef, cheese flown in from Italy and specially inscribed gifts for her guests what could possibly go wrong?', 70612, 4, 1296706, 85964, '2017-03-28');
