INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1282966, 'Leap of Faith', 'In the series premiere, the twins discover they must make a change, mature and learn to do things on their own. They receive life advice from their best friend Lauren Bushnell and her fiancé Ben Higgins, as well as their beloved grandma.', 70619, 1, 1282966, 85974, '2017-03-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1296142, 'Working Girls', 'Things get fishy as the twins delve into the job search starting with an opportunity to become sushi models. As the hunt continues, the girls decide to take a plunge into a 117,000-gallon tank as part of a mermaid show. Meanwhile, in order to learn about their heritage, the twins take an ancestry test which leads to them exploring Japanese culture via meeting with a Harajuku woman and exploring Italian culture by making a pizza with the world''s fastest pizza maker. After discovering their Jewish heritage, Haley and Emily decide to hold a "Bark Mitzvah" for their dogs.', 70619, 2, 1296142, 85974, '2017-03-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1296143, 'We''re In It to Twin It!', 'Haley and Emily decide to explore two new professions: becoming a clown and being a magician''s assistant. After a minor accident, the ladies have to go to driving school which leads to a high-speed, high-octane "driving school" where they can drive up to 190 mph. Meanwhile, their mother Jill insists that they start to grow up by taking responsibility for their out-of-control dogs and train them once and for all.', 70619, 3, 1296143, 85974, '2017-04-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1296144, 'What the BLEEP Should We Do!?', '', 70619, 4, 1296144, 85974, '2017-04-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1296145, 'Happily NEVER After!', '', 70619, 5, 1296145, 85974, '2017-04-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1308166, 'Hoff and Running. . .', 'The twins receive some devastating news that has them questioning their move to Los Angeles and needing money fast. They are desperate until an unexpected encounter helps them land jobs as personal assistants to the one and only David Hasselhoff. Meanwhile, Bachelor Nation-favorite Ashley I. helps the twins cope by setting up an unusual blind date featuring body suits.', 70619, 6, 1308166, 85974, '2017-04-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1311649, 'Double Trouble (1)', 'Emily and Haley’s cheerleading dreams are back on, as they work hard to get their dance skills up to speed. Later, the twins receive an opportunity to host the red carpet of Disney’s “Beauty and the Beast,” which means interviewing guests such as Emma Watson, Dan Stevens and Celine Dion. In order to prepare, Emily and Haley attend an improv class and practice their interviewing skills on kids.', 70619, 7, 1311649, 85974, '2017-05-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1314807, 'Double Trouble (2)', 'Haley and Emily work hard to practice their dance skills in anticipation of their big audition, but after major back issues a doctor puts them through a series of tests to determine if they need career-ending surgery. Finally, the big day has arrived for the twins to audition for a chance to be Los Angeles Rams cheerleaders.', 70619, 8, 1314807, 85974, '2017-05-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62073, 'A Look at Season 6: Inside Mad Men', 'The cast and creators of Mad Men give some tantalizing information about what''s ahead in the 6th Season.', 1104, 1, 62073, 3564, '2013-03-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62009, 'Smoke Gets in Your Eyes', 'In 1960 New York City - the high-powered and glamorous "Golden Age" of advertising - Don Draper, the biggest ad man in the business, struggles to stay a step ahead of the rapidly changing times and the young executives nipping at his heels.', 1104, 1, 62009, 3566, '2007-07-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62008, 'Ladies Room', 'Don continues to conceal his increasingly complicated personal life, even in the face of Roger Sterling''s invitation to open up. Meanwhile, Peggy pines for the absent Pete  still on his honeymoon  while fending off the advances of several of the men of Sterling Cooper.', 1104, 2, 62008, 3566, '2007-07-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62011, 'Marriage of Figaro', 'Pete returns from his honeymoon, excited about his new marriage, but conflicted about his past encounter with Peggy. After his business relationship with Rachel takes an unforeseen turn, Don attends a party which further illuminates his increasing dissatisfaction with his present life.', 1104, 3, 62011, 3566, '2007-08-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62010, 'New Amsterdam', 'Pete''s professional and personal lives become more complicated as he struggles to assert power in both. While facing pressure from his wife regarding a new apartment, he further alienates Don and endangers his own position at Sterling Cooper.', 1104, 4, 62010, 3566, '2007-08-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62012, '5G', 'After Don wins an award, his photo is featured in Advertising Age. Don must deal with the fallout as the photo brings back a past he isnt ready to confront. Ken gets a short story published in The Atlantic Monthly, inciting jealousy among his colleagues and driving Pete to make an unorthodox request of his wife. Peggy overhears a startling conversation in the office and shares the secret with Joan.', 1104, 5, 62012, 3566, '2007-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62013, 'Babylon', 'A taboo office romance is revealed. At a brainstorming session, Peggy proves to be more than a secretary, opening up new opportunities for her at Sterling Cooper. Meanwhile, Rachel faces her conflicted feelings for Don after he seeks out her advice on a new campaign.', 1104, 6, 62013, 3566, '2007-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62016, 'Red in the Face', 'Roger joins Don for an evening of dinner and drinking, during which Roger''s behavior leads to a rift in their friendship. Though Don accepts his apology, there are further consequences for Roger. Pete faces trouble at home as he continues to struggle with the demands of his new marriage.', 1104, 7, 62016, 3566, '2007-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62015, 'The Hobo Code', 'Don is tormented as pieces of his secretive past begin to haunt him. Peggy''s new success at work, and resulting boost in confidence, threaten her office relationship. Salvatore Romano gets a little too close with a client.', 1104, 8, 62015, 3566, '2007-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62014, 'Shoot', 'A rival ad agency courts Don, involving Betty in their attempt to lure him from Sterling Cooper. As the presidential campaign heats up, the agency looks for new ways to counter the latest Kennedy ads. Tempers flare over Peggy.', 1104, 9, 62014, 3566, '2007-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62018, 'Long Weekend', 'Don loses an account. Roger, stuck in the city for Labor Day weekend, attempts to cheer him up. Meanwhile, Joan has a night out on the town with her roommate.', 1104, 10, 62018, 3566, '2007-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62020, 'Indian Summer', 'Peggy is given a difficult assignment. Roger''s work problems provide new opportunities for Don, and Pete grows more frustrated. Betty finds a new outlet for her growing dissatisfaction.', 1104, 11, 62020, 3566, '2007-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62017, 'Nixon Vs. Kennedy', 'On election night, the Sterling Cooper staff pulls a rowdy all-nighter while watching the returns. Pete''s ambitions cause him to directly challenge Don. Don remembers his past as a soldier in the Korean War.', 1104, 12, 62017, 3566, '2007-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62019, 'The Wheel', 'As Thanksgiving approaches, Don''s work responsibilities interfere with his domestic life. Peggy is given a new opportunity, provoking the ire of some of her colleagues. Betty makes a startling discovery.', 1104, 13, 62019, 3566, '2007-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62021, 'For Those Who Think Young', 'It’s Valentine’s Day, and the Sterling Cooper advertising agency is hustling to stay on top of its game and buzzing over the newest office equipment. Don and Duck find themselves at odds over an account. Betty reconnects with an old friend and once again finds herself struggling with car trouble.', 1104, 1, 62021, 3567, '2008-07-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62024, 'Flight 1', 'Paul hosts a party at his apartment and introduces someone special to his Sterling Cooper colleagues. Peggy visits her family for dinner. Despite a conflict of interest, the Sterling Cooper agency aggressively pursues an airline account and Duck attempts to appeal to the client using an unorthodox approach.', 1104, 2, 62024, 3567, '2008-08-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62023, 'The Benefactor', 'Trouble arises on the set of a commercial; Harry tries to gather support for a controversial sponsorship; Betty and Don try to appease a client with a friendly dinner.', 1104, 3, 62023, 3567, '2008-08-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62022, 'Three Sundays', 'Peggy''s family hosts a lunch for their church''s new priest; Don and Betty enjoy a weekend together; Freddy and Ken take a client out to lunch; the staff works to prepare for a last minute pitch meeting.', 1104, 4, 62022, 3567, '2008-08-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62025, 'The New Girl', 'Don has to deal with issues between a TV comedian and his wife; Joan finds Don the perfect secretary.', 1104, 5, 62025, 3567, '2008-08-24');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62027, 'Maidenform', 'Don and Duck try to make peace; Peggy tries to get into the executive''s after-hours meetings; Duck deals with a family visit.', 1104, 6, 62027, 3567, '2008-08-31');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62026, 'The Gold Violin', 'Don buys a new car; Pete, Harry and Ken strategize to attract new business; Don''s secretary makes a grave error; Cooper has a new piece of art in his office.', 1104, 7, 62026, 3567, '2008-09-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62029, 'A Night to Remember', 'Peggy contributes on a church project; Duck and Don try to create market appeal for a foreign beer brand; Harry recruits assistance to help with the workload in his department.', 1104, 8, 62029, 3567, '2008-09-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62028, 'Six Month Leave', 'Freddy Rumsen disappoints his team during a pitch. Pete finds an opportunity at the office to exploit while Don proves his loyalty to an old friend. Betty finds a welcome distraction in Sara Beth.', 1104, 9, 62028, 3567, '2008-09-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62030, 'The Inheritance', 'Betty visits her father; Paul''s girlfriend tries to convince him to prioritize his duties; Pete''s mother disapproves of his and Trudy''s idea.', 1104, 10, 62030, 3567, '2008-10-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62031, 'The Jet Set', 'Don makes some new friends on his trip to Los Angeles; Peggy looks for romance; Duck ponders the future of Sterling Cooper.', 1104, 11, 62031, 3567, '2008-10-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62032, 'The Mountain King', 'Don meets up with an old friend; Pete''s personal life presents problems; Joan brings her boyfriend to the office.', 1104, 12, 62032, 3567, '2008-10-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62033, 'Meditations in an Emergency', 'The office scrambles without Don; Betty learns some disconcerting news.', 1104, 13, 62033, 3567, '2008-10-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62034, 'Out of Town', 'In the third-season opener, Salvatore and Don take a business trip out of town. Pete Campbell and Ken Cosgrove worry about the changes at Sterling-Cooper and how the changes will impact them.', 1104, 1, 62034, 3568, '2009-08-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62035, 'Love Among the Ruins', 'Don''s father-in-law pays a visit to his daughter''s family. Peggy works hard on a campaign while the firm tries to decide if they will accommodate an unusual request from a client. Elsewhere, Roger plans a wedding.', 1104, 2, 62035, 3568, '2009-08-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62036, 'My Old Kentucky Home', 'The writers make an attempt to stave off late-night boredom during a mandatory overtime session. Roger throws a party as Joan and Greg host their own party. Sally has a run-in with Grandpa.', 1104, 3, 62036, 3568, '2009-08-30');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62037, 'The Arrangements', 'Don and his father-in-law cross paths. Meanwhile, Peggy is in search of a new roommate; and a rich new client is excited to be doing business with the firm.', 1104, 4, 62037, 3568, '2009-09-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62038, 'The Fog', 'Sally''s behavior causes concern for Don and Betty. Betty has an eye-opening dream that has a strange effect on her. Pete tries to work a new business angle in his dealings.', 1104, 5, 62038, 3568, '2009-09-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62039, 'Guy Walks Into an Advertising Agency', 'Sterling Cooper receives a surprise visitor; Sally has been spooked by something (or someone); and Joan receives some shocking news.', 1104, 6, 62039, 3568, '2009-09-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62040, 'Seven Twenty Three', 'Betty tries her hand at local politics. Don is forced into thinking about the future. Peggy receives a luxurious gift.', 1104, 7, 62040, 3568, '2009-09-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62041, 'Souvenir', 'Don decides to include Betty on a company business trip. Pete lends a hand to a neighbor in his apartment building.', 1104, 8, 62041, 3568, '2009-10-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62042, 'Wee Small Hours', 'There is trouble for Don and Sal in giving their clients what they ask for. Meanwhile, Betty hosts a fundraiser.', 1104, 9, 62042, 3568, '2009-10-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62043, 'The Color Blue', 'The firm celebrates as they hit a milestone. Peggy and Paul compete to secure the same account.', 1104, 10, 62043, 3568, '2009-10-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62045, 'The Gypsy and the Hobo', 'A former client makes a return; Betty and her kids go on a trip; and Joan and Greg make plans for their future.', 1104, 11, 62045, 3568, '2009-10-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62046, 'The Grown-Ups', 'Peggy''s taste in men proves questionable. Pete has to make a big decision about his career and a candidate makes a big impression on Don.', 1104, 12, 62046, 3568, '2009-11-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62044, 'Shut the Door, Have a Seat', 'Don has a big meeting with Connie about their future relationship. Betty is the beneficiary of some interesting advice and Pete has a serious sit-down with some clients.', 1104, 13, 62044, 3568, '2009-11-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62048, 'Public Relations', 'Don deals with a trade-paper interview but doesn''t want to talk about himself. A manufacturer of a "wholesome" two-piece bathing suit wants to hire the firm but doesn''t want anything too risque. Pete and Peggy try to secure more money for the firm.', 1104, 1, 62048, 3569, '2010-07-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62049, 'Christmas Comes But Once a Year', 'The agency''s Christmas party is nearly spoiled by the late arrival of a surprise and not-so-welcome visitor.', 1104, 2, 62049, 3569, '2010-08-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62054, 'The Good News', 'Don takes a trip. Joan has scheduling problems. Don and Lane get to know each other a little better.', 1104, 3, 62054, 3569, '2010-08-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62051, 'The Rejected', 'An edict from Roger and Lane puts Pete in a personal dilemma.', 1104, 4, 62051, 3569, '2010-08-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62050, 'The Chrysanthemum and the Sword', 'Don and Pete disregard Roger''s plans in order to land a new client.', 1104, 5, 62050, 3569, '2010-08-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62053, 'Waldorf Stories', 'Peggy clashes with her new creative partner; Don pitches under unusual circumstances.', 1104, 6, 62053, 3569, '2010-08-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62059, 'The Suitcase', 'A deadline disrupts Sterling Cooper Draper Pryce.', 1104, 7, 62059, 3569, '2010-09-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62047, 'The Summer Man', 'Joan and Peggy deal with high-jinx in the office.', 1104, 8, 62047, 3569, '2010-09-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62058, 'The Beautiful Girls', 'Peggy is forced to face some unpleasant facts about a client''s discriminatory business practices. Don and Faye''s burgeoning relationship is tested when Sally runs away from home and turns up at the office. Roger tries to rekindle his affair with Joan.', 1104, 9, 62058, 3569, '2010-09-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62052, 'Hands and Knees', 'An unannounced visitor at the Francis home rattles Betty.', 1104, 10, 62052, 3569, '2010-09-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62056, 'Chinese Wall', 'Sterling Cooper Draper Price employees resort to scuttlebutt after an agency wide meeting is called.', 1104, 11, 62056, 3569, '2010-10-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62055, 'Blowing Smoke', 'In the midst of a crisis, Don runs into an old friend.', 1104, 12, 62055, 3569, '2010-10-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62057, 'Tomorrowland', 'Don and Peggy are faced with life-altering decisions', 1104, 13, 62057, 3569, '2010-10-17');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62072, 'A Little Kiss (1)', 'For the Draper family, life has changed. The children must adapt to a new home, a new brother, and a new stepmother. Don seems to have everything a man could want. However, Megan, still employed at the agency, has difficulty interpreting Don''s expectations for a sex kitten at home and a prim and proper employee at the office.', 1104, 1, 62072, 3570, '2012-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62061, 'A Little Kiss (2)', 'Don and Megan work out some of their issues, Roger and Pete butt heads, and Joan has a run-in with a house guest.', 1104, 2, 62061, 3570, '2012-03-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041484, 'Severance', 'Don attempts to track down a friend, Joan tries to solve a problem with an account and an unlikely person sets up Peggy.', 1104, 8, 1041484, 3565, '2015-04-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62066, 'Tea Leaves', 'As Sterling Cooper Draper Pryce tries to build upon its current business, Peggy is given new responsibility. Don and Harry indulge a client. Betty contemplates her mortality after seeing a doctor.', 1104, 3, 62066, 3570, '2012-04-01');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62070, 'Mystery Date', 'Don has an encounter with someone from the past. Meanwhile, Roger increases Peggy''s workload, and Joan comes to a momentous decision.', 1104, 4, 62070, 3570, '2012-04-08');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62069, 'Signal 30', 'Lane attempts to land an account with Jaguar Cars, leading to a altercation with Pete. Pete and Trudy host a dinner party in the suburbs.', 1104, 5, 62069, 3570, '2012-04-15');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62067, 'Far Away Places', 'Peggy has a tough time during a particularly formidable pitch. Don calls on a potential client. Roger and Jane have an experience with LSD.', 1104, 6, 62067, 3570, '2012-04-22');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62062, 'At the Codfish Ball', 'Don is honored at a banquet for the American Cancer Society, but finds his professional reputation has been damaged. Sally lends a hand to a relative. Megan''s parents come to visit from Canada.', 1104, 7, 62062, 3570, '2012-04-29');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62068, 'Lady Lazarus', 'Megan has second thoughts about her future at Sterling, Cooper, Draper, Pryce. Peggy lashes out when she''s inadvertently put in the uncomfortable position of having to lie. Pete''s effort to protect an acquaintance doesn''t turn out quite like he expected.', 1104, 8, 62068, 3570, '2012-05-06');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62060, 'Dark Shadows', 'Don attempts to regain his creative spark, but undermines a member of his staff while doing so. Roger pursues some new clients, and in the process, hurts Jane. Betty displays her pettiness when she reveals a distressing secret to Sally.', 1104, 9, 62060, 3570, '2012-05-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62071, 'Christmas Waltz', 'Harry finds himself in an uncomfortable position after reconnecting with Paul Kinsey who has joined the Hare Krishnas. Lane takes drastic and unethical measures to get out of financial trouble. Don spends an afternoon with Joan to get her mind off her marital problems.', 1104, 10, 62071, 3570, '2012-05-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62063, 'The Other Woman', 'Pete asks Joan to make a personal and moral sacrifice to ensure the company lands the Jaguar account. Don becomes furious after learning of the impact Megan''s new profession will have on their life. Feeling unappreciated, Peggy attends lunch with Freddy Rumsen, who encourages her to make a move.', 1104, 11, 62063, 3570, '2012-05-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62064, 'Commissions and Fees', 'Lane''s shameful secret comes to the surface with dire consequences. Don recaptures his hunger for success, and Sally experiences a major milestone.', 1104, 12, 62064, 3570, '2012-06-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62065, 'The Phantom', 'Roger seeks to expand his affair with Megan''s mother. Pete has a "last" encounter with Beth with lasting repercussions. Megan struggles to find acting work and asks for Don''s help getting an audition. Peggy still seeks Don''s approval.', 1104, 13, 62065, 3570, '2012-06-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62084, 'The Doorway (1)', 'Don and Megan take a trip to Hawaii for the holidays, Sally''s friend visits the Francis family, a comedian torpedoes Peggy''s Super Bowl ad campaign, and Roger gets some bad news about his mother.', 1104, 1, 62084, 3571, '2013-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62077, 'The Doorway (2)', 'Don strikes up a friendship with the surgeon in his building, Peggy tries to save her campaign, Roger makes a scene at his mother''s funeral, and Betty goes to Manhattan to find Sally''s friend.', 1104, 2, 62077, 3571, '2013-04-07');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62074, 'Collaborators', 'While Don continues his affair with Sylvia, Pete''s latest infidelity threatens his marriage. Meanwhile, Peggy''s icy relationship with her new staff continues, but she also gets an unlikely tip on a potential new client.', 1104, 3, 62074, 3571, '2013-04-14');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62075, 'To Have and to Hold', 'Don works in secret on a Heinz ketchup campaign while Megan gets a love scene on the set of her soap opera. Meanwhile, Harry makes his power play while Joan has more trouble with the secretaries.', 1104, 4, 62075, 3571, '2013-04-21');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62078, 'The Flood', 'Set among the events surrounding Martin Luther King''s assassination, Peggy tries to get a new apartment, Ginsberg is set up on a date, and Don has a revelation during his weekend with the kids.', 1104, 5, 62078, 3571, '2013-04-28');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62076, 'For Immediate Release', 'As the firm prepares to go public, Don and Pete''s actions cause them to lose two huge clients. However, Roger uses a new connection to put them in position to gain their biggest client ever.', 1104, 6, 62076, 3571, '2013-05-05');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62079, 'Man With a Plan', 'Things quickly become awkward after the two firms merge, Don asserts his dominance over Sylvia, Pete has to deal with his ailing mother, and Bob Benson helps out a sick Joan.', 1104, 7, 62079, 3571, '2013-05-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62080, 'The Crash', 'The creative department has a wild, drug-influenced weekend as they work on the Chevy account, Don has trouble letting go of Sylvia, and Sally walks in on an unwelcome intruder.', 1104, 8, 62080, 3571, '2013-05-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (997952, 'The Better Half', 'Peggy becomes unsatisfied with her apartment and with Abe, Don has an eventful weekend with Betty while Megan has problems on the set, Roger has time with his grandson, and Pete begins exploring his options outside the firm.', 1104, 9, 997952, 3571, '2013-05-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62082, 'A Tale of Two Cities', 'Cutler and Chaough prepare to make radical changes to the firm while Sterling and Draper are visiting a client in Los Angeles. Joan''s decision to go after a new account on her own leaves Pete furious and frustrated.', 1104, 10, 62082, 3571, '2013-06-02');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62007, 'Favors', 'Don is preoccupied with keeping Sylvia''s son from being drafted, Peggy has a rat in her apartment, Don and Ted bury the hatchet, Pete has a problem with his mother''s new nurse, and Sally makes an accidental discovery about her father.', 1104, 11, 62007, 3571, '2013-06-09');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62083, 'The Quality of Mercy', 'Don renews his battle with Ted after seeing his relationship with Peggy, Sally interviews at a boarding school, and Pete discovers Bob Benson''s background.', 1104, 12, 62083, 3571, '2013-06-16');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (62006, 'In Care Of', 'With his personal and professional life crumbling around him, Don positions himself for a change of scenery. Meanwhile, Pete''s life is falling apart as well, thanks to the meddling of Bob Benson.', 1104, 13, 62006, 3571, '2013-06-23');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974138, 'Time Zones', 'Don makes a new friend. Joan meets a client for drinks. Peggy hears impressive new work. Roger has a puzzling phone call.', 1104, 1, 974138, 3565, '2014-04-13');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974665, 'A Day''s Work', 'Peggy receives a bouquet of flowers at the office. Pete navigates the politics of new business. Joan is put in an impossibly awkward situation.', 1104, 2, 974665, 3565, '2014-04-20');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (974905, 'Field Trip', 'Don takes an impromptu trip. Betty has lunch with a friend. Harry lobbies for a cause. The partners consider a questionable asset.', 1104, 3, 974905, 3565, '2014-04-27');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975265, 'The Monolith', 'Sterling Cooper & Partners prepares for a guest; Don contacts an old friend; Roger deals with problems at home; Peggy is underestimated.', 1104, 4, 975265, 3565, '2014-05-04');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975696, 'The Runaways', 'Don has a visitor from his past. Stan embarrasses a superior. Peggy helps Ginsberg with a problem. Harry finds that he has a new ally at the agency.', 1104, 5, 975696, 3565, '2014-05-11');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975954, 'The Strategy', 'Peggy determinedly collects research for a pitch. Pete is invited to join an exclusive club. Joan looks forward to spending time with her friend.', 1104, 6, 975954, 3565, '2014-05-18');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (975955, 'Waterloo', 'Don receives a troubling letter. A risky venture entails a new future for Peggy. Roger gets an unexpected phone call. Pete butts heads with Cutler.', 1104, 7, 975955, 3565, '2014-05-25');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041486, 'New Business', 'Roger gives Don some unwanted advice. Peggy and Stan disagree over an account''s personnel. Harry asks for Don''s blessing.', 1104, 9, 1041486, 3565, '2015-04-12');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1041485, 'The Forecast', 'Roger pawns off a project on Don, Joan goes on a business trip and Peggy and Pete cannot agree on how to deal with an account.', 1104, 10, 1041485, 3565, '2015-04-19');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050166, 'Time & Life', 'Don comes up with a big idea, Roger asks Joan to help him fix a clerical error and Peggy has difficulties casting for a commercial.', 1104, 11, 1050166, 3565, '2015-04-26');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050295, 'Lost Horizon', 'Don receives a reward for his work. Joan butts heads with her co-worker on an account. Faced with a big decision, Roger dodges.', 1104, 12, 1050295, 3565, '2015-05-03');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050296, 'The Milk and Honey Route', 'Don has trouble sleeping. Pete is blindsided by a difficult friend. Facing a new challenge, Henry arranges a family reunion.', 1104, 13, 1050296, 3565, '2015-05-10');
INSERT INTO public.episode (id, name, overview, series_id, numepisode, tvdbid, season_id, aired) VALUES (1050297, 'Person to Person', 'The stories of Don Draper, his family and his co-workers at Sterling Cooper & Partners conclude.', 1104, 14, 1050297, 3565, '2015-05-17');
