In this video I tell the story of how I transitioned to minimalist travel with no luggage and how the quest for less became an obsession.  I show the essentials that I packed and mention items I no longer needed.', 85618, 2, 1664281, 115808, '2018-05-12');

I travel without a backpack to make my experiences more immersive and rewarding. I made this video to help others think differently and embrace alternatives. Exploring with less, I share the motivations behind my unusual approach to travel. I detail the difficulties backpacks can bring, whether physical or mental. This minimalist approach removes all these complications, leaving me free to enjoy everything along the way.', 85618, 3, 1664284, 115808, '2018-08-01');

In this episode I share the difficulties faced by travelling without luggage. Considering the practical pressures from this level of minimalist travel is important before setting off on a trip or sending your backpack home. These are the long-term issues I face without a backpack.', 85618, 4, 1664286, 115808, '2018-09-28');

In this episode, I reflect on how minimalism has had a lasting influence on my life. I explore some of the positive and negative implications from living out of a tiny bag.

Throughout my travels, I''ve learnt that the best way to face any pre-trip concerns is simply to begin. We sometimes pay too much attention to all the minor details which add up and can make us lose sight of our primary objectives. By choosing minimalist travel, we are placing all our focus on just the important things that we really need ...but can minimalism become a distraction in itself?', 85618, 5, 1664288, 115808, '2018-10-18');

This episode is for those who wish to travel ultralight but still feel unable to do so.  I specifically look into the few essentials that women might need, beyond the basics I carry in my bum bag.

Acknowledging prevalent gender distinctions, the video suggests some minimalist packing tips for those that might depend on more.  My intention is to show how travel without luggage can still be accessible for all.

For this episode, I have a little help from my girlfriend, Talise. I tried to make her think differently and I hope it can encourage you to think a little differently too.

I wanted Talise to consider preparing to leave for a no-luggage adventure. I asked her to share the minimum she could leave with, beyond the items I carry.

These are her key minimalist essentials, the crucial extra items she couldn’t go without.', 85618, 6, 1664289, 115808, '2018-11-20');

When undertaking a minimalist transformation there are personal, physical and mental challenges to confront before leaving with almost no luggage.

For this episode, I wanted to consider how others could start to approach a no-baggage trip. I looked at my girlfriends perspective to packing and asked her whether she could leave with less. I was curious if she could ever imagine taking a no-luggage trip and if so, what would be her notable barriers to overcome.

Can I convince my girlfriend to travel without luggage?  Talise knows too well not to pack too much, she knows how to carry almost nothing, however, she still chooses a lot to pack.  This video shares more of her packing story, which involves some heavy struggles along the way.

Minimising my baggage, transformed the way I experience the world. I love ultralight adventures, but traveling with one small bag whilst in a relationship uncovers a striking polarity.

Travel is personal, therefor only you can decide how much is necessary. By sharing my thinking behind why I travel the way I do, I hope this series helps those wanting to take their next step in ultralight travel.

The main obstacle to travelling light can be helping carry other peoples bags.', 85618, 7, 1681872, 115808, '2019-01-22');

When she is invited to a relative''s wedding, Nadiya decides to bake a three-tiered pumpkin celebration cake for the bride. It is a decision she may have thought twice about if she had realised the only available oven would be in an industrial bakery.

This trip is also a chance to reconnect with family Nadiya has not seen since her own arranged marriage over ten years ago, and it proves to be a moving trip down memory lane.', 85627, 1, 1664205, 115824, '2016-08-24');

In the capital city, Dhaka, Nadiya spends time with a charity that delivers school dinners to some of the country''s most deprived children and she cooks coconut and fennel samosas as a delicious treat for the kids.

Invited to travel south from Dhaka aboard one of the last remaining rocket steamer passenger ferries, Nadiya cooks the captain and crew a delicious goat biryani to say thank you. As she travels deeper into Bangladesh, she visits a small Hindu fishing village on the banks of the Padma, where she learns about an ancient fishing method that uses trained otters, and she cooks one of her favourite dishes - grilled chicken with shatkora pickle - to share with the fisherman and his family.

Nadiya''s journey continues across Bangladesh as she meets and learns from food entrepreneurs and experiences a side of modern Bangladesh she never knew existed. As her adventure comes to an end, she returns to her family village to share one last meal - beef curry with spiced okra and rice chapatis - and say her goodbyes, filled with optimism and pride and a better understanding of herself and Bangladesh.', 85627, 2, 1664206, 115824, '2016-08-31');

Bear challenges novice Miranda to go far beyond her comfort zone with a series of exhilarating adventures during an intense two-day expedition.

Miranda traverses a glacier, crosses crevasses roped to Bear, tackles deep snow in snow shoes and completes a huge boulder scramble. She also faces her greatest fears when she flies in a helicopter and abseils down a waterfall.', 85630, 1, 1664212, 115827, '2011-12-26');

Bear challenges novice Jonathan with a series of exhilarating adventures during an intense two-day trip, including trekking through dense jungle with machetes, SAS-style fast-roping from a helicopter, a walk down an active volcano and sleeping in a cave in a steep cliff face.

Bear and Jonathan have to fend for themselves, including preparing wild animals for food.', 85630, 2, 1664213, 115827, '2012-01-01');

Over the course of two days, high in the Italian Dolomites, Stephen travels on the skids of a helicopter, climbs down a raging 500-foot waterfall, sleeps in a First World War trench and abseils down a towering cliff face.

Stephen and Bear face treacherous conditions as a freak summer snow storm hits the mountains, and Stephen must face up to some of his deepest fears.

He also talks frankly about some of the other challenges he has faced over the years, including prison, his body image, bipolar disorder and a near fatal suicide attempt.

''My hope is that I will be a little bit more proud of myself at the end of it and at least feel that I''ve accomplished something.'' says Stephen.

Will Bear break one of our national treasures? Or can Stephen overcome everything thrown at him and face his demons head on?', 85630, 3, 1664214, 115827, '2013-12-25');

